      html: '<p><strong>1.</strong> </p>\n<p>Du rocher de Jacob </p>\n<p>Toute l&#39;oeuvre est parfaite. </p>\n<p>Ce que sa bouche a dit, </p>\n<p>Sa main l&#39;accomplira! </p>\n<p>Alléluia! Alléluia! (bis) </p>\n<p>Car Il est notre Dieu, (ter) </p>\n<p>Notre haute retraite! </p>\n<p><br/> <strong>2.</strong></p>\n<p>C&#39;est pour l&#39;éternité </p>\n<p>Que le Seigneur nous aime: </p>\n<p>Sa grâce en notre coeur </p>\n<p>Jamais ne cessera. </p>\n<p>Alléluia!  Alléluia!  (bis) </p>\n<p>Car Il est notre espoir,  (ter) </p>\n<p>Notre bonheur suprême. </p>\n<p><br/> <strong>3.</strong></p>\n<p>De tous nos ennemis </p>\n<p>Il sait quel est le nombre; </p>\n<p>Son bras combat pour nous </p>\n<p>Et nous délivrera. </p>\n<p>Alléluia!  Alléluia!  (bis) </p>\n<p>Les méchants devant lui,  (ter) </p>\n<p>S&#39;enfuiront comme l&#39;ombre. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Louons donc l&#39;Éternel, </p>\n<p>Notre Dieu, notre Père! </p>\n<p>Le Seigneur est pour nous: </p>\n<p>Contre nous qui sera? </p>\n<p>Alléluia!  Alléluia!  (bis) </p>\n<p>Triomphons en Jésus,  (ter) </p>\n<p>Et vivons pour lui plaire. </p>\n'
