    title: "Mon Sauveur m'aime",
    lyrics:
      "1.\nMon Sauveur m'aime,\nQuel ferme appui pour ma foi!\nL'amour suprême\nDescend vers moi!\nDieu vint sur la terre\nVivre en homme de douleur;\nVoyant ma misère,\nIl m'ouvre son coeur.\n\nRefrain\nJésus! Jésus! Qui peut sonder ton amour?\nJésus! Jésus! Je t'aime en retour.\n\n2.\nMon Sauveur m'aime\nMalgré mon indignité,\nToujours le même,\nPlein de pitié!\nIl voit ma souffrance,\nIl enlève mon souci;\nSon amour immense\nEst mon sûr abri.\n\n3.\nMon Sauveur m'aime\nComme un joyau précieux\nDu diadème\nQu'il porte aux cieux.\nSa vie éternelle,\nIl partage avec moi,\nSa gloire immortelle,\nIl offre à ma foi.",
