    title: 'Sur la paille fraîche',
    lyrics:
      "1.\nSur la paille fraîche\nUn pauvre crèche\nDort l'enfant si beau;\nLui sert de berceau.\nDe l'azur céleste\nL'Étoile a souri\nA l'Enfant qui reste\nSi tard endormi.\n\n2.\nVoilà que l'ânesse\nRéveille l'enfant!\nMais Lui, la caresse\nTout en souriant.\nCher Jésus, je t'aime!\nPrends mon petit coeur\nEt veille toi-même\nSur moi, doux Seigneur!\n\n3.\nPrès, plus près encore\nDe mon petit lit\nDu soir à l'aurore\nCar j'ai peur, la nuit!\nBénis, frère tendre\nLes autres petits…\nViens bientôt nous prendre\nDans ton paradis.",
