      md: "**1.** \n\nÉcoutez! Un saint cantique \n\nVient d'éclater dans les cieux: \n\nC'est un hymne magnifique, \n\nC'est un chant simple et joyeux. \n\nLes voix parcourant l'espace, \n\nDisent aux humains surpris: \n\n“La loi fait place à la grâce, \n\nEt Moïse à Jésus-Christ.” \n\n\n<br/> **2.**\n\nLa promesse est accomplie, \n\nLe salut nous est donné: \n\nEn Christ, Dieu réconcilie \n\nSa justice et sa bonté. \n\nL'heure de la délivrance \n\nPour les captifs a sonné; \n\nC'est la nouvelle alliance: \n\nL'enfant Jésus nous est né. \n\n\n<br/> **3.**\n\nEt, soudain, perçant le voile \n\nDu firmament ténébreux, \n\nL'éclat nouveau d'une étoile \n\nVers Judas jette ses feux. \n\nLes Mages, à sa lumière, \n\nAccourent de l'Orient; \n\nEt pour entendre gloire au Père, \n\nIls vont adorer l'Enfant. \n\n\n<br/> **4.**\n\nCe Jésus est notre Frère, \n\nIl a vécu parmi nous; \n\nIl a pris notre misère, \n\nPécheurs, il est mort pour nous. \n\nSa charité, nous enlace, \n\nIl veut régner sur nos coeurs; \n\nSachons accepter sa grâce: \n\nJésus, sois notre Sauveur! \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Écoutez! Un saint cantique </p>\n<p>Vient d&#39;éclater dans les cieux: </p>\n<p>C&#39;est un hymne magnifique, </p>\n<p>C&#39;est un chant simple et joyeux. </p>\n<p>Les voix parcourant l&#39;espace, </p>\n<p>Disent aux humains surpris: </p>\n<p>“La loi fait place à la grâce, </p>\n<p>Et Moïse à Jésus-Christ.” </p>\n<p><br/> <strong>2.</strong></p>\n<p>La promesse est accomplie, </p>\n<p>Le salut nous est donné: </p>\n<p>En Christ, Dieu réconcilie </p>\n<p>Sa justice et sa bonté. </p>\n<p>L&#39;heure de la délivrance </p>\n<p>Pour les captifs a sonné; </p>\n<p>C&#39;est la nouvelle alliance: </p>\n<p>L&#39;enfant Jésus nous est né. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Et, soudain, perçant le voile </p>\n<p>Du firmament ténébreux, </p>\n<p>L&#39;éclat nouveau d&#39;une étoile </p>\n<p>Vers Judas jette ses feux. </p>\n<p>Les Mages, à sa lumière, </p>\n<p>Accourent de l&#39;Orient; </p>\n<p>Et pour entendre gloire au Père, </p>\n<p>Ils vont adorer l&#39;Enfant. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Ce Jésus est notre Frère, </p>\n<p>Il a vécu parmi nous; </p>\n<p>Il a pris notre misère, </p>\n<p>Pécheurs, il est mort pour nous. </p>\n<p>Sa charité, nous enlace, </p>\n<p>Il veut régner sur nos coeurs; </p>\n<p>Sachons accepter sa grâce: </p>\n<p>Jésus, sois notre Sauveur! </p>\n'
