    num: 43,
    title: 'Salut, Blanche Étoile',
    lyrics:
      "1.\nSalut, blanche étoile,\nAu plus haut du ciel!\nRayonne sans voile,\nSplendeur de Noël!\nVenez, tendre enfance,\nQu'un chant d'espérance,  (bis 2 lignes)\nDe nos coeurs s'élance\nJusqu'à l'Éternel!\n\n2.\nArdente jeunesse,\nLouez le Seigneur!\nTremblante vieillesse,\nN'ayez point de peur!\nDieu même, ô mystère!\nSe fait notre Frère,  (bis 2 lignes)\nEt vient sur la terre\nSauver le pécheur.\n\n3.\nLe Fils adorable\nLui. Le Roi des rois,\nNaît dans une étable,\nMeurt sur une croix:\nSa grâce fidèle\nPardonne aux rebelle…(bis 2 lignes)\nJésus nous appelle:\nÉcoutons sa voix!\n\n4.\nSalut, blanche étoile,\nAu plus haut du ciel!\nRayonne sans voile,\nSplendeur de Noël!\nPour l'âme qui t'aime,\nTa clarté suprême  (bis 2 lignes)\nEst le doux emblème\nDu jour éternel!",
