    language: 'fr',
    songId: '43_CE_fr',
    lyrics_Markdown: {
      md: "**1.** \n\nSalut, blanche étoile, \n\nAu plus haut du ciel! \n\nRayonne sans voile, \n\nSplendeur de Noël! \n\nVenez, tendre enfance, \n\nQu'un chant d'espérance,  (bis 2 lignes) \n\nDe nos coeurs s'élance \n\nJusqu'à l'Éternel! \n\n\n<br/> **2.**\n\nArdente jeunesse, \n\nLouez le Seigneur! \n\nTremblante vieillesse, \n\nN'ayez point de peur! \n\nDieu même, ô mystère! \n\nSe fait notre Frère,  (bis 2 lignes) \n\nEt vient sur la terre \n\nSauver le pécheur. \n\n\n<br/> **3.**\n\nLe Fils adorable \n\nLui. Le Roi des rois, \n\nNaît dans une étable, \n\nMeurt sur une croix: \n\nSa grâce fidèle \n\nPardonne aux rebelle…(bis 2 lignes) \n\nJésus nous appelle: \n\nÉcoutons sa voix! \n\n\n<br/> **4.**\n\nSalut, blanche étoile, \n\nAu plus haut du ciel! \n\nRayonne sans voile, \n\nSplendeur de Noël! \n\nPour l'âme qui t'aime, \n\nTa clarté suprême  (bis 2 lignes) \n\nEst le doux emblème \n\nDu jour éternel! \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Salut, blanche étoile, </p>\n<p>Au plus haut du ciel! </p>\n<p>Rayonne sans voile, </p>\n<p>Splendeur de Noël! </p>\n<p>Venez, tendre enfance, </p>\n<p>Qu&#39;un chant d&#39;espérance,  (bis 2 lignes) </p>\n<p>De nos coeurs s&#39;élance </p>\n<p>Jusqu&#39;à l&#39;Éternel! </p>\n<p><br/> <strong>2.</strong></p>\n<p>Ardente jeunesse, </p>\n<p>Louez le Seigneur! </p>\n<p>Tremblante vieillesse, </p>\n<p>N&#39;ayez point de peur! </p>\n<p>Dieu même, ô mystère! </p>\n<p>Se fait notre Frère,  (bis 2 lignes) </p>\n<p>Et vient sur la terre </p>\n<p>Sauver le pécheur. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Le Fils adorable </p>\n<p>Lui. Le Roi des rois, </p>\n<p>Naît dans une étable, </p>\n<p>Meurt sur une croix: </p>\n<p>Sa grâce fidèle </p>\n<p>Pardonne aux rebelle…(bis 2 lignes) </p>\n<p>Jésus nous appelle: </p>\n<p>Écoutons sa voix! </p>\n<p><br/> <strong>4.</strong></p>\n<p>Salut, blanche étoile, </p>\n<p>Au plus haut du ciel! </p>\n<p>Rayonne sans voile, </p>\n<p>Splendeur de Noël! </p>\n<p>Pour l&#39;âme qui t&#39;aime, </p>\n<p>Ta clarté suprême  (bis 2 lignes) </p>\n<p>Est le doux emblème </p>\n<p>Du jour éternel! </p>\n'
    },
