    lyrics_Markdown: {
      md: "**1.** \n\nDans le pays de la gloire éternelle, \n\nDans ce beau ciel où l'on ne souffre plus! \n\nTe contempler, abrité sous ton aile, \n\nC'est le bonheur que je rêve, ô Jésus! \n\n\n\n\n<br/> **Refrain**\n\n**Gloire à jamais, gloire é Jésus!  (bis)** \n\n**Auprès de lui, je ne pécherai plus!** \n\n**Auprès de lui, je ne pleurerai plus!** \n\n**Auprès de lui, je ne souffrirai plus!** \n\n**Oh! Gloire à jamais, gloire à toi, Jésus!** \n\n\n\n<br/> **2.**\n\nQuand tu m'auras, dans ta grâce infinie, \n\nFait une place au milieu des élus, \n\nTout mon bonheur, et ma gloire, et ma vie \n\nSera toujours de te louer, Jésus! \n\n\n<br/> **3.**\n\nMes bien-aimés partageront ma gloire, \n\nDans ton ciel où l'on ne se quitte plus. \n\nMais pour mon coeur la suprême victoire \n\nSera d'avoir ton sourire, ô Jésus! \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Dans le pays de la gloire éternelle, </p>\n<p>Dans ce beau ciel où l&#39;on ne souffre plus! </p>\n<p>Te contempler, abrité sous ton aile, </p>\n<p>C&#39;est le bonheur que je rêve, ô Jésus! </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Gloire à jamais, gloire é Jésus!  (bis)</strong> </p>\n<p><strong>Auprès de lui, je ne pécherai plus!</strong> </p>\n<p><strong>Auprès de lui, je ne pleurerai plus!</strong> </p>\n<p><strong>Auprès de lui, je ne souffrirai plus!</strong> </p>\n<p><strong>Oh! Gloire à jamais, gloire à toi, Jésus!</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Quand tu m&#39;auras, dans ta grâce infinie, </p>\n<p>Fait une place au milieu des élus, </p>\n<p>Tout mon bonheur, et ma gloire, et ma vie </p>\n<p>Sera toujours de te louer, Jésus! </p>\n<p><br/> <strong>3.</strong></p>\n<p>Mes bien-aimés partageront ma gloire, </p>\n<p>Dans ton ciel où l&#39;on ne se quitte plus. </p>\n<p>Mais pour mon coeur la suprême victoire </p>\n<p>Sera d&#39;avoir ton sourire, ô Jésus! </p>\n'
    },
