    title: 'Je chanterai, Seigneur',
    lyrics:
      "1.\nJe chanterai, Seigneur,\nTes oeuvres magnifiques,\nTon auguste pouvoir,\nTa suprême grandeur,\nAux concerts de tes saint\nJ'unirai les cantiques\nQue pour toi me dicte mon coeur.  (bis)\n\n2.\nOh! Que de l'Éternel\nLa parole est féconde!\nL'univers fut jadis\nL'ouvrage de sa voix;\nIl dit…les éléments,\nLe ciel, la terre et l'onde\nDu néant sortent à la fois.  (bis)\n\n3.\nLe monde passera;\nCe superbe édifice\nUn jour s'ébranlera\nJusqu'en ses fondements.\nTa sagesse, grand Dieu,\nTa bonté, ta justice\nSubsisteront dans tous les temps.  (bis)",
