    num: 27,
    title: 'Dieu fort et grand!',
    lyrics:
      "1.\nDieu fort et grand!\nTu vois toute ma vie,\nTu m'as connu,\nTu m'as sondé des cieux:\nOù puis-je fuir\nTa science infinie?Éternel roi,\nTu me suis en tous lieux.  (bis 4 lignes)\n\n2.\nSoit que je marche\nOu bien que je m'arrête,\nVoici, Seigneur!\nTu te tiens près de moi;\nEt, pour parler\nQuand ma langue s'apprête,\nTout mon dessein\nEst déjà devant toi.  (bis 4 lignes)\n\n3.\nVivant ou mort,\nDans les cieux, sur la terre,\nCeint de lumière\nOu ceint d'obscurité,\nPartout ta main\nPeut me saisir, ô mon Père!\nPartout sur moi\nTon oeil s'arrêté.  (bis 4 lignes)\n\n4.\nQue ta pensée\nEst donc mystérieuse!\nJe n'en saurais\nMesure la hauteur;\nA mes regards\nTon oeuvre est merveilleuse,\nEt, confondu,\nJ'adore ta grandeur.  (bis 4 lignes)\n\n5.\nConnaître, ô Dieu!\nTon amour, ta puissance,\nSur mon sentier\nVoir briller ta splendeur\nFonder sur toi\nToute mon espérance\nSont les seul biens\nQue désire mon coeur.  (bis 4 lignes)",
