    title: 'A toi la gloire, Ô ressuscité',
    lyrics:
      "1.\nA toi la gloire,\nO ressuscite!\nA toi la victoire\nPour l'éternité!\nBrillant de lumière,\nL'ange est descendu,\nIl roule la pierre\nDu tombeau vaincu.\n\nRefrain\nA toi la gloire, - O ressuscité!\nA toi la victoire – Pour l'éternité!\n\n2.\nVois-le paraître!\nC'est lui, c'est Jésus,\nTon Sauveur, ton maître!\nOh!  Ne doute plus!\nSois dans l'allégresse,\nPeuple du Seigneur,\nEt redis sans cesse\nQue Christ est vainqueur.\n\n3.\nCraindrais-je encore?\nIl vit à jamais,\nCelui que j'adore,\nLe Prince de paix;\nIl est ma victoire,\nMon puissant soutien,\nMa vie et ma gloire:\nNon, je ne crains rien.",
