    title: 'Jésus est notre ami suprême',
    lyrics:
      "1.\nJésus est notre Ami suprême;\nOh!  Quel amour!\nMieux qu'un tendre frère, il nous aime;\nOh!  Quel amour!\nIci parents, amis, tout passes;\nLe bonheur paraît et s'efface;\nSon coeur seul jamais ne se lasse…\nOh!  Quel amour!\n\n2.\nIl est notre vie éternelle;\nOh!  Quel amour!\nCélébrons son oeuvre immortelle;\nOh!  Quel amour!\nPar son sang, notre âme est lavée;\nAu désert il l'avait trouvée;\nDans son bercail Il l'a sauvée;\nOh!  Quel amour!\n\n3.\nSeigneur Jésus, fais-nous comprendre\nTout ton amour!\nDans nos coeurs, oh! Daigne répandre\nTout ton amour!\nQue cet amour soit notre vie!\nQu'à jamais notre âme ravie\nSavoure une joie infinie\nEn ton amour!",
