    title: 'Divine Parole',
    lyrics:
      "1.\nDivine Parole\nQui soutiens ma foi,\nTa clarté console,\nViens briller en moi.\nLorsqu'un voile sombre\nS'étend sur mon coeur,\nTu dissipes l'ombre\nD'un rayon vainqueur.\n\nRefrain\nDivine Parole, Qui soutiens ma foi,\nTa clarté console, Viens briller en moi.\n\n2.\nMessage si tendre\nDu Sauveur en croix,\nQu'il est doux d'entendre\nCes mots: «Viens et crois!»\nPar son sacrifice,\nIneffable don,\nLa loi, la justice\nFont place au pardon.\n\n3.\nQue ce triste monde\nT'écoute en tout lieu,\nÔ Bible, et répondre\nA l'appel de Dieu!\nQue toute âme humaine\nPar toi trouve enfin,\nAn brisant sa chaîne,\nLe bonheur sans fin!",
