      html: '<p><strong>1.</strong> </p>\n<p>J&#39;ai quitté le  ciel pour toi, </p>\n<p>J&#39;ai connu ta misère extrême; </p>\n<p>Perdu, mourant loin de moi, </p>\n<p>Ignorant mon amour suprême. </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Je suis ton Sauveur, ton Ami,</strong> </p>\n<p><strong>Reviens à moi dans ta tristesse;</strong> </p>\n<p><strong>Oh!  Sois sauvé dès aujourd&#39;hui,</strong> </p>\n<p><strong>Et tu chantera d&#39;allégresse.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>J&#39;ai vécu, pécheur, pour toi, </p>\n<p>J&#39;ai souffert l&#39;angoisse profonde; </p>\n<p>N&#39;ai-je pas été le Roi </p>\n<p>Rejeté, méprisé du monde? </p>\n<p><br/> <strong>3.</strong></p>\n<p>J&#39;ai subi la croix pour toi, </p>\n<p>Je suis mort pour ta délivrance; </p>\n<p>Si tu voulais croire en moi, </p>\n<p>Je te remplirais de puissance. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Je vis maintenant pour toi, </p>\n<p>Là-haut dans la maison du Père; </p>\n<p>Oh!  Viens, suis-moi par la foi, </p>\n<p>Oui, jusqu&#39;à ton  heure dernière. </p>\n'
