      md: "**1.** \n\nComme un phare sur la plage, \n\nPerçant l'ombre de la nuit, \n\nL'amour de Dieu, dans l'orage, \n\nCherche l'homme et le conduit. \n\n\n\n\n<br/> **Refrain**\n\n**O Sauveur!  Que ta lumière** \n\n**Resplendisse sur les flots,** \n\n**Et, vers le ciel, qu'elle éclaire** \n\n**Et sauve les matelots.** \n\n\n\n<br/> **2.**\n\nNulle étoile n'étincelle \n\nPour vous guider, ô nochers! \n\nQui gardera la nacelle \n\nDes écueils et des rochers? \n\n\n<br/> **3.**\n\nDans la nuit qui m'environne, \n\nDe ton amour, ô Jésus! \n\nQue par moi l'éclat rayonne \n\nAux yeux des marins perdus! \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Comme un phare sur la plage, </p>\n<p>Perçant l&#39;ombre de la nuit, </p>\n<p>L&#39;amour de Dieu, dans l&#39;orage, </p>\n<p>Cherche l&#39;homme et le conduit. </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>O Sauveur!  Que ta lumière</strong> </p>\n<p><strong>Resplendisse sur les flots,</strong> </p>\n<p><strong>Et, vers le ciel, qu&#39;elle éclaire</strong> </p>\n<p><strong>Et sauve les matelots.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Nulle étoile n&#39;étincelle </p>\n<p>Pour vous guider, ô nochers! </p>\n<p>Qui gardera la nacelle </p>\n<p>Des écueils et des rochers? </p>\n<p><br/> <strong>3.</strong></p>\n<p>Dans la nuit qui m&#39;environne, </p>\n<p>De ton amour, ô Jésus! </p>\n<p>Que par moi l&#39;éclat rayonne </p>\n<p>Aux yeux des marins perdus! </p>\n'
