    lyrics:
      "1.Quel ami fidèle et tendreNous avons en Jésus-Christ,Toujours prêt à nous entendre;À répondre à notre cri!Il connaît nos défaillances,Nos chutes de chaque jour.Sévère en ses exigences,Il est riche en son amour.2.Quel ami fidèle et tendreNous avons en Jésus-Christ,Toujours prêt à nous comprendreQuand nous sommes en souci!Disons-lui toutes nos craintes,Ouvrons-lui tout notre coeur.Bientôt ses paroles sainteNous rendront le vrai bonheur.3.Quel ami fidèle et tendreNous avons en Jésus-Christ,Toujours prêt à nous apprendreQuand nous presse l'ennemi!Il nous suit dans la mêlée,Nous entoure de ses bras,Et c'est lui qui tient l'épéeQui décide des combats.4.Quel ami fidèle et tendreNous avons en Jésus-Christ,Toujours prêt à nous apprendreÀ vaincre en comptant sur lui!S'il nous voit vrais et sincèresÀ chercher la sainteté,Il écoute nos prièresEt nous met en liberté.5.Quel ami fidèle et tendreNous avons en Jésus-Christ!Bientôt Il viendra nous prendrePour être au ciel avec lui.Suivons donc l'étroite voieEn comptant sur son secours.Bientôt nous aurons la joieDe vivre avec lui toujours!",
