    num: 120,
    title: 'Reste avec nous',
    lyrics:
      "1.\nReste avec nous,\nSeigneur, le jour décline,\nLa nuit s'approche\nEt nous menace tous;\nNous implorons ta présence divine;\nReste avec nous, Seigneur,\nReste avec nous!\n\n2.\nEn Toi nos coeurs\nOnt salué leur Maître,\nEn Toi notre âme\nÀ trouvé son Époux;\nÀ ta lumière, elle se sent renaître;\nReste avec nous, Seigneur,\nReste avec nous.\n\n3.\nDans nos combats,\nSi ta main nous délaisse,\nSatan vainqueur\nNous tiendra sous ses coups;\nQue ta puissance arme notre faiblesse\nReste avec nous, Seigneur,\nReste avec nous!\n\n4.\nSous ton regard,\nLa joie est sainte et bonne;\nPrès de ton coeur\nLes pleurs mêmes sont doux;\nSoit que ta main nous frappe ou nous couronne,\nReste avec, Seigneur,\nReste avec nous!\n\n5.\nEt quand, au bout\nDe ce pèlerinage,\nNous partirons\nPour le grand rendez-vous;\nPour nous guider dans ce dernier passage,\nReste avec nous, Seigneur,\nReste avec nous!",
