      md: "**1.** \n\nDu ciel, bientôt, Jésus va revenir! \n\nSi c'était aujourd'hui? \n\nTous, radieux, nous le verront venir! \n\nSi c'était aujourd'hui? \n\nAlors tous les saints à sa vue, \n\nSes enfants sûrs de sa venue, \n\nIront avec Lui sur la nue! \n\nSi c'était aujourd'hui? \n\n\n\n\n<br/> **Refrain**\n\n**Gloire!  Gloire!  Jésus revient bientôt!…** \n\n**Gloire!  Gloire!  Nous le couronneront!…** \n\n**Gloire!  Gloire!  Et nous l'adorerons!** \n\n**Gloire!  Gloire!  Jésus revient bientôt!…** \n\n\n\n<br/> **2.**\n\nDans ce beau ciel, le mal ne sera plus!… \n\nSi c'était aujourd'hui!… \n\nPlus de douleur, le regard de Jésus! \n\nSi c'était aujourd'hui? \n\nNotre âme après ce jour soupire!… \n\nMais déjà la nuit se retire, \n\nLe grand matin va bientôt luire! \n\nSi c'était aujourd'hui?… \n\n\n<br/> **3.**\n\nOh!  Que Jésus trouve en nous des coeurs droits, \n\nS'il revient aujourd'hui! \n\nVeillant, priant, dociles à sa voix, \n\nS'il revient aujourd'hui! \n\nAvons-nous cette assurance \n\nD'être enlevés en sa présence, \n\nDans le séjour de sa puissance! \n\nS'il revient aujoud'hui? \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Du ciel, bientôt, Jésus va revenir! </p>\n<p>Si c&#39;était aujourd&#39;hui? </p>\n<p>Tous, radieux, nous le verront venir! </p>\n<p>Si c&#39;était aujourd&#39;hui? </p>\n<p>Alors tous les saints à sa vue, </p>\n<p>Ses enfants sûrs de sa venue, </p>\n<p>Iront avec Lui sur la nue! </p>\n<p>Si c&#39;était aujourd&#39;hui? </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Gloire!  Gloire!  Jésus revient bientôt!…</strong> </p>\n<p><strong>Gloire!  Gloire!  Nous le couronneront!…</strong> </p>\n<p><strong>Gloire!  Gloire!  Et nous l&#39;adorerons!</strong> </p>\n<p><strong>Gloire!  Gloire!  Jésus revient bientôt!…</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Dans ce beau ciel, le mal ne sera plus!… </p>\n<p>Si c&#39;était aujourd&#39;hui!… </p>\n<p>Plus de douleur, le regard de Jésus! </p>\n<p>Si c&#39;était aujourd&#39;hui? </p>\n<p>Notre âme après ce jour soupire!… </p>\n<p>Mais déjà la nuit se retire, </p>\n<p>Le grand matin va bientôt luire! </p>\n<p>Si c&#39;était aujourd&#39;hui?… </p>\n<p><br/> <strong>3.</strong></p>\n<p>Oh!  Que Jésus trouve en nous des coeurs droits, </p>\n<p>S&#39;il revient aujourd&#39;hui! </p>\n<p>Veillant, priant, dociles à sa voix, </p>\n<p>S&#39;il revient aujourd&#39;hui! </p>\n<p>Avons-nous cette assurance </p>\n<p>D&#39;être enlevés en sa présence, </p>\n<p>Dans le séjour de sa puissance! </p>\n<p>S&#39;il revient aujoud&#39;hui? </p>\n'
