    title: 'Douce Clarté',
    lyrics:
      "1.\nDouce clarté,\nDans la nuit qui m'enserre,\nDirige-moi!\nLa route est noire,\nEt longue et solitaire,\nDirige-moi!\nBrille à mes pieds; je ne demande pas\nAvoir de loin: guide-moi pas à pas!\n\n2.\nAh!  Je n'ai pas\nToujours désiré d'être\nConduit par toi;\nMais aujourd'hui\nJ'ai retrouvé mon Maître:\nDirige-moi!\nJe reconnais mes fautes du passé,\nÔ Dieu, pardonne au pèlerin lassé!\n\n3.\nN'étais-je pas,\nMême en mes jours de doute,\nConduit par Toi!\nRavins, torrents,\nEn vain barrent ma route:\nDirige-moi!\nJusqu'à l'aurore où me seront rendus\nMes bien-aimés, un instant disparus!",
