    title: 'Tiens Dans Ta Main',
    lyrics:
      "1.\nTiens dans ta main,\nTa main puissante et forte,\nTon faible enfant\nQui seul ne peut marcher.\nVers toi, Seigneur,\nTout mon désir se porte,\nSur mon chemin\nGarde-moi de broncher!\n\n2.\nTiens dans ta main\nTous les jours de ma vie,\nQu'ils soient des jours\nDe peine ou de bonheur;\nQue de t'aimer,\nSoit toute mon envie,\nQue je sois à\nToi, Jésus, mon Sauveur!\n\n3.\nTiens dans ta main\nMa main parfois tremblante,\nQuand vient l'épreuve\nEt ses jours de douleurs.\nDonne à ma foi,\nSouvent si chancelante,\nPlus de douceur,\nDe paix et de ferveur!\n\n4.\nTiens dans ta main\nMon âme toute entière;\nRévèle-moi,\nJésus, tout mon amour;\nSois mon rocher,\nMon ancre, ma lumière,\nMoi Roi, mon Maître,\nO Jésus, chaque jour!",
