    title: 'Ne crains rien, je t’aime',
    lyrics:
      "1.\nNe crains rien, je t'aime!\nJe suis avec toi!\nPromesse suprême,\nQui soutient ma foi.\nLa sombre vallée\nN'a plus de terreur;\nL'âme consolée,\nJe marche avec mon Sauveur.\n\nRefrain\nNon, jamais tout seul!  (bis)\nJésus, mon Sauveur, me garde,\nJamais ne me laisse seul.\nNon, jamais tout seul!  (bis)\nJésus, mon Sauveur, me garde,\nJe ne suis jamais tout seul.\n\n2.\nL'aube matinière\nNe luit qu'aux beaux jours;\nJésus, ma lumière,\nM'éclaire toujours!\nQuand je perds de vue\nL'astre radieux,\nÀ travers la nue,\nJésus me montre les cieux!\n\n3.\nLes dangers accourent,\nSubtils, inconnus:\nDe près ils m'entourent,\nPlus près est Jésus,\nQui, dans le voyage,\nMe redit: «C'est moi!\nNe crains rien, courage!\nJe suis toujours avec toi!»",
