    lyrics_Markdown: {
      md: '**1.** \n\nSaint-Esprit, notre Créateur \n\nEt notre grand Consolateur, \n\nRends-toi le Maître de nos âmes! \n\nEsprit du Dieu de vérité, \n\nÉclaire-nous par ta clarté \n\nEt nous embrase de tes flammes! \n\nEsprit de Jésus notre Roi, \n\nSoumets-nous à ta douce loi. \n\n\n<br/> **2.**\n\nHumilie et change nos coeurs; \n\nRègle notre vie et nos moeurs; \n\nProduis en nous la repentance, \n\nUne parfaite humilité, \n\nUne sincère charité \n\nUne constante patience. \n\nOpère en nous tous puissamment \n\nEt fais-nous vivre saintement. \n\n\n<br/> **3.**\n\nRépands dans nos âmes ta paix; \n\nDaigne inspirer tous nos projets; \n\nImprime en nos coeurs ta parole; \n\nTriomphe de nos passions; \n\nDans toutes nos afflictions \n\nExauce-nous et nous console; \n\nSoutiens-nous dans tous nos combats; \n\nRedresse et conduis tous nos pas. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Saint-Esprit, notre Créateur </p>\n<p>Et notre grand Consolateur, </p>\n<p>Rends-toi le Maître de nos âmes! </p>\n<p>Esprit du Dieu de vérité, </p>\n<p>Éclaire-nous par ta clarté </p>\n<p>Et nous embrase de tes flammes! </p>\n<p>Esprit de Jésus notre Roi, </p>\n<p>Soumets-nous à ta douce loi. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Humilie et change nos coeurs; </p>\n<p>Règle notre vie et nos moeurs; </p>\n<p>Produis en nous la repentance, </p>\n<p>Une parfaite humilité, </p>\n<p>Une sincère charité </p>\n<p>Une constante patience. </p>\n<p>Opère en nous tous puissamment </p>\n<p>Et fais-nous vivre saintement. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Répands dans nos âmes ta paix; </p>\n<p>Daigne inspirer tous nos projets; </p>\n<p>Imprime en nos coeurs ta parole; </p>\n<p>Triomphe de nos passions; </p>\n<p>Dans toutes nos afflictions </p>\n<p>Exauce-nous et nous console; </p>\n<p>Soutiens-nous dans tous nos combats; </p>\n<p>Redresse et conduis tous nos pas. </p>\n'
    },
