    title: 'Promesse du Père',
    lyrics:
      "1.\nPromesse du Père,\nEsprit glorieux!\nToi dans la lumière\nDessille les yeux!\n\nRefrain\nVeuille sur nous descendre,\nSaint Consolateur!\nEn nos coeurs viens répandre\nL'amour du Sauveur.\n\n2.\nRanime le zèle\nDu coeur triste et las;\nDu pied qui chancelle\nRaffermis les pas.\n\n3.\nComble notre attente;\nEn nous fais jaillir\nLa source abondante\nQui ne peut tarir.\n\n4.\nViens vivre en notre âme,\nEsprit de Jésus!\nQue ta sainte flamme\nNe pâlisse plus!",
