    num: 112,
    title: 'Romps-nous le pain de vie',
    lyrics:
      "1.\nRomps-nous le pain de vie!\nQue ta bonté,\nSeigneur, nous rassasie\nDe vérité!\nAmour qui nous fait vivre,\nRévèle-Toi!\nParle dans le saint Livre\nÀ notre foi!\n\n2.\nO toi don't la clémence\nCréa du pain\nPour une foule immense\nMourant de faim.\nVois, ton peuple se presse\nAutour de Toi…\nSecours notre détresse\nEt notre foi!\n\n3.\nC'est toi le Pain de vie.\nVerbe puissant!\nC'est de ta chair meurtrie,\nC'est de ton sang\nQue notre âme doit vivre…\nAh!  Donne-toi\nPar l'Esprit et le livre\nÀ notre foi!\n\n4.\nTu bénis tes apôtres,\nPuis, à leur tour,\nIls portèrent à d'autres\nTon grand amour…\nÔ parole féconde,\nQue notre foi\nT'offre à ce pauvre monde\nQui meurt sans Toi!",
