    title: 'En expirant, le rédempteur',
    lyrics:
      "1.\nEn expirant, le Rédempteur\nLaissa, don suprême,\nA son peuple un Consolateur:\nDieu lui-même.\n\n2.\nDans tous les coeurs l'Hôte divin\nVeut prendre une place,\nEt personne n'implore en vain\nCette grâce.\n\n3.\nSans se lasser, sa douce voix,\nConsole ou châtie;\nEt tout bas nous chante parfois\nLa Patrie!\n\n4.\nToutes nos vertus sont le fruit\nDon't il est la sève;\nIl commence l'oeuvre et c'est Lui\nQui l'achève.\n\n5.\nEsprit de lumière et de paix,\nAh!  Que dès cette heure,\nNos coeurs deviennent à jamais\nTa demeure!",
