    lyrics:
      "1.\nEs-tu lassé, rempli de tristesse?…\nDit tout à Jésus!  (bis)\nSon coeur est ouvert à ta voix sans cesse\nOh!  Dit tout à Jésus!\n\nRefrain\nDis tout à Jésus!\nOh!  Dis-Lui tout!\nCombien son accueil est doux.\nIl peut comprendre,\nIl aime à t'entendre:\nDis-Lui simplement tout!\n\n2.\nIl voit tes yeux rougis par les larmes:\nDis tout à Jésus!  (bis)\nIl connaît ton coeur, Il sait tes alarmes.\nOh!  Dis tout à Jésus!\n\n3.\nSi ton passé surgit comme un ombre:\nDis tout à Jésus!  (bis)\nIl peut effacer tes péchés sans nombre.\nOh!  Dis tout à Jésus!\n\n4.\nEt pour demain ce que tu redoutes:\nDis tout à Jésus!  (bis)\nIl est près de toit le long de la route.\nOh!  Dis tout à Jésus!",
