    title: 'Oui, Jésus, c’est vers Toi',
    lyrics:
      "1.\nOui, Jésus, c'est vers Toi,\nToujours plus haut!\nQue s'élève ma foi,\nToujours plus haut\nLibre de tout lien,\nPoursuivant le seul bien,\nMon regard sur le tien,\nToujours plus haut!\n\n\n2.\nOui, c'est là mon soupir,\nToujours plus haut!\nTu connais mon désir,\nToujours plus haut!\nPerçant l'obscurité,\nMontre-moi ta clarté,\nTa divine beauté,\nToujours plus haut!\n\n\n3.\nMarche, me dit Jésus,\nToujours plus haut!\nOh! N'arrête plus,\nToujours plus haut!\nBientôt, je reviendrai,\nEt te délivrerai,\nOui, je t'introduirai\nChez Moi, là-haut!",
