    title: 'Mon Jésus, je t’aime',
    lyrics:
      "1.\nMon Jésus, je t'aime,\nJe Te sais à moi,\nJe fuis les plaisirs de\nCe monde pour Toi.\nSauveur qui fait grâce\nA tout coeur repentant,\nSi jamais je T'aime,\nC'est bien maintenant.\n\n\n2.\nJe T'aime, car Toi,\nLe premier, Tu m'aimas;\nJe T'aime pour la croix\nOù Tu Te donnas,\nEt pour les épines\nSur Ton front sanglant,\nSi jamais je T'aime,\nC'est bien maintenant.\n\n\n3.\nJe T'aimerai dans la vie\nEt dans la mort;\nOui, je T'aimerai\nJusqu'à la fin encore,\nEt tout bas, je dirai\nLe mot consolant:\nSi jamais je T'aime,\nC'est bien maintenant.\n\n\n4.\nDans la gloire et le\nBonheur de Ton palais,\nJe T'adorerai, Jésus,\nPlus que jamais;\nDe l'Église en triomphe\nÉclate ce chant:\nSi jamais je T'aime,\nC'est bien maintenant.",
