    title: 'Demain, peut-être',
    lyrics:
      "1.\nDemain, peut-être,\nJe te croirai,\nEt pour mon Maître\nJe te prendrai.\nAinsi, quand Dieu l'invite,\nL'âme réponds: « Attends! »\nAh! Pécheur, entre vite!\nViens, il est temps!\n\n\n2.\nDemain, peut-être,\nPlus de pardon!\nQuoi! Méconnaître\nUn pareil don!\nDieu t'offre, dans sa grâce,\nLe bonheur des élus;\nAvant que l'heure passe,\nViens à Jésus!\n\n\n3.\nDemain, peut-être,\nDu châtiment\nTu vas connaître\nL'affreux tourment.\nJésus t'appelle, Il t'aime;\nIl est le seul chemin;\nViens, c'est l'instant suprême!\nPourquoi demain?",
