    title: 'Comme un fleuve immense',
    lyrics:
      "1.\nComme un fleuve immense\nEst la paix de Dieu.\nParfaite elle avance\nVainqueur en tout lieu;\nParfaite elle augmente\nConstamment son cours;\nParfaite sa pente\nS'abaisse toujours.\n\nRefrain\nSelon ta promesse, O Jésus, mon Roi,\nJe trouve sans cesse Paix parfaite en toi.\n\n\n2.\nTu traces ma voie:\nJ'y marche avec toi!\nL'épreuve et la joie\nMe viennent de toi!\nCadran de nos vies,\nMarque, chaque jour,\nLes heures bénies\nDu soleil d'amour!\n\n\n3.\nOcéan de gloire,\nPaix de mon Sauveur!\nGage de victoire!\nTrésor de bonheur!\nTa grâce infinie,\nCoulant nuit et jour,\nInonde ma vie\nDe vagues d'amour!",
