    num: 194,
    title: 'Jésus te confie',
    lyrics:
      "1.\nJésus te confie\nUne oeuvre d'amour,\nUtile et bénie\nJusqu'à son retour;\nCette sainte tâche,\nVeux-tu l'accomplir\nPour Lui, sans relâche,\nSans jamais faiblir?\n\nRefrain\nPrie, agis, jour après jour,\nSans broncher, suis ton Sauveur avec amour;\nSoit fidèle, obéissant,\nEt le Maître rendra ton travail puissant.\n\n\n2.\nVa chercher ton frère,\nEsclave enlacé,\nLas de sa misère,\nDe son noir passé;\nArrache son âme\nAu plaisir trompeur,\nLe salut proclame,\nEn Christ, ton Sauveur.\n\n\n3.\nVa vers la jeunesse,\nQue le tentateur\nVeut leurrer sans cesse,\nLoin du vrai bonheur;\nCombattant le doute,\nParle-lui d'amour;\nMontre-lui la route\nDu ciel, saint séjour.\n\n\n4.\nVa vers ceux qui meurent\nSans Dieu, sans espoir;\nDis à ceux qui pleurent\nQuand tout semble noir:\n« Jésus donne vie,\nBonheur, joie et paix\nA qui se confie\nEn Lui, pour jamais. »",
