      md: "**1.** \n\nEntends-tu? Jésus t'appelle; \n\nViens, ô pécheur, Il t'attend… \n\nA cette voix si fidèle \n\nTu résista trop souvent. \n\n\n\n\n<br/> **Refrain**\n\n**Laisse entrer le Roi de gloire;** \n\n**Ouvre ton coeur à Jésus!** \n\n**Laisse entrer le Roi de gloire,** \n\n**Hâte-toi, ne tarde plus.** \n\n\n\n<br/> **2.**\n\nPour le péché, pour le monde, \n\nTu trouves place en ton coeur… \n\nPoint pour le Sauveur du monde, \n\nRien pour l'Homme de douleur! \n\n\n<br/> **3.**\n\nJésus frappe, Il frappe encore; \n\nOuvre à ton Libérateur, \n\nEt pour toi luira l'aurore \n\nDu véritable bonheur. \n\n\n<br/> **4.**\n\nAujourd'hui, c'est jour de grâce; \n\nNe compte pas sur demain. \n\nPendant que ton Sauveur passe, \n\nSaisis sa puissante main! \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Entends-tu? Jésus t&#39;appelle; </p>\n<p>Viens, ô pécheur, Il t&#39;attend… </p>\n<p>A cette voix si fidèle </p>\n<p>Tu résista trop souvent. </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Laisse entrer le Roi de gloire;</strong> </p>\n<p><strong>Ouvre ton coeur à Jésus!</strong> </p>\n<p><strong>Laisse entrer le Roi de gloire,</strong> </p>\n<p><strong>Hâte-toi, ne tarde plus.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Pour le péché, pour le monde, </p>\n<p>Tu trouves place en ton coeur… </p>\n<p>Point pour le Sauveur du monde, </p>\n<p>Rien pour l&#39;Homme de douleur! </p>\n<p><br/> <strong>3.</strong></p>\n<p>Jésus frappe, Il frappe encore; </p>\n<p>Ouvre à ton Libérateur, </p>\n<p>Et pour toi luira l&#39;aurore </p>\n<p>Du véritable bonheur. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Aujourd&#39;hui, c&#39;est jour de grâce; </p>\n<p>Ne compte pas sur demain. </p>\n<p>Pendant que ton Sauveur passe, </p>\n<p>Saisis sa puissante main! </p>\n'
