    title: 'Ah! Donne A Mon Ame',
    lyrics:
      "1.\nAh!  Donne à mon âme\nPlus de sainteté…\nPlus d'ardente flamme,\nDe sérénité,\nPlus de confiance\nPour rester debout,\nPlus de patience\nPour supporter tout.\n\n\n2.\nFais que je contemple\nSans cesse l'Agneau,\nSon vivant exemple,\nSa croix, son tombeau,\nSa grâce fidèle,\nSon immense amour,\nSa gloire éternelle,\nSon prochain retour.\n\n\n3.\nJésus, à mes larmes,\nTu veux compatir;\nDe toutes tes armes,\nViens me revêtir;\nPar plus de prière.\nDe zèle et de foi.,\nQue dans la lumière,\nJe marche avec joie!\n\n\n4.\nDonne, à ton service,\nUn coeur plus joyeux,\nPrompt au sacrifice,\nToujours sous tes yeux,\nQui chante et qui tremble,\nHumble en sa ferveur,\nUn coeur qui ressemble\nAu tien, mon Sauveur.",
