      md: "**1.** \n\nAnnonçons partout le dernier Message \n\nDu Seigneur Jésus revenant des cieux; \n\nDans le mon entier, rendons témoignage \n\nAu Roi saint et glorieux \n\n\n\n\n<br/> **Refrain**\n\n**Annonçons partout la bonne nouvelle:** \n\n**Jésus réunit tous ses rachetés;** \n\n**Il vient leur donné la vie éternelle.** \n\n**Oh!  Publions ses bontés.** \n\n\n\n<br/> **2.**\n\nAnnonçons partout le dernier Message: \n\nLe Seigneur Jésus vient sécher nos pleurs \n\nBriser les liens de notre esclavage, \n\nMettre un terme à nos douleurs. \n\n\n<br/> **3.**\n\nAnnonçons partout le dernier Message: \n\nBientôt nous verrons la sainte Cité. \n\nGloire à notre Dieu!  Chrétiens, bon courage! \n\nCar voici l'éternité \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Annonçons partout le dernier Message </p>\n<p>Du Seigneur Jésus revenant des cieux; </p>\n<p>Dans le mon entier, rendons témoignage </p>\n<p>Au Roi saint et glorieux </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Annonçons partout la bonne nouvelle:</strong> </p>\n<p><strong>Jésus réunit tous ses rachetés;</strong> </p>\n<p><strong>Il vient leur donné la vie éternelle.</strong> </p>\n<p><strong>Oh!  Publions ses bontés.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Annonçons partout le dernier Message: </p>\n<p>Le Seigneur Jésus vient sécher nos pleurs </p>\n<p>Briser les liens de notre esclavage, </p>\n<p>Mettre un terme à nos douleurs. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Annonçons partout le dernier Message: </p>\n<p>Bientôt nous verrons la sainte Cité. </p>\n<p>Gloire à notre Dieu!  Chrétiens, bon courage! </p>\n<p>Car voici l&#39;éternité </p>\n'
