    title: 'Sur De La Victoire',
    lyrics:
      "1.\nSûr de la victoire,\nSoldat du Seigneur,\nMarche, chante: « Gloire! »\nTu seras vainqueur.\nLe grand Capitaine\nQui va devant toi\nTe la rend certaine;\nCombats avec foi.\n\nRefrain\nOui, la victoire, - Tu l'auras!\nChante donc: « Gloire! » - Tu verras\nTon adversaire – Fort, vaillant,\nCouché par terre – A l'instant!\n\n\n2.\nL'ennemi s'avance\nRedoublant le pas\nEt plein d'assurance,\nNe s'arrête pas;\nMais, Christ va combattre,\nReste près de lui;\nDéjà pour l'abattre,\nSon épée à lui.\n\nRefrain: Et la victoire, etc…\n\n\n3.\nDieu tient la couronne\nPromise au vainqueur;\nC'est lui qui la donne\nAvec le bonheur;\nBientôt sur ta tête\nIl va la poser;\nDans sa paix parfaite\nTu va reposer.\n\nRefrain: Car la victoire, etc…",
