    title: 'Voici, je me tiens',
    lyrics:
      "1.\nVoici, je me tiens\nA la porte de l'âme,\nJe frappe sans cesse\nAvec divin espoir.\nSi quelqu'un m'entend,\nS'il m'ouvre et me réclame,\nChez lui j'entrerai,\nJ'y souperai ce soir.\n\nRefrain\nOuvre, ouvre-moi!\nSi quelqu'un m'ouvre la porte,\nJe soupe avec lui ce soir.  (bis 2 lignes)\n\n\n2.\nJe frappe au matin,\nQuand toute la nature\nNous parle d'un Père\nEt tendre et tout-puissant.\nJe frappe à midi,\nQuand la moisson est mûr,\nRévélant l'amour\nD'un Dieu si prévoyant.",
