      md: "**1.** \n\nMiséricorde insondable! \n\nDieu peut-il tout pardonné? \n\nAbsoudre un si grand coupable, \n\nEt mes péchés oublier? \n\n\n\n\n<br/> **Refrain**\n\n**Jésus, je viens!  Je viens à Toi!** \n\n**Tel que je suis, je viens à Toi!** \n\n**Jésus, je viens, je viens à Toi!** \n\n**Tel que je suis, prends-moi.** \n\n\n\n<br/> **2.**\n\nLongtemps j'ai, loin de sa face, \n\nProvoqué son saint courroux, \n\nFermé mon coeur à sa grâce, \n\nBlessé le sien devant tous. \n\n\n<br/> **3.**\n\nO Jésus!  À Toi je cède, \n\nJe veux être libéré; \n\nDe tout péché qui m'obsède \n\nÊtre à jamais délivré. \n\n\n<br/> **4.**\n\nAlléluia!  Plus de doute, \n\nMon fardeau est enlevé; \n\nPour le ciel je suis en route, \n\nHeureux pour l'éternité \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Miséricorde insondable! </p>\n<p>Dieu peut-il tout pardonné? </p>\n<p>Absoudre un si grand coupable, </p>\n<p>Et mes péchés oublier? </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Jésus, je viens!  Je viens à Toi!</strong> </p>\n<p><strong>Tel que je suis, je viens à Toi!</strong> </p>\n<p><strong>Jésus, je viens, je viens à Toi!</strong> </p>\n<p><strong>Tel que je suis, prends-moi.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Longtemps j&#39;ai, loin de sa face, </p>\n<p>Provoqué son saint courroux, </p>\n<p>Fermé mon coeur à sa grâce, </p>\n<p>Blessé le sien devant tous. </p>\n<p><br/> <strong>3.</strong></p>\n<p>O Jésus!  À Toi je cède, </p>\n<p>Je veux être libéré; </p>\n<p>De tout péché qui m&#39;obsède </p>\n<p>Être à jamais délivré. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Alléluia!  Plus de doute, </p>\n<p>Mon fardeau est enlevé; </p>\n<p>Pour le ciel je suis en route, </p>\n<p>Heureux pour l&#39;éternité </p>\n'
