    title: 'Plus haut, plus haut!',
    lyrics:
      "1.\nPlus haut, plus haut!\nC'est le cri de ma foi:\nS'il faut courber\nLa tête sous le glaive,\nJe veux encore\nQue mon âme s'élève\nPlus près de Toi, mon Dieu,\nPlus près de Toi!\n\n\n2.\nLorsque la nuit\nSe fait autour de moi,\nQuand j'erre seul\nDans le désert immense,\nQue de mon âme\nEncore ce cri s'élance:\nPlus près de Toi, mon Dieu,\nPlus près de Toi!\n\n\n3.\nPrends, ô mon coeur,\nLes ailes de la foi,\nVole au-dessus\nDes monts et des vallées,\nChante, au travers\nDes plaines étoilées:\nPlus près de Toi, mon Dieu,\nPlus près de Toi!\n\n\n4.\nQuand tu viendras,\nO mon céleste Roi,\nMe recueillir\nDans ta pure lumière,\nQue je redise\nA mon heure dernière:\nPlus près de Toi, mon Dieu,\nPlus près de Toi!",
