    title: 'O Dieu de vérité',
    lyrics:
      "1.\nO Dieu de vérité,\nPour qui seul je soupire,\nUnis mon coeur à Toi\nPar de forts et doux noeuds!\nJe me lasse d'ouïr,\nJe me lasse de lire,\nMais non pas de te dire:\nC'est Toi seul que je veux!\nMais non pas de te dire:\nC'est Toi seul que je veux!\n\n\n2.\nParle seul à mon coeur,\nEt qu'aucune prudence,\nQu'aucun autre docteur\nNe m'explique tes lois;\nQue toute créature,\nEn ta sainte présence,\nS'impose le silence\nEt laisse agir ta voix!\nS'impose le silence\nEt laisse agir ta voix!\n\n\n3.\nTiens-toi près de mon âme,\nEt, dans ma solitude,\nViens remplir de ta paix\nLe vide de mon coeur.\nDissipe mes ennuis\nEt toute inquiétude,\nEt que ma seule étude\nSoit de t'aimer, Seigneur!\nEt que ma seule étude\nSoit de t'aimer, Seigneur!\n\n\n4.\nTu me réponds, mon Dieu!\nMais encore des nuages\nMe voilent tes splendeurs,\nCéleste Vérité!\nQue ne puis-je bientôt,\nSur de plus purs rivages\nPar delà tous les âges\nContempler ta bonté!\nPar delà tous les âges\nContempler ta bonté!",
