    lyrics:
      "1.\nPour Toi seule, en qui j'espère,\nPour Toi seul, d'un coeur joyeux,\nJe fais monter de la terre\nMon cantique vers les cieux.\nPour Toi seul,  (bis)\nOui, mon Sauveur, pour Toi seul.\n\n\n2.\nA Toi seul, sainte Victime,\nAgneau mis à mort pour moi,\nDont le sang lava mon crime,\nÀ Toi seul s'attend ma foi.\nÀ Toi seul,  (bis)\nOui, mon Sauveur, à Toi seul.\n\n\n3.\nA Toi seul, dans la détresse,\nÀ Toi seul j'aurais recours,\nÀ Toi seul, ma forteresse,\nLe rocher de mon secours,\nÀ Toi seul,  (bis)\nOui, mon Sauveur, à Toi seul.",
