    title: "Jusqu'à La Mort",
    lyrics:
      "1.\nJusqu'à la mort,\nNous te serons fidèles,\nJusqu'à la mort,\nTu seras notre Roi;\nSous ton drapeau,\nJésus, tu nous appelles;\nNous y mourons\nEn luttant avec foi!\n\nRefrain\nJusqu'à la mort!\nC'est notre cri de guerre,\nLe libre cri d'un peuple racheté;\nJusqu'à la mort,\nNous aurons pour bannière\nTa croix sanglante,\nÔ Christ ressuscité!\n\n\n2.\nPour toi, Jésus,\nOn est heureux de vivre;\nTous les chemins\nAvec toi semblent doux.\nAgneau de Dieu,\nQui ne voudrait te suivre\nJusqu'à la mort,\nToi qui mourus pour nous?\n\n\n3.\nJusqu'à la mort,\nSoumis à ta puissance,\nNous voulons vivre\nEt mourir sous tes lois,\nToi qui pour nous\nPoussas l'obéissance\nJusqu'à la mort,\nEt la mort de la croix.\n\n\n4.\nMais, ô Sauveur!\nTu sais notre faiblesse;\nNous tomberons\nSûrement en chemin\nSi tu ne viens\nAccomplir ta promesse:\nJusqu'à la mort,\nNous tenir par la main.\n\n\n5.\nQue ton Esprit\nNous guide et nous anime!\nEt que sa flamme,\nEmbrasant tous nos coeurs,\nNous devenions\nPar toi, sainte victime,\nSur la mort même\nUn peuple de Vainqueurs!",
