      html: '<p><strong>1.</strong> </p>\n<p>Souvent, Seigneur, en sa détresse, </p>\n<p>Un pauvre pécheur ne t&#39;adresse </p>\n<p>Pour prières que des soupirs. </p>\n<p>Vers lui, plein d&#39;amour, tu t&#39;inclines; </p>\n<p>Quoiqu&#39;il se taise, tu devines </p>\n<p>Le secret de tous ses désirs. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Mais, ô Dieu! Ces élans de l&#39;âme, </p>\n<p>Ce cri d&#39;un coeur qui te réclame, </p>\n<p>Je ne les trouve pas en moi: </p>\n<p>Toujours occupé de la terre, </p>\n<p>Quoique de tout je désespère, </p>\n<p>Je ne sais m&#39;élever à Toi. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Mon coeur se tait comme la lyre, </p>\n<p>Dont Saül a, dans son délire, </p>\n<p>Interrompu les doux accords. </p>\n<p>Seigneur, fais-en vibrer les cordes, </p>\n<p>Pour que de tes miséricordes </p>\n<p>Je parles avec de saints transports. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Mais quoi! Ce désir que j&#39;éprouve, </p>\n<p>Ce souhait qu&#39;en mon coeur je trouve, </p>\n<p>Ne me viendraient-ils pas de Dieu? </p>\n<p>Je disais: dicte ma prière! </p>\n<p>Et tu m&#39;avais, ô tendre Père, </p>\n<p>Déjà dicté ce premier voeu. </p>\n<p><br/> <strong>5.</strong></p>\n<p>Désormais donc, ô Dieu suprême! </p>\n<p>Pourquoi chercherais-je en moi-même </p>\n<p>Le prière qu&#39;il faut t&#39;offrir? </p>\n<p>J&#39;attends toute sainte pensée </p>\n<p>Du ciel, d&#39;où descend la rosée </p>\n<p>Que le soleil doit recueillir. </p>\n'
