    title: 'Jour de Seigneur',
    lyrics:
      "1.\nJour du Seigneur,\nJ'ouvre mon coeur\nA ta douce lumière:\nJour solennel,\nA l'Éternel\nConsacre ma prière.\n\n\n2.\nDieu tout-puissant,\nDieu bienfaisant,\nJ'ai besoin de ta grâce.\nÉclaire-moi,\nSoutiens ma foi;\nJe viens chercher ta face.\n\n\n3.\nTa vérité,\nTa charité,\nBrillent dans ta Parole.\nSeule elle instruit,\nGuide et conduit\nNotre âme, et la console.\n\n\n4.\nJ'entends ta voix;\nTes saintes lois\nNe sont pas difficiles.\nViens les graver,\nLes conserver\nDans des âmes dociles.\n\n\n5.\nQue ton Esprit,\nO Jésus-Christ,\nRègne seul en notre âme!\nQue ton amour,\nEt nuit et jour,\nL'embrase de sa flamme!",
