    title: 'Paix, paix parfaite',
    lyrics:
      "1.\nPaix, paix parfaite\nEn Jésus le Sauveur,\nParfaite paix,\nMême pour moi, pécheur!\n\n\n2.\nPaix, paix parfaite!\nOù sont tous mes péchés?…\nLe sang de Christ\nLes a tous effacés!\n\n\n3.\nPaix, paix parfaite!\nAu fort de ma douleur\nL'amour de Christ\nMet la joie en mon coeur!\n\n\n4.\nPaix, paix parfaite!\nEn face de la mort,\nCar mon Sauveur\nEst Maître de mon sort!\n\n\n5.\nPaix, paix parfaite!\nEn Christ, ô doux espoir!\nLe triste « adieu »\nSe change en « au revoir! »\n\n\n6.\nPaix, paix parfaite\nEn notre Emmanuel,\nPaix sur la terre\nEt gloire dans le ciel!",
