    title: 'À moi, les coeurs braves',
    lyrics:
      "1.\n« A moi les coeurs braves! »\nA dit le vainqueur\nQui rompt les entraves\nDu pauvre pécheur.\n« Noble est la carrière:\nQui veut y courir?\nEt, sous ma bannière,\nCombattre et mourir? »\n\nRefrain\nA Toi, divin Maître, mon coeur et mon bras:\nJésus, je veux être l'un de tes soldats!\n\n\n2.\nL'ennemi fait rage:\nJe sens ses fureurs;\nComme un bruit d'orage,\nJ'entends ses clameurs,\nQuand Satan déchaîne\nTous ses alliés:\nMais ce flots de haine\nExpire à tes pieds.\n\n\n3.\nMa couronne est prête:\nTu m'as racheté!\nMa justice est faite\nDe ta sainteté.\nTa grâce infinie\nCouvre mes péchés;\nA ta croix bénie\nIls sont attachés.\n\n\n\n\n\n\n\n\n\n4.\nAprès tant de luttes,\nLassés mais vainqueurs,\nRelevés des chutes,\nGuéris des douleurs,\nGardés sous ton aile,\nNous irons goûter\nLa paix éternelle,\nEt pourrons chanter:\n\nRefrain\n« A toi la couronnes de tous les élus!\nC'est qui leur donnes ton ciel, ô Jésus! »",
