    title: 'Je vis D’espérance',
    lyrics:
      "1.\nJe vis d'espérance,\nD'amour et de foi,\nEt mon chant s'élance\nVers Toi, divin Roi.\nGrande est ma faiblesse,\nMon indignité;\nMais dans ta tendresse,\nTu m'as racheté.\n\nRefrain\nOui, mon coeur chante,\nMon âme est contente;\nMon Jésus est tout mon bien,\nJe ne craindrai rien!  (bis 4 lignes)\n\n\n2.\nOh! Quelle tendresse,\nQuel immense amour!\nCet amour me presse\nD'aimer à mon tour:\nAimer, c'est te suivre\nEt c'est t'obéir.\nAimer, oui, c'est vivre\nEt s'épanouir.\n\n\n3.\nQue le coeur en fête\nLa nuit et le jour\nToujours je reflète\nTon immense amour!\nL'amour qui rayonne,\nTe gagnant les coeurs,\nVoilà la couronne\nAu front des vainqueurs!",
