    title: 'Le Cri De Mon âme',
    lyrics:
      "1.\nLe cri de mon âme\nS'élève vers Toi;\nElle te réclame,\nJésus, pour son Roi.\nTon joug est facile,\nTon fardeau léger;\nSur mon coeur docile,\nRègne, ô Bon Berger!\n\n\n2.\nTrop longtemps le monde,\nTrompa mes désirs.\nChangeants comme l'onde\nSont tous ses plaisirs.\nSa joie est frivole,\nTout est vanité;\nSeule, ta Parole\nEst la vérité.\n\n\n3.\nParole éternelle,\nO Christ Rédempteur,\nPrends-moi sous ton aile,\nHabite en mon coeur.\nDans la nuit profonde,\nTiens-moi par la main;\nLumière du monde\nLuis sur mon chemin!\n\n\n4.\nSource de l'eau vive,\nPain venu des cieux,\nQue par Toi je vive\nPaisible et joyeux!\nQuand luira l'aurore\nDu jour éternel,\nQue je vive encore\nPour Toi, dans le ciel!",
