    num: 196,
    title: 'Mon Dieu, mon Père',
    lyrics:
      "1.\nMon Dieu, mon Père,\nÉcoute-moi,\nCar ma prière\nS'élève à toi.\nEn Jésus-Christ,\nTu nous l'as dit,\nJe puis, Seigneur,\nT'ouvrir mon coeur.\nAh! Fais-moi grâce,\nDieu tout-puissant!\nTourne ta face\nVers ton enfant.\n\n\n2.\nViens, je te prie,\nChange mon coeur;\nGuide ma vie\nLoin de l'erreur.\nMon seul désir\nEst de choisir\nLa bonne part\nSous ton regard.\nQue mon offense\nNe lasse plus\nTa patience,\nSeigneur Jésus!\n\n\n3.\nFais-moi comprendre\nTa charité\nEt bien entendre\nTa vérité.\nOui, que ta main,\nSur mon chemin,\nSoit, ô Dieu fort,\nMon seul support!\nQue ta puissance\nSoit chaque jour\nMa délivrance,\nO Dieu d'amour!\n\n\n4.\nRends-moi fidèle\nPar ton secours,\nEt sous ton aile\nTiens-moi toujours;\nLoin du danger,\nO Bon Berger!\nConduis mes pas\nJusqu'au trépas.\nVois ma faiblesse\nEt mes soutiens\nPar ta tendresse:\nJe t'appartiens.",
