      html: '<p><strong>1.</strong> </p>\n<p>Toi dont l&#39;âme est tourmentée </p>\n<p>Aux approches de la mort, </p>\n<p>Toi dont la nef ballottée </p>\n<p>Ne sait où trouver le port, </p>\n<p>Regarde à travers tes larmes, </p>\n<p>Ce phare, qui tant de fois </p>\n<p>A brillé dans tes alarmes: </p>\n<p>C&#39;est la croix! C&#39;est la croix! </p>\n<p><br/> <strong>2.</strong></p>\n<p>O toi qu&#39;assaille le doute, </p>\n<p>Toi que le monde a séduit, </p>\n<p>Toi qui marches sur la route </p>\n<p>Dans la nuit et vers la nuit, </p>\n<p>Même en doutant, prie, adore </p>\n<p>Celui qui meurt sur le bois, </p>\n<p>Regarde, oh! Regarde encore </p>\n<p>Vers la croix! Vers la croix! </p>\n<p><br/> <strong>3.</strong></p>\n<p>Sur la croix où Christ expire, </p>\n<p>La mort succombe avec lui: </p>\n<p>C&#39;en est fait de son empire, </p>\n<p>Le jour de la vie a lui! </p>\n<p>Péchés, doutes et souffrance </p>\n<p>Demeurent cloués au bois: </p>\n<p>O sublime délivrance </p>\n<p>De la croix! De la croix! </p>\n<p><br/> <strong>4.</strong></p>\n<p>A tes pieds, ô croix bénie, </p>\n<p>Signe auguste et méprisé </p>\n<p>De triomphe et d&#39;agonie, </p>\n<p>J&#39;apporte mon coeur brisé. </p>\n<p>Désormais, sois ma bannière! </p>\n<p>Je veux vivre sous tes lois </p>\n<p>Et mourir sous ta lumière, </p>\n<p>Sainte croix! Sainte croix! </p>\n'
