    title: 'C’est Toi Jésus',
    lyrics:
      "1.\nC'est toi, Jésus!\nQue recherche mon âme;\nA te trouver\nSe bornent mes souhaits;\nC'est ton regard\nQue sur moi je réclame;\nRends-moi, Seigneur,\nRends-moi ta douce paix.\n\n\n2.\nLongtemps j'errai\nDans les sentiers du monde,\nNe connaissant\nNi ton nom ni ta loi;\nTu me cherchas\nEn cette nuit profonde,\nEt, pour toujours,\nM'en tiras par la foi.\n\n\n3.\nDe ton amour\nLa voix se fit entendre;\nJ'appris alors\nQue tu m'as racheté,\nEt ton Esprit\nA mon coeur fit comprendre\nCe qu'est pour nous,\nO Dieu!  Ta charité!\n\n\n4.\nPrends donc pitié\nDe ma grande misère!\nSoumets mon coeur,\nBrise sa dureté.\nA Golgotha\nMon âme te fut chère:\nJe compte, ô Dieu!\nSur ta fidélité.",
