    title: 'Epoux chrétiens, que le ciel vous sourie',
    lyrics:
      "1.\nÉpoux chrétiens, que le ciel vous sourie\nDans ce beau jour où vous êtes unis;\nPour vous, ici, chacun de nos coeurs prie.\nSoyez heureux, amis, soyez bénis!\n\n\n2.\nOh! Que Jésus, dont la douce présence\nVoulut orner les noces de Cana,\nPréside encore, dans sa condescendance,\nA ce bonheur que Lui-même donna!\n\n\n3.\nQu'il fait chez vous un autre Béthanie,\nOù l'on accueille avec empressement\nSon coeur aimant, sa parole bénie,\nOù l'on s'entr'aime, à ses pieds, doucement.",
