      md: "**1.** \n\nÉpoux chrétiens, que le ciel vous sourie \n\nDans ce beau jour où vous êtes unis; \n\nPour vous, ici, chacun de nos coeurs prie. \n\nSoyez heureux, amis, soyez bénis! \n\n\n<br/> **2.**\n\nOh! Que Jésus, dont la douce présence \n\nVoulut orner les noces de Cana, \n\nPréside encore, dans sa condescendance, \n\nA ce bonheur que Lui-même donna! \n\n\n<br/> **3.**\n\nQu'il fait chez vous un autre Béthanie, \n\nOù l'on accueille avec empressement \n\nSon coeur aimant, sa parole bénie, \n\nOù l'on s'entr'aime, à ses pieds, doucement. \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Époux chrétiens, que le ciel vous sourie </p>\n<p>Dans ce beau jour où vous êtes unis; </p>\n<p>Pour vous, ici, chacun de nos coeurs prie. </p>\n<p>Soyez heureux, amis, soyez bénis! </p>\n<p><br/> <strong>2.</strong></p>\n<p>Oh! Que Jésus, dont la douce présence </p>\n<p>Voulut orner les noces de Cana, </p>\n<p>Préside encore, dans sa condescendance, </p>\n<p>A ce bonheur que Lui-même donna! </p>\n<p><br/> <strong>3.</strong></p>\n<p>Qu&#39;il fait chez vous un autre Béthanie, </p>\n<p>Où l&#39;on accueille avec empressement </p>\n<p>Son coeur aimant, sa parole bénie, </p>\n<p>Où l&#39;on s&#39;entr&#39;aime, à ses pieds, doucement. </p>\n'
