    title: 'Viens, âme qui pleures',
    lyrics:
      "1.\nViens, âme qui pleures,\nViens à ton Sauveur;\nDans tes tristes heures,\nDis-lui ta douleur…\nDis tout bas ta plainte\nAu Seigneur Jésus…\nParle-lui sans crainte,\nEt ne pleure plus!\n\n\n2.\nSis tout à ce frère,\nA ce tendre ami,\nTon épreuve amère,\nTon deuil, ton souci.\nIl aime, Il console\nLes coeurs abattus;\nCrois à sa parole\nEt ne pleure plus!\n\n\n3.\nDis à d'autres âmes\nPloyant sous le fait,\nQue tu les réclames\nPour le Dieu de paix.\nCalme leurs alarmes,\nMontre-leur Jésus;\nVa sécher leurs larmes,\nEt ne pleure plus!",
