    title: 'Marchons Avec Joie',
    lyrics:
      "1.\nMarchons avec joie\nDans le bon chemin,\nDans l'étroite voie\nDu bonheur sans fin.\nLaissons en arrière\nLes biens d'ici-bas;\nPrions notre Père\nDe guider nos pas.\nComptant sur sa grâce,\nRemplis de sa paix,\nQue rien n'embarrasse\nNos pas désormais.\n\n\n2.\nSi rude est la route,\nGlissant le sentier,\nLe Seigneur écoute\nQui le sait prier.\nIl est la lumière,\nLe Libérateur\nDu coeur qui n'espère\nQu'en son Dieu-Sauveur.\nSa toute-puissance\nDéfend le croyant;\nSon amour immense\nSauve son enfant.\n\n\n3.\nEt quand sonne l'heure\nDe quitter ces lieux,\nIl a pour demeure\nLe palais des cieux!\nVêtements de gloire,\nD'immortalité,\nPalmes de victoire\nPour l'éternité!\nVoilà ce que donne\nLe Seigneur Jésus!\nVoilà la couronne\nDe tous les élus.",
