    title: 'Repose ton âme',
    lyrics:
      "1.\nRepose ton âme\nDans la sainteté,\nDe ton Dieu proclame\nLa fidélité;\nLa sainte Parole\nDont il te nourrit\nCondamne et console,\nBlesse, mais guérit.\n\n\n2.\nRepose ton âme\nDans la sainteté,\nNe crains ni le blâme,\nNi l'adversité;\nTout près de ton guide,\nLa main dans sa main,\nLe désert aride\nFleurira soudain.\n\n\n3.\nRepose ton âme\nDans la sainteté,\nL'Esprit Saint réclame\nTon activité;\nJésus, par sa grâce,\nDemeurant en toi,\nChoisira ta place\nPour l'oeuvre du Roi.\n\n\n4.\nRepose ton âme\nDans la sainteté,\nEntretiens la flamme\nDe la charité.\nEn suivant le Maître\nDoux, humble de coeur,\nTu feras connaître,\nSa grâce au pécheur.\n\n\n5.\nRepose ton âme\nDans la sainteté,\nQuand la foule acclame\nLa mondanité;\nPense à la couronne\nPromise au vainqueur.\nVa, le ciel l'ordonne,\nServir ton Sauveur!",
