    title: 'Gen lumyè nan nanm mwen jodi ya',
    lyrics:
      '1.\nGin lumiè nan nan-m mouin jodi a,\nAvèk gloua pi gran pasé\nMin-m solèy la n-apé ouè nan sièl,\nKa Jézu té kléré-m.\n\nKè:\nOui, gin lumiè, gin bèl lumiè;\nMouin kontan, mouin vlé toujou chanté;\nLè Jézu montré amou li nan kè mouin\nLumiè sa toujou rété.\n\n\n2.\nGin kantik nan nan-m mouin jodi a,\nSé gnou kantik pou Jézu;\nÉ li konnin sa mouin pakab di,\nKa amou-l san mézi.\n\n\n3.\nGin la joua nan nan-m mouin jodi a,\nAk éspoua, louanj, amou,\nPou bi-infè li ban mouin tou lé jou,\nPou siè l-a ban mouin tou.',
