    title: 'Ségné, Angnin M-Pa Ka Ba Ou',
    lyrics:
      '1.\nSégnè angnin m-pa ka ba ou,\nSèl gnou kè ki bouké soufri,\nÉ san ou mouin pa kab géri,\nMizè mouin dévan ou.\n\nKè\nPran mouin jan ou ouè-m la,\nSan fòs é san souti-in\nJan ou ouè-m la,  (2 foua)\nO Jézu gran frè mouin.\n\n\n2.\nMouin pa janmin obéi ou,\nPéché kouvri-m la tèt o pié,\nÉ pou-m prézanté dévan ou\nPéché sèlman m-poté.\n\n\n3.\nMouin fèb nan kè, mouin fèb nan chè,\nPou-m rézisté dévan Satan;\nO Ségnè mouin, mouin fèb tout tan,\nMap rélé: ban-m lumiè.\n\n\n4.\nSan li koulé a va blanchi-m,\nSint-Espri ou va purifié-m\nRichès ou yo va anrichi-m,\nMon mouin! Vini sové-m.',
