    title: 'A la gnou bèl bagay',
    lyrics:
      '1.\nA la gnou bèl bagay ki nan vi mouin rivé\nLè Jézu vini nan kè mouin.\nMouin gin lumiè nan kè-m, sa-m té toujou chaché\nLè Jézu vini nan kè mouin.\n\nKè:\nLè Jézu vini nan kè mouin,  (2 foua)\nLa joua mouin débòdé pasé gnou gran riviè\nLè Jézu vini nan kè mouin.\n\n\n2.\nMouin suspan-n voyajé nan gnou mové chémin\nLè Jézu vini nan kè mouin.\nSan Jézu éfasé tout péché m-té gingnin\nLè Jézu vini nan kè mouin.\n\n\n3.\nMouin té jouin-n gnou éspoua ki va duré tou tan\nLè Jézu vini nan kè mouin.\nÉ nan pouin dout ankò nan kè mouin kòm avan\nLè Jézu vini nan kè mouin.\n\n\n4.\nMouin gin gnou lumiè ki kléré santié lan mò\nLè Jézu vini nan kè mouin.\nÉ m-kapab ouè pòt sièl la ki louvri lòt bò\nLè Jézu vini nan kè mouin.\n\n\n5.\nMouin gingnin nan sièl la gnou kay pou mouin rété\nLè Jézu vini nan kè mouin.\nMouin kontan, bi-in kontan, bonè mouin asuré\nLè Jézu vini nan kè mouin.',
