    lyrics:
      '1.\nMouin pito gin Jézu pasé gro lajan;\nMouin pito pa Li, pasé m-ta rich tout tan,\nMouin pito gin Jézu pasé bèl kay;\nPito li gidé mouin nan tout bagay.\n\nKè:\nPasé pou-m ta roua nan gnou gran péi,\nLè péché-m ta fè-m soufri;\nPito m-gin Jézu pasé tout bagay\nKé lé mon-n ta kapab bay.\n\n\n2.\nMouin pito gin Jézu pasé vanité;\nMouin pito fidèl; pou Li mapé luté;\nMouin pito gin Jézu pasé rénonmé:\nMouin pito kinbé-L, é viv nan la pè.\n\n\n3.\nJustis Jézu-Kri sé gnou gran mèvèy;\nParol li pi dous pasé gnou gato mièl;\nMouin pito gin Jézu – Li kon-n satisfè-m;\nMouin pito suiv li – Li kon-n dirijé-m.',
