    title: 'Nan pouin angnin ant nan-m mouin é Sovè-m',
    lyrics:
      '1.\nNan pouin angnin ant nan-m mouin é Sovè-m,\nAngnin nan lé mon-n dépravé sa,\nMouin té rénonsé tout plézi la chè-m,\nJézu pou mouin, pa gin bariè la.\n\nKè:\nNan pouin angnin ant nan-m mouin é Sovè-m,\nPou anpéché-m ouè Li fas a fas;\nAngnin pou détouné favè Li anvè-m,\nOuété tout bò-n!  pa gin bariè la.\n\n\n2.\nNan pouin plézi mon-n sa ant mouin ak Kris;\nKoun yé a vis la vi vi-n san ka;\nYo pa kab séparé-m ak Li non plis,\nJézu pou mouin, nan pouin bariè la.\n\n\n3.\nMalgré m-a gin éprèv ki du pépèt,\nMalgré lé mon-n méprizé la Koua;\nMa-p tan-n nan priè jouk Ségnè-m parèt,\nSé va trionf, nan pouin bariè la.',
