    title: 'Yon Vi Pou Jézu Bay La Pè',
    lyrics:
      '1.\nGnou vi pou Jézu bay la pè\nKou gnou riviè ki pa rété;\nDifikulté yo kon-n vi-ni –\nMin Jézu la, é sa sufi.\n\nKè:\nÉdé-m sèvi Ou plus chak jou,\nPou-m rété toujou avèk Ou;\nM-rinmin Ou, Kris, plus ké janmin;\nTan pri, pa kité-m égaré.\n\n2.\nGnou vi pou Jézu bay répo,\nLi ouété nan mouin sa ki fo;\nParol Li sé la vérité;\nL-a gidé-m pou létènité.\n\n3.\nGnou vi pou Jézu bay la joua\nDèské mouin sové pa la foua;\nZanmi yo mèt abandonnin-m,\nJézu fidèl, Li va kinbé-m.\n\n4.\nGnou vi pou Jézu bay viktoua,\nAk fòs Li m-maché pa-za-pa;\nKris té vink diab, lé mon-n, la chè;\nKoun-yé-a mouin plus ké vinkè.',
