      "1.\t\nA de nouveaux combats, Jésus tu nous appelles\nEt nous voici fidèles, prêts à suivre tes pas \nConduits nous aux combats, nous sommes tes soldats\n\nChoeur\nArme nos bras, arme nos coeurs\nEt nous serons plus que vainqueurs  (bis)\nArme nos bras, arme nos coeurs.\n\n2.\t\nArme-nous O Seigneur, de foi, de hardiesse,\nDe force, de sagesse, d'amour et de ferveur\nEmbrasse-nous Seigneur, d'une invincible ardeur\n\n3.\t\nNous tiendrons ferme et haut,\nLa croix, notre bannière\nPour vaincre l'adversaire, par le sang de l'Agneau\nOui! Nous tiendrons bien haut, ta croix, notre drapeau.\n\n4.\t\nLuttons, prions, souffrons,\nNous aurons la victoire; la couronne de gloire\nUn jour ceindra nos fronts, luttons, prions,\nSouffrons; bientôt nous règnerons.",
