    lyrics:
      '1.\nEské ou gin tan kité souin\nPapa ou, ou régrèt ké ou\nEgaré louin, gin gnou voua dou\nE tand kap mandé pou ou\n\nKè: Pitit mouin, pitit mouin, rétounin\nPitit mouin, pitit mouin,\nO pitit ou égaré, Papa ou apé plédé\nPitit mouin tounin, tounin\n\n2.\nEské ou san sékou nan loraj la vi\nBato ou prèt pou plonjé anfin\nMin! Lumiè lévanjil, antré nan labri\n\n3.\nJodi a Lap plédé avèk ou anko\nAvantaj lé monn pa vo angnin\nAntré vit pa négligé gnou vré trézo',
