    title: 'Mèt, Palé! Sévant Ou Kouté!',
    lyrics:
      '1.\nMèt, palé!  Sèvant ou kouté!\nMap tan-n bon paròl bouch ou;\nVoua ou ki fè mouin si kontan\nKè-m souaf tandé li toujou.\nMapé kouté ou, Ségnè,\nKi sa ou gin pou di mouin.\n\n\n2.\nMèt, rélé mouin non pa mouin-min’m,\nDi-m sé ak mouin ou palé,\nPou mouin kapab suiv ou pi fèm;\nPou mouin maché san tranblé.\nPalé! Ou sé Bon Bèjé,\nMouin, mouton ou té rachté.\n\n\n3.\nKouté mouin avan mouin alé,\nMouin tankou gnou moun pèdi.\nMèt, palé! Sé ou ki konnin\nTout bagay kè mouin anvi,\nTou sa nan-m mouin bézouin vré;\nVini, é nan kè-m palé.\n\n\n4.\nMèt, palé!  É fè mouin paré\nLè-m tandé bi-in sa ou di,\nAk vitès, épi kè kontan\nPou-m suiv tou sa ou té di,\nMapé kouté ou, Mèt mouin;\nPalé, Jézu! Palé mouin!',
