    title: 'O Gran Amou Kité Rachté-m',
    lyrics:
      '1.\nO gran amou ki té rachté-m\nNan péché a,\nKoupab é sal jan mouin té yé\nM-pat gin éspoua.\nLè sa m-té nan gnou gran fènoua\nO ki gran jou!\nLi lévé nan-m mouin nan lan mò,\nKi gran amou!\n\nKè:\nKi gran amou pou rachté nan-m mouin,\nKi gran amou pou géri kè mouin.\nAmou sa voyé Ségnè-m mouri.\nKi gran amou! Adoré sin non Li.\n\n\n2.\nAmou sa fè Sovè-m mouri\nSou boua Kalvè\nPou péchè ki rébèl kont Li.\nKouman sa yé!\nAmou fè pon ant mouin ak sièl,\nLi pou mouin tou,\nMouin padonnin, mouin pa tou sèl\nKi gran amou!\n\n\n3.\nAmou té louvri pòt lumiè\nRouayom sièl la.\nJézu va parèt la an lè,\nL-a résévoua-m.\nAmou té lévé-m nan malè.\nA la gnou jou!\nPat gin lot èd sou tout la tè,\nKi gran amou!',
