    lyrics:
      '1.\nZanj ap chanté an lè;\nMin bèl zétoual nan sièl;\nGin pitit pou nou ouè,\nJézu Éma-nuèl.\nKité mouton nan chan,\nVi-ni ouè mèvèy sa,\nPaské krèch Bétléèm\nRésévoua Roua dè roua.\n\n\n2.\nMin-m zétoual yo an joua\nPou nésans mèvéyé;\nPaské Pitit vièj la\nSé Ségnè tout la tè.\nMaj, kité péi ou\nVi-ni ouè mèvèy sa,\nPaské krèch Bétléèm\nRésévoua Roua dè roua.\n\n\n3.\nTi Pitit ki kouché\nNan lumiè zétoual la,\nSé Fis létènité,\nSé pou li tout la gloua.\nNou tout zanj nan sièl la\nVi-ni ouè mèvèy sa,\nPaské krèch Bétléèm\nRésévoua Roua dè roua.\n\n\n4.\nTout moun ki nan fè noua,\nYo tout anba malè,\nSé pou nou bèl chan sa,\nBon-Dieu ban nou lumiè.\nKouri vi-n jouin-n Jézu,\nSé li-min’m ki Sovè-n;\nKa Pitit nan krèch la\nSé Jézu, Rédanmtè-n.',
