    lyrics:
      '1.\nMouin kanpé sou tout promès\nDé Kris, roua mouin,\nPandan létènité\nMap chanté louanj Li,\nGloua nan tout sièl la\nSa va sujè chan mouin,\nMouin kanpé sou tou promès Bon-Dieu.\n\nKè:\nKanpé, kanpé, mouin kanpé sou\nTou promès ké Bon-Dieu fè nou;\nKanpé, kanpé, mapé kanpé\nSou tout promès Bon-Dieu.\n\n2.\nMouin kanpé sou tout promès ki pa fayi,\nLè mové tanpèt\nÉ tout krint vlé koulé-m,\nPa voua Paròl Bon-Dieu\nM-a sòti vinkè,\nMouin kanpé sou tout promès Bon-Dieu.',
