      md: '**1.** \n\nGin gnou non mouin rinmin chanté, \n\nSé gnou non mouin p-ap jan-m blié, \n\nPaské sé pa li mouin sové, \n\nSé présié non dé Jézu. \n\n\n\n\n<br/> **Kè:**\n\n**O, oui, mouin rinmin Jézu (3 foua)** \n\n**Paské Li rinmin-m avan.** \n\n\n\n<br/> **2.**\n\nBoua Kalvè mouin p-ap jan-m blié, \n\nSé la Li mouri pousové \n\nTout péchè ki vlé vi-n lavé \n\nNan san Li ki koulé la. \n\n\n<br/> **3.**\n\nParol Bon-Dieu m-apé séré \n\nNan kè mouin pou mouin pa péché \n\nKont Jézu ki té vlé sové \n\nNou, lè Li mouri pou nou. \n\n\n',
