    lyrics:
      '1.\nSièl la sé la m-pralé\nPou tout létènité.\nSé lè sa gloua-L va révélé\nLòt bò bèl pòt sa, Jézu kap tan-n mouin la.\n\nKè:\nMouin va rankontré tout krétyin yo,\nTout sa yo ki kon-n lagno.\nÉ sé la m-a viv toujou.\nMin plus pasé sa m-a ouè Jézu,\nM-a réjoui nan prézans Li.\nSé pou sa mouin vlé alé.\n\n2.\nGin la, bèl flèv la vi,\nLa joua nan Jézu Kri.\nKonbyin mouin ta vlé ouè ak Li!\nSé la lumiè-l kléré, pou tout létènité.\nSé pou sa mouin vlé alé.',
