    title: 'San Sovè, San Bon-Dieu',
    lyrics:
      '1.\nSan Sovè, san Bon-Dieu, sa ou va fè?\nLè ou apé mouri, sa ou va fè?\nLè sa li sérié, nan-m ou pralé;\nKi sa ou va tounin; sa ou va fè?\n\n\n2.\nOu-min’m kap ri tout tan; sa ou va fè?\nJou sa ou va tou sèl; sa ou va fé?\nSi lè lan mò vini, ou pa paré,\nLa pè va sézi ou; sa ou va fè?\n\n\n3.\nEské gin gnou koté pou oukaché?\nLè Bon-Dieu rélé ou, sa ou va fè?\nGran moun tan ap pasé; jèn jan; jèn fi;\nMoun ki rinmin péché; sa ou va fè?\n\n\n4.\nMoun ki rinmin Jézu, al jouin Bon-Dieu;\nLi bon, li patènel; li sové yo;\nLan mò pa fò yo pè, Jézu ak yo;\nLi kaché yo non bra-l, li sové yo.',
