      md: '**1.** \n\nSan Sovè, san Bon-Dieu, sa ou va fè? \n\nLè ou apé mouri, sa ou va fè? \n\nLè sa li sérié, nan-m ou pralé; \n\nKi sa ou va tounin; sa ou va fè? \n\n\n<br/> **2.**\n\nOu-min’m kap ri tout tan; sa ou va fè? \n\nJou sa ou va tou sèl; sa ou va fé? \n\nSi lè lan mò vini, ou pa paré, \n\nLa pè va sézi ou; sa ou va fè? \n\n\n<br/> **3.**\n\nEské gin gnou koté pou oukaché? \n\nLè Bon-Dieu rélé ou, sa ou va fè? \n\nGran moun tan ap pasé; jèn jan; jèn fi; \n\nMoun ki rinmin péché; sa ou va fè? \n\n\n<br/> **4.**\n\nMoun ki rinmin Jézu, al jouin Bon-Dieu; \n\nLi bon, li patènel; li sové yo; \n\nLan mò pa fò yo pè, Jézu ak yo; \n\nLi kaché yo non bra-l, li sové yo. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>San Sovè, san Bon-Dieu, sa ou va fè? </p>\n<p>Lè ou apé mouri, sa ou va fè? </p>\n<p>Lè sa li sérié, nan-m ou pralé; </p>\n<p>Ki sa ou va tounin; sa ou va fè? </p>\n<p><br/> <strong>2.</strong></p>\n<p>Ou-min’m kap ri tout tan; sa ou va fè? </p>\n<p>Jou sa ou va tou sèl; sa ou va fé? </p>\n<p>Si lè lan mò vini, ou pa paré, </p>\n<p>La pè va sézi ou; sa ou va fè? </p>\n<p><br/> <strong>3.</strong></p>\n<p>Eské gin gnou koté pou oukaché? </p>\n<p>Lè Bon-Dieu rélé ou, sa ou va fè? </p>\n<p>Gran moun tan ap pasé; jèn jan; jèn fi; </p>\n<p>Moun ki rinmin péché; sa ou va fè? </p>\n<p><br/> <strong>4.</strong></p>\n<p>Moun ki rinmin Jézu, al jouin Bon-Dieu; </p>\n<p>Li bon, li patènel; li sové yo; </p>\n<p>Lan mò pa fò yo pè, Jézu ak yo; </p>\n<p>Li kaché yo non bra-l, li sové yo. </p>\n'
