    lyrics:
      '1.\nKè nou pa bézouin troublé plis,\nBon-Dieu ban nou la pè  nan Kris.\nSé sèlman pou nou kouè Bon-Dieu,\nAk Jézu-Kri, la vérité.\n\n\n2.\nLa foua nan Li, sé gnou rémèd;\nLi chanjé troub yo ki pi rèd!\nMoun yo ki gin anpil la foua,\nDoulè yo va tounin nan joua.\n\n\n3.\nGin anpil moun ki pè lan mò;\nYo krin-n sa kap tan-n yo lòt bò!\nJézu di ké nan kay Papa-l,\nLi va préparé pliziè sal.\n\n\n4.\nSé té pou tout disip li yo,\nLi té palé gnou si bèl mo.\nLi vlé disip li yo rété\nNan min-m koté li va yé.\n\n\n5.\nSé Jézu-Kri, la vérité,\nKi promèt li ban nou la pè;\nSa li ban nou, sé pou tout tan;\nSan krint ni troub, kè nou kontan.',
