    title: 'Lé monn antié pèdu nan ténèb péché',
    lyrics:
      '1.\nLé mon-n antié pèdu nan ténèb péché;\nSèl lumiè lé mon-n sé Jézu!\nKon solèy midi Lévanjil la briyé;\nSèl lumiè lé mon-n sé Jézu!\n\nKè:\nVi-n jouin-n Jézu, La ba ou lumiè;\nLumiè a dous, li bèl, sé Jézu!\nMouin té avèg, koul yé a mouin ouè\nSèl lumiè lé mon-n sé Jézu!\n\n\n2.\nMoun ki gin Jézu nan kè yo, gin lumiè;\nSèl lumiè lé mon-n sé Jézu!\nSi ou suiv Jézu chak jou, ou-a gin lumiè;\nSèl lumiè lé mon-n sé Jézu!\n\n\n3.\nMoun kapé viv nan péché, yo nan ténèb;\nSèl lumiè lé mon-n sé Jézu!\nPa konté sous tradision yo, sa trò fèb;\nSèl lumiè lé mon-n sé Jézu!\n\n\n4.\nSèl lumiè ki va nan sièl la, sé Jézu;\nSèl lumiè lé mon-n sé Jézu!\nLumiè na gin nan vil dò a sé Jézu;\nSèl lumiè lé mon-n sé Jézu!',
