    lyrics:
      '1.\nJézu rélé-n nan tout touman\nLa vi nou ki kou tanpèt,\nTou lé jou voua Li rézonné,\nLi di: O Kréti-in, suiv mouin.\n\n\n2.\nLè apot yo té kon-n tandé-l\nKoté la mè Galilé,\nYo té kité kay ak zanmi,\nTout bagay pou tèt non Li.\n\n\n3.\nJézu rélé-n pou nou kité\nLé mon-n ak tout vanité.\nTout idòl avèk tout malis,\nLi di: Kréti-in, rinmin-m plus.\n\n\n4.\nNan la joua é nan la tristès,\nLè nou jinnin ou a lèz,\nNinpòt lè, é nan ninpòt rout\nLi di-m: Pran ka-m pasé tout.\n\n\n5.\nJézu rélé-n! Nan pitié ou,\nSové, fè-n tandé voua ou;\nBan nou kè ki obéisan\nPou sèvi, rinmin tout tan.',
