    lyrics:
      '1.\nLa koua kanpé solid,\nAlélouya,  Alélouya;\nDékourajé janmin –\nAlélouya,  Alélouya.\nTout van lanfè vanté,\nLé mon-n tout riz montré,\nMin la koua rété solid,\nAlélouya pou la koua.\n\nKè:\nAlélouya,  Alélouya,\nAlélouya pou la koua,\nAlélouya,  Alélouya;\nLi sové sak gin la foua.\n\n2.\nSé toujou la koua Jézu,\nAlélouya,  Alélouya;\nLi pòté la viktoua –\nAlélouya,  Alélouya.\nLa koua montré gras Li,\nNan Kris, Pitit Bon-Dieu,\nKi té mouri pou sové nou,\nAlélouya pou la koua.\n\n3.\nJézu té péyé dèt péché,\nAlélouya,  Alélouya;\nLi pòté péché nou,\nAlélouya,  Alélouya.\nSé pou la koua nou chanté,\nDé Kris, ofran-n pou nou,\nDé Kris, Roua nou vivan,\nAlélouya, pou la koua.',
