    lyrics:
      '1.\nLé mon-n vlé mouin suiv plézi li,\nMin pito m-suiv Jézu;\nLé mon-n pa kap ban mouin la vi,\nMouin vlé sanblé Jézu.\n\nKè:\nSanblé Jézu, sé dézi-m,\nLè mouin sèl ou pami moun;\nSanblé Jézu nan tout vi-m,\nMouin vlé sanbléJézu.\n\n\n2.\nLi té krazé chin-n péché-m yo;\nMouin vlé sanblé Jézu,\nPou nan-m mouin kab sèvi-l pi fò,\nMouin vlé sanblé Jézu.\n\n\n3.\nMouin vlé ouè Li nan Paradi\nPami anj avèk sin;\nMouin vlé tandé bèl paròl Li\nLè-l di: « Ou té fè bi-in. »',
