    title: 'Peyi Lwen',
    lyrics:
      '1.\nPéi louin, louin isit, sé la mouin doué alé,\nPéi sa gin anpil moun pèdu.\nMoun la yo pa konnin Jézu-Kri sé koulé,\nLi rinmin nou anpil, li mouri.\n\nKè:\nPéi louin…louin isit…\nMouin doué alé…mouin doué alé…\nJouk tout moun…fi-n konnin…\nBòn nouvèl…Jézu-Kri.\n\n\n2.\nLi voyé mouin alé nan gnou lié  difisil,\nÉ lié sa sé gnou lié trè, trèdu.\nMoun nan yo gin kè du, yo papé vlé kouté,\nMin kan min-m yo bézouin-m, mouin pralé.\n\n\n3.\nGin anpil, anpil moun ki toujou yo déro.\nJézu-Kri vlé yo vi-n jodi a.\nLi voyé mouin alé nan péi louin ankò,\nRanmasé yo, pòté yo bay Li.',
