    title: 'Maten an avan ou sòti',
    lyrics:
      '1.\nMatin an avan ou sòti,\nÈské outé prié?\nO non dé Jézu, Sovè nou,\nÈské ou mandé favè li\nPou protéjé ou?\n\nKè:\nLa priè va ba ou répo,\nLa priè chanjé tout bagay;\nLè chémin la sanblé trò long,\nPa blié prié.\n\n\n2.\nLè kè ou té ranpli kolè,\nÈské outé prié?\nÈské outé mandé gras li\nPou padonnin lè zòt yo\nKi té blésé ou.\n\n\n3.\nLè zéprèv anpil té vini,\nÈské outé prié?\nLè nan-m ou té gingnin tristès,\nÈské outé chaché joua Bon-Dieu\nDépi gran matin?',
