    title: 'Mouin tap néyé nan péché',
    lyrics:
      '1.\nMouin tap néyé nan péché\nBi-in louin la pè Bon-dieu;\nNan-m mouin ki té tout taché\nTap koulé san lévé.\nJézu ki tapé véyé-m\nLè li tandé rèl mouin\nLi vi-ni tout suit édé-m,\nLi sové mouin.\n\nKè:\nJézu sové-m!  Jézu sové-m!\nLè mouin té san sékou, Jézu sové-m!\nJézu sové-m!  Jézu sové-m!\nLè mouin té san sékou, Jézu sovè-m!\n\n\n2.\nOui, tout kè-m mouin vlé bay li,\nPou-m toujou avèk li,\nPou mouin viv nan prézans li,\nPou-m chanté louanj li,\nAmou li si bon, si gran!\nLi mérité tout vi-m,\nPou mouin sèvi li tout tan\nMap bay tout vi-m.\n\n\n3.\nMoun ki nan péché chaché-l,\nJézu vlé sové ou;\nPou-l pòté, avèk amou-l,\nTout fado ki trò lou.\nL-a sové ou nan tanpèt,\nL-a kaché ou toujou,\nFòtifié ou nan dizèt,\nL-a sové ou.',
