    title: 'Papa mouin gin kay, avèk anpil tè',
    lyrics:
      '1.\nPapa mouin gin kay, avèk anpil tè,\nPla min ni kinbin tout fòtu-n ké li fè,\nPiè présié, diaman, ak lajan ak lò,\nTout bouat li yo plin, nan richès li pi fò.\n\nKè:  Mouin sé pitit Roua a,\nGnou pitit Roua a;\nJézu sé Sovè mouin,\nMouin sé pitit Roua a.\n\n\n2.\nSèl Pitit Bon-Dieu ki Sovè lé mon-n,\nGnou jou té maché sou la tè kon gnou non-m:\nKoun yé a, lap plédé padon nou nan sièl;\nLè L-a vi-n chaché nou, n-a rantré avè-l.\n\n\n3.\nLontan mouin maché, gnou non-m égaré;\nM-té pito péché pasé konnin Bon-Dieu;\nMin Li adopté-m, é Li ban mouin non-m;\nMouin sé éritié gnou palè ak kourò-n.\n\n\n4.\nJoupa ou bi-in kay, sa pa fè-m angnin;\nAn ro a, yap bati gnou palè pou mouin;\nPandan map tan-n li, m-a chanté chan sa a:\nTout gloua pou Bon-Dieu, mouin sé pitit Roua a.',
