    title: 'A la bèl gloua, maché ak Jézu',
    lyrics:
      '1.\nA la bèl gloua, maché ak Jézu!\nLi vèsé san-l pou mouin;\nNan-m mouin pran plézi li chak jou,\nSé gran joua lè Jézu koté mouin,\nLi ak mouin tou patou.\nGloua a Dieu!\nSé gnou bèl gloua pou mouin.\n\nKè:\nA la bèl gloua, maché ak Jézu!  (2 foua)\nLi kondui-m nan tout chémin,\nLi kinbin-m, sa sé sètin;\nA la bèl gloua, maché ak Jézu.\n\n\n2.\nA la bè gloua, min-m lè li fè noua,\nPou-m konnin li tou pré;\nAlò m-prié ak konfians, ak foua;\nA la bèl gloua, santi li tou pré\nLè chémin mouin plin joua.\nGloua a Dieu!\nSé gnou bèl gloua pou mouin.\n\n\n3.\nA la bèl gloua, lè, la kay Bon-Dieu,\nAk li m-a va maché,\nPou toujou koté-l m-a va rété;\nSa va gnou mèvèy lè map chanté\nPou tou létènité.\nGloua a Dieu!\nSé gnou bèl gloua pou mouin.',
