    lyrics:
      '1.\nMouin té fi-n pèdu\nMin Jézu té sové-m,\nSé gnou mèvéyé Sovè pou mouin;\nPéché-m té maré-m,\nMin Jézu délivré-m,\nSé gnou mèvéyé Sovè pou mouin.\n\nKè:\nLi sé gnou mèvéyé Sovè pou mouin,\nSé gnou mèvéyé Sovè pou mouin,\nMouin té fi-n pèdu, min Jézu té sové-m,\nSé gnou mèvéyé Sovè pou mouin.\n\n\n2.\nLi gnou zanmi vré,\nSi pasian é trankil,\nSé gnou mèvéyé Sovè pou mouin;\nTout bagay m-bézouin,\nMouin toujou jouin-n nan Li,\nSé gnou mèvéyé Sovè pou mouin.\n\n\n3.\nJézu konsolé-m,\nÉ Li ankourajé-m\nSé gnou mèvéyé Sovè pou mouin;\nLi padonnin mouin,\nLi suiyé dlo nan jé-m,\nSé gnou mèvéyé Sovè pou mouin.\n\n\n4.\nLamou Jézu vi-n\nPi présié tou lé jou,\nSé gnou mèvéyé Sovè pou mouin;\nLè-m rété fidèl,\nGras Li dous toujou,\nSé gnou mèvéyé Sovè pou mouin.',
