      md: '**1.** \n\nKouté Jézu apé rélé, \n\nLi kon-n mouton-l yo an danjé, \n\nLi palé yo avèk amou, \n\nLi gin éspoua jouin-n yo gnou jou. \n\n\n\n\n<br/> **Kè:**\n\n**Chaché yo, chaché yo!** \n\n**Èské ou konnin pri gnou nan-m?** \n\n**Chaché yo, chaché yo!** \n\n**Kris mandé pou nou tout ansan-m.** \n\n\n\n<br/> **2.**\n\nAnba soufrans, anba péché \n\nMouton yo santi y-antravé; \n\nJézu mandé nou édé Li \n\nDélivré gran avèk piti! \n\n\n<br/> **3.**\n\nEské Kris ka konté sou nou? \n\nÈské nou vlé sèvi Li tou \n\nPou rakonté tout moun pèdu \n\nGin délivrans la nan Jézu! \n\n\n',
