    title: 'Ti réyon bèl solèy la',
    lyrics:
      '1.\nTi réyon bèl solèy la,\nKi moun fè ou kléré kon sa?\nSé Bon Papa nou.  (2 foua)\nTi zouazo ak bèl koulè,\nKi moun fè ou chanté tout lè?\nSé Bon Papa nou.  (2 foua)\n\nKè:\nSé Bon-Dieu nan sièl ki Papa nou,\nSé Li ki fè nou – Li plin lamou.\n\n\n2.\nBèl ti flè kap réjoui nou,\nSé ki moun ki konnin fè ou?\nSé Bon Papa nou.  (2 foua)\nBèl ti riviè kap koulé,\nKi moun fè ou, èské ou konnin?\nSé bon Papa nou.  (2 foua)\n\n\n3.\nTi moun ak figu briyé,\nKi moun fè kè ou si léjé?\nSé Bon Papa nou.  (2 foua)\nKi moun montré ou chanté\nKou ti zouazo ki toujou gé?\nSé Bon Papa nou.  (2 foua)',
