    title: 'Bon-Dieu damou té rinmin',
    lyrics:
      '1.\nBon-Dieu damou té rinmin\nTout péchè yo anpil\nÉ Li té bay sèl pitit Li pou sové yo.\nSé sou la koua\nJézu té mouri gnou jou\nÉ Li té vèsé san-ni la pou nou.\n\nKè:\nO alélouya, O gloua a Jézu!\nPaské mouin sové\nNan gran gras Bon-Dieu.\nLi té pran péché-m,\nLi ban mouin la vi,\nKoun yé-a m-sové pou létènité.\n\n2.\nM-té kon-n maché nan péché\nRouj mouin yo san frin\nMin lumiè Bon-Dieu\nTé ékléré mouin-min’m tou.\nSint-Éspri Li té\nFè-m ouè jan-m té pèdu\nÉ sa-m doué fè pou kité rout lanfè.\n\n3.\nTout gras Bon-Dieu gingnin\nLi pa ka jan-m fini\nLi gin kont lamou\nKi kap sové nou-min’m tou\nVi-n ouvri kè ou pou aksépté Jézu\nÉ ou va réjoui nan sièl la ak nou.',
