    title: 'San pa Jézu gin gran vale',
    lyrics:
      '1.\nSan pa Jézu gin gran valè,\nLi ban nou padon;\nJézu vlé sové tout péchè,\nDélivré-l tout bon.\n\nKè\nSan an koulé pou tout péchè,\nRébèl kont Bon-Dieu;\nSan pa Jézu gin gran valé,\nSé sa ki rachté-m.\n\n\n2.\nEské chay péché ou trè lou,\nRouj kon kramouazi?\nJézu kab nétouayé kè ou,\nFè ou pu kou li.\n\n\n3.\nKoun yé a nou kapab antré\nNan prézans Bon-Dieu,\nAsuré ké san pa Jézu\nOuété tout péché.\n\n\n4.\nAk san an nou kapab brizé\nTout puisans Satan;\nAk san an nou kapab trouvé\nLa pè pou tout tan.',
