    title: 'Lè Nap Maché Ak Dieu',
    lyrics:
      '1.\nLè nap maché ak Dieu, ann lumiè Parol li,\nKi bèl gloua li voyé sou rout nou!\nLè nap fè volonté-l, li rété koté nou,\nÉ ak tout moun ki « Obéi-kouè ».\n\nKè:\n« Obéi-kouè », sé tou sa pou ou fè,\nPou ou kontan nan Jézu, sé pou «obéi-kouè».\n\n\n2.\nLonbraj ki va parèt, tout nuaj ka nan sièl la,\nSouri Jézu va fè-l disparèt;\nPa gnou dout, pa gnou pè, ni soupi, ni gnou kri,\nKa rété lè nou « Obéi-kouè »\n\n\n3.\nNou pap pòté gnou chaj pou lè zòt kap soufri,\nSan Jézu pa béni nou pou sa.\nNou pap subi gnou pèd, nou pap pòté gnou koua,\nSan-n pa béni, si-n «obéi-kouè».\n\n\n4.\nMin nou pa ka konnin tout mèvèy amou li\nAvan nou konsakré tout bagay;\nPaské bi-infè li yo é la joua li ban nou,\nSé pou moun ki vlé «obéi-kouè».\n\n\n5.\nKon sa nan prézans li, na chita nan pié li,\nOu nou va maché nan rout avè-l.\nSa li di, nou va fè.  Nou pral koté li vlé;\nSan pè angnin, na «obéi-kouè».',
