    lyrics:
      '1.\nOu pa doué pè angnin;\nMouin toujou ak ou:\nMin promès la, krétiin,\nKi soutni kè nou.\nRout sou té a mèt noua,\nSa pap fè mouin pè;\nNan-m mouin plin ak éspoua,\nM-ap maché ak bon Sovè-m.\n\nKè:\nMouin pa janmin sèl;  (2 foua)\nJézu, Sovè-m, ap véyé mouin,\nLi pa jan-m kité mouin sèl.\nMouin pa janmin sèl;  (2 foua)\nJézu, Sovè-m, ap véyé mouin,\nMouin pa jan-m rété tou sèl.\n\n\n2.\nSolèy la kléré bi-in,\nLè bèl tan sèlman;\nMin Jézu, lumiè mouin,\nLi kléré tout tan.\nLè mouin pa ouè klèté\nSolèy ki si bèl,\nNan ninpòt ki koté\nJézu parèt – mouin ouè sièl.',
