    title: 'Esk Ou Ta Vlé Viv Pou Jézu Nét Epi Toujou?',
    lyrics:
      '1.\nEsk-ou ta vlé viv pou Jézu nèt épi toujou?\nEsk-ou vlé maché avèk li tou lè jou?\nEsk-ou vlé li pòté chay ou, soutni kè ou tou?\nKité-l fè ou kon li vlé.\n\nKè:\nPuisans li kab fè ou sa ou doué yé,\nSan-l kab nétouayé kè ou kon li yé,\nAmou li va plin na-m ou, si ou kouè.\nPito kité-l kondui ou kon li vlé.\n\n\n2.\nEsk-ou vlé li fè ou lib pou suiv li kout ké kout?\nEsk-ou vlé kouraj pou fè nonpòt ki rout?\nEsk-ou vlé délivré ou nan tout pièj, tout dout?\nKité-l fè ou kon li vlé.\n\n\n3.\nEsk-ou ou chaché gnou répo pou nan-m ou nan la pè?\nEsk-ou vlé Kris la avèk ou nan léprèv?\nEsk-ou vlé obéi li é pòté foui bon zèv?\nKité-l fè ou kon li vlé.',
