    title: 'Bèje mwen, se gnou Rwa damou',
    lyrics:
      '1.\nBèjé mouin, sé gnou Roua damou,\nBonté li pap jan-m fini.\nSi sé li-min’m ki Sovè mouin,\nMouin pap jan-m manké angnin.\n\n\n2.\nKoté dlo a koulé pi fré,\nSé la li va kondui mouin,\nÉ sé koté zèb yo pi bèl\nLi mété paturaj mouin.\n\n\n3.\nMouin té fou, lè mouin té kité-l;\nMin, li-min’m alé chaché-m,\nÉ sou zépòl li, li pòté-m\nBi-in kontan, ak li m-tounin.\n\n\n4.\nMin-m si mouin ouè lan mò an fas,\nMouin papé pè gnou ti kras.\nGran baton ou ap protéjé-m,\nKoua ou dévan ap gidé-m.\n\n\n5.\nOu ranjé gnou supèb kouvè\nPou mouin, dévan tout lènmi-m,\nOu manjé ak mouin, Ou ban-m bouè\nDlo ké sièl la sèl gingnin.\n\n\n6.\nNinpò ki sa ki kab rivé,\nJuska la fin ma suiv ou.\nÉpi nan sièl la ma chanté\nGras ou ki pa jan-m fini.',
