    title: 'Moun Yo Ki Obéi',
    lyrics:
      '1.\nMoun yo ki obéi,\nÉ kap suiv Jézu-Kri,\nYo kontan é trézò yo an ro.\nLé zòt yo pa konnin\nNi la joua ni la pè\nNan kè tout moun kap suiv Sovè yo.  (2 foua)\n\n\n2.\nPandan tout la jounnin,\nSé non Kris map chanté.\nMouin ta souété tout moun konnin Li.\nMouin sètin li rinmin-m;\nLi mouri pou sové-m\nAvèk tout moun kap vini jouin-n Li.  (2 foua)\n\n\n3.\nSé gnou favè divin,\nSé gnou gran joua san fin;\nJézu rété nan kè-m, mouin kon-n sa.\nMouin posédé Sovè-m.\nMouin konnin li béni-m\nKòm si tout amou Bon-Dieu té la.  (2 foua)',
