    lyrics:
      '1.\nSégnè Jézu, konvèti nou,\nTravay nou pa angnin,\nSégnè Jézu, sé ak fòs Ou\nNou kab fè sa ki bi-in.\n\nKè:\nChanjé ak gras Bon-Dieu,\nTout gloua pou Ou, Roua mouin,\nPou-m fè volonté Ou, Ségnè,\nSé sèl bu mouin gingnin.\n\n\n2.\nKonsolé chagrin ak tristès\nNan chak kè ki chanjé.\nBan nou la joua nan la détrès,\nÉ lè nan-m nou troublé.\n\n\n3.\nOuété tout chut ak tout érè\nKaché nan la vi nou;\nNan non Ou, Ségnè, na vinkè.\nLouanj pou Ou toujou.',
