    lyrics:
      '1.\nSou mòn Kalvè, Ségnè jézu,\nJé mouin ouè la koua ou,\nPéchè sa a gin gnou dézi:\nSégnè, sèvi ak mouin.\nSégnè, sa rèd po moun péri\nTandis ké mouin fè kè mouin du.\nSégnè Jézu, mouin prié ou,\nSèvi ak mouin.\n\n\n2.\nSégnè Jézu, vè Bétani\nMouin ouè dèt mouin réglé.\nOu-min’m ki klouré é mouri\nMin ki résusité.\nJézu, ou gin démè nan sièl,\nParé pou tou sa yo li kouè-l.\nSégnè Jézu, nétouayé mouin,\nSèvi ak mouin.\n\n\n3.\nSégnè, lè mon-n ki plin péché\nAnpéché-m gin la foua,\nFè-m gras pou-m jouin-n nan-m égaré;\nPou-m séyé, ban-m gras sa.\nLè la vi-m fi-ni, ma pralé\nKontré ak nan-m ké m-té gingnin\nMaptannou di: «Ou té fè bi-in!»\nSèvi ak mouin.',
