    title: 'Ségnè Jézu ki Sovè nou',
    lyrics:
      '1.\nSégnè Jézu ki Sovè nou,\nNinpòt ki ras nou yé!\nNou rékonnèt sé ou ki Mèt,\nSé ou ki modèl nou.\n\n\n2.\nNan présans ou, nou rékonnèt\nKi jan nou gingnin défo.\nOu rinmin nou, min an min-m tan\nOu rai péché nou.\n\n\n3.\nTout pansé yo ki nan tout kè\nPa kaché dévan ou,\nOu konnin tout, ou ouè tout klè,\nPa gin sékrè pou ou.\n\n\n4.\nMalgré nou fèb, pa bon du tou,\nOu kité-n sèvi ou.\nTout kado nou ofri ba ou,\nOu pa réfuzé yo.\n\n\n5.\nAngnin pa bon, lè ou pa la,\nSan ou tout travay vin.\nLonbraj koua ou pi bèl pou nou\nPasé lumiè solèy.\n\n\n6.\nOu sé zanmi-n, frè nou, Mèt nou,\nKi sa ou vlé pou-n fè?\nSé pa nan rit ni fòm spésial,\nSé sèlman pou suiv ou.\n\n\n7.\nNou pa ouè bi-in, ni tandé bi-in.\nNou pa kon-n prié bi-in.\nMin tout, nou rékonnèt nan ou\nLa vérité, la vi.',
