    title: 'Min Gnou Bèl Ti Nouvel',
    lyrics:
      '1.\nMin gnou bèl ti nouvèl\nKi sòt nan sièl\nPéchè Jézu rélé ou, lévé jé ou.\nOu mèt kouvri ak mizè,\nPéché mèt dégizé ou\nVi-n jouin-n Li!\n\n2.\nJézu pitit Bon-dieu\nMouri pou nou;\nLi montré-n amou Li\nSou bou Kalvè\nNan san ki kap lavé\nTout kè ki plin péché,\nVi-n mèt tout konfians ou;\nVi-n jouin-n Jézu!\n\n3.\nLè Jézu la vé ou\nAvèk san Li\nLi délivré ou nèt nan min satan,\nPéché pa gin puisans\nNan kè ou kòn avan\nLéspri sanktifié ou,\nVini jouin-n Li.\n\n4.\nVini koun yé-a min-m,\nPiga ou rété\nOu prèt pou délivré, si ou vini\nSi ou kouè nan Jézu-Kri,\nPéché ou ap éfasé\nÉ na chanté ansan-m.\nGloua a Jézu.',
