    title: 'Mouin Louvri Kè Mouin',
    lyrics:
      '1.\nMouin louvri kè mouin,\nPou-m résévoua ou.\nJézu, Sovè mouin,\nKè mouin bézouin ou;\nMouin santi mouin sèl;\nKè mouin fatigé;\nViv ak ou ta bèl,\nOu kab ban-m la pè.\n\n\n2.\nMouin louvri léspri-m,\nPou-m résévoua ou.\nJézu-Kri, Ségnè-m,\nRété la toujou.\nVini pou régné,\nGidé tout bagay.\nPou dirijé-m bi-in\nMa suiv lòd ou bay.\n\n\n3.\nMouin louvri nan-m mouin\nPou-m résévoua ou.\nBon Rédanmtè mouin,\nKò mouin pou ou tou.\nPou ban mouin la vi,\nPa manké angnin,\nPou mouin ou mouri!\nPran kò-m, vi-m, nan-m mouin.',
