    title: 'Gingnin Gnou Sous Tout Plin Ak San',
    lyrics:
      '1.\nGingnin gnou sous tou plin ak san,\nSé san dé Jézu-Kri.\nPéchè yo ki bingnin la dan\nSòti san tach é pu.  (3 foua)\nPéchè yo ki bingnin la dan\nSòti san tach é pu.\n\n\n2.\nVolè a ki tapé mouri,\nLi té réjoui nan jou sa.\nÉ nan-m mouin ki koupab kon li\nJouin padon nan sous la.  (3 foua)\nÉ nan-m mouin  ki koupab kon li\nJouin padon nan sous la.\n\n\n3.\nSovè-m, san ou ki té koulé\nPap jan-m pèdu puisans\nJouk lè ké tout légliz Bon-Dieu\nRéjoui nan délivrans.  (3 foua)\nJouk lè ké tout légliz Bon-dieu\nRéjoui nan délivrans.\n\n\n4.\nDépi mouin té ouè tout bonté\nOu montré-m nan sali,\nAmou map chanté san rété\nJouk lè ma va mouri.  (3 foua)\nAmou map chanté san rété\nJouk lè ma va mouri.\n\n\n5.\nLè lang pa mouin va fi-n palé,\nÉ kò mouin nan tonbo;\nLouanj Jézu ma va chanté\nAk rachté yo an ro.  (3 foua)\nLouanj Jézu ma va chanté\nAk rachté yo an ro.',
