    lyrics:
      '1.\nTi moun yo nan Jéruzalèm\nTé chanté gloua non Jézu.\nÉ ti moun yo jodi a\nKapab chanté non li tou.\n\nKè:\nKouté bi-in, ti moun yo ap chanté:  (2 foua)\nOzanna  (3 foua)  pou lé roua Jézu.\n\n\n2.\nNap apran-n rinmin Jézu,\nNap apran-n li Parol Li,\nNou kap suiv lé bon chémin;\nGloua a Jézu, lé Ségnè!\n\n\n3.\nGran moun avèk ti moun yo,\nSé pou nou chanté ansan-m.\nChanté avèk anj yo tou,\nOzanna, gloua a Jézu.',
