    lyrics:
      '1.\nO Sovè, ou té pran kè mouin,\nKoun yé a, mouin pou ou.\nLa vi-m, la joua, la pè-m, tout choz\nMouin jouin-n nan ou toujou.\n\nKè:\nKè mouin ap chanté tou lé jou,\nPaské léspri mouin lib nan ou.\nNan-m mouin plin ak lamou divin,\nSégnè, mouin jouin-n répo chak jou.\n\n\n2.\nSint-Éspri abité nan kè-m,\nMouin pa gin krin non plus.\nFado péché-m té fi-n alé,\nMouin fondé sou lé Kris.\n\n\n3.\nKè mouin débòdé ak lamou,\nMouin konnin mouin pou ou.\nDévan tròn gras ou m-ajénou\nPou-m prié ou chak jou.',
