    lyrics:
      '1.\nO Ségnè, nou pòté rémèsiman\nPou bi-infè ou ki anpil:\nOu fè tè Daiti-a trè fètil\nPou pa manké aliman.\nO Bon Papa!  (2 foua)\nPitit ou yo ran-n ou gloua!\nAlélouya!\n\n\n2.\nO gadé ki bi-infè Bon-Dieu ban nou:\nNou jouin-n rékolt san konpran-n\nSa-k pasé nan pié kafé, poua, bannan-n,\nNan pié flè nou ouè patou.\nA la mèvèy!  (2 foua)\nA la Bon-Dieu bon papa!\nAlélouya!\n\n\n3.\nMin Dieu di:  Pin sèl pa kab bay la vi.\nGnou lè nou pap manjé, bouè,.\nLi vlé pran souin nou isit sou la tè\nPou nou viv nan Jézu-Kri.\nO pran kè nou!  (2 foua)\nBon-Papa ki rinmin nou!\nAlélouya!',
