    title: 'Sa Sa Fè Si Rout La Mové',
    lyrics:
      '1.\t\nSa sa fè si rout la mové?\nMin-m si gin mové pa?\nLi konnin byin tou sa-m kap fè,\nPapa-m ranjé-l konsa.\n\nKè:\nMap chanté nan solèy, nan fè noua,\nNinpòt sak rivé ma kontan,\nFò-m chanté, mouin pa kapab rété,\nPapa-m ranjé-l konsa.\n\n2.\t\nSikonstans yo kapab chanjé,\nSa pa fè mouin angnin,\nDèské sé konsa Li chouazi,\nPlan Papa-m bon pou mouin.\n\n3.\t\nLi té déjà pasé rout sa,\nMap suiv Li pa-za-pa,\nMouin gin konfians ké lé Ségnè,\nAp minnin-m nan sièl la.\n\n4.\t\nSèlman lumiè a réjouisans,\nAp tan-n mouin a la fin,\nDonk, mouin pa pè gnou ti soufrans,\nPapa-m ranjé-l konsa.',
