    title: 'Jézu sèl unik éspérans',
    lyrics:
      '1.\nJézu, sèl unik éspérans,\nSé li sèl ki bay asurans,\nLi sé souti-in’m, li sé fòs mouin\nÉ mouin pa rété nan chémin.\n\nKè\nJézu, sé ou ki délivré-m;\nSé ou, Sovè-m, kapé kinbé-m.  (2 foua)\n\n\n2.\nOkin-n lòt plas pa kab kaché-m,\nOkin-n lòt non pap délivré-m,\nMoun ki chouazi lòt diréksion,\nSoufri, péri nan rémision.\n\n\n3.\nMin, lè tout bagay vlé sombré.\nMouin gadé Jézu, mouin kanpé;\nLè kouraj mouin ta vlé fébli,\nMouin jouin-n sékou nan prézans li.\n\n\n4.\nKon sa lan mò gin pou-l vini,\nMin, toutfoua sa sé pa mouri,\nAvèk Jézu pa gin lan mò,\nSé fèmin jé, louvri-l lòt bò.',
