    title: 'Pandan La Nuit',
    lyrics:
      '1.\nPandan la nuit, lè bèjé yo\nOkupé mouton yo,\nAnj lé Ségnè vini désan-n,\nLa gloua briyé patou,\nLi di: « Pa pè », paské yo tout\nTé trablé, tou sézi,\nMa póté ba nou bon nouvèl!\nPou nou ak tou lè zòm.\n\n\n2.\nNan la vil David, joda a,\nGnou pitit vini fèt,\nSé li ki Kris, Sovè, Ségnè,\nMin ki sign ma ba nou:\nNou va jouin-n pitit lè sièl la,\nLi la dévan jé moun,\nVlopé nan rad tout òdi-nè,\nÉ kouché nan gnou krèch.\n\n\n3.\nLè anj la té palé kon sa,\nGnou foul parèt tou suit,\nSé té lamé anj yo lé sièl,\nPou chanté kantik sa:\nTout gloua pou Bon-Dieu nan lé sièl,\nÉ la pè sou la tè,\nBon-Dieu voyé bòn-n volonté,\nPou lè zòm pou tout tan.',
