      html: '<p><strong>1.</strong> </p>\n<p>Amou Bon-dieu pi gran pasé </p>\n<p>Tou sa lang moun ak zanj kab di; </p>\n<p>L-alé pi louin pasé zétoual, </p>\n<p>Li jouin-n moun ki té fi-n pèdu. </p>\n<p>Pitit Bon-Dieu chaché moun ki </p>\n<p>Nan la pin-n ak péché; </p>\n<p>Si yo rékonnèt péché yo, </p>\n<p>Li prèt pou padonnin. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Amou Bon-Dieu sé rich, sé pu;</strong> </p>\n<p><strong>Li san mézi, li fò;</strong> </p>\n<p><strong>Amou sa a duré tout tan,</strong> </p>\n<p><strong>Sé kantik tout zanj yo.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Lè tout jou ak lanné pasé, </p>\n<p>Lè tout tròn, tout roua fi-n tonbé; </p>\n<p>Lè moun ki pa prié jodi </p>\n<p>Va chaché mouayin pou sové; </p>\n<p>Lamou Bon-Dieu va la toujou, </p>\n<p>L-a san mézi, l-a fò; </p>\n<p>L-a fòs Bon-Dieu pou sové nou, </p>\n<p>L-a kantik tout zanj yo. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Si nou té kab chanjé la mè </p>\n<p>Kon lank, nan sièl la pou n-ékri; </p>\n<p>Si tout boua sou la tè té plum, </p>\n<p>É tout moun té kapab ékri; </p>\n<p>Pou yo ékri lamou Bon-Dieu </p>\n<p>Ta fi-n séché la mè, </p>\n<p>É sièl la pa ta kab kinbé </p>\n<p>Tout zèv lamou-l té fè. </p>\n'
