    title: 'Jézu, kinbin-m pré la koua',
    lyrics:
      '1.\nJézu, kinbé-m pré la koua;\nSan ou té vèsé la,\nPou-l kab purifié tout nan-m\nKi ta plonjé ladan.\n\nKè:\nPré la koua,  (2 foua)\nMouin vlé toujou rété,\nJouk Jézu vini chaché-m\nPou-l sa ban mouin la joua.\n\n\n2.\nPré la koua, nan-m mouin tranblé;\nAmou li té jouin-n mouin,\nLa lumiè li té antré,\nLi té chanjé kè mouin.\n\n\n3.\nPré la koua, O Bon Sovè!\nFè-m sonjé soufrans ou,\nÉdé-m maché jou an jou\nAn ba lonbraj kalvè.\n\n\n4.\nPré la koua mapé véyé,\nKouè, obéi, prié,\nJouk tan lè la va sonnin\nPou li vi-n chaché mouin.',
