    title: 'An ro mòn Kalvè yo té planté gnou koua',
    lyrics:
      '1.\nAn ro mòn Kalvè yo té planté gnou koua,\nKi té lévé gnou nòm méprizé.\nMin nòm sa a té pitit unik Bon-Dieu,\nKi mouri pou nou kab sové.\n\nKè:\nKris pan-n sou la koua,\nSa sé sujè chan mouin,\nKris sa a li bi-in mèvéyé.\nLi rachté sa-k pèdi,\nLi té péyé tout pri.\nGloua a Jézu, kloué sou la koua.\n\n\n2.\nLè zòm pat konnin sa yo tap fè lè sa;\nKris di: Padonnin yo, souplé.\nYo pa té konnin min-m koua ki méprizé,\nSé té la koua Kris glorifié.\n\n\n3.\nLè zòt yo adoré la koua Kris sèlman,\nSujè mouin, sé Kris sou la koua.\nSé pa nan boua la koua puisans la rété,\nMin sé Kris sèl ki bay viktoua.',
