    title: 'Mouin té tandé la voua Jézu',
    lyrics:
      '1.\nMouin té tandé la voua Jézu\nKi palé mouin pou di:\nNou ki chajé, vini jouin-n mouin,\nRépozé ou sou mouin.\nMouin té vini, kòm mouin té yé,\nMizérab, fatigé!\nMouin jouin-n nan Li répo, la pè,\nKè-m vi-n kontan é gé.\n\n\n2.\nMouin té tandé la voua Jézu\nKi palé mouin pou di:\nMin ni, m-ofri ou dlo vivan,\nSé pou ou, vini pran!\nMouin té vini, é mouin té bouè\nDlo a dé mon Sovè;\nNan-m mouin té vini rafréchi,\nÉ mapé viv nan li.\n\n\n3.\nMouin té tandé la voua Jézu\nKi palé mouin pou di:\nSé mouin ki vrè lumiè lè zòm,\nGadé bò mouin tout moun.\nMouin té gadé bò Jézu-Kri,\nMouin jouin-n lumiè nan li,\nÉ sé li ki va kléré mouin\nTout vi-m juska la fin.',
