    title: 'Nan bonte li, Jézu vi-ni',
    lyrics:
      '1.\nNan bonté li, Jézu vi-ni\nPou rachté nan-m mouin pa la gras;\nNan bafon péché ak la ront\nKonpasion-l lévé mouin.\n\nKè:\nNan té danjé li soutni mouin,\nAk min-l bi-in dous li lévé mouin\nSòt nan nouasè, vi-n nan lumiè,\nMap adoré-l li lévé mouin.\n\n\n2.\nDépi lontan li rélé mouin,\nAvan kè mouin té répanti.\nMin lè-m kinbé-l nan paròl li\nAk padon L-lévé mouin.\n\n\n3.\nAnpil pikan té pèsé fron-l,\nDé klou térib té pèsé min-l;\nMin lè mouin bandonné péché\nAmou li lévé ouin.\n\n\n4.\nKoul yé a min-m, an lè bi-in ro\nNan-m mouin apé joui gnou répo.\nKi jan? pouki? Mouin pa konnin\nKouman li lévé mouin.',
