    lyrics:
      '1.\nLè Jézu mouri sou Kalvè,\nLè Kris mouri sé té pou mouin.\nMouin mandé-m, èské m-a konnin\nKonbi-in mouin doué, konbi-in mouin doué?\n\nKè:\nKonbi-in mouin doué lamou san fin?\nKonbi-in mouin doué, ka Kris pou mouin?\nMouin konnin sa li fè pou mouin;\nMouin pa ka di konbi-in mouin doué.\n\n\n2.\nSovè mouin, nan Jétsémani,\nTé pasé pi gran agoni.\nSé pou mouin soufrans sa té yé,\nKouman pou-m di konbi-in mouin doué?\n\n\n3.\nSé té amou li gin pou mouin\nKi fè-l soufri gnou mò onté.\nLè tout san kò li té koulé,\nLi sové mouin, konbi-in mouin doué?\n\n\n4.\nLè m-a rivé nan sièl la tou,\nRété avèk li pou toujou,\nMouin mèt palé di mil anné;\nMouin pap fi-n di konbi-in mouin doué.',
