      md: "**1.** \n\nIl est un Ami fidèle \n\nQui chérit les enfants, \n\nSans se lasser, appelle \n\nLes petits et les grands, \n\nQui sur eux à toute heure \n\nSe penche, plein d'amour, \n\nUn Ami qui demeure \n\nLe même chaque jour… \n\n\n<br/> **2.**\n\nIl est un riant rivage \n\nOù nous attend Jésus, \n\nOù le bruit de l'orage \n\nNe nous troublera plus. \n\nLà cessent nos alarmes; \n\nTout sera joie et paix; \n\nPlus de péché, les larmes \n\nN'y couleront jamais. \n\n\n<br/> **3.**\n\nIl existe une couronne \n\nPour les enfants pieux, \n\nQui pour toujours rayonne \n\nEt resplendit sur eux, \n\nCéleste diadème \n\nAux éclatants fleurons \n\nQue le Seigneur Lui-même \n\nPosera sur leurs fronts! \n\n\n<br/> **4.**\n\nIl est un divin cantique \n\nAux sons mélodieux \n\nQue le choeur angélique \n\nEntonne dans les cieux; \n\nCe chant suave et tendre \n\nEn l'honneur de l'Agneau, \n\nQu'il fera bon l'entendre! \n\nC'est de tous le plus beau! \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Il est un Ami fidèle </p>\n<p>Qui chérit les enfants, </p>\n<p>Sans se lasser, appelle </p>\n<p>Les petits et les grands, </p>\n<p>Qui sur eux à toute heure </p>\n<p>Se penche, plein d&#39;amour, </p>\n<p>Un Ami qui demeure </p>\n<p>Le même chaque jour… </p>\n<p><br/> <strong>2.</strong></p>\n<p>Il est un riant rivage </p>\n<p>Où nous attend Jésus, </p>\n<p>Où le bruit de l&#39;orage </p>\n<p>Ne nous troublera plus. </p>\n<p>Là cessent nos alarmes; </p>\n<p>Tout sera joie et paix; </p>\n<p>Plus de péché, les larmes </p>\n<p>N&#39;y couleront jamais. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Il existe une couronne </p>\n<p>Pour les enfants pieux, </p>\n<p>Qui pour toujours rayonne </p>\n<p>Et resplendit sur eux, </p>\n<p>Céleste diadème </p>\n<p>Aux éclatants fleurons </p>\n<p>Que le Seigneur Lui-même </p>\n<p>Posera sur leurs fronts! </p>\n<p><br/> <strong>4.</strong></p>\n<p>Il est un divin cantique </p>\n<p>Aux sons mélodieux </p>\n<p>Que le choeur angélique </p>\n<p>Entonne dans les cieux; </p>\n<p>Ce chant suave et tendre </p>\n<p>En l&#39;honneur de l&#39;Agneau, </p>\n<p>Qu&#39;il fera bon l&#39;entendre! </p>\n<p>C&#39;est de tous le plus beau! </p>\n'
