    title: 'Si ou vlé kasé tout kòd vié péché',
    lyrics:
      '1.\nSi ou vlé kasé tout kòd vié péché,\nGin fòs nan san Kris,  (2 foua)\nSi ou vlé vinkè sou tout méchansté,\nGin fòs nan gnou sèl sakrifis.\n\nKè\nOui, gin fòs, fòs, oui gin fòs anpil\nNan san Kris Krusifié,\nOui, gin fòs, fòs, oui gin fòs anpil\nNan présié san Kris, Lagno Bon-Dieu.\n\n\n2.\nSi ou vlé kité pasion ak lògèy,\nGin fòs nan san Kris,  (2 foua)\nSous Kalvè a kab lavé tout péché,\nGin fòs nan gnou sèl sakrifis.\n\n\n3.\nSi ou vlé jété tout féblès la chè,\nGin fòs nan san Kris,  (2 foua)\nBon zèv ou pap fè ou chapé lanfè,\nGin fòs nan gnou sèl sakrifis.\n\n\n4.\nSi ou vlé sèvi Bon-Dieu fidèlman,\nGin fòs nan san Kris,  (2 foua)\nMoun ki chanté gloua li étènelman,\nGin fòs nan gnou sèl sakrifis.',
