    title: 'Segne, Fe Pitit Ou Pi Sanble Ou Chak Jou',
    lyrics:
      '1.\nSégnè, fè pitit ou pi sanblé ou chak jou;\nBan mouin plus Sint-Espri, pou mouin pa fayi;\nBan mouin plus asurans, sé fòs mouin ou yé,\nKon sa ma rét kanpé dévan tout danjé.\n\n\n2.\nFè-m konpran-n Jézu-Kri, fè-m konpran-n lan mò li,\nSé li sèl pou mouin ouè nan tou sa map fè,\nJan li té obéi, sa li té soufri,\nTou sa li té subi pou-m té ka frè li.\n\n\n3.\nBan mouin pou-m kab fidèl, gnou kè ki pa rébèl,\nGnou kè toujou trankil, min-m éprèv anpil,\nGnou kè ki pa anflé, é ki pap tranblé,\nGnou kè sinp, gnou kè dou, ki plin ak amou.',
