    title: 'Kè Mouin Ap Chanté Kantik Chak Jou',
    lyrics:
      '1.\nKè mouin ap chanté kantik chak jou\nPaské Jézu pa pi louin;\nLi di mouin kon sa: Mouin avèk ou,\nOu pa gin doua pè angnin.\n\nKè:\nJézu, Jézu, Jézu,\nNon pi dous pou mouin,\nMa chanté amou li.\nKè-m kontan , m-pa pè angnin.\n\n\n2.\nMouin pa té manké kon-n fé rébèl\nKont tout pasians Jézu-Kri;\nJodi a mouin gingnin asurans,\nSé té nan plas mouin l-mouri.\n\n\n3.\nO, ki gran amou ki fè li vlé\nPadonnin mouin tout péché!\nO, ségnè, fè-m rai tout péché,\nDévan ou pou mouin maché.\n\n\n4.\nGnou jou l-a vini pou résévoua-m\nNan kay-l nan si bèl sièl la.\nMa kité tè sa ak gnou gran joua;\nMa ouè li an ro jou sa.',
