    title: 'Pa kite mouin, O bon Sove',
    lyrics:
      '1.\nPa kité mouin, O bon Sovè,\nKouté krié mouin;\nKon ou okupé lé zòt yo,\nPa pasé louin mouin.\n\nKè:\nSovè, Sovè,\nKouté krié mouin;\nKon ou okupé lé zòt yo,\nPa pasé louin mouin.\n\n\n2.\nDévan tròn ou ban-m padon ou,\nBan-m gnou dous fréchè;\nMin mouin koubé nan prézans ou\nÉdé-m pou mouin kouè.\n\n\n3.\nMouin konfié-m sèl nan mérit ou;\nM-ta gadé ou nan fas;\nGéri kè mouin ki nan tristès,\nKinbé-m nan la gras.\n\n\n4.\nOu sé sous pou konsolé mouin,\nMouin vlé rét fidèl;\nMouin rinmin ou pasé tout moun\nSou tè é nan sièl.',
