    lyrics:
      '1.\nJézu mandé ou briyé pou li koté ou yé,\nTout kréti-in, bay lumiè tout patou;\nBriyé nan fanmi ou, nan travay, koté ou yé;\nBriyé pou Jézu koté ou yé.\n\nKè:\nBriyé pou Jézu koté ou yé,  (2 foua)\nLumiè ou kab édé gnou nan-m pèdu jouin-n Jézu;\nBriyé pou Jézu koté ou yé.\n\n\n2.\nMin-m lè sièl la noua, min-m lè chémin an pa trò klè,\nSé lè sa pou lumiè ou briyé.\nPou briyé, Jézu té lésé ou-min’m sou la tè;\nBriyé pou Jézu koté ou yé.\n\n\n3.\nSé gran gras ké Bon-Dieu fè ou vini gnou lumiè\nLè péché ténèb antouré ou,\nLévé lumiè a bi-in ro pou-l kab kléré tout kè;\nBriyé pou Jézu koté ou yé.\n\n\n4.\nSi ou vlé briyé gnou jou ak Jézu nan sièl la,\nLumiè ou doué lumin sou la tè;\nPaské Bon-Dieu plasé nou kou lumiè isiba;\nBriyé pou Jézu koté ou yé.',
