    lyrics:
      '1.\nOu pa bézouin gin krint ni pè,\nJézu va pran souin ou.\nPou ou, li sé gnou gran Sovè,\nJézu va pran souin ou.\n\nKè:  Jézu va pran souin ou,\nNan tout chémin, jusk a la fin,\nJézu va pran souin ou\nTou lé jou, jusk a la fin.\n\n\n2.\nLi konnin tou sa ou bézouin,\nJézu va pran souin ou;\nLi pap kité ou san angnin,\nJézu va pran souin ou.\n\n\n3.\nSi ou sèl é dékourajé,\nJézu va pran souin ou;\nLi sé toujou gnou Bon Bèjé,\nJézu va pran souin ou.\n\n\n4.\nOu pa bézouin pè pou chak jou,\nJézu va pran souin ou.\nLi la, lapé véyé sou ou,\nJézu va pran souin ou.',
