    title: 'Kèk foua nou jouin-n tristès nan la vi nou',
    lyrics:
      '1.\nKèk foua nou jouin-n tristès nan la vi nou,\nKèk foua kè nou gin gro fado tou;\nMin nou kab konnin ninpòt sa-k rivé,\nJézu la pou toujou.\n\nKè:\nNan pouin fado ké Jézu pa kab pòté,\nNan pouin tristès ké Li pat gingnin tou.\nMalgré jou yo kab bay la joua ou tristès,\nJézu la pou toujou.\n\n\n2.\nLè nou nan mitan problèm la vi sa,\nChajé ak travay, ak fado lou;\nNou gin konfò nan Jézu, Sovè a,\nJézu la pou toujou.\n\n\n3.\nLè nap maché nan bèl rout isi-ba,\nKon sa gin montagn difisil tou;\nNan promès Bon-Dieu nou jouin-n asurans,\nJézu la pou toujou.\n\n\n4.\nM-avèk ou toujou, Parol la di nou,\nDieu pa manké répon-n priè nou;\nKonfié ou nan Parol Li, promès Li,\nJézu la pou toujou.',
