    title: 'An nou chanté ak tout kè',
    lyrics:
      '1.\nAn nou chanté ak tout kè,\nGloua a Dieu, lé Kréatè.\n\nKè:  Bonté Li sé pou toujou;\nLi fidèl, Li plin amou.\n\n\n2.\nAn nou anonsé non Li,\nPaské Li sèl sé Bon-Dieu.\n\n\n3.\nSé Li ki fè solèy la\nPou bay tout moun bèl lumiè.\n\n\n4.\nBèt ak moun konté sou Li,\nMin Li bay yo nouriti.\n\n\n5.\nLi béni pèp Li chouazi\nNan dézè bò Si-naï.\n\n\n6.\nLi gingnin pitié pou nou,\nNan mizè ak féblès tou.\n\n\n7.\nAn nou chanté ak tout kè:\nGloua a Dieu, lé Kréatè.',
