    lyrics:
      '1.\nJézu sé Sovè mouin – mapé rété fèm\nMouin pap manké angnin –\nMa pé rété fèm\nKou gnou pié boua\nKi planté bò riviè-a,\nOui, mapé rété fèm.\n\nKè:\nMapé rété, mapé rété fèm  (bis)\nKou gnou pié boua\nKi planté bò riviè-a\nOui, mapé rété fèm.\n\n2.\nJézu ban mouin la vi –\nMapé rété fèm\nKaché an-ba zèl Li –\nMapé rété fèm\nKou gnou pié boua\nKi planté bò riviè-a,\nOui, mapé rété fèm.\n\n3.\nAk gnou foua ki vivan –\nMapé rété fèm\nGras Li ran-n mouin puisan –\nMapé rété fèm\nKou gnou pié boua\nKi planté bò riviè-a,\nOui, mapé rété fèm.\n\n4.\nNouri nan Paròl Li –\nMapé rété fèm\nA-lèv, jouk Li vini,\nMapé rété fèm\nKou gnou piè boua\nKi planté bò riviè-a,\nOui, mapé rété fèm.',
