    lyrics:
      '1.\nJézu, mouin rinmin ou, sé ou ki Sovè-m,\nAmou ou fè-m kité plèzi péché mouin.\nRédanmtè béni mouin, sé ou ki Sovè-m,\nMouin rinmin ou, Ségnè, pi plus ké janmin.\n\n\n2.\nMouin rinmin ou paské ou rinmin-m avan,\nSou pié boua Kalvè ou té soufri pou mouin.\nMouin rinmin ou ki pòté kourò-n pikan;\nMouin rinmin ou, Ségnè, pi plus ké janmin.\n\n\n3.\nNan la vi, nan lan mò, mouin va rinmin ou.\nMa sèvi ou tout tan ou ban-m souf bouch mouin\nLè lonbraj lan mò vi-n sou mouin, ma di ou:\nMouin rinmin ou, Ségnè, pi plus ké janmin.\n\n\n4.\nNan kay Bon-Dieu, ak joua é gloua é la pè,\nNan sièl la ma va adoré ou san fin.\nDévan tout anj Bon-Dieu yo, ma va chanté:\nMouin rinmin ou, Ségnè, pi plus ké janmin.',
