    title: 'You jou ma suspann chante-m yo',
    lyrics:
      '1.\nGnou jou ma suspan-n chanté-m yo,\nVoua-m a rété san-l pa chanté;\nMin ak sin ki nan la gloua yo,\nNan-m mouin va kontan pou-l mélé.\n\nKè:\nMa va ouè li min-m jan li yé,\nJézu, Rédanmtè, Fis Bon-Dieu.  (2 li-n 2 foua)\n\n\n2.\nGnou jou fòk kan min-m mouin kité\nAbitasion-m sou la tè a,\nMin pòt abitasion Bon-Dieu\nVa louvri pou mouin jou sa a.\n\n\n3.\nGnou jou fè noua va kouvri mouin,\nSolèy va kouché pou toujou;\nMin an ro Jézu va pran mouin,\nPap jan-m fè noua, min tout tan jou.\n\n\n4.\nFò-l vini, jou la gloua sa a,\nSé li ki asurans kè mouin,\nSégnè, kinbé-m paré pou sa,\nNan ou m-mété tout konfians mouin.',
