    title: 'Bon-Dieu té montré amou-l',
    lyrics:
      '1.\nBon-Dieu té montré amou-l\nDé pi tròn li nan sièl la;\nMouin té jouin-n gnou plas répo\nAn ba zèl amou li a.\n\nKè:\nMapé pozé, pozé,\nPozé dousman an ba zèl amou-l,\nMapé pozé nan amou-l;\nPozé an ba zè amou li a.\n\nKè: pou ténò\nMapé pozé, dousman pozé an ba zèl amou li a,\nPozé an ba zèl amou li a.  (2 foua)\n\n\n2.\nLè léprèv la vi frapé-m,\nLè sièl la an ro tou noua,\nMouin kab toujou jouin-n répo\nAn ba zèl amou li a.\n\n\n3.\nA! si ou pat jan-m béni\nAvèk la pè nan kè a,\nGin pou ou gnou plas répo\nAn ba zèl amou li a.',
