    title: 'Non Jézu Gin Gnou Son Si Dou',
    lyrics:
      '1.\nNon Jézu gin gnou son si dou!\nLi chasé tristès nou.\nNon li, sé kou gnou gérizon,\nPa gin gnou pi bèl son!\n\n\n2.\nNon Jézu kalmé kè troublé,\nÉ léspri fatigé.\nLi kou gnou manjé tèlman dou\nPou nan-m yo ki grangou.\n\n\n3.\nNon Jézu sé kou gnou roché\nKi pat kab déplasé,\nLi protéjé-m, li kaché mouin,\nL-a sové-m jouk la fin.\n\n\n4.\nJézu sèvi pou mouin tankou\nBèjé-m, é zanmi-m tou,\nSé li ki chémin an, épi\nLa vérité, la vi.\n\n\n5.\nMouin pat kab fè anpil pou ou;\nMouin fèb é piti tou,\nMa di Ou mèsi pou tout gras,\nLè m-ouè Ou fas a fas.\n\n\n6.\nJouk lè sa a, mouin vlé sèvi\nAk tout souf mouin, pou di\nTout péché yo, sé nan non Ou\nYo kapab sové tou.',
