    title: 'A la gnou Zanmi se Jézu',
    lyrics:
      '1.\nA la gnou Zanmi sé Jézu,\nTout péché nou sé chaj li!\nA la gnou bi-infè: pou pòté\nPin-n ba li nan la priè!\nKonbi-in foua la pè nou pèdi,\nKonbi-in chagrin nou subi?\nPouki? Paské nou pa pòté\nTout bali nan la priè.\n\n\n2.\nSi gin tantasion ak touman,\nOu traka ninpòt kouman,\nNou pa pou jan-m dékourajé:\nJézu la nan la priè.\nKi lès Zanmi ki si fidèl,\nKi fè nan-m blié doulè-l?\nJézu konnin sa féblès yé:\nJouin-n ak li nan la priè.\n\n\n3.\nNou santi-n fèb? Nou pa kapab?\nKi lès flo napé pasé?\nSovè a di li résponsab:\nJouin-n ak li nan la priè.\nSi zanmi ou yo blié ou,\nDi Jézu-l, li tandé ou.\nLapé tan-n ou, bra li louvri.\nJézu vlé ba ou la vi.',
