      html: '<p><strong>1.</strong> </p>\n<p>A la gnou Zanmi sé Jézu, </p>\n<p>Tout péché nou sé chaj li! </p>\n<p>A la gnou bi-infè: pou pòté </p>\n<p>Pin-n ba li nan la priè! </p>\n<p>Konbi-in foua la pè nou pèdi, </p>\n<p>Konbi-in chagrin nou subi? </p>\n<p>Pouki? Paské nou pa pòté </p>\n<p>Tout bali nan la priè. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Si gin tantasion ak touman, </p>\n<p>Ou traka ninpòt kouman, </p>\n<p>Nou pa pou jan-m dékourajé: </p>\n<p>Jézu la nan la priè. </p>\n<p>Ki lès Zanmi ki si fidèl, </p>\n<p>Ki fè nan-m blié doulè-l? </p>\n<p>Jézu konnin sa féblès yé: </p>\n<p>Jouin-n ak li nan la priè. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Nou santi-n fèb? Nou pa kapab? </p>\n<p>Ki lès flo napé pasé? </p>\n<p>Sovè a di li résponsab: </p>\n<p>Jouin-n ak li nan la priè. </p>\n<p>Si zanmi ou yo blié ou, </p>\n<p>Di Jézu-l, li tandé ou. </p>\n<p>Lapé tan-n ou, bra li louvri. </p>\n<p>Jézu vlé ba ou la vi. </p>\n'
