    lyrics:
      '1.\nAmou Kris chanté pou tout moun tandé,\nPréché nouvèl sa nan tout koté;\nBon-Dieu a té voyé sèl pitit Li,\nPou sa ki kouè nan Li kab sové.\n\nKè:\nAmou Li mèvéyé pou mouin,\nAmou Li mèvéyé pou mouin,\nJézu té si rinmin-m\nKé Li té mouri min-m;\nAmou Li mèvéyé pou mouin.\n\n\n2.\nAmou Bon-Dieu révélé nan Jézu\nLè Li té pré la mè Galilé,\nLi té péyé fot mouin sou boua Kalvè,\nMalgré Li pat janmin fè péché.\n\n\n3.\nAmou Kris ki soulajé tout tristès,\nAmou Kris sé protéksion nan-m mouin,\nPran la vi-m, kinbé tou sa mouin gingnin,\nMin mouin, Jézu, sé ou mouin rinmin.',
