    lyrics:
      '1.\nMouin santi-m bi-in kontan pou-m sèvi Roua a,\nMouin bi-in kontan, oui bi-in kontan;\nMouin gin la pè, la joua pasé tout bagay,\nLè map sèvi pi gran Roua.\n\nKè: Mapé sèvi pi gran Roua,\nChak talan-m Li résévoua;\nMouin gin la pè, la joua, tout bagay,\nLè-m sèvi pi gran Roua.\n\n\n2.\nMouin santi-m bi-in kontan pou-m sèvi Roua a,\nMouin bi-in kontan, oui bi-in kontan;\nMalgré solèy, malgré nuaj, m-a chanté\nLè map sèvi, pi gran Roua.\n\n\n3.\nMouin santi-m bi-in kontan pou-m sèvi Roua a,\nMouin bi-in kontan, oui bi-in kontan;\nMa kité min-l dirijé mouin pa-za-pa\nLè map sèvi pi gran Roua.\n\n\n4.\nMouin santi-m bi-in kontan pou-m sèvi Roua a,\nMouin bi-in kontan, oui bi-in kontan;\nTou sa-m gingnin, nan min Li ouin kontan bay,\nLè map sèvi pi gran Roua.',
