    title: 'Gin gnou foua nan la vil David',
    lyrics:
      '1.\nGin gnou foua nan la vil David,\nNan gnou étab pov é ba,\nGnou manman kouché pitit li\nNan krèch la ranjé ak pay.\nMari té manman si janti,\nJézu-Kri té ti pitit li.\n\n\n2.\nLi té sòti min-m nan sièl la,\nLi ki Bon-Dieu é Ségnè,\nLi désan-n jouk nan étab la,\nSé nan krèch li dòmi.\nJézu, Sovè nou, té vini\nPami moun yo, pov é janti.\n\n\n3.\nÉ tout tan lè Li té piti\nLi té kouté manman li.\nLi rinmin gadé-l é sèvi-l,\nLi té soumi dévan li.\nTout ti moun yo ki vlé suiv li\nDoué toujou soumi é janti.\n\n\n4.\nJézu sé modèl ti moun yo,\nLi tap grandi tankou nou;\nLi té bézouin moun okupé-l,\nLi kon-n krié, li souri tou.\nLè nou tris, li soufri ak nou;\nLè nou jouayé, li kontan tou.',
