    title: 'Koté Min-d-èv Yo Pou Rékolté',
    lyrics:
      '1.\nKoté min-d-èv yo ki pou rékolté,\nGran mouason dé zam\nKi nan chan péché?\nFòk nou byin paré ak la vérité,\nPou rantré rékòt pou létènité.\n\nKè:\nKoté min-d-èv yo pou rékolté,\nGran mouason dé zam\nKi nan chan péché?\nKilès va édé-n zam\nNan travay Bon-Dieu,\nÉgzanté lé zam nan jujman dufé?\n\n2.\nTravay la va rèd é li fè byin cho,\nNa kéyi lé zam malgré rajé gro,\nPa kité gnou sèl,\nPaské tout pou Kris,\nTout éfò nou fè sonjé Li fè plus.\n\n3.\nMouason déjà prèt pou li rékolté,\nTravay la anpil, manké ouvrié.\nByinto l-a pèdu si nou fè réta,\nVini bay konkou\nNan gran travay sa.\n\n4.\nAn nou mété tout\nMin nou yo ansan-m,\nNou pa fi-n konnin\nValè gnou sèl nan-m\nByinto Mèt rékòt la va rétounin,\nLi vlé nou réjoui ak Li a la fin.',
