    title: 'M-konfié Nan Dieu Ninpot Koté Mwen Yé',
    lyrics:
      '1.\nM-konfié nan Dieu ninpòt koté mouin yé.\nNi sou la tè, si sou la mè troublé;\nNan tout traka, nan la vi sa a\nPapa-m nan sièl la apé véyé mouin.\n\nKè:\nM-konfié nan Dieu,\nMouin konnin L-ap pran souin mouin,\nNan dézè a, ou nan mové chémin,\nLa mè pousé-m, Bon-Dieu kinbé-m\nPapa-m nan sièl la apé véyé mouin.\n\n2.\nLi gadé flè yo nan chan tou patou,\nLi pran souin zouazo kap chanté pou nou,\nJuska la fin, L-ap sonjé mouin,\nPapa-m nan sièl la apé véyé mouin.\n\n3.\nRout la mèt du, nuaj yo kouvri mouin,\nBèjé a gadé mouton-l jouk la fin\nApré mon-n sa, na ouè sièl la,\nPapa-m nan sièl la apé véyé mouin.',
