    num: 321,
    title: 'O Dieu De Nos Aïeux',
    lyrics:
      "1.\nO Dieu de nos aïeux,\nDaigne entendre nos voeux\nPour la patrie.\nToi qui brisas nos fers,\nQue la terre chérie\nJamais par des revers\nNe soit flétrie!\n\n\n2.\nOui, tout brûlants d'ardeur,\nNous t'implorons, Seigneur,\nPour la patrie!\nMaintiens-la dans ses droits,\nSois sa force, sa vie,\nEt, qu'à tes saintes lois,\nLa foi la lie!\n\n\n3.\nPère, Fils, Saint-Esprit,\nTrinité que tout craint,\nVois la Patrie!\nParle, et que converti\nPar ta voix obéie\nChaque enfant d'Haïti\nTe glorifie!",
    updated_at: '2016-03-22T21:35:53.961Z',
    created_at: '2015-11-22T05:56:37.479Z',
