    language: 'fr',
    songId: '321_CE_fr',
    lyrics_Markdown: {
      md: "**1.** \n\nO Dieu de nos aïeux, \n\nDaigne entendre nos voeux \n\nPour la patrie. \n\nToi qui brisas nos fers, \n\nQue la terre chérie \n\nJamais par des revers \n\nNe soit flétrie! \n\n\n<br/> **2.**\n\nOui, tout brûlants d'ardeur, \n\nNous t'implorons, Seigneur, \n\nPour la patrie! \n\nMaintiens-la dans ses droits, \n\nSois sa force, sa vie, \n\nEt, qu'à tes saintes lois, \n\nLa foi la lie! \n\n\n<br/> **3.**\n\nPère, Fils, Saint-Esprit, \n\nTrinité que tout craint, \n\nVois la Patrie! \n\nParle, et que converti \n\nPar ta voix obéie \n\nChaque enfant d'Haïti \n\nTe glorifie! \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>O Dieu de nos aïeux, </p>\n<p>Daigne entendre nos voeux </p>\n<p>Pour la patrie. </p>\n<p>Toi qui brisas nos fers, </p>\n<p>Que la terre chérie </p>\n<p>Jamais par des revers </p>\n<p>Ne soit flétrie! </p>\n<p><br/> <strong>2.</strong></p>\n<p>Oui, tout brûlants d&#39;ardeur, </p>\n<p>Nous t&#39;implorons, Seigneur, </p>\n<p>Pour la patrie! </p>\n<p>Maintiens-la dans ses droits, </p>\n<p>Sois sa force, sa vie, </p>\n<p>Et, qu&#39;à tes saintes lois, </p>\n<p>La foi la lie! </p>\n<p><br/> <strong>3.</strong></p>\n<p>Père, Fils, Saint-Esprit, </p>\n<p>Trinité que tout craint, </p>\n<p>Vois la Patrie! </p>\n<p>Parle, et que converti </p>\n<p>Par ta voix obéie </p>\n<p>Chaque enfant d&#39;Haïti </p>\n<p>Te glorifie! </p>\n'
    },
