    title: 'Tout Bonè Mouin Nan Jézu-Kri',
    lyrics:
      '1.\nTout bonè mouin nan Jézu-Kri,\nKris pou mouin!  (2 foua)\nSan Jézu mouin pa gin la vi,\nKris pou mouin!\nSé li ki Roua-m, li sé Sovè-m,\nSé li-min’m tou ki bon doktè-m,\nSi-l pa té la, sa mouin ta fè?\nKris pou mouin!  (2 foua)\n\n\n2.\nMouin kité-n chaché lajan,\nKris pou mouin!  (2 foua)\nMouin gin kichoy pi konsékan,\nKris pou mouin!\nSi ou ban-m rad avèk bijou,\nSi ou fè-m rich nan gnou sèl jou,\nTou sa sé pa angnin toujou,\nKris pou mouin!  (2 foua)\n\n\n3.\nNan santé kou nan maladi,\nKris pou mouin!  (2 foua)\nLè kè-m kontan, lè m-ap soufri,\nKris pou mouin!\nLè tan-m rivé pou mouin mouri,\nLésé tout bagay nan la vi,\nMouin pap krié, mouin pap kouri,\nKris pou mouin!  (2 foua)',
