    title: 'Minnin mouin, O Bon Sovè',
    lyrics:
      '1.\nMinnin mouin, O Bon Sovè.\nKondui-m nan chémin sali.\nAvèk ou m-pa bézouin pè.\nNan ou sèl mouin jouin-n la vi.\n\nKè:Jézu, Jézu, pa kité-m, O Bon Sovè.\nFè-m soti nan tantasion.\nOu-a fè mouin plus ké vinkè.\n\n\n2.\nJézu, pa kité-m isi\nSou tè sa plin ak doulè.\nSan ou nan pouin lòt zanmi,\nMin nan ou mouin jouin-n bon-nè.\n\n\n3.\nOu té lévé-m nan la bou\nDé pi profon méchansté.\nOu-a fè-m rivé nan sièl tou.\nSé la gloua Ou ma chanté.',
