    lyrics:
      '1.\nMon-n sa sé pou papa-m\nSé Li ki té fè li\nZouazo nan boua chanté ak joua\nPou loué bonté Li.\n\nKè:\nMon-n sa sé pou papa-m\nSé Li ki Tou-Puisan\nSièl-la, tè-a ak la mè,\nTout di ki jan Li gran.\n\n2.\nMon-n sa sé pou papa-m\nMap kouté tou patou\nZétoual, solèy yo tout palé\nKi jan Li rinmin nou.\n\n3.\nMon-n sa sé pou papa-m\nA la kè mouin kontan;\nLi rinmin mouin jiska la fin,\nMouin pou Li pou tout tan.',
