    title: 'San Jézu, mouin pa kapab viv',
    lyrics:
      '1.\nSan Jézu mouin pa kapab viv,\nMouin pa sa fè gnou sèl pa;\nSé li-min’m sèl mouin ta vlé suiv\nMouin suiv li jouk sa kaba.\n\nKè:\nAngnin mouin pa gin pou-m krin-n,\nPuiské Sovè-m ap véyé;\nMa suiv li san mouin pa jan-m plin-n\nLi pap kité mouin néyé.\n\n\n2.\nAmou li avèk promès li\nPlin kè mouin ak gnou gran joua;\nMouin mèt tou fèb, mouin mèt kagou,\nSètin l-a ban-m la viktoua.\n\n\n3.\nLè fè noua vi-n pou fè-m tranblé,\nAvèk li mouin brav fasil;\nLè voua Satan apé grondé\nMouin rété dousman trankil.\n\n\n4.\nJézu, ouété tou sa ki tròp\nNan kè mouin, pou mouin maché,\nPurifié mouin, lavé-m, fè-m pròp\nJan Bon-Dieu vlé pou mouin yé.',
