    title: 'Gen you zanmi, you bon zanmi',
    lyrics:
      '1.\nGin gnou zanmi, gnou bon zanmi,\nLi rinmin-m dépi tout tan.\nLi gingnin kè mouin ak lamou,\nLi tankou chin-n pou kinbé-m.\nPèsòn pa kab kasé chin-n nan,\nLi kinbé-m pa lamou li.\nMouin pou Li-min’m, Li pou mouin tou,\nPou tout tan é pou tout tan.\n\nKè:\nMouin pou Li-min’m, Li pou mouin tou,\nPou tout tan é pou tout tan.  (2 li-n 2 foua)\n\n\n2.\nGin gnou zanmi, gnou bon zanmi.\nLi té mouri pou sové-m,\nLi té ban mouin, avèk la vi,\nGnou lot kado, sé Li-min’m!\nTou sa-m gingnin, sé pa pou mouin,\nTout bagay sé pou Zanmi-m;\nKè mouin, é vi-m, tout sé pou Li,\nTout sé pou Li pou tout tan.\n\n\n3.\nGin gnou zanmin, gnou bon zanmi,\nLi gin bon kè, Li janti.\nLi sé gnou gid, konséyè,\nÉpi Li kon-n défan-n mouin.\nKi moun kapab séparé mouin\nAvèk Li-min’m kap rinmin-m?\nNi nan lan mò, ni lanfè min-m!\nNon! Mouin pou Li pou tout tan.',
