    title: 'Nou pa krin-n ankò',
    lyrics:
      '1.\nNou pa krin-n ankò,\nNi troub ni lan mò!\nLéspri a vi-ni,\nJézu ki alé, voyé lé Sint-Éspri.\n\n\n2.\nJézu ki la pè,\nNan sièl la li yé.\nLi voyé gnou gaj\nKi palé nan kè nou gnou bèl témouagnaj.\n\n\n3.\nJézu rinmin nou;\nLi pran-n nan la bou;\nLi fè-n gnou kado,\nLi pap jan-m ouété Sint-Éspri a ankò.\n\n\n4.\nLi, ki avèk nou,\nSèvi kou gid tou.\nLi ban nou lamou\nLi tabli rouayom lamou li nan kè nou.\n\n\n5.\nTout moun yo ki kouè,\nYo va délivré:\nYo konnin la pè,\nAk puisans é la joua, yo va délivré.\n\n\n6.\nAn nou plin la joua,\nChanté ak tout voua,\nNap suiv lé Ségnè,\nNap vink avèk li juska la dèniè è.',
