      md: '**1.** \n\nNou pa krin-n ankò, \n\nNi troub ni lan mò! \n\nLéspri a vi-ni, \n\nJézu ki alé, voyé lé Sint-Éspri. \n\n\n<br/> **2.**\n\nJézu ki la pè, \n\nNan sièl la li yé. \n\nLi voyé gnou gaj \n\nKi palé nan kè nou gnou bèl témouagnaj. \n\n\n<br/> **3.**\n\nJézu rinmin nou; \n\nLi pran-n nan la bou; \n\nLi fè-n gnou kado, \n\nLi pap jan-m ouété Sint-Éspri a ankò. \n\n\n<br/> **4.**\n\nLi, ki avèk nou, \n\nSèvi kou gid tou. \n\nLi ban nou lamou \n\nLi tabli rouayom lamou li nan kè nou. \n\n\n<br/> **5.**\n\nTout moun yo ki kouè, \n\nYo va délivré: \n\nYo konnin la pè, \n\nAk puisans é la joua, yo va délivré. \n\n\n<br/> **6.**\n\nAn nou plin la joua, \n\nChanté ak tout voua, \n\nNap suiv lé Ségnè, \n\nNap vink avèk li juska la dèniè è. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Nou pa krin-n ankò, </p>\n<p>Ni troub ni lan mò! </p>\n<p>Léspri a vi-ni, </p>\n<p>Jézu ki alé, voyé lé Sint-Éspri. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Jézu ki la pè, </p>\n<p>Nan sièl la li yé. </p>\n<p>Li voyé gnou gaj </p>\n<p>Ki palé nan kè nou gnou bèl témouagnaj. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Jézu rinmin nou; </p>\n<p>Li pran-n nan la bou; </p>\n<p>Li fè-n gnou kado, </p>\n<p>Li pap jan-m ouété Sint-Éspri a ankò. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Li, ki avèk nou, </p>\n<p>Sèvi kou gid tou. </p>\n<p>Li ban nou lamou </p>\n<p>Li tabli rouayom lamou li nan kè nou. </p>\n<p><br/> <strong>5.</strong></p>\n<p>Tout moun yo ki kouè, </p>\n<p>Yo va délivré: </p>\n<p>Yo konnin la pè, </p>\n<p>Ak puisans é la joua, yo va délivré. </p>\n<p><br/> <strong>6.</strong></p>\n<p>An nou plin la joua, </p>\n<p>Chanté ak tout voua, </p>\n<p>Nap suiv lé Ségnè, </p>\n<p>Nap vink avèk li juska la dèniè è. </p>\n'
