    title: 'Chè Ségnè, kinbin min-m, Édé mouin rété fèm',
    lyrics:
      '1.\nChè Ségnè, kinbin min-m, Édé mouin rété fèm;\nMouin bouké, fatigé, tèlman.\nNan loraj, nan fènoua, kléré rout la dévan;\nKinbin min-m, chè Ségnè, fè-m rivé.\n\n\n2.\nLè chémin difisil, É m-bézouin ou anpil,\nSégnè, rété la tou pré mouin.\nLè mouin prèt pou alé, Édé-m pou-m pa buté,\nKinbin min-m, chè Ségnè, fè-m rivé.\n\n\n3.\nLè solèy la kouché, É nuit la ap proché,\nÉ tout la vi mouin va fini,\nÉdé-m pa régrété, Nan ou sèl mouin konfié,\nKinbin min-m, chè Ségnè, fè-m rivé.',
