    title: 'Mouin té chouazi nèt pou toujou',
    lyrics:
      '1.\nMouin té chouazi nèt pou toujou\nAnt mon-n sa é Fis Bon-Dieu;\nAngnin pap chanjé mouin du tou,\nPaské Li fi-n pran kè-m vré.\nPran mon-n sa ak tout plézi li,\nPran yo, pran yo, kout ké kout,\nBan mouin Jézu, présié Sovè-m,\nLi pi dous pasé yo tout.\n\nKè:  Pi dous, pi dous pasé tout,\nPi dous, pi dous pasé tout.\nBan mouin Jézu, présié Sovè-m,\nLi pi dous pasé yo tout.\n\n\n2.\nDépi m-fè choua mouin pou toujou,\nDépi m-maché avèk Kris,\nVi mouin vi-ni pi rich chak jou;\nParol Li touché-m pi plus.\nPran mon-n sa ak tout richès li,\nPran yo, pran yo, kout ké kout,\nBan mouin Jézu, présié Sovè-m,\nLi pi dous pasé yo tout.\n\n\n3.\nDépi mouin fè choua pou sièl la,\nDépi Kris pi bon zanmi-m,\nTout moun kité-m sou tè sa,\nMin nan Kris mouin jouin-n apui-m.\nPran tout amitié sou tè a,\nPran yo, pran yo, kout ké kout,\nBan mouin Jézu, présié Sovè-m;\nLi pi dous pasé yo tout.\n\n\n4.\nLè zèv la vi mouin achévé,\nLè mouin pasé pòt lan mò,\nLè mouin monté koté Bon-Dieu,\nLè m-a maché bò lot bò,\nLè jé mouin gin tan ouè zanj yo,\nGran ak piti, m-a ouè tout.\nBan mouin Jézu, présié Sovè-m,\nLi pi dous pasé yo tout.',
