    title: 'Nap chanté gnou kantik Noèl',
    lyrics:
      '1.\nNap chanté gnou kantik Noèl,\nBèl fèt ki ran-n nou tout jouayé!\nJou Noèl nan tan lontan,\nJézu-Kri té vini sou la té.\nLi té désan’n – Pami lè zòm,\nKou gnou ti moun.\nÉ lap voyé:  Bòn volonté\nÉ la pé pou tout moun!\n\nKè:  Sonnin bi-in bèl\nTout klòch Noèl.\nLè Kris vini\nPou rét ak nou –\nÉma-nuèl, ki non si bèl.\n\n\n2.\nBéjè yo kouté – tout sézi,\nLè anj la di gnou si bèl mo.\nTout foul zanj yo tap chanté:\nTout gloua pou Bon-Dieu nan lié trè ro!\nKi gran lamou- Li gin pou nou,\nKi fè-l désan-n.\nPrémié Noèl – Jou la si bèl\nPou tou lè zòm!\n\n\n3.\nNap tandé bèl kantik ankò,\nÉ nap vini présé, présé.\nNou vlé ofri-L gnou kado,\nSé pa lò, min kè nou nap pòté.\nLi té vini – Li té soufri\nJusk a lan mò,\nPou minnin nou – Ak tout moun tou,\nNan kay-L an ro.',
