    title: 'An-n chanté louanj Bon-Dieu papa nou',
    lyrics:
      '1.\nAn-n chanté louanj Bon-Dieu papa nou\nNan gnou bèl kantik damou.\n\nKè:  Paské bonté li duré,\nToujou fidèl, asuré.\n\n\n2.\nSé li ki fè gnou si bèl solèy,\nLa lun, zétoual, tout mèmèy.\n\n\n3.\nLi voyé la rouzé ak la pli\nPou grin-n jèmin, plant grandi.\n\n\n4.\nLi kòmandé tout jadin fètil,\nPou fè rékolt yo anpil.\n\n\n5.\nRémèsié li pou viv tè ak foui\nTout danré li fè vini.\n\n\n6.\nRémèsié li pou tout zannimo,\nPouason nan dlo, tout zouazo.\n\n\n7.\nGras a li, la vi-n pa an danjé,\nLi louvri min-l, nou manjé.\n\n\n8.\nMin li ba nou manjé ki pi bèl,\nJézu, pin ki sòt nan sièl.\n\n\n9. Chanté, chanté louanj Papa sila,\nTout moun chanté ak tout voua.\n\nDènié Kè:\nDieu lé Pè, Fis, Sint-Éspri,\nGloua non ou pap jan-m fini.',
