      html: '<p><strong>1.</strong> </p>\n<p>An-n chanté louanj Bon-Dieu papa nou </p>\n<p>Nan gnou bèl kantik damou. </p>\n<p>Kè:  Paské bonté li duré, </p>\n<p>Toujou fidèl, asuré. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Sé li ki fè gnou si bèl solèy, </p>\n<p>La lun, zétoual, tout mèmèy. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Li voyé la rouzé ak la pli </p>\n<p>Pou grin-n jèmin, plant grandi. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Li kòmandé tout jadin fètil, </p>\n<p>Pou fè rékolt yo anpil. </p>\n<p><br/> <strong>5.</strong></p>\n<p>Rémèsié li pou viv tè ak foui </p>\n<p>Tout danré li fè vini. </p>\n<p><br/> <strong>6.</strong></p>\n<p>Rémèsié li pou tout zannimo, </p>\n<p>Pouason nan dlo, tout zouazo. </p>\n<p><br/> <strong>7.</strong></p>\n<p>Gras a li, la vi-n pa an danjé, </p>\n<p>Li louvri min-l, nou manjé. </p>\n<p><br/> <strong>8.</strong></p>\n<p>Min li ba nou manjé ki pi bèl, </p>\n<p>Jézu, pin ki sòt nan sièl. </p>\n<ol>\n<li>Chanté, chanté louanj Papa sila, </li>\n</ol>\n<p>Tout moun chanté ak tout voua. </p>\n<p>Dènié Kè: </p>\n<p>Dieu lé Pè, Fis, Sint-Éspri, </p>\n<p>Gloua non ou pap jan-m fini. </p>\n'
