    title: 'Dépi tan lontan, Bon-Dieu',
    lyrics:
      '1.\nDépi tan lontan, Bon-Dieu\nTé promèt nou Jézu-Kri.\nJou Noèl, gnou jou dé gloua,\nLi té vi-n bay tout moun joua.\n\nKè:\nMin, bèl jou sa a rivé,\nJou nou ouè lé Kris Li-min’m.\nChanté tou patou sou tè.\nJézu fèt nan Bétléèm!\n\n\n2.\nBèjé, di nou li, tan pri,\nKi nouvèl nou gin pou nou?\nPouki nou vini isit,\nKité troupo yo nan mòn?\n\n\n3.\nLè nou véyé nan la nui,\nMin! nou ouè gnou bèl lumiè!\nZanj yo vini chanté – ap di:\nSovè a vi-n sou tè.\n\n\n4.\nO Jézu, ki gran amou\nTé fè ou vini désan-n –\nKité sièl la, la kay ou,\nPou rété pami lè zòm?\n\n\n5.\nSégnè Jézu, fè nou ouè\nGnou si bèl dousè nan ou,\nKé nou plin gnou gran anvi\nPou sanblé ou plus chak jou.',
