    title: 'Lè la vi mouin va fini',
    lyrics:
      '1.\nLè la vi mouin va fini\nÉ mouin janbé riviè-a\nLè mouin ouè briyé\nGnou matin glorié\nMa va konnin Rédanmtè mouin\nLè-m rivé nan sièl la\nÉ souri Li va pou mouin gnou byinvénu.\n\nKè:\nMa va ouè Li, ma konnin Li,\nLè ma kanpé bò koté Jézu-Kri;\nMa va ouè Li, ma konnin Li\nPa mak klou yo Li gingnin nan min Li.\n\n2.\nKi transpò dalégrès\nLè mouin va ouè Li fas a fas\nÉ tout gran amou kap\nBriyé nan jé Li;\nO kè mouin va loué Li\nPou mizérikòd ak gras,\nKi paré pou mouin\nGnou bèl plas nan kay Li.\n\n3.\nNan bèl péi anro-a\nMouin gingnin kèk byin-émé\nMouin sonjé lè yo té di mouin révoua\nAk graan joua yo va\nChanté lè yo ouè mapé rivé,\nMin mouin prémièman.\n\n4.\nMapé antré nan vil la\nNan gnou ròb ki blan é pu,\nKoté pap gin soufrans ni tristès ankò,\nMapé chanté ak zanj yo\nNan gnou sélès amoni\nMin mouin ta vlé ouè\nSovè mouin prémièman.',
