    title: 'Il y avait des bergers',
    lyrics:
      "1.\t\nIl y avait des bergers qui gardaient leurs troupeaux,\nQui gardaient leurs troupeaux la nuit;\nIl y avait des bergers qui gardaient leurs troupeaux,\nQui passaient dans les champs les veilles de la nuit.\n      \n2.\t\nVoici, un ange du Seigneur leur apparut\nEt la gloire du Seigneur resplendit autour d'eux,\nIls furent saisis de frayeur.            \n\n3.\t\nMais l'ange leur dit, il leur dit;\nMais l'ange leur dit, il leur dit:\nNe craignez point, car je vous annonce une bonne nouvelle\nQui sera pour tout le peuple le sujet d'une grande joie.\n\n4.\t\nC'est qu'aujourd'hui il vous est né\nC'est qu'aujourd'hui il vous est né,\nDans la ville de David,\nUn Sauveur qui est Christ le Seigneur\nC'est qu'aujourd'hui il vous est né,\nUn Sauveur, un Sauveur, qui est Christ Le Seigneur.\n\n5.\t\nGloire à Dieu, au Sauveur,\nGloire à Émmanuel,\nGloire à Dieu, Gloire à Dieu,\nDans les lieux très hauts!\nGloire à Dieu, Gloire au Sauveur,\nGloire à Émmanuel,\nGloire, Gloire à Dieu dans les lieux Très hauts.",
