    title: 'Mouin Kanpé Sezi Nan Prézans',
    lyrics:
      '1.\nMouin kanpé sézi nan prézans\nJézu, Rédanmtè béni;\nKonman li té kapab rinmin-m,\nMouin-min’m, gnou péchè inpi!\n\nKè:\nSé mèvéyé! Sé admirab!\nMa va chanté pou toujou.\nSé mèvéyé! Sé admirab!\nAmou Jézu gin pou nou.\n\n\n2.\nSé pou mouin l-alé nan jadin,\nPrié pou mouin ta sové,\nLi pa té krié pou li-min’m;\nPou mouin sé san li sué.\n\n\n3.\nLi té pran péché ak pin-n mouin,\nKon-m si tou sa té pou li;\nLi pòté yo tout nan Kalvè,\nSé la l-soufri, li mouri.\n\n\n4.\nLè mouin ouè fas li nan sièl la,\nAk rachté yo nan la gloua,\nMouin va vlé chanté amou li;\nSé nan sa ma jouin-n tout joua.',
