    title: 'Kité lé mon-n bi-in louin ou',
    lyrics:
      '1.\nKité lé mon-n bi-in louin ou,\nVi-ni, vi-ni avèk nou;\nNap fè gnou nouvo pa chak jou,  (2 foua)\nPou Sion, patri nou.  (2 foua)\n\nKè: Nap fè rout pou Sion,\nBèl Sion, péi Sovè nou!\nKréti-in an avan pou Sion,\nSé bèl, sé bèl péi nou!\n\n\n2.\nNan sièl la, bèl musik la,\nAvèk bèl kantik yo you,\nKapé kondui lamé sièl la,  (2 foua)\nVa réjoui-n tou, gnou jou.  (2 foua)\n\n\n3.\nPou ranpòté la viktoua,\nSé pou nou suiv Jézu-Kri;\nChak solda gin pou résévoua,  (2 foua)\nLa gloua lè-l fi-n soufri.  (2 foua)\n\n\n4.\nJézu-Kri, Rédanmtè a\nInstalé sou gran trò-n li;\nLapé régné nan tout sièl la,  (2 foua)\nAk kouròn sou tèt li.  (2 foua)',
