    title: 'Li ba nou plus gras',
    lyrics:
      '1.\nLi ban nou plus gras\nLè fado nou vi-n pi lou.\nLi ba nou plus fòs\nLè travay nou pi rèd.\nNan mitan lafliksion\nZéprèv yo ak danjé\nNan amou-L Li ba nou\nLa pé ki pi dou.\n\nKè:\nLamou Li san mézu,\nGras Li sé pou tout moun-n\nPuisans Li pi gran\nPasé konésans nou\nNan richès infini\nLi gingnin nan Jézu\nLi ba nou, Li ba nou,\nLi ba nou toujou.\n\n2.\nLè tout amou, tout pasians\nNou gin tan fini;\nLè nou pèdu tout fòs\nMin-m avan midi;\nLè nou manké kouraj\nPou maché nan rout Li;\nLè sa Dieu kòmansé\nBa nou puisans Li.',
