    title: 'Mouin vie mil lang pou chante biin',
    lyrics:
      '1.\nMouin vlé mil lang pou chanté bi-in\nLouanj Rédanmtè mouin;\nTout gloua, sé pou Bon-Dieu, Roua mouin,\nGras li gin tout viktoua.\n\n\n2.\nMèt mouin, é a-nonsé patou:\nPou-m a-nonsé aptou:\nPou-m répan-n nan la tè antié\nKonnésans non Jézu.\n\n\n3.\nJézu, non ou chasé krintif,\nLi chasé tristès nou.\nJézu, non ou, sé bèl muzik,\nSé vi ak santé tou.\n\n\n4.\nLi krazé puisans vié péché,\nPrizonnié yo lagé.\nSan li né touayé péché yo,\nSan li nétouayé mouin.\n\n\n5.\nNou-min’m, tout pèp, gadé koté-l,\nSé li ki Bon-Dieu nou.\nLa foua sové nou, la foua sèl;\nGras li padonnin nou.\n\n\n6.\nBon-Dieu té rinmin tout péché,\nLi rinmin nou sé si!\nPou tout moun patou sou la tè\nPitit li té mouri.',
