    title: 'Seyè Bondie, mwen vle la vi-m',
    lyrics:
      '1.\nSégnè Bon-Dieu, mouin vlé la vi-m\nKa ranpli ak louanj,\nNan tou sa-m yé, ak tou sa-m fè,\nPlè ou tankou lè zanj.\n\n\n2.\nSé pa sèlman louanj lèv mouin,\nNi sèlman louanj kè,\nMouin mandé ou été-m ofri\nLouanj ou a tout è.\n\n\n3.\nMouin vllé loué ou tout tan, min-m\nNan bagay òdi-nè;\nChak kou mouin sòti ou rantré,\nÉpi nan tou sa-m fè.\n\n\n4.\nFè ké tout pati nan mouin-min-m;\nKò, nan-m avèk léspri,\nKap chanté louanj ou, Ségnè,\nMalgré m-fèb é piti.\n\n\n5.\nSé kon sa, Ségnè, mouin-min-m min-m,\nVa glorifié ou,\nÉ m-va kòmansé sou la tè\nChan ki pou lé siél tou.\n\n\n6.\nTout la jouné avèk lan nuit,\nVa sin, lè m-fè kon sa,\nM-va gin gnou komunion pafè\nAk ou, min-m isi ba.',
