    title: 'Tout Moun Ki Rété Rou La Tè',
    lyrics:
      '1.\nTout moun ki rété sou la tè,\nChanté lé Ségnè ak tout voua;\nSèvi-l ak krint, fè louanj li,\nDévan li chanté avèk joua.\n\n\n2.\nNou konnin sé Bon-Dieu li yé;\nNou pat édé-l lè li fè nou.\nL-a nouri nou, sé pa-l nou yé;\nTankou mouton-l li minnin nou.\n\n\n3.\nAntré nan pòt li ak louanj;\nAvèk joua, proché tanp li tou;\nBéni non li tankou lè zanj,\nSé bon pou fè kon sa toujou.\n\n\n4.\nPouki? Paské Bon-Dieu nou bon,\nAmou-l rété fidèl toujou.\nTou sa li di, li fè-l tout bon;\nParòl Bon-Dieu sètin toujou.',
