    title: 'Ségnè-m ki vi-n régné',
    lyrics:
      '1.\nSégnè-m ki vi-n régné,\nMouri pou-n ka sové.\nLi té tan nan tonbo\nJou pou-l monté an ro.\n\nKè:\nJézu résusité\nNan gloua é majésté,\nLi résusité pou toujou.\nSé pou nou publié\nLouanj non li koun yé,\nPaské jodi a li vivan.\n\n\n2.\nPouki nou nan tristès,\nNap krié nan détrès?\nBi-into soufrans lan mò\nTounin nan joua ankò.\n\n\n3.\nGro ròch la déplasé,\nLè Kris résusité.\nLi vivan nan sièl la,\nAmou-l pa jan-m kaba.',
