    title: 'Séré-m Pi Pré Ou, Tou Pré Kè Ou',
    lyrics:
      '1.\nSéré-m pi pré ou, tou pré kè ou.\nOu sé trézò mouin é ou Sovè-m tou.\nKinbé-m, o kinbé-m, Bon-Dieu damou.\nFè-m jouin-n gnou koté pou-m kaché nan ou.  (2 foua)\n\n2.\nSéré-m pi pré ou; mouin pa angnin.\nMouin pa gin ofran-n pou Jézu, Roua mouin;\nSèlman gnou kè ki tou plin péché.\nLavé-m, Jézu, san ou koulé pou mouin.  (2 foua)\n\n3.\nSéré-m pi pré ou, Ségnè Jézu.\nSé pa pou mon-n sa ké mouin gin dézi.\nMouin lagé péché ak tout lògèy.\nBan-m sèlman Jézu, Ségnè-m krusifié.  (2 foua)\n\n4.\nSéré-m pi pré ou, pandan vi sa,\nJouk tan mouin la avèk ou nan la gloua,\nPou mouin rété toujou avèk ou,\nPi pré ou Sovè-m, pi pré ou toujou.  (2 foua)',
