    lyrics:
      '1.\nLontan mouin té rété nan lògèy;\nM-pat ran-n kont Ségnè-m té krusifié;\nM-pat konnin sé pou mouin san-l koulé\nSou boua Kalvè.\n\nKè:\nTout gras Bon-Dieu té pou grin mési,\nJézu té ban mouin tout padon li.\nNan-m mouin ki té troublé jouin-n la vi\nSou boua Kalvè.\n\n\n2.\nParòl Bon-Dieu té montré-m péché-m;\nLò mouin ouè la loua mouin té tranblé,\nJouk tan nan-m mouin koupab té viré\nBò boua Kalvè.\n\n\n3.\nKoun yé a mouin ran-n Kris tout bagay;\nKoun yé a sé pou li map travay;\nKoun yé a sé rémèsiman m-bay\nPou boua Kalvè.\n\n\n4.\nO lamou ki té fè plan salu!\nO la gras ki té fè li vini!\nSé pou péché mouin Kris té soufri\nSou boua Kalvè.',
