    lyrics:
      '1.\nLa bib di nou, té gin gnou non-m\nKi viv nan tan lontan,\nLi té bi-in rich, min li santi\nLi bézouin plus ké lò.\n\nKè:  Oui, mé zanmi, gin gnou bagay\nKi pi plus pasé lò!\nKonnin péché ou padonnin,\nSé pi plus pasé lò!\n\n\n2.\nNon-m nan sé té gnou moun ti tay.\nGnou jou moun yo vi-n di-l\nKé Jézu-Kri va vi-n ofri\nGnou bagay plus ké lò.\n\n\n3.\nNon-m nan té monté gnou pié boua,\nPou li ta kapab ouè\nLé Sovè ki kapab ofri\nGnou bagay plus ké lò.\n\n\n4.\nBi-into Jézu té vi-n bò la,\nLi ouè non-m nan an lè.\nÉpi Li rélé-l, é Li di-l:\n«Fòk mouin al la kay ou.»\n\n\n5.\nNon-m nan té obéi tou suit;\nÉ li té ouè sé vré\nKé bi-infè Jézu té ba li\nSé té plus pasé lò.',
