      md: '**1.** \n\nSièl la si bèl, O Étènèl, \n\nLi palé nou sou la gloua ou, \n\nMin gin gnou bagay ki pi bèl: \n\nSé lè jé nou ouè Parol ou. \n\n\n<br/> **2.**\n\nBèl solèy la ki bay lumiè, \n\nPèmèt nou ouè gran puisans ou, \n\nMin nan la Bib, bèl liv si chè, \n\nNou jouin-n justis ak la gras ou. \n\n\n<br/> **3.**\n\nSolèy, la lun, bèl zétoual tou, \n\nKlélé la tè, lé mon-n antié. \n\nSé kon sa tou, vérité ou, \n\nSé pou tout moun sou la tè. \n\n\n<br/> **4.**\n\nLévanjil la, mésaj la gras, \n\nPap jan-m rété, jouk lè tout moun \n\nVi-n jouin-n ak Jézu fas a fas – \n\nLi mouri pou-l pa pèdu gnoun. \n\n\n<br/> **5.**\n\nBon Jézu-Kri, Lumiè lé mon-n, \n\nKléré tout moun ak lumiè ou. \n\nLévanjil kap ran-n saj tout òm, \n\nMin-m sa ki jin-n, min-m sa ki fou! \n\n\n<br/> **6.**\n\nKi bèl mèvèy nou kapab ouè, \n\nSé moun ki vi-n chanjé, sové. \n\nSégnè, sovè-m, ban-m gnou bon kè. \n\nAk Parol ou map jouin-n la pè. \n\n\n',
