      "1.\t\nAmour sublime\nImmense charité\nJésus victime\nMéprisé, maltraité\nSouffrit la peine\nDe mes nombreux forfaits\nEt brise ma gloire\nO gloire à jamais.\n\nChoeur\nSeigneur ta grâce\nAtteint jusqu'aux cieux\nElle surpasse\nTout don merveilleux\nQui dans ce monde\nJ'aurais souhaité\nCette grâce inonde\nTon racheté.\n\n2.\t\nQuand je chancelle\nSur un sombre chemin\nL'Ami fidèle\nMe saisit par la main\nAlors la crainte\nSe dissipe aussitôt\nPlus d'amères plaintes\nLe regard là-haut.\n\n3.\t\nTa croix sanglante\nEst ma seule rançon\nL'âme souffrante\nY trouve un plein  pardon\nC'est mon Refuge\nDans la vie et la mort\nDevant le Grand juge\nOh! Quel heureux sort.",
