    title: 'Jézu, lésé-m maché ak ou',
    lyrics:
      '1.\nJézu, lésé-m maché ak ou,\nBi-in kontan pou-m fè sèvis ou;\nDi mouin tout sékrè ou gingnin,\nÉdé-m pa inkiè pou démin.\nMontré-m édé kè moun ki pè\nAvèk bon Parol ou, Ségnè;\nGadé-m tout tan nan bon chémin,\nÉ kondui mouin juska la fin.\n\n\n2.\nFè-m gin plus pasians tankou ou,\nGadé-m tou pré ou tou lè jou\nPou-m fè travay mouin, ak la foua\nÉ konfians ou ki bay viktoua,\nNan éspoua ou ki kon solèy,\nKléré tout bagay sou la tè,\nNan la pè ou sèl ka ban nou,\nLésé-m viv, Jézu, tou prè ou!',
