    lyrics:
      '1.\nOnoré puisans non Jézu,\nTout zanj doué fas a tè.\nPòté vini kouròn pi sin\nÉ kouroné Li Ségnè.\nPòté vini kouròn pi sin\nÉ kouroné Li Ségnè.\n\n\n2.\nPèp chouazi nan ras Izraèl,\nNou ké Bon-Dieu rachté\nRan-n gloua pou Li ki ban nou sièl\nÉ kouroné Li Ségnè.\nRan-n gloua pou Li ki ban nou sièl\nÉ kouroné Li Ségnè.\n\n\n3.\nSé pou tout moun nan chak nasion\nKi rété sou la tè,\nBa Li lonnè kòm pi gran Chèf\nÉ kouroné Li Ségnè.\nBa Li lonnè kòm pi gran Chèf\nÉ kouroné Li Ségnè.\n\n\n4.\nAn nou uni nou ak zanj yo\nAk adoré nan sièl,\nNa chanté gnou kantik nouvo\nÉ kouroné Li Ségnè.\nNa chanté gnou kantik nouvo\nÉ kouroné Li Ségnè.',
