    title: 'Mouin kontan jodia, gin solèy nan kè-m',
    lyrics:
      '1.\nMouin kontan jodia, gin solèy nan kè-m;\nTout krint ak dout yo pasé;\nJézu di kon sa: ninpòt moun ki vlé\nMèt jouin-n mouin pou-l sové.\n\nKè:\nNan Jan toua sèz  «ki konk» vlé di mouin,\n«Ki konk» vlé di mouin,\nMap mété non mouin la.\nNan Jan toua sèz «ki konk» vlé di mouin;\nMouin ladan! Alélouya!\n\n\n2.\nMouin kontan jodia, gin éspoua nan kè-m;\nA Jézu mouin vlé ran-n gloua,\nPaské li ban-m la viktoua sou péché-m;\nNan kè-m li sèl sé Roua.\n\n\n3.\nAmou li mèvéyé! Gras li mèvéyé!\nPou mouin – Jézu té mouri.\nMouin té rinmin lé mon-n, m-té pèdu nèt,\nJouk tan li té fè-m lib.',
