    lyrics:
      '1.\nMap tandé bèl voua bon Sovè mouin;\nVi-n suiv mouin;  (3 foua)\nVoua Jézu ap rélé-m tout jounin:\nVi-n suiv mouin;  (3 foua)\nMouin té monté Kalvè pou ou;\nMouin té bay la vi-m pou sové ou;\nSan pa-m vèsé péyé dèt ou;\nVi-n suiv mouin.  (3 foua)\n\n\n2.\nOu té péché, min ou jouin-n padon;\nVi-n suiv mouin;  (3 foua)\nMa lagé ou nan chin-n péché yo;\nVi-n suiv mouin;  (3 foua)\nTout lot bagay apé chanjé,\nMa va dirijé ou, si ou vlé,\nM-va joua ou pou létènité,\nVi-n suiv mouin.  (3 foua)\n\n\n3.\nVi-n rémèt mouin tout chagrin ou yo,\nVi-n suiv mouin;  (3 foua)\nMouin prèt pou ouété fado ou yo,\nVi-n suiv mouin;  (3 foua)\nVi-n jouin-n répo, kité krint ou;\nÉ kouè mouin pou sa-k va rivé tou,\nMa séché tout dlo nan jé ou;\nVi-n suiv mouin.  (3 foua)',
