    title: 'Sé gnou chan jouayé',
    lyrics:
      '1.\nSé gnou chan jouayé,\nGnou nouvèl glorié,\nNan pouin lòt kòm li\nNan lé mond antié;\nMouin rinmin chanté-l\nÉ m-a proklamé-l\nBon-Dieu nou kapab\nBa ou la délivrans.\n\nKè:\nSé Bon-Dieu ki kapab délivré,\nSé Li sèl ki toujou délivré,\nTout fado péché, sou Li dépozé,\nPaské Bon-Dieu nou\nKap bay la délivrans.\n\n2.\nMoun-n vlé vini\nPa doué jan-m mizé,\nPòt la byin ouvè pou-l kapab antré;\nKris sé chémin, la vérté, la vi,\nBon-Dieu nou kapab\nBa ou la délivrans.\n\n3.\nSé gnou chan jouayé,\nProklamé-l byin louin,\nPou tout aflijé anba chaj péché,\nKapab résévoua padon pa la foua,\nBon-Dieu non kapab\nBa ou la délivrans.',
