    lyrics:
      '1.\nIsi-ba mouin satisfè ak gnou ti kay\nAk mézu byin ké, Jézu ap bay.\nNan vil sélès la\nKoté zanj yo ap chanté\nMouin gin gnou palè dépi mouin sové.\n\nKè:\nNan péi-m anro-a\nMouin gingnin gnou palè\nSé lòt bò mòn la mouin anvi rivé,\nGnou jou map ouè li\nLè Jézu va vini\nMap loué Li pou létènité.\n\n2.\nMalgré mouin tanté,\nToumanté, méprizé\nÉ pafoua tèt mouin kon-n trè chajé\nMap alé nan sièl la\nMouin ouè pa la foua\nGnou palè la-ba.\n\n3.\nMouin pa maléré,\nMouin pa dékourajé\nMouin santi mouin rich é,\nMouin vlé chanté\nDévan tròn Bon-Dieu\nNap kanpé ak zanj yo\nJoué hap mouin nan\nGnou kantik nouvo.',
