    title: 'Clarté Céleste',
    lyrics:
      "1.\t\nDans les vallons et sur la montagne\nA la clarté des rayons divers,\nJésus mon divin Rédempteur m'accompagne\nIl est mon juge jusqu'à la fin.           \n\nChoeur\nClarté céleste, clarté céleste\nRemplit mon coeur de rayons divins,\nClarté céleste, clarté céleste\nInonde de soleil mon chemin.\n\n2.\t\nLorsque les nuages m'environnent\nIl ne peut cacher mon Rédempteur\nCar sa lumière sur moi rayonne\nLa nuit a perdu toute sa terreur.\n\n3.\t\nEn avant chrétien dans l'allégresse\nToujours plus haut presse vers les cieux,\nMarche en avant louer sans cesse\nChrist le Seigneur Jésus de Dieu.",
