    title: 'Ségnè Bon-Dieu Ki Papa Nou',
    lyrics:
      '1.\nSégnè Bon-Dieu ki Papa nou,\nKi rinmin tout moun tou,\nPadonnin nou tout bagay fou,\nChanjé vi nou yo tou patou,\nRan-n nou pi sanblé ou.\n\n\n2.\nÉdé nou montré gnou la foua,\nKon moun yo ki ak joua,\nNan Galilé té suiv la voua\nJézu, lè-l ofri yo gnou choua,\nLa foua o lié la loua.\n\n\n3.\nJété sou nou gnou bèl rozé,\nGnou léspri plin la pè.\nKalmé nan-m yo ki anouyé,\nÉ ba yo tout trankilité,\nAvèk sérénité.\n\n\n4.\nOuété nan nou tout fó dézi,\nKi pa fè ou plézi,\nBan nou féchè nou ka santi\nNan ké nou, é palé san brui,\nDous voua lé Sint-Éspri.',
