    title: 'Ma demeure',
    lyrics:
      "1.\t\nDu monde la gloire ainsi que tous les biens\nNe seront jamais ici-bas mon partage,\nParce que Jésus-Christ, le Nazaréen,\nLà-haut me prépare un plus grand héritage.\n\nChoeur\nMa demeure est là où Jésus fait sa demeure;\nLorsque j'erre à travers un périlleux sentier,\nIl s'approche, me guide et près de moi demeure,  \nM'exhortant toujours à veiller, à prier.\n\n2.\t\nBien souvent je suis tenté et ballotté\nPar Satan, le grand et terrible adversaire.\nConnaissant du monde l'instabilité,\nVers mon sûr abri je cours par la prière.\n\n3.\t\nQue j'affronte labeur, fatigue sur mes pas;\nQue mon père, ma mère, mon frère abandonnent\nJe ne puis chanter que «Gloire Alléluia»\nPuisqu'au ciel m'attend ma princière couronne.",
