    title: 'Le jour de la moisson',
    lyrics:
      "1.\t\nLe jour de la moisson viendra\nPour tout fils d'Adam-né,\nEt ce que l'homme aura semé\nIl le moissonnera.\n\nChoeur\nLa semence d'ici-bas\nC'est la moisson d'en haut\nSelon ce que nos travaux,\nBien ou mal, il viendra,\nLe jour où tu verras\nCette fois, ta moisson croissera.\n\n2.\t\nSi tu veux semer pour la chair\nContenant ses passions,\nTa moisson sera corruption\nEt tourment de l'enfer.\n\n3.\t\nPourquoi semerais-tu le mal\nEt la méchanceté?\nQuand tu sèmes pour le péché\nLe sort sera fatal.\n\n4.\t\nSi tu sèmes la charité\nPar la foi en Jésus-Christ,\nTa moisson sera le salut\nEt la félicité.\n\n5.\t\nCessez de semer pour la chair\nCar tu vas à la mort.\nLe semence assure le sort\nJésus ou Lucifer.",
