    title: 'Priez sans cesse',
    lyrics:
      "1.\t\nPriez toujours, priez sans cesse\nPriez le Seigneur entendra\nIl est fidèle à sa promesse\nPriez, priez, Il répondra.\n\n2.\t\nPriez si vos coeur se déchirent\nLa main qui blesse guérira\nIl entend tous ceux qui soupirent\nIl a souffert, Il guérira!\n\n3.\t\nPriez dans la fournaise ardente\nQuand Satan gronde autour de vous\nJésus sait calmer la tourmente,\nPriez, triomphez à genoux.\n\n4.\t\nPriez, priez lorsque le doute\nObscurcira votre horizon!\nPriez! Jésus connaît la route,\nIl ouvrira votre prison.\n\n5.\t\nPriez pour rendre témoignage\nPriez pour confesser Jésus\nDieu bénira votre langage\nPour sauver les pécheurs perdus.\n\n6.\t\nPriez quand votre âme hésitante\nNe sais où choisir son chemin\nMême à travers la mer brillante\nJésus vous tiendra par la main.\n\n7.\t\nPriez si votre ciel est sombre\nSi vous tremblez devant la mort!\nJésus vous couvrant de son ombre\nVous ouvrira les portes d'or.",
