    title: 'Kantik Spésial',
    lyrics:
      '1.\t\nLè Jézu rélé-m, lè Jézu rélé-m\nMa répon-n Li, ma répon-n Li.\nLè Li rélé-m, rélé-m  (ter)\nMa répon-n Li.\n\n2.\t\nSégnè jézu mouin vlé sèvi Ou\nSégnè Jézu mouin vlé sèvi Ou\nMouin vlé sèvi Ou, sèvi Ou  (ter)\nTout tan nan vi mouin.\n\n3.\t\nDépi lontan mouin té pèdi\nPèson-n pat ouè-m bézouin sové\nBézouin sové, sové  (ter)\nAn ba min Satan.\n\n4.\t\nGloua a Jézu ki  té jouin-n mouin\nNan gran chémin san souti-in min’m\nLi té jouin-n mouin, jouin-n mouin (ter)\nLè-m té san souti-in. \nAmen.',
