    title: 'Jésus est ressuscité',
    lyrics:
      "1.\t\nPour nos péchés Christ a été brisé\nIl a souffert sur la Croix\nMais Il est Celui qui vit pour toujours\nIl ne meurt qu'une seule fois.\n \nChoeur\nAlléluia, Alléluia,\nJésus est ressuscité.  (bis)\n\n2.\t\nO Mort où est ta victoire?\nOù est ton pouvoir angoissant?\nPour toujours Satan a été dompté\nJésus-Christ est triomphant.\n\n3.\t\nDevant le Père Il intercède,\nIl est notre Médiateur,\nBientôt Il viendra nous prendre\nDans la céleste demeure.\n\n4.\t\nVenez, donc, chanter ses louanges,\nIl est vainqueur de la mort,\nIl est mort pour sauver les pécheurs\nMais Il est vivant encore.",
