    num: 27,
    title: 'Minuit chrétiens',
    lyrics:
      "1.\t\nMinuit, chrétiens, c'est l'heure solennelle\nOù l'homme Dieu descendit jusqu'à nous\nPour effacer la tâche originelle\nEt de son Père arrêter le courroux.\nLe monde entier tressaille d'espérance,\nA cette nuit qui lui donne un Sauveur;\nPeuple, à genoux! Attends ta délivrance,\nNoël, Noël! Voici le Rédempteur,\nNoël, Noël! Voici le Rédempteur.\n\n2.\t\nDe notre foi que la lumière ardente\nNous guide tous au berceau de l'Enfant\nComme autre fois une étoile brillante\nY conduisit les chefs de l'Orient.\nLe Roi des rois naît la dans une humble crèche.\nPuissants du jour, fiers de votre grandeur,\nA votre orgueil c'est de là qu'un Dieu prêche\nCourbez vos fronts devant le Rédempteur.\n\n3.\t\nLe Rédempteur a brisé toute entrave;\nLa terre est libre et le ciel est ouvert.\nIl voit un frère où n'était qu'un esclave,\nL'amour unit ceux qu'enchaînait le fer.\nQui leur dira notre reconnaissance?\nC'est pour nous tous qu'Il naît,\nQu'Il souffre et meurt;\nPeuple debout! Chante ta délivrance,\nNoël, Noël! Chante le Rédempteur,\nNoël, Noël! Chante le Rédempteur!",
