    num: 33,
    title: 'Un parfait séjour',
    lyrics:
      "1.\t\nUn parfait séjour de gloire et de lumière\nT'es préparé, mon âme: c'est dans le ciel,\nLà-haut, tout effroi, toute douleur amère\nSe changeront en bonheur saint, éternel.\n\nChoeur\nJe vais au paradis de gloire,\nAu pays de parfait bonheur; \nLà tout est douceur,\nAlléluia! Gloire à mon Sauveur.\n\n2.   \nDans ce beau pays, plus de mort, mais la vie\nPlus de péché, car là tout est pureté,\nL'Enfant de Dieu c'est l'unique patrie\nLà sont comblés tous nos voeux de sainteté.\n\n3.   \nJe retrouverai dans la gloire immortelle\nCeux qu'ici-bas j'ai si tendrement aimés,\nEt tous, couronnés d'allégresse éternelle\nNous te louerons, Seigneur Jésus, pour jamais.\n\n4.\t\nPourquoi donc, ô Dieu tant de bonheur suprême\nDe paix et d'amour dans ce céleste lieu\nC'est que sur la croix Jésus s'offrit Lui-même\nPour me donner le beau paradis de Dieu.\n\n5.\t\nLe pécheur lavé dans le sang du Calvaire\nIci-bas même connais déjà le ciel\nGloire à Toi, Jésus, mon Sauveur et mon Frère\nThème parfait des cantiques éternels.",
