    title: 'Gnou vi pou Jézu',
    lyrics:
      '1.\t\nGnou vi pou Jézu bay la pè\nKon gnou riviè ki pa rété\nDifikulté yo kon-n vini\nÉ Jézu la é sa  sufi.\n\nKè:\nÉdé-m sèvi Ou plus chak jou\nPou-m rété toujou avèk Ou\nM-rinmin Ou Kris plus ké janmin\nTanpri pa kité-m égaré.\n\n2.\t\nGnou vi pou Jézu bay répo\nLi ouété nan mouin sa ki fo\nParòl li sé la vérité\nLa gidé-m pou létènité.\n\n3.\t\nGnou vi pou Jézu bay la joua\nDèské-m sové pa la foua\nZanmi yo mèt abandon-nin’m\nJézu fidèl, Li va kinbé-m.\n\n4.\t\nGnou vi pou Jézu bay viktoua\nAk fòs li m-maché pa-za-pa\nKris té vink diab, lé mon, la chè\nKounié ya mouin plus ké vinkè.',
