    num: 48,
    title: 'Jézu pa louin',
    lyrics:
      '1.\nJézu pa louin pou Li vini\nSa ouap tan-n pou ou préparé\nÈské Jézu pa té di ou\nLap vini tankou gnou vòlè\nSi ou té konnin lè L-ap vini\nOu ta lonjé pié ou jan ou vlé\nAprè sa nou ta préparé pou-n tan-n\nJézu O, O, O, O.\n\nKè:\nPuiské nou pa konnin ki lè\nBon Sovè-a pral rétounin  (bis)\nAn nou jété tout vié péché\nAn nou lagé tout vié plézi-I\nAn nou prié, an nou véyé, Kris pral vini.\n\n2.\nGnou nasion va kont gnou nasion\nGnou rouayòm va kont gnou rouayòm\nMin-m légliz va kont lòt légliz\nMan-man, papa va kont pitit\nLè na ouè tout bagay sa yo\nKonnin Jézu prèt pou vini\nAn nou prié, an nou véyé,\nKris pral vini, O, O, O, O.\n\n3.\nYo va di min Li nan mòn nan\nYo va di min-L nan valé-a\nYo va di min Li nan lé Nò\nYo va di min Li nan lé Sud\nMin-m si yo fè zétoual désan-n\nMin-m si yo fè difé so-t nan sièl\nPa fè a douat, pa fè a goch\nAn-n résté fèm, O, O, O, O.',
