    title: 'A rébò gnou chémin',
    lyrics:
      '1.\nA rébò gnou chémin ki minnin Jériko;\nJézu té rankontré gnou mandian\nGnou vié rad sou li tou dé jél té fèmin,\nÉ li tap mandé charité.\n\nRéfrin:\nJézu té di: «Ou mèt alé! » (bis)\nDépi min-m lè-a li ouè.\n\n2.\nLè ou gadé nan Jan chapit 8, vèsè 12\nJézu di sé limin-m ki limiè,\nMoun ki suiv li pap jan-m maché\nNan noua ankò.\nMin li va gin limiè é la vi.\n\n3.\nParòl mouin sé gnou lanp \nNan pié ou si ou suiv mouin\nGnou limiè nan kè nou pou tout tan\nMoun ki suiv mouin \nPap jan-m maché nan fènoua ankò\nMin li va limiè é la vi.',
