    lyrics:
      "1.\nÉcoutez, frères,\nJésus vous appelle,\nLe temps est court,\nLa tâche inachevée;\nRéveillez-vous,\nProclamez son message,\nCherchez les âmes –\nIl veut les sauver.\n\nChoeur:\nEn avant, frères,\nSans plus tarder,\nMenons à bonne fin\nLa tâche inachevée.\n\n2.\nVoici des milliers\nD'âmes qui périssent\nCaptives dans\nLes chaînes du péché,\nSans le message\nD'amour et de grâce\nEn Jésus-Christ\nQui veut les libérer.\n\n3.\nProclamons à\nToute peuple, toute nation\nQue Jésus-Christ\nEst mort, ressuscité:\nAu gré de notre Maître\nPour accomplir\nLa tâche inachevée.",
