    language: 'fr',
    lyrics:
      "1.\t\nSeigneur à Tes pieds me voici\nTremblant, humilié.\nJe suis rouge d'un noir souci\nPitié Seigneur, Seigneur pitié.\n\n2.\t\nVeuille abaisser tes yeux sur moi\nJe pleure mon péché\nHélas j'ai méprisé ta loi\nPitié Seigneur, pitié.\n\n3.\t\nDevant ta justice O Seigneur\nJe me sens accablé\nTout m'accuse et surtout mon coeur\nPitié Seigneur, pitié.\n\n4.\t\nL'enfer m'épouvante grand Dieu\nCar je l'ai mérité\nSatan veut m'avoir en son lieu\nPitié Seigneur, pitié.\n\n5.\t\nO ciel, O fortune séjour\nMe serais-je fermé\nPardonne au nom de ton amour\nPitié Seigneur, pitié.\n\nAmen,  Amen,  Amen.",
