    title: 'Abondans la vi',
    lyrics:
      '1.\t\nNan Kris é nan Li sèl, n-a jouin-n vrè la vi\nSé gras a Li, vié natu a mouri,\nLi rachté mouin nèt, ni kò, nan-m, ni léspri\nMap viv, min pa mouin-min’m, sé Jézu-Kri.\n\nKè:\nAbondans la vi, mapé jouin-n nan Li,\nL-a transfòmé mouin, pou-m sèvi Li byin,\nSan Li té rachté mouin;\nLi ban mouin Léspri-Sin,\nSé nan Jézu gin abaondans la vi.\n\n2.\t\nSé Sint-Éspri ki fè-m aksépté Jézu,\nLi fè-m konfié nan promès Bon-Dieu tou.\nDé gloua an gloua Lap chanjé-m nan imaj Li\nAmou Li dévlopé pi plus chak jou.\n\n3.\t\nDlo a ki nan sous la vi ap débòdé,\nÉ sé li ki pòté bénédiksion.\nSé la vi an abondans L-ap transpòté,\nLi bay lamou, la joua, pè ak padon.',
