    title: 'Lè-m nan problèm yo',
    lyrics:
      '1.\nLè-m nan problèm yo map chanté pou Kris\nLè-m nan doulè yo map chanté pou Li\nLè-m nan tristès yo mouin rélé Jézu\nKa Li tou édé-m.\n\nKè:\nOui Kris toujou la, pou Li tandé mouin\nPou Li édé mouin, \nÉ pou-L ban mouin la vi.    (bis)\n\n2.\nNan mitan la nuit mouin pa jan-m tou sèl\nNinpòt koté mouin yé, Li toujou la avè-m,\nAla gnou bon Papa ki rinmin-m tout bon\nMouin vlé soufri pou Li.\n\n3.\nOu min-m zanmi mouin vini jouin-n Jézu\nLi gingnin répo pou kè fatigé\nSi Li kinbé min ou, ou pap jan-m tonbé,\nOu va gingnin la vi.',
