    title: 'Je me rappelle un jour, où dans le ciel je vis',
    language: 'fr',
    lyrics:
      "1.\nJe me rappelle un jour, où dans le ciel je vis\nLe livre dans lequel, tout péché est écrit\nJe vis mon nom très clair\nJe dis mon Dieu que faire?\nEn tombant à ses pieds, je réglai mon affaire.\n\nChoeur\nA l'instant,  (bis)\nOui le vieux compte fut réglé a l'instant,\nJe ne suis plus effrayé, \nMa dette est déjà payée\nEt mon compte avec mon Juge est tout réglé.\n\n2.\nMon compte était très lourd\nEt grandissant toujours\nO j'étais égaré, pêchant plus chaque jour.\nMais quand mes yeux s'ouvrent\nEt je vis mon état,\nJe me jetais aux pieds du Sauveur a l'instant.\n\n3.\nAu jour du jugement, devant le trône blanc,\nQuand tous les morts viendront\nLes livres s'ouvriront\nEt quand on cherchera, mon nom n'y sera pas\nCar Jésus l'a écrit, au livre de la vie.\n\n4.\nO pêcheur viens à Lui\nMets-toi en règle aussi\nEt fais-le aujourd'hui, car l'occasion s'enfuit\nIl te pardonnera, si tu fais comme moi\nEn venant à ton Sauveur\nTu fais de Lui ton Roi, a l'instant.",
