    title: 'Bon-Dieu voyé pitit li',
    lyrics:
      '1.\nBon-Dieu voyé pitit li, rélé-l Jézu\nKi té vini é padoné\nLi rachté nou, é Li mété nou lib\nKounyé-a la, Li ak Papa-L lapé tan-n nou.\n\nKè:\nMouin konnin-L vivan\nMap konté sou démin\nPaské-L vivan, inkiétud mouin alé\nPaské-m konnin, O m-konnin\nLi sé tout la vi mouin\nMap konté jou pou-L vi-n chèché-m;\nPaské-L vivan.\n\n2.\nMouin aksépté tout sa ki rivé mouin\nPaské Sovè-m kap défan-n mouin\nJoudin-an mèt dévan-m\nKè mouin pap boulvèsé\nPaské Jézu-m nan pa mouri, min Li vivan.\n\n3.\nSèl éspoua mouin sé sou Li sèlman\nPaské-l di mouin lap vi-n chèché-m\nÉprèv nan la vi sa pap fè-m douté dutou\nBon-Dieu-m nan gran é Li vivan map tan-n Li.',
