    lyrics:
      "1.\t\nL'Éternel seul est Seigneur  (bis)\nSeul Il est dominateur  (bis)\nSur les peuples de la terre\nIl est maître Souverain\nMaître des ouvrages que sa main\nPour sa gloire a voulu faire.\n\nChoeur\nSeigneur Éternel – \nPuissant Créateur\nNous te louons, Amen\nNous t'adorons, Amen.\n\n2.\t\nMais quel bienheureux mortel  (bis)\nAu saint nom de l'Éternel  (bis)\nAura le droit de paraître\nEt quel ô Puissant\nSeigneur pour demeurer avec Toi\nAssez juste pourrait être?\n\n3.\t\nC'est l'homme qui dans son coeur  (bis)\nPar Ton Esprit ô Seigneur  (bis)\nHait du péché les souillures\nQui fuyant la fausseté\nToujours te sert en sincérité\nLevant à Toi des mains pures.",
