    lyrics:
      "1.\t\nPour être heureux dans la vie\nPour être heureux tous les jours\nPour avoir la paix bénie\nIl faut Jésus-Christ toujours.\n\nChoeur\nSur son coeur douce retraite\nHeureux qui veut se cacher\nIci la douleur s'arrête\nJésus est le bon Berger.\n\n2.\t\nSi l'orage se déchaîne\nJe ne crains pas sa fureur\nCar de sa brebis en peine\nIl veux calmer sa frayeur.\n\n3.\t\nSi vos larmes sont amères\nSi vous êtres seuls souffrants\nLa Victime du Calvaire\nPrendra sur Lui vos tourments.\n\n4.\t\nVenez au Christ qui console\nEt qui sauve le pécheur\nOn apprend à son école\nLe chemin du vrai bonheur.",
