    title: 'Map kalkulé-m gnou jou',
    lyrics:
      '1.\t\nMap kalkilé-m gnou jou\nNan sièl la ma ouè sa\nAn dédan tout liv sa yo\nTout péché té ékri\nMouin ouè non mouin é kri trè klè\nMouin di mon Dié kè fè-m\nMin-m vini tonbé nan pié Sovè-m\nPou-m réglé zafè mouin.\n\nKè\nA linstan koun yé a  (bis)\nOui tout vié péché-m yo parèt a linstan\nMouin pa gin angnin pou mouin pè\nDèt mouin yo déja péyé\nÉ péché avèk jujman-m té tou réglé.\n\n2.\t\nSa mouin té fè té trò\nYo ta grandi toujou\nLè sa-m té égaré\nPé ché-m tap plis chak jou\nMin kan jé-m vi-n louvri\nMouin vi-n jété-m nan pié\nNan pié Ségnè Jézu.\n\n3.\t\nJou jujman va vini\nDévan gnou tròn ki blanche\nKan tout lè mò vini\nPou yo louvri liv yo\nKan yo vap chaché non-m\nNon pa mouin pa-p la\nKa Jézu té inskri-l\nNan liv dé la vi.\n\n4.\t\nPéchè vi-n Jouin-n Jézu\nMété ou an règ ak Li\nÉ fè sa koun yé a\nKa okazion sa pralé\nÉ lap padonnin ou\nSi ou fè kòm mouin min-m\nLè ou vi-n jouin-n Jézu\nOua fè-l tounin Roi ou.\n\n5.\t\nAnfan, jè-n é vié-a\nPa di ou ansi-in pasé-m\nLoguèy sé don Satan\nJézu di Simon-Piè\nSatan ap chaché kriblé-ou\nDésan-n pou sa monté\nKréti-in fòk ou dépouyé-ou\nPou kab sanblé ak Jézu.',
