    title: 'Mouin gingnin gnou zié kap véyé',
    lyrics:
      '1.\nMouin gin gnou zié kap véyé sou mouin\nMin-m si yo pa ouè pèson-n\nMouin pa bézouin pè ni douté\nPaské Sovè-m ap véyé-m\nLi fè-m promès Li avèk mouin\nTou lè jou juska la fin\nMouin gin gnou zié \nKap véyé sou mouin tou lè jou.\n\n2.\nMouin gin gnou zié kap véyé sou mouin\nKan map monté montagn yo\nMouin gin gnou zié kap véyé sou mouin\nLè map travèsé plèn yo\nLi kon-n lè-m kouché lè-m lévé\nSovè-m nan pa jan-m dòmi\nMouin gin gnou zié\nKap véyé sou mouin tou lè jou.\n\n\n3.\nMouin gin gnou zié kap véyé sou mouin\nMin-m si kò sa va mouri\nLi va alé nan gnou lòt kò\nKapé  préparé pou mouin\nMin-m lè sièl la ta va fè noua\nLi toujou bò boté mouin\nMouin gin gnou zié \nKap véyé sou mouin tou lè jou.\n\n4.\nMouin gin gnou zié kap véyé sou mouin\nMin-m si map maché nan difé\nLi va vlopé mouin nan manto L\nPou flan-m yo kap pa boulé-m\nMouin gin gnou zié kap véyé sou mouin\nMin-m lè la mè-a mové\n\n5.\nMouin gin gnou zié Kap véyé sou mouin tou lè jou\nÉ lè jou sa yo va tèminé, lé mon-n sa va fini\nMap chita pami tout zanj yo\nPou-m loué Bon-Dieu mouin-an\nPou-m rakonté grandè Li\nMouin gin gnou zié \nKap véyé sou mouin tou lè jou.',
