    title: 'Ségnè, tanpri souplé',
    lyrics:
      '1.\nSégnè tanpri souplé, kouté voua pitit ou\nTandé kri kè mouin non, mouin prié Ou\nTantasion, chatiman, oui tou sa nésésè\nMin tanpri souplé kinbé min mouin.\n\nKè:\nGin dé lè mouin santi-m kon-n vlé dékourajé\nLè féblès anvayi léspri mouin\nKinbé min mouin souplé, pa kité mouin tonbé\nSi sé ou ki kinbé-m fò-m rivé.\n\n2.\nLoraj, gro van tanpèt, vlé détounin kè mouin\nÉ souvan zéprèv yo, yo di anpil\nMin mouin konfié-m nan Ou, \nÉ-m konnin m-asuré\n\n3.\nMété fòs ou Ségnè nan féblès mouin souplé\nÉdé mouin, édé-m pou-m pa tonbé\nMouin rémèt nan min Ou,\nKè mouin, kò mouin, nan-m mouin\nSi sé Ou ki kinbé-m ma rivé.',
