    title: 'Souvan nou mandé',
    lyrics:
      '1.\nSouvan nou mandé, sa démin ap poté\nSi sé pa anpil joua, chagrin ou tristès\nSouvan nou pèdu anpil sou avni nou\nSan nou pa min-m pansé si Jézu ak nou.\n\nKè:\nFrè mouin ak sè mouin atansion pa troublé\nKonnin ké avni nou, li nan min Bon-Dieu\nTout sòm la vi-a, lé prézan é lavni\nYo tout byin kalkilé pa Léspri Bon-Dieu.\n\n2.\nNou pa kapab fè angnin pou tèt nou\nSi sé pa min Bon-Dieu ki ap kondui nou\nSi nou vlé gingnin gnou bèl briyant avni\nSèl bagay pou nou fè sé konfié nan Dieu.\n\n3.\nSonjé trè byin Bon-Dieu nou-an puisan\nTout sa ki imposib, ak Li yo posib\nNou doué préparé nou pou retou Jézu-Kri\nPaské Li a la pòt, L-ap vi-n chèché nou.',
