      "1.\nL'Éternel est omnipotent,\nSon Nom est glorieux.\nIl est un Dieu de miracles\nC'est écrit dans les cieux.\n\nChoeur:\nIl fallut un miracle\nPour créer les cieux,\nPlacer en orbite\nLes astres radieux,\nMais pour me délivrer\nDe tous mes péchés\nIl fallut un miracle merveilleux!\n\n2.\nBien que Sa gloire, Sa puissance\nNous soient révélées,\nLes merveilles de Son trône,\nNous sont toujours voilées.\n\n3.\nLa Bible nous parle partout\nDe sagesse infinie,\nChaque oiseau et chaque fleur\nEn est un témoin béni.",
