    lyrics_Markdown: {
      md: "**1.** \n\nJe ne suis qu'un passant \n\nSur cette terre maudite \n\nJe veux aller retrouver mon Père dans le ciel \n\nQui m'attend, qui m'attend \n\nAvec tous les anges, pour chanter sa gloire. \n\n\n\n\n<br/> **Refrain**\n\n**Gloire, Gloire, Alléluia!   (ter)** \n\n**Jésus revient bientôt!** \n\n\n\n<br/> **2.**\n\nLa vie sur cette terre n'est que lutte et misère \n\nDans la cité de gloire, \n\nIl y aura que la paix, la joie \n\nLà, nous serons, \n\nNous serons tous ensemble frères \n\nUnis pour jamais \n\n\n<br/> **3.**\n\nJe veux vous dire amis, l'histoire de mon Jésus \n\nCloué sur une croix, pour vous et pour moi \n\nIl reviendra, reviendra, nous prendre \n\nAvec Lui pour toute la vie. \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Je ne suis qu&#39;un passant </p>\n<p>Sur cette terre maudite </p>\n<p>Je veux aller retrouver mon Père dans le ciel </p>\n<p>Qui m&#39;attend, qui m&#39;attend </p>\n<p>Avec tous les anges, pour chanter sa gloire. </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Gloire, Gloire, Alléluia!   (ter)</strong> </p>\n<p><strong>Jésus revient bientôt!</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>La vie sur cette terre n&#39;est que lutte et misère </p>\n<p>Dans la cité de gloire, </p>\n<p>Il y aura que la paix, la joie </p>\n<p>Là, nous serons, </p>\n<p>Nous serons tous ensemble frères </p>\n<p>Unis pour jamais </p>\n<p><br/> <strong>3.</strong></p>\n<p>Je veux vous dire amis, l&#39;histoire de mon Jésus </p>\n<p>Cloué sur une croix, pour vous et pour moi </p>\n<p>Il reviendra, reviendra, nous prendre </p>\n<p>Avec Lui pour toute la vie. </p>\n'
    },
