    title: 'M’aimant',
    lyrics:
      "1.\t\nM'aimant quand la route est obscure\nJésus s'approche et me rassure;\nIl me conduit par sa main sure \nDans son amour.\n\n2.\t\nM'aimant d'un amour insondable,\nJésus de la gloire ineffable\nM'apporte joie intarissable\nPar son amour.\n\n3.\t\nM'aimant pendant les jours d'orage,\nQuand mon ciel n'est qu'un noir nuage,\nJésus me sauve du naufrage\nDans son amour.\n\n4.\t\nM'aimant dans ce monde où tout passa\nOù tout comme un rêve s'efface.\nDans son coeur Jésus me fait place\nDans son amour.\n\n5.\t\nM'aimant dans la gloire suprême\nDe la crèche à la croix, Il m'aime\nHier, aujourd'hui toujours le même\nDans son amour.\n\n6.\t\nM'aimant oh! Jusqu'à la venue\nQuand Tu descendras sur la nue\nNous chantons l'hymne, l'âme émue\nDe ton amour.",
