    language: 'fr',
    lyrics:
      "-\nOn frappe à la porte de votre coeur,\nDe votre coeur, voulez-vous ouvrir…\nAu Sauveur?\n\n1.\t\nC'est Lui qui frappe à votre porte\nDepuis longtemps Il frappe en vain,\nC'est son amour qu'Il vous apporte,\nOh, voulez-vous ouvrir enfin, voulez-vous?\n\nChoeur\nOh, voulez-vous ouvrir la porte\nEt recevoir, pauvre pécheur,\nLe grand salut qu'Il vous apporte?\nOh, voulez-vous ouvrir vos coeurs au Sauveur?\nOh, voulez-vous ouvrir vos coeurs?\n\n2.\t\nSa douce voix se fait pressante,\nNe remettez pas à demain\nNe prolongez pas son attente,\nCraignez qu'Il passe son chemin.\n\n3.\t\nIl tend vers vous ses mains percées,\nSa voix d'amour insiste tant!\nLaissez-Le, donc, âmes lassées, entrer\nEntrer chez vous en cet instant.",
