    lyrics:
      '1.\nLi touché-m, o Li touché,\nÉ la joua té néyé nan-m mouin\nGnou bagay té pasé kounyé-a m-konnin\nLi touché-m nan gran bonté Li.\n\n2.\nKè mouin té chajé ak fado lou\nPéché ak ront té kouvri mouin\nAlò min Jézu té touché-m\nKounyé-a mouin santi vi-n chanjé.\n\n3.\nDépi-m té jouin-n Sovè béni an\nDépi-L té sové-m é géri-m\nMouin pap janmin suspan-n loué Li\nMap chanté gloua Li étènèlman.\n\n\n\n---\n1.\nÉzaï désan-n bato a\nLétènèl rantré landan-l\nLi maké-l alélouya\nDiab la di-l pa ka rantré.\n\n2.\nLoué, loué gloua a Jézu  (2 foua)\nPéché mouin éfasé\nLoué, loué, loué, Amen, Alélouya.\nLoué Létènèl…Loué Létènèl…',
