      html: '<p><strong>1.</strong> </p>\n<p>Li touché-m, o Li touché, </p>\n<p>É la joua té néyé nan-m mouin </p>\n<p>Gnou bagay té pasé kounyé-a m-konnin </p>\n<p>Li touché-m nan gran bonté Li. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Kè mouin té chajé ak fado lou </p>\n<p>Péché ak ront té kouvri mouin </p>\n<p>Alò min Jézu té touché-m </p>\n<p>Kounyé-a mouin santi vi-n chanjé. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Dépi-m té jouin-n Sovè béni an </p>\n<p>Dépi-L té sové-m é géri-m </p>\n<p>Mouin pap janmin suspan-n loué Li </p>\n<p>Map chanté gloua Li étènèlman. </p>\n<hr>\n<p><br/> <strong>1.</strong></p>\n<p>Ézaï désan-n bato a </p>\n<p>Létènèl rantré landan-l </p>\n<p>Li maké-l alélouya </p>\n<p>Diab la di-l pa ka rantré. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Loué, loué gloua a Jézu  (2 foua) </p>\n<p>Péché mouin éfasé </p>\n<p>Loué, loué, loué, Amen, Alélouya. </p>\n<p>Loué Létènèl…Loué Létènèl… </p>\n'
