    title: 'Nan-m mouin té souaf',
    lyrics:
      '1.\nNan-m mouin té souaf\nMouin pat jouin-n satisfaksion\nPlézi lé mon-n té tronpé nan-m mouin\nMin gnou bon jou \nLè-m tap chèché soulajman\nJézu té di-m vi-n jouin-n répo nan Mouin.\n\nKè:\nOuin mouin té jouin-n li\nBèl sous la vi a\nGras a Jézu ki té mouri pou mouin\nSan Li té koulé sou boua Kalvè ya\nÉ kounié-a li satisfè nan-m mouin.\n\n2.\nLa vi-m té tris lè-m pat konnin Jézu\nM-pat gin éspoua, nan-m mouin té boulvèsé\nMin gras Bon-Die té louvri sous la vi-a\nMouin té jouin-n ladan-l padon é libèté.\n\n3.\nChè zanmi mouin, min pou ki sa ou mizé?\nKouri vini nan bèl sous la vi-a\nFado péché trò lou pou ou pòté\nJézu vlé ba ou répo jodi-a.',
