    lyrics:
      "1.\nUn soir d'hiver, j'étais seule\nDans le ciel de ma fenêtre\nUne étoile qui brille d'un éclat\nÉblouissant les ténèbres\nAlors un homme s'est perché\nLe chemin reconnu\nQue mène à la crèche de Bethléem\nEt proclamant tout ce jour sacré.\n\nRefrain\nUn Sauveur est né, Béni soit ce jour\nIl est le Sauveur, des enfants du Seigneur.\n\n2.\nJ'ai suivi, les bergers\nIls m'ont montré le chemin\nEt j'ai vu l'enfant couché\nSous un lit de froid\nMarie, sa mère Lui sourit\nÉmue, émerveillé et caresse des yeux\nL'enfant qui lui vient de Dieu.\nUn Sauveur est né, béni soit ce jour\nIl est le Sauveur, des enfants du Seigneur.",
