    title: 'Épargne-les Seigneur',
    lyrics:
      "1.\nTous ceux que je courtois, ne veulent pas écouter\nEntendre la douce voix.  Qui voudrait leur parler\nLa vie est bien trop courte.  Nul ne sait si demain\nQu'il ne prendra la route.  Qui marque leur destin.\n\nRefrain\nÉpargne-les Seigneur,  Épargne-les\nC'est le cri de mon coeur, Épargne-les.\nÉpargne-les mon Dieu, Épargne-les\nOh je serais heureux de les voir aux cieux.\n\n2.\nPrisonniers de la terre. Qu'ils sont là si nombreux,\nLe péché qu'ils préfèrent.  A la bonté de Dieu",
