    title: 'Ouapé mandé-m pouki',
    lyrics:
      '1.\nOuapé mandé pouki nou kontan konsa\nNou kontan vré paské nou gin Jézu-Kri\nSé gnou Zanmi ki papé jan-m blié nou\nNan la détrès, nan maladi, \nNan la doulè.   (bis 2 lign)\n\nKè:\nJézu lavé-m, li délivré-m\nLi rétiré-m anba vié péché koté mouin té yé.\n(kè 2 foua)\n\n2.\nMè byin-émé an nou chanté pou Jézu\nLa jénès an nou loué pou Létènèl\nMè frè é sè an nou pa dékourajé (bis 2 lign)\nAn nou kinbé fè-m \nJouk Jézu vini nap kinbé la foua.\n\nKè:\nJézu bon, Jézu bon, Jézu…\nMouin santi-L nan kè mouin, Jézu bon…\nMouin santi-L nan tèt mouin,\nMouin santi-L nan tout kò mouin,\nMouin santi-L nan pié mouin, Jézu bon…\nJézu bon, Jézu bon…Jézu……',
