    title: "Racheté! Que j'aime à l'annoncer",
    lyrics:
      "1.\nRacheté! Que j'aime à l'annoncer,\nLavé dans le sang de l'Agneau,\nMes péchés noirs sont tous effacés,\nJe suis Son fils, né de nouveau.\n\nChoeur:\nSauvé!  Sauvé!\nLavé dans le sang de l'Agneau,\nSauvé!  Sauvé!\nLavé dans le sang de l'Agneau.\n\n2.\nRacheté, joyeux dans le Seigneur,\nQui peux raconter mon bonheur?\nLa présence de mon Rédempteur\nEst la lumière de mon coeur.\n\n3.\nJ'adore Christ Jésus, mon Sauveur,\nJe Le glorifie toujours,\nMon thème est l'amour de mon Seigneur,\nMon espoir, Son prochain retour.\n\n4.\nEt je Le verrai dans Sa beauté,\nMon Roi, qui fait tout mon délice;\nLui qui prépare dans Sa cité\nUne place pour moi, Son fils.",
