    title: 'Partout sur la terre',
    lyrics:
      "1.\nPartout sur la terre\nPortant le salut,\nTous les rachetés\nMarchent avec Jésus,\nAnnonçant au monde\nLe Sauveur puissant.\nLeur cri de victoire:\n«Pour Christ, en avant!»\n\nChoeur:\nOui, partout avec Christ,\nSans crainte et sans peur\nProclamons le salut\nDe notre Sauveur!\n\n2.\nPartout dans le monde\nBeaucoup de pécheurs,\nPour la délivrance,\nViennent au Sauveur;\nJésus les pardonne,\nTransforme leur coeur,\nA chacun Il donne\nL'éternel bonheur.\n\n3.\nPartout sur la terre\nBénissons Son nom,\nRacontons Sa gloire\nParmi les nations;\nAu pécheur rebelle,\nPartout, proclamons\nUne vie nouvelle,\nUn joyeux pardon!",
