    title: 'Travaillons tous pour',
    lyrics:
      "1.\t\nTravaillons tous pour notre Maître\nDonnons lui tout notre coeur\nSoyons prêts à son service\nRépondons à son appel\nTous en Lui soyons unis\nPour le grand travail du ciel\nAnnonçons cette nouvelle\nLe salut de Dieu partout.\n\nChoeur\nTravaillons tous pour notre Maître\nC'est notre but pour toujours\nAllons y sous ses ordres\nMontrons le Sauveur aux autres\nVoici l'appel du Maître\nNotre divin Capitaine\nAllons donc en avant toujours\nAvec amour et vigueur.\n\n2.\t\nSur le chemin du combat\nMarchons toujours par la foi\nEt nous voulons le servir\nSans condition obéir\nIl nous a donné l'exemple.\nD'un soldat fidèle et ferme\nSuivons donc à notre Maître\nDans la vie et dans la mort.\n\n3.\t\nBientôt Jésus notre Maître\nViendra pour nous recevoir\nDans la maison de son Père\nPour toujours sa face et voir\nEt si nous étions ici-bas\nFidèle à le servir\nNous aurons la récompense\nDans la gloire un de ces jours.",
