      md: '**1.** \n\nSou gnou mò-n abandon-né \n\nGnou vié koua té planté \n\nKoté brigan yo gin pou mouri \n\nMin sé sou min-m koua sa-a \n\nJézu mouri pou mouin \n\nPou-m kapab patajé tout gloua. \n\n\n\n\n<br/> **Kè:**\n\n**Yo té kloué Jézu sou la koua** \n\n**É sé la li  té mouri pou mouin** \n\n**Mapé viv nan gloua Li sou tè sa** \n\n**É gnou jou ma va ouè Li nan sièl.** \n\n\n\n<br/> **2.**\n\nPou tou sa kab rivé \n\nSou la koua nan jou sa \n\nMa va toujou gin rékonésans \n\nPaské tout Jézu fè \n\nLi té fè-l nan plas mouin \n\nPou-L ban mouin la vi an abondans. \n\n\n<br/> **3.**\n\nKòm yo touyé Jézu \n\nKité pitit Bon-Dié \n\nÉ yo pa vlé ouè mouin min’m non plus \n\nMin mouin pito suiv Li \n\nNan tout sa kab rivé \n\nPasé tout sa-m ka jouin-n sou tè sa a. \n\n\n<br/> **4.**\n\nMouin té pèdi nan boua \n\nMouin té sal ak péché-m \n\nMouin pat jouin-n pèson vi-n ban-m la min \n\nÉ mouin té fi-n pèdi \n\nJézu ban mouin chémin rout sièl la. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Sou gnou mò-n abandon-né </p>\n<p>Gnou vié koua té planté </p>\n<p>Koté brigan yo gin pou mouri </p>\n<p>Min sé sou min-m koua sa-a </p>\n<p>Jézu mouri pou mouin </p>\n<p>Pou-m kapab patajé tout gloua. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Yo té kloué Jézu sou la koua</strong> </p>\n<p><strong>É sé la li  té mouri pou mouin</strong> </p>\n<p><strong>Mapé viv nan gloua Li sou tè sa</strong> </p>\n<p><strong>É gnou jou ma va ouè Li nan sièl.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Pou tou sa kab rivé </p>\n<p>Sou la koua nan jou sa </p>\n<p>Ma va toujou gin rékonésans </p>\n<p>Paské tout Jézu fè </p>\n<p>Li té fè-l nan plas mouin </p>\n<p>Pou-L ban mouin la vi an abondans. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Kòm yo touyé Jézu </p>\n<p>Kité pitit Bon-Dié </p>\n<p>É yo pa vlé ouè mouin min’m non plus </p>\n<p>Min mouin pito suiv Li </p>\n<p>Nan tout sa kab rivé </p>\n<p>Pasé tout sa-m ka jouin-n sou tè sa a. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Mouin té pèdi nan boua </p>\n<p>Mouin té sal ak péché-m </p>\n<p>Mouin pat jouin-n pèson vi-n ban-m la min </p>\n<p>É mouin té fi-n pèdi </p>\n<p>Jézu ban mouin chémin rout sièl la. </p>\n'
