    title: 'Lè la vi-m sanblé tris',
    lyrics:
      '1.\nLè la vi-m sanblé tris, lè-m chajé ak problèm\nSé sou jenou-m mouin kap jouin-n la joua\nPèson-n sou la tè sa pa kapab édé mouin\nSèlman Ségnè-m kap fè tout pou mouin.\n\nKè:\nOu min-m ki di frapé é ou va louvri\nOu min-m kap vi-n chèché-m pou mal nan sièl\nSonjé mouin chè Jézu nan rout  la vi sa\nOh sonjé mouin, sonjé mouin souplé.\n\n2.\nTout bagay sou la tè va pasé zanmi mouin\nParòl Bon-Dieu ki va la toujou\nOu min-m ki toujou gin tan vini jouin-n Li\nFè atansion pou-l pa ta pou ou.\n\n3.\nAné yo pasé vit tan yo fini si kout\nSign yo vlé ki ké ou ap vini\nOu min-m kap sèvi Kris an nou suiv Li chak jou\nTa lè konsa lap vi-n chèché ou.',
