    lyrics:
      '1.\nJézu sé ou sèl ki fòs mouin\nPouki sa ou abandoné mouin\nChak jou-m lévé mapé krié\nLouvri jé ou pou ouè mizè mouin.\n\nKè:\nNan ou min-m ki gingnin la vi\nPouki sa mouin min-m map souri\nKounié-a mouin prèt pou-m mouri\nPa kité-m péri souplé.\n\n2.\nDlo nan jé-m sèvi-m nouriti\nÉ-m konnin ou gin tout pouvoua\nRétiré sak pa bon nan mouin\nPou-m kapab sèvi ou Ségnè.\n\n3.\nSi sé péché-m ki fè map soufri\nMouin vini mandé ou padon\nO bon Sovè di gnou mo pou mouin\nPou-m pa ront dévan énmi-m yo.\n\n4.\nZanmi mouin Jézu ap rélé ou\nDé bra Li louvri lap tan-n ou\nPa kité Satan touyé ou\nVini Li va ba ou la vi.',
