    title: 'Dieu tout puissant',
    lyrics:
      "1.\nDieu tout puissant\nQuand mon coeur considère\nTout l'univers\nCréé par Ton pouvoir;\nLe ciel d'azur,\nLes éclairs, la tonnerre\nLe clair matin\nOu les ombres du soir…\nDe tout mon être,\nAlors, s'élève un chant:\n«Dieu tout puissant,\nQue Tu est grand!» (bis 4 lignes)\n\n2.\nMais quand je songe,\nO sublime mystère!\nQu'un Dieu si grand\nA pu penser à moi;\nQue Son cher Fils\nEst devenu mon frère,\nEt que je suis\nL'héritier du grand Roi…\nAlors mon coeur\nRedit, la nuit, le jour:\n«Que Tu es bon,\nO Dieu d'amour!» (bis 4 lignes)\n\n3.\nQuand mon Sauveur,\nÉclatant de lumière,\nSe lèvera de Son trône éternel,\nEt que, laissant\nLes douleurs de la terre,\nJe pourrai voir\nLes splendeurs de Son ciel…\nJe redirai, dans Son divin séjour:\nRien n'est plus grand\nQue Ton amour! (bis 3 lignes)",
