    title: "Car Dieu m'a tant aimé",
    lyrics:
      "1.\nCar Dieu m'a tant aimé\nQu'Il a pour moi donné\nSon Fils pour me sauver\nDe la mort, du péché!\nMaintenant, quel bonheur\nGloire à mon Libérateur!\n\n\n2.\nGardé par Son amour,\nJe vais de jour en jour,\nJoyeux, chantant toujours,\nAttendant Son Retour.\nMaintenant, quel bonheur!\nJésus vit dans mon coeur!\nGloire à mon puissant Sauveur.\n\n\n3.\nBientôt, alléluia!\nEnfin Il reviendra.\nJésus m'enlèvera,\nAvec Lui me prendra.\nAlors, parfait bonheur,\nJésus sera Vainqueur.\nGloire à mon Grand Triomphateur.",
