    title: 'Un parfait Sauveur',
    lyrics:
      "1.\nUn parfait Sauveur est ici qui t'invite\nA te jeter dans ses bras\nD'un salut parfait, Il t'acquit le mérite\nTu n'as qu'à faire un seul pas.\n\nRefrain\nUn seul pas, un seul pas, et Jésus te recevra\nUn seul pas, jette-toi dans ses bras\nCeux qu'Il affranchit sont entièrement libres\nTu n'as qu'à faire un seul pas.\n\n2.\nC'est Lui, c'est Lui seul qui peut briser les chaînes   \nDes esclaves de Satan                   \nDes larmes à ses pieds ne sont jamais vaines\nJésus pardonne à l'instant\nPense aux pas nombreux qu'Il fit à ta rencontre\nIl marcha jusqu'au trépas                 \nMais pour te livrer à l'amour qu'Il te montre\nIl ne te reste un seul pas.",
