      md: '**1.** \n\nNan gran jou la rézurèksion \n\nLè tronpèt Bon-Dieu va son-nin \n\nNa lévé alélouya, na lévé \n\nNa rankontré ak Sovè béni \n\nPi gran éspérans nou gingnin \n\nNa lévé alélouya, na lévé. \n\n\n\n\n<br/> **Kè:**\n\n**Na lévé alélouya, na lévé, amè-n na lévé…** \n\n**Nan gran jou la rézurèksion** \n\n**Lè pò prizon la mò krazé** \n\n**Na lévé alélouya, na lévé.** \n\n\n\n<br/> **2.**\n\nNan gran jou la rézurèksion \n\nKi pral pi bèl gran réunion \n\nNa lévé alélouya, na lévé \n\nAk paran nou, frè nou ak sè nou \n\nKi té chaché lé vrè padon \n\nNa lévé alélouya, na lévé. \n\n\n<br/> **3.**\n\nNan gran la rézuréksion \n\nNa va jouin-n ak Kris an lè ya \n\nNa lévé alélouya, na lévé \n\nLa poté jouk mouin tou nan la gloua \n\nÉ tout bagay va aranjé \n\nNa lévé alélouya, na lévé \n\n\n',
