    title: 'Dépi-m vi-n jouin-n ak Jézu',
    lyrics:
      '1.\nDépi-m vi-n jouin-n ak Jézu\nLa vi mouin vi-n chanjé\nMouin pa maché min-m jan ankò\nAnpil zié sé sou mouin\nJézu réstoré la vi-m\nMouin kité lòt ouè sa\nTou vlé suiv min-m tras avèk mouin\nPaské Jézu nan mouin.\n\nKè:\nMap chanté paské-m kontan\nMap chanté paské-L sové-m\nLavi-m chanjé konplètman\nMouin vi-n gnou moun nouvo.\n\n2.\nTout éspoua-m nan la vi sa\nSé pou mal jouin-n Jézu\nKi té mouri pou mouin\nLi ki té ban-m la vi\nJou yo pa tèlman si louin,\nProfési yo ap akonpli\nAn nou luté pou nou ouè Li\nNan gran jou jujman-an.  (bis)',
