    title: "Quand le mal t'assaille",
    lyrics:
      "1.\nQuand le mal t'assaille,\nSubtil et caché,\nDresse une muraille,\nDevant le péché;\nAu propos infâme\nNe cède jamais,\nOh! Garde ton âme\nDu monde mauvais.\n\nChoeur:\nCherche l'appui du Maître,\nSoumets-Lui tout ton être;\nAlors tu pourras être,\nPartout plus que vainqueur.\n\n2.\nRésiste à l'étreinte\nDe l'impureté,\nVis toujours sans crainte\nDans la sainteté\nContre tous les vices,\nLutte vaillamment,\nEt qu'en Christ tu puisses\nVaincre constamment.\n\n3.\nFuis la route sombre\nDu plaisir trompeur,\nCar là git dans l'ombre\nLe grand tentateur:\nQui perd sa victime,\nEn la conduisant\nVers le sombre abîme,\nL'enfer effrayant.\n\n4.\nChasse à l'instant même\nTout regard impur,\nEt que Dieu qui t'aime\nSoit ton abri sûr;\nQuand, dans ta faiblesse,\nTu crois succomber,\nRegarde sans cesse\nAu Christ, bon Berger.",
