    tags: [''],
    total_views: 8,
    _id: '56f1b82eef5d7bda928377b2',
    num: 31,
    title: 'Je n’aurai point de disette',
    lyrics:
      "1.\t\nJe n'aurai point de disette\nChrist est mon Berger\nSous sa divine houlette\nIl n'est nul danger\nDans ses riches pâturages\nChaque jour nourrit\nSous des bienfaits ombrages\nJe suis à l'abri.\n\nChoeur\nQuel Berger tend et fidèle\nGardé par sa main\nLe long du chemin\nJusqu'en la vie éternelle\nA l'abri sous son aile\nQuel repos divin.\n\n2.\t\nLe long des aimables rives\nDes calmes ruisseaux\nDes paisibles eaux\nIl nourrit mon âme avide\nDu céleste pain\nEn son nom l'Esprit me guide\nDans un sûr chemin.\n\n3.\t\nEt dans la sombre vallée\nIl est mon gardien\nSa grâce m'est assurée\nJe ne craindrai rien\nSa présence et sa parole\nChassent la frayeur\nEt sa houlette console\nDe tout douleur.\n\n4.\t\nAux regards remplis de crainte\nDe mes ennemis\nIl dresse une table sainte\nOù je suis admis\nPar Lui ma couple est remplie\nDivine faveur.\nSon Esprit me sanctifie,\nEt garde mon coeur.\n\n5.\t\nSa grande miséricorde\nSon divin secours\nSes riches biens Il m'accorde\nAinsi touts les jours\nBientôt ineffable, grâce et fidélité\nDans son ciel j'aurai ma place\nPour l'éternité.",
