    title: 'La foi',
    lyrics:
      "1.\t\nLa foi fait tomber sous nos yeux,\nLes plus fortes murailles,\nLa foi nous rend victorieux,\nEt gagne les batailles;\nLa foi nous ouvre les trésors,\nDe la toute puissance\nLes plus faibles deviennent forts\nSous sa sainte influence.\n\nChoeur\nPar l'Esprit du Seigneur\nPar Christ le Rédempteur\nPar notre Dieu Sauveur\nCombattons pleins d'ardeur.\n\n2.\t\nProtégés par ce bouclier,\nNous n'avons nulle crainte;\nQui sait en Dieu se confier,\nDu mal brave l'atteinte.\nQue n'ont pas souffert les héros,\nDont nous suivons la trace\nQue de dangers, que de travaux,\nMais quelle sainte audace\n\n3.\t\nQue leur victoire et leurs combats\nEnflammant notre zèle\nCroyons et courons sur leurs pas;\nNotre Chef nous appelle.\nQuand la foi vit au fond du coeur\nEt nourrit l'espérance\nOn est par l'amour du Sauveur\nJoyeux dans la souffrance.",
