    title: 'Adeste fideles',
    lyrics:
      "1.\t\nViens, âmes fidèle! Joyeuse nouvelle!\nAuprès de la crèche prosterne-toi:\nVoici l'Enfant qu'ont salue les anges.\nViens chanter ses louanges,\nViens chanter ses louanges,\nIl est ton Roi.\n\n2.\t\nA Lui notre hommage! Dans notre esclavage\nIl vient pour nous rendre la liberté.\nChante et bénis, réveille-toi, mon âme;\nQue tout en moi proclame,\nQue tout en moi proclame,\nQue tout en moi proclame sa charité.\n\n3.\t\nDevant la faiblesse où Jésus s'abaisse\nJ'adore et je chante son grand amour.\nOui, ton amour, Sauveur tendre et fidèle,\nPour nous se renouvelle,\nPour nous se renouvelle,\nPour nous se renouvelle, de jour en jour.\n\n4.\t\nSauveur débonnaire, à Toi la prière,\nL'ardente prière de notre coeur.\nRègne sur nous, oui, règne d'âge en âge;\nA Toi notre humble hommage,\nA Toi notre humble hommage,\nA Toi notre humble hommage, \nJésus, Seigneur!",
