    lyrics:
      '1.\tSégnè Bon-Dié lè nan la nuit sou tè-aMouin ouè zétoual, sa yo ké ou té fèMouin tandé loraj, mouin ouè zéklè-aYo tout déklaré pouvoua ou gingnin.Kè:Nan-m mouin chanté nan ou Bon-dié puisanA la Ou gran, a la Ou gran (bis 2 lign)2.\tLa nui lè map maché nan boua déyò-aMouin tandé zouazo yo ap chanté nan bouaLè mouin anro gnou montagn ki biin ro-aMin-m dlo ap palé dé Dié avèk joua.3.\tLè mouin sonjé Bon-Dié, Papa, ki ba nouSèl Pitit ou, ki vini pou mouriTout roua pasé gnou Roua poté gnou kourònPikan pou nou tout, ki té doué pèdi.4.\tLè Kris vini nan la gloua ak tout zanj yoMouin va ouè tout grandè majésté LiÉ nan-m mouin va mélé ak tout akanj yoÉ ma tonbé biin ba pou-m adoré-L.',
