    title: 'Gnou jou m-té pèdu',
    lyrics:
      '1.\nGnou jou m-té pèdu nan chémin an\nMouin pa té kab konnin ki koté m-doué alé\nMin gnou Non-m té vini pran min mouin\nÉ Li té kondui mouin koté dlo a byinfré.\n\nKè:\nJézu sé Roua, Jézu sé Roua\nJézu sé Roua dè roua\nLap vi-n chèché mouin\nPou-m alé nan sièl la\nJézu sé Roua dè roua.\n\n2.\nDépi jou min-L té pozésou mouin\nLa vi mouin té chanjé\nÉ nan-m mouin té vi-n lib\nNan kè mouin toujou gingnin gnou chan\nKi témouayé grandè amou Li pou mouin.\n\n3.\nA la gnou si gran jou sa va yé, lè Jézu va vini\nPou pran mouin avèk ou\nAnpil moun va di, Sègnè, Ségnè\nMin yo pap kab antré nan bèl  vil Sélès la',
