    lyrics:
      '1.\nMouin gin éspoua\nGnou jou pou-m fi-n soufri\nÉ jou sa-a li louin pou li vini\nFrè-m ak sè-m yo\nÉdé-m nan priè nou\nAfin pou-m saka rankontré Jézu.\n\nKè:\nJézu sé rézon kè mouin\nMouin vlé suiv li jouk la fin\nJou sa ma ouè Li fas a fas\nJézu sé tout pou mouin.\n\n2.\nLi pran min mouin\nLi ouété-m nan ténèb yo\nÉ kounié ya mouin vlé résté pou non Li\nRout la fè noua\nLi apik épil glisé\nMin-m doué konnin fòk Jézu-Kri sé tout.',
