    title: 'Ou ouè tribilasion-m',
    lyrics:
      '1.\nOu ouè tribilasion-m Ségnè Jézu\nOu konnin mizè mouin\nSi ou lagé-m, O ki moun ki pral konsolé-m\nMouin tankou gnou òfélin, O, O,\nNan gnou mon-n si méchan\nOu sé sèl éspoua ké mouin gingnin\nTanpri Ségnè sové mouin.\n\nKè:\nMouin prié ou lé matin\nMouin rélé ou a midi\nÉ mouin prié ou a souè\nMap chèché gnou sékou ki pa kapab vini\nMouin prèt pou mouin mouri\nPou ki sa ou abandoné-m Jézu\nGin pitié pou mouin.\n\n2.\nPou tan nan mon-n sa, gin moun ki trè alèz\nKi pa min-m konnin Bon-Dieu\nMoun pa kap sèvi ou-o, yo toujou méprizé\nPa kité mouin troublé, O,\nPou bagay nan mon-n sa-a\nKa-m konnin min-m si mouin maléré\nGnou jou ouap vi-n chèché-m.',
