    title: "Répondant à l'appel",
    lyrics:
      "1.\nRépondant à l'appel\nDe Jésus mon divin Maître,\nAvec Lui je suis sorti\nDu pays du malheur;\nDélivré par Son pouvoir,\nJe ne veux plus connaître,\nQue la grâce et l'amour\nDe mon Sauveur!\n\nChoeur:\nJ'ai trouvé, bien loin du monde,\nUn abri paisible et sûr;\nIci le bonheur abonde,\nSous un ciel toujours d'azur!\nOh, oui, je veux dresser ma tente,\nDans ce pays merveilleux,\nEt toujours vivre\nPlus près de Dieu!\n\n2.\nBien au loin j'entends l'écho\nDes vains bruits de la terre,\nL'écho triste et douloureux\nD'un monde révolté;\nMais désormais mon seul bien\nC'est la croix du Calvaire,\nC'est Jésus, Sa gloire, Sa vérité!\n\n3.\nPar la ruse et les menaces,\nVoulant ma défaite,\nSatan vide contre moi\nSon infâme carquois,\nMais Dieu m'offre en Sa Parole\nUne sûre retraite,\nEt pour Capitaine, le Roi des rois!",
