    lyrics:
      "1.\t\nSi du péché tu veux être délivré\nRegarde à l'Agneau de Dieu;\nPour toi sur la croix Il a tout payé\nRegarde à l'Agneau de Dieu.\n\nChoeur\nRegarde à l'Agneau de Dieu  (bis)\nEn Lui seul tu trouveras le secours;\nRegarde à l'Agneau de Dieu.\n\n2.\t\nQuand Satan vient subtil pour te tenter\nRegarde à l'Agneau de Dieu\nAvec sa force tu peux triompher\nRegarde à l'Agneau de Dieu.\n\n3.\t\nQuand tu te sens seul et découragé\nRegarde à l'Agneau de Dieu\nPar ton amour tu seras consolé\nRegarde à l'Agneau de Dieu.\n\n4.\t\nNe crains point lorsque ta route est pénible\nRegarde à l'Agneau de Dieu  \nAvec Jésus tout te seras possible\nRegarde à l'Agneau de Dieu.",
