    title: 'Lémon-n sé pa lakay mouin',
    lyrics:
      '1.\t\nLé mon-n sé pa la kay mouin nan siè la m-pralé\nTrézò mouin ak kè mouin an ro tout fiksé\nMouin tandé zanj yo kap rélé mouin anlè la\nÉ mouin pa kab santi m-tro alèz isi-ba.\n\nKè:\nJézu ou konnin ou sé sèl zamni mouin\nSi ou pa prn-m nan sièl, O Ségnè sa ma fè\nMouin tandé zanj yo kap rélé mouin anlè la\nÉ mouin pa kab santi m-tro alèz isi-ba.\n\n2.\t\nMouin konnin mouin pa dign, mouin sé gnou vié péchè\nMin mouin gin tout éspoua ké Jézu sèl Sovè\nSé Jézu ki té mouri sou lé boua Kalvè\nÉ Li té sové nan-m mouin pou létènité.\n\n3.\t\nMouin gin kèk biin-émé ki vouyajé déja\nYo nan bra dé Jézu é yapé tan-n mouin la\nMouin gin pou-m rété lité kòm you bon sòlda\nMin Ségnè lè Ou rélé-m ma vini avèk joua.\n\n4.\t\nMouin tandé voua Jézu di-m lité pran kouraj\nAlé louin préché yo chanté é la priè\nPa troublé pa plingnin mouin va la avèk ou\nSé mouin min-m ki chouazi ou pou-m voyé alé la',
