    title: 'Dépi nan tan lontan',
    lyrics:
      '1.\nDépi nan tan lontan\nLèzò-m té toujou méchan\nKayin tiyé Abèl \nSé sa-n ouè lòm pratiké\nJézu vi-n sou la tè\nPou ouété péché kriminèl yo\nYarété-L, yo touyé-L, yo klouré-L sou la koua\n\nKè:\nÉlas!  Élas! \nMouin régrèt sa pou lé mon-n,\nTalè konsa, lé mon-n pral boulvèsé vré.\nÉlas!  Élas!  \nMouin régrèt sa pou lé mon-n\nTalè kon sa, lé mon-n pral dlo nan jé.\n\n2.\nAkab ak Jézabèl mét ansan-m Yo touyé Nabòt\nAkab ak Jézbèl pansé Bon-Dieu pat ouè yo\nSa pat rété konsa Létènèl té kondané yo\nGnou ékzanp, gnou jujman\nBon-Dieu trasé sou lòm.\n\n2.\nLézòm fabriké za-m\nSé pa pou yo détoui pié boua,\nLézòm fabriké za-m\nSé pa pou yo détoui zan-imo\nLézòm fabriké za-m\nSé pou yo détoui lòm parèy yo\nYap touyé, yap jété ou,\nKè yo pa jan-m soté - Élas!\n\n3.\nPou ninpòt ti bagay \nNou ouè lòm ap tuyé lòm\nPou ninpòt ti plézi\nNou ouè lòm ap mét kouto sou lòm\nLòm pa kab gadé lòm gnou moman\nYo mété ou kadav\nÉpi yap banboché – Élas!',
