    title: 'J’ai trouvé Jésus',
    lyrics:
      "1.\nJ'ai trouvé Jésus admirable\nLe Dieu fort le Prince de paix\nQui vient dans ce monde coupable\nSemez à jamais ses bienfaits.\n\nRefrain\nChacun devrait savoir\nQu'en Christ est mon espoir\nServir mon Sauveur adorable\nC'est mon suprême devoir.\n\n2.\nJ'ai trouvé la grande famille\nLes vaillants témoins de l'Agneau\nTout inscrits aux livres de vie\nEt par l'esprit né de nouveau.\n\n3.\nJ'ai trouvé la paix de mon âme\nLe repos si longtemps cherché\nLe repos que chacun réclame\nEn un Dieu se trouve et caché.\n\n4.\nJ'ai trouvé la sainte boussole\nQui me dirige vers le port\nC'est de Dieu la bonne parole\nSeule peut me rendre fort et joyeux.",
