    title: 'Kinbé fèm travay nap fè',
    lyrics:
      '1.\nKinbé fè-m trava nap fè pou Jézu-Kri\nRout la pa fasil, fòk nou toujou soufri\nLè satan ap fè ravaj li, nou va tris\nNou konnin Jézu la, Li va kinbé nou.\n\nKè:\nKinbé fè-m jouk sa fini\nKinbé fè-m jouk Kris vini\nKinbé fè-m, piga ou lagé\nLè Jézu la ou pa janmin fatigé.\n\n2.\nGnou sòlda pa jan-m touché san-l pa travay\nSé pou li toujou fidèl nan tout bagay\nLi pap janmin rékilé lè-l nan batay\nNou konnin aprè batay nap gin viktoua.\n\n3.\nJézu séré gnou bèl kouròn pou tout krétyin\nKi toujou rété fidèl jouska la fin\nVa gin tout kalité kouròn nan jou sa-a\nLuté byin pou nou ka pran kouròn yo.',
