    title: 'Gingnin gnou rout si bon',
    lyrics:
      '1.\nMouin pap fiksé angnin\nNan lé mòn-n ankò\nLè-m dòmi sé sièl la m-révé\nMouin gingnin  pou-m alé nan péyi anro-a\nPou-m al joui bonè ki pap jan-m fini.\n\nKè:\nBonè ki papé jan-m fini\nMa rété ak Bon-Dieu papa mouin\nMouin pap fiksé lé mòn-n\nZèv li yo pa pou mouin\nMa pralé jouin Papa-m anro-a.\n\n2.\nMouin konnin gin anpil problèm sou rout la\nDoulè ak anpil tèt chajé.\nMouin gingnin pou-m priyé\nSa va gin pou-l volé\nFò-m alé jouin-n Papa-m anro-a.\n\n3.\nKonsa gin anpil baga ki rézèvé\nPou tout krétyin kap luté\nGin anpil bèl bagay kap tan-n nou nan sièl la\nLè-n alé nan péyi anro-a.\n\n4.\nLè nou va rivé nan palè rouaya-l la\nNou va rankontré ak zanj yo\nNou va anbrasé yo, nan palè nan sièl la\nGnou bonè ki pap jan-m fini.',
