    title: 'Amis venez!',
    lyrics:
      "1.\nAmis venez!\nLe Maître nous entraîne:\nOuvrons nos coeurs\nTout grands à Son Esprit;\nQue pleins de feu,\nS'élancent dans l'arène\nLes plus fervents:\nLes tièdes sont bannis!\n\nChoeur:\nSerrons les rangs sous la bannière\nDe notre Roi victorieux.\nQue rien n'altère la foi si claire\nQui nous unit au Fils de Dieu.\nAh! Qu'il fait beau chanter la gloire\nDe notre Roi victorieux.\nPour qui veut croire, c'est la victoire,\nEt c'est la joie en notre Dieu.\n\n2.\nPour être forts,\nVivons dans la prière:\nAvec le Christ,\nOn peut braver l'enfer,\nIl est l'Ami, pour nous\nPlus près qu'un frère,\nIl fait fleurir\nLes coeurs les plus déserts.\n\n3.\nTout bon soldat\nRevêt de Dieu l'armure\nEt sans broncher\nSe charge de sa croix.\nPatrie, exil, succès\nOu vile injure\nTelle est la rude école de la foi.\n\n4.\nDe nous il faut\nQu'un saint amour s'empare,\nL'amour qui sait\nDonner sans se lasser.\nQui va chercher\nLes âmes qui s'égarent,\nEt verse un baume\nSur les coeur blessés.",
