    title: 'Quel bonheur',
    lyrics:
      "1.\t\nQuel bonheur d'être en famille\nD'être aimé, surtout d'aimer\nAu doux foyer qui pétille\nL'homme fort peut se former\nEntouré de ce qu'on aime\nOn doit cultiver son coeur\nOn se connait mieux soit-même (bis)\nEt l'on devient un vainqueur. (bis)\n\n2.\t\nLa victoire est difficile\nMais le combat bienfaisant\nSi parfois l'amour vacille\nCe n'est pas pour bien longtemps\nOn supporte avec tendresse\nOn pardonne avec bonheur\nLe coeur rajeunit sans cesse (bis)\nL'amour est un grand vainqueur. (bis)\n\n3.\t\nQu'une humeur toujours sereine\nAvec la céleste paix\nRègle seule en souveraine\nA mon foyer désormais\nCher foyer, combien je t'aime\nCombien je vais te choyer\nEn attendant qu'au ciel même (bis)\nSe transporte mon foyer. (bis)",
