    title: 'Témouin',
    lyrics:
      '1.\t\nMouin sé témouin Jézu-Kris\nM-pap troublé la Bib\nLé mon-n kouè ya jouin-n Sovè\nSan pa Jézu-Kri.\nSatan ban-n gnou fo dokti-n\nPou-n pa fè kòlè\nMinistè sou la tè\nToujou gin finans.\n\nKè:\nO oui pou-m témouin\nFò-m konnin Jézu\nKa Létènèl fè Li\nAvan nou té la\nLòm pa jouin-n a Jézu-Kri\nSan pa Léspri Sin\nAlélouya-m té pèdi\nMin-m trouvé la vi.\n\n2.\t\nAbraham, pè dé la foua\nLi pa sa témouin\nAvan Abraham té fèt\nJézu-Kri té la\nSi-m témouin sa-m pa konnin\nPa la vérité\nPou-m témouin vrè témouin\nFò-m nan Jézu-Kri. \n\n3.\t\nLè-m kouè-m té pré Jéova\nPoutan-m té trè louin\nLè map chanjé mo yo\nM-té vlé ouè rézon\nTout pouvoua pou Jézu-Kri\nNan sièl é la tè\nM-oui tap palé vanité\nÉré pa lé van\n\n4.\t\nDié toua foua Sin, Jéova\nA travè lé mon-n\nAbraham, Izaak é Jakòb\nYo pa vrè témouin\nLòm ki vrèman vrè témouin\nSòf  Émmanièl\nGloua a Dié, gloua a Dié\nJézu, Roua Dè roua',
