    title: 'Mouin pa kapab blié',
    lyrics:
      '1.\nMouin pa kapab blié ki koté-m té yé\nLè Jézu té jouin-n mouin, la vi-m té chanjé\nSé pou sa map chanté paské Li sové-m\nSi Satan vlé baré-m ma va rélé Jézu.\n\nKè:\nJézu va roulé roch la\nKi vi-n baré-m nan mò-n la  (3 foua)\nÉ-m konnin gnou jou sa va chanjé.\n\n2.\nMouin pa janmin blié ki jan sa té yé\nLéspri-m té boulvèsé paské-m té maré\nLè-m vi-n jouin-n ak Jézu tout bagay chanjé\nRoch la té mèt baré-m Jézu va délivré-m.\n\n3.\nPafoi-m kon-n ap krié dévan problèm yo\nMouin désan-n sou jénou map rélé Jézu\nMouin tandé voi Jézu kap palé avè-m\nLi di mouin pran kouraj tout bagay va chanjé.\n\n4.\nSi ou santi ou tris é dékourajé\nOu lévé ouap krié ou pa gin éspoua\nOu mèt jouin-n ak Jézu la konsolé ou\nOui sé Li min-m ki di Li va roulé roch la\n\n5.\nOu té mèt méprizé ou pa gin zanmi\nSi ou sé zanmi Jézu ou gin tout bagay\nLa vi ou té mèt tou noua \nGnou jou sa va chanjé.',
