    title: 'Nan la vi-a nou',
    lyrics:
      '1.\nNan la vi-a nou rankontré anpil problèm\nAnpil bagay ki fè nou pèdi tèt nou\nProblè a douat, problè a goch\nSoufrans jodi, soufrans démin\nNap mandé ki lè pou sa fini\nNou lévé tèt nou di Bon-Dieu\nNou vlé sési, nou vlé séla\nSouvan priyè nou pa ékszosé.\n\nKè:\nChéché Jézu ak tout kè nou\nÉ Li va délivré nou é Li va ékszosé nou\nChèché-L avan vanité yo\nÉ tout bagay mal va fini pou nou.\n\n2.\nRoua Salomon té ba nou gnou trè bèl égzamp\nBon-Dieu té di-l lap bali sa li mandé\nRoua Salomon pa té mandé pou-l gin lajan\nPou-l gin richès\nSèlman-l té mandé Bon-Dieu sajès\nKonsa kè Bon-Dieu té kontan\nLi bay Salomon sajès ak richès\nLè zòm pap jan-m gingnin.',
