    lyrics:
      '1.\nGin gnou voua douséman\nKi rélé-m pandan nuit la\nLi di-m lévé min énmi ou yo déyò-a\nLè-m té louvri jé-m\nM-ouè énmi yo déyò-a\nMouin di Ségnè édé mouin-o non souplé.\n\nKè:\nSégnè rout la du anpil\nLòt bò mòn nan map pralé\nÉ-m konnin ma rivé.\n\n2.\nMouin té malad, paran-m yo di map mouri\nMouin di Ségnè désan-n amé sélès la\nLè-m té louvri zié mouin\nMouin ouè amé ap désan-n\nKapitèn nan pran dévan lap vi-n sové-m.',
