    lyrics:
      '1.\nSipozé Bon-Dieu té chèché nan sièl\nLi pat kap jouin-n pèson-n ki té vlé\nPou-l té bay siprèm sakrifis nésésè\nLi bay vi Li pou té sové mouin ak ou.\n\nKè:\nO, O, si sé pat pou gnou plas\nYo rélé mò-n Kalvè,\nSi sé pa té sou pié boua la koua-a\nSi sé pat pou Non-m sa-a yo rélé Jézu ya\nÉ pou toujou mouin min-m ak ou ta pèdu.\n\n2.\nM-si kontan Li t-aksépté bouè koup amè\nMalgré priyè, pè lésé-l pasé louin\nM-si kontan Li pat rélé zanj nan sièl yo\nPou vi-n ouété klou kap toumanté min-l yo.',
