    lyrics:
      "1.\t\nLa fontaine de l'eau vive\nJaillit pour nous  (bis)\nLa fontaine de l'eau vive\nJaillit pour nous toujours.\n\nChoeur\nMoi et ma maison, et ma maison, et ma maison,\nMoi et ma maison nous servirons l'Éternel.\n\n2.   \nLe boulanger le Pain du ciel\nTravaille pour nous  (bis)\nLe boulanger le Pain du ciel\nTravaille pour nous toujours.\n\n3.\t\nLe Saint-Esprit en Jésus-Christ,\nDescend sur nous  (bis)\nLe Saint-esprit, en Jésus-Christ,\nDescend sur nous toujours.\n\n4.\t\nLe Capitaine Émmanuel\nGouverne-nous, dirige-nous,\nLe Capitaine, le Roi des rois\nFais nous rentrer au port.\n\n5.\t\nLa paix de Dieu reste avec nous \nReste avec nous, reste avec nous\nLa paix de Dieu reste avec nous\nReste avec nous toujours.",
