    title: 'Louons le Seigneur',
    lyrics:
      "1.\t\nOh! Quelle joie de vivre en Jésus\nD'être sauvé par Son sang du malheur\nMoi pécheur au rang de ses élus\nPour jouir avec Lui du vrai bonheur.\n\nChoeur\nEn Jésus mon Sauveur,\nJ'ai trouvé le vrai bonheur.\nEn Christ mon Rédempteur,\nJ'ai trouvé le vrai bonheur.\nEn Jésus, en Jésus\nLe bonheur, la joie, la vie\nEn Jésus c'est la paix\nEt la vie éternelle.\n\n2.\t\nDe riche qu'Il était le ciel bénit\nIl s'est fait pour eux pour m'enrichir\nOh mon Dieu que veux-tu pour ce don?\nRends-moi nouveau pour ce grand pardon.\n\n3.\t\nQui peut compter l'amour de Jésus\nImitons ce Sauveur glorieux\nTravaillons pour plaire à Jésus\nNous serrons tous aussi glorieux.\nAmen.",
