      md: "**1.** \n\nJe me rappelle un jour \n\nOù dans le ciel je vis \n\nLe livre dans lequel \n\nTout péché est écrit. \n\nJe vis mon nom très clair \n\nJe dis mon Dieu que faire \n\nEn tombant à ses pieds \n\nJe réglai mon affaire. \n\n\n\n\n<br/> **Choeur**\n\n**A l'instant  (bis)** \n\n**Oui le vieux compte fut réglé** \n\n**A l'instant** \n\n**Je ne suis plus effrayé** \n\n**Ma dette est déjà payée** \n\n**Et mon compte avec mon juge** \n\n**Est tout réglé.** \n\n\n\n<br/> **2.**\n\nMon compte était très lourd \n\nEt grandissant toujours \n\nO j'étais égaré \n\nPêchant plus chaque jour \n\nMais quand mes yeux s'ouvrent \n\nEt je vis mon état \n\nJe me jetais aux pieds du Sauveur \n\nA l'instant. \n\n\n<br/> **3.**\n\nDu jour du jugement \n\nDevant le trône blanc \n\nQuand tous les morts viendront \n\nLes livres s'ouvriront \n\nEt quand on cherchera \n\nMon nom n'y sera pas \n\nCar Jésus l'a écrit \n\nAu livre de la vie. \n\n\n<br/> **4.**\n\nO pêcheur viens à Lui \n\nMets toi en règle aussi \n\nEt fais-le aujourd'hui \n\nCar l'occasion s'enfuit \n\nIl te pardonnera \n\nSi tu fais comme moi \n\nEn venant à ton Sauveur \n\nTu fais de Lui ton Roi \n\nA l'instant. \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Je me rappelle un jour </p>\n<p>Où dans le ciel je vis </p>\n<p>Le livre dans lequel </p>\n<p>Tout péché est écrit. </p>\n<p>Je vis mon nom très clair </p>\n<p>Je dis mon Dieu que faire </p>\n<p>En tombant à ses pieds </p>\n<p>Je réglai mon affaire. </p>\n<p><br/> <strong>Choeur</strong></p>\n<p><strong>A l&#39;instant  (bis)</strong> </p>\n<p><strong>Oui le vieux compte fut réglé</strong> </p>\n<p><strong>A l&#39;instant</strong> </p>\n<p><strong>Je ne suis plus effrayé</strong> </p>\n<p><strong>Ma dette est déjà payée</strong> </p>\n<p><strong>Et mon compte avec mon juge</strong> </p>\n<p><strong>Est tout réglé.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Mon compte était très lourd </p>\n<p>Et grandissant toujours </p>\n<p>O j&#39;étais égaré </p>\n<p>Pêchant plus chaque jour </p>\n<p>Mais quand mes yeux s&#39;ouvrent </p>\n<p>Et je vis mon état </p>\n<p>Je me jetais aux pieds du Sauveur </p>\n<p>A l&#39;instant. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Du jour du jugement </p>\n<p>Devant le trône blanc </p>\n<p>Quand tous les morts viendront </p>\n<p>Les livres s&#39;ouvriront </p>\n<p>Et quand on cherchera </p>\n<p>Mon nom n&#39;y sera pas </p>\n<p>Car Jésus l&#39;a écrit </p>\n<p>Au livre de la vie. </p>\n<p><br/> <strong>4.</strong></p>\n<p>O pêcheur viens à Lui </p>\n<p>Mets toi en règle aussi </p>\n<p>Et fais-le aujourd&#39;hui </p>\n<p>Car l&#39;occasion s&#39;enfuit </p>\n<p>Il te pardonnera </p>\n<p>Si tu fais comme moi </p>\n<p>En venant à ton Sauveur </p>\n<p>Tu fais de Lui ton Roi </p>\n<p>A l&#39;instant. </p>\n'
