    lyrics:
      "1.\t\nJ'ai trouvé la voie\nQui mène au jour sans fin\nLà haut dans le lieu divin.\nMais pour parcourir\nLe chemin sans faillir\nSeigneur tiens-moi près de toi.\n\nChoeur\nJ'ai trouvé la voie  (bis)\nOh! Gloire alléluia!\nJ'ai trouvé la voie.\n\n2.\t\nQue craindrais-je encore?\nCar avec Jésus-Christ\nJe vais braver l'ennemi.\nEt mes chants de joie \nEn l'honneur de mon Roi\nTémoigneront ma victoire.\n\n3.\t\nQuand viendra la fin\nConduis-nous par la main\nNous suivons-le sur le chemin\nQui mène au repos\nAlors avec l'Agneau\nNous verrons la gloire sans fin.",
