    title: 'Chak pa mouin fè',
    lyrics:
      '1.\nChak pa mouin fè, Sovè-m alé dévan mouin\nAk min Li kondui mouin nan bon chémin.\nNan zorèy Li mouin palé, m-adoré Li\nNan la joi maché ak Li chak jou.\n\nKè:\nChak pa mouin fè, konnin Jézu ap gidé-m\nNan gnou plin-n pi ro, Li toujou minnin-m,\nJouk tan gnou jou, \nMouin va fè dènié pa mouin\nChak pa mouin fè, kondui-m pi pré sièl la.\n\n2.\nLè asurans mouin kòmansé fayi\nÉ dévan-m gin falèz infini.\nMouin viré jé-m, mouin gadé Bon Sovè mouin\nLi sé fòs mouin, lè mouin maché avè-L.\n\n3.\nMouin konfié nan Kris, malgré sikonstans yo\nJézu gingnin pouvoua an abondans.\nLa pé kinbé klé ya, louvri pòt la\nPou Li minnin-m nan péyi promès la.',
