    title: 'Nan vil Samari',
    lyrics:
      '1.\nNan vil Samari, bò pui Jakob,\nAk pitit li yo té fouyé\nJézu tap fè gnou pozé bò pui sila\nGnou Samaritè-n parèt la \nNan pui-a vini pran dlo\nÉ Jézu té di li sil vou plè ban-m ti gout dlo.\n\nKè:\nFan-m nan té trè étoné\nPou gnou Jiuf pa pè adrésé-l\nOu ki soti an Izraèl, ki pa vlé ouè Samaritin\nJézu té di li konsa \nSi ou té konnin don Bon-Dieu\nSi ou té konnin ki lès mouin yé ou ta mandé\nMouin ta ba ou dlo, pou lé tan é létènité.\n\n2.\nFan-m nan té di Ségnè av:k ki sa\nNou ka pran dlo nan pui-a\nSé sèlman nan pui sa ki gin dlo fré\nDi-m non si ou pi gran k é pè Jakob\nKi té ba nou pui sila\nLadan-l pitit li bouè, nou puizé pou bèt nou yo.',
