      md: '**1.** \n\nOtréfoi-m té kouché, \n\nÉ zié-m louvri map pansé \n\nAk kòmandman Jézu-Kri té bay disip Li yo \n\nMouin t  santi lè sa-a gnou gran transfòmasion \n\nGnou riviè tap koulé nan zié mouin \n\n\n\n\n<br/> **Kè:**\n\n**Jézu-Kri apran-n nou nou doué gin tèt ansanm** \n\n**Pi gran kòmandman an,** \n\n**Sé rinmin nou gnoun lòt.** \n\n\n\n<br/> **2.**\n\nApran-n a padoné-é tout frè tout sè ou yo \n\nMin-m lè yo méprizé ou kon fatra \n\nOu pa vo angnin \n\nPa krié pa plingnin, réziyé ou frè mouin \n\nSoufrans lan du sé vré min pran kouraj. \n\n\n<br/> **3.**\n\nPatajé ak frè ou, tristès li ak lapin-n \n\nSé sa Jézu mandé pou nou gnoun soufro pou lòt \n\nPa umilié frè ou, pa umilié sè ou \n\nNou tout an jénéral sé pousiè. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Otréfoi-m té kouché, </p>\n<p>É zié-m louvri map pansé </p>\n<p>Ak kòmandman Jézu-Kri té bay disip Li yo </p>\n<p>Mouin t  santi lè sa-a gnou gran transfòmasion </p>\n<p>Gnou riviè tap koulé nan zié mouin </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Jézu-Kri apran-n nou nou doué gin tèt ansanm</strong> </p>\n<p><strong>Pi gran kòmandman an,</strong> </p>\n<p><strong>Sé rinmin nou gnoun lòt.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Apran-n a padoné-é tout frè tout sè ou yo </p>\n<p>Min-m lè yo méprizé ou kon fatra </p>\n<p>Ou pa vo angnin </p>\n<p>Pa krié pa plingnin, réziyé ou frè mouin </p>\n<p>Soufrans lan du sé vré min pran kouraj. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Patajé ak frè ou, tristès li ak lapin-n </p>\n<p>Sé sa Jézu mandé pou nou gnoun soufro pou lòt </p>\n<p>Pa umilié frè ou, pa umilié sè ou </p>\n<p>Nou tout an jénéral sé pousiè. </p>\n'
