    title: 'Nous voulons vivre pour Sa gloire',
    lyrics:
      "1.\nNous voulons vivre pour Sa gloire,\nComme les témoins d'autrefois\nEt lutter jusqu'à la victoire,\nSous le grand signe de la Croix.\n\nChoeur:\nDebout, debout! Le Seigneur\nNous veut pour Lui, pour Lui.\nDebout, debout!\nOh, consacrons-nous aujourd'hui.\n\n2.\nContre le mal livrant bataille\nNous combattons auprès de Toi,\nSans qu'aucun jamais ne défaille,\nSous le grand signe de la Croix.\n\n3.\nSi Satan nous crible et nous tente,\nAyons plus d'ardeur, plus de foi,\nEt progressons, cohorte ardente,\nSous le grand signe de la Croix.\n\n4.\nO tous écoutez la Parole:\n«Préparez le chemin du Roi!»\nDebout! Qu'on se donne et s'enrôle,\nSous le grand signe de la Croix.",
