    title: 'Mouin tap maché nan',
    lyrics:
      '1.\nMouin tap maché nan gnou rout \nDifisil, plin danjé\nLè tout suit mouin fè rankont ak Non-m sa\nLi di mouin, pitit mouin,\nVini jouin-n mouin, pa mizé\nM-obéi san plignin, é san pè, é Li kinbé min-m.\n\nKè:\nNon Li sé Jézu, nan pouin lòt kon Li\nNon Li sé Jézu, vi-n adoré Li\nSa sé sujè kontantman kè mouin\nMouin ouè Sovè ya.\n\n2.\nChémin mouin té kòmansé\nVi-n fasil, byin fasil\nLè mouin vi-n rékon-nèt sé té Non-m sa\nKi gnou jou Li té bay la vi-L\nSou la koua pou sové-m\nKontantman ak la joua, plin kè mouin\nMouin ouè Sovè ya.\n\n3.\nKi gran jou sa va yé, \nLè La tounin vi-n chèché-m;\nTout kriyé, doulè, soufrans va fini\nMa réjoui avèk tout zanj \nNan sièl la pou tout tan.\nMalè pou tout sa ki pat jan-m vlé kouè\nNan sèl Sovè ya.',
