    title: 'De la poussière de la terre',
    lyrics:
      "1.\nDe la poussière de la terre\nMon Dieu fit sortir l'homme\nSon souffle lui donne une âme vivante\nEt Dieu a tant aimé le monde\nQu'Il a donné son Fils unique\nVoilà pourquoi je L'aime tant.\n\nChoeur\nJe suis créé à on image\nOui bien à son image\nJe suis sur terre pour Le servir\nJamais je ne Le nierai\nJe marcherai toujours près de Lui\nCar Il m'a créé pour Le servir.\n\n2.\nMon coeur, mon corps, mon âme\nNe m'appartiennent plus\nIls sont au service du Seigneur\nLes années pourront s'enfuir\nLes jours succédés au jour\nMon corps est le temple du Seigneur",
