    language: 'fr',
    lyrics:
      "1.\nPrends ma vie dans tes bras\nOh Jésus tendre Ami\nCar de toi jaillira la seule source de vie\nPorte-moi dans ma foi quand ton amour sera\nOh! Seigneur guide-moi par ta main.\n\n2.\nSi parfois j'ai troublé, égaré et confus\nDes tourments et douleurs\nQui assaillent mon coeur\nTu demeures avec moi car Tu m'aimes Jésus\nGrâce à Toi je triomphe sans peur.\n\n3. \nDans ma vie aujourd'hui\nRien ne vit, tout est vain.\nC'est la mort en esprit de l'humain en humain\nMais \tquand je T'ai rencontré\nToute ma vie a changé,\nTu m'as ressuscité, libéré.",
