    title: 'Pouki moun palè kristal sa?',
    lyrics:
      '1.\nPouki moun palè kristal sa-a?\nSé pou mouin ak Jézu-Kri!\nPouki moun fotèy an nò yo?\nSé pou mouin ak rachté yo!\n\nRéfrin:\nSé gnou bèl palè kristal\nAvèk anpil chèz an nò,\nPou tout moun ki vlé alé\nAvèk Ségnè Jézu.\n\n2.\nJéruzalèm nan bèl anpil,\nLi pi bèl pasé diaman\nLi soti koté Bon-Dieu min-m\nÉ li gin tout gloua Bon-Dieu.\n\n3.\nPa bézouin solèy ak lalu-n\nPou kléré nou jou é nouit\nMin la gloua Bon-Dieu va briyé\nÉkla Li va gnou flanbo.\n\n4.\nPap gin krint, doulè ak touman\nNi lanmò, ni maladi.\nMédizans, kout lang va fini\nSé louanj, lanmou san fin.\n\n5.\nA la gnou bèl jou sa va yé,\nLè tronpèt la va sonnin\nPou tou mò nan Kris yo lévé\nPou y-al rankontré Jézu.',
