      html: '<p><strong>1.</strong> </p>\n<p>Pouki moun palè kristal sa-a? </p>\n<p>Sé pou mouin ak Jézu-Kri! </p>\n<p>Pouki moun fotèy an nò yo? </p>\n<p>Sé pou mouin ak rachté yo! </p>\n<p><br/> <strong>Réfrin:</strong></p>\n<p><strong>Sé gnou bèl palè kristal</strong> </p>\n<p><strong>Avèk anpil chèz an nò,</strong> </p>\n<p><strong>Pou tout moun ki vlé alé</strong> </p>\n<p><strong>Avèk Ségnè Jézu.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Jéruzalèm nan bèl anpil, </p>\n<p>Li pi bèl pasé diaman </p>\n<p>Li soti koté Bon-Dieu min-m </p>\n<p>É li gin tout gloua Bon-Dieu. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Pa bézouin solèy ak lalu-n </p>\n<p>Pou kléré nou jou é nouit </p>\n<p>Min la gloua Bon-Dieu va briyé </p>\n<p>Ékla Li va gnou flanbo. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Pap gin krint, doulè ak touman </p>\n<p>Ni lanmò, ni maladi. </p>\n<p>Médizans, kout lang va fini </p>\n<p>Sé louanj, lanmou san fin. </p>\n<p><br/> <strong>5.</strong></p>\n<p>A la gnou bèl jou sa va yé, </p>\n<p>Lè tronpèt la va sonnin </p>\n<p>Pou tou mò nan Kris yo lévé </p>\n<p>Pou y-al rankontré Jézu. </p>\n'
