    title: 'Rude est la mêlée',
    lyrics:
      "1.\nRude est la mêlée,\nNe l'oublions pas!\nPrenons donc l'épée,\nPour le saint combat!\nLe Seigneur l'ordonne\nÉcoutons l'appel,\nQui descend, pour nous, du ciel.\n\nChoeur:\nEn avant, oui,\nMarchons en avant!\nNous avons un\nMaître tout puissant.\nLuttons contre\nLe péché, l'erreur,\nAu nom de Jésus,\nLe grand vainqueur!\n\n2.\nNotre Capitaine,\nNous appelle tous,\nToute lutte est vaine,\nS'Il n'est avec nous,\nMais Il est fidèle,\nSuivons-Le partout,\nOui, suivons-Le jusqu'au bout!\n\n3.\nOui, de l'adversaire,\nLe pouvoir cruel,\nRépand sur la terre,\nSon venin mortel;\nMais, de haute lutte,\nJésus l'a vaincu,\nEt nous offre un plein salut!\n\n4.\nLuttons sans relâche,\nSans crainte et sans peur;\nPoursuivons la tâche,\nAu nom du Sauveur;\nLe bonheur, la gloire,\nLa paix, le repos,\nNous serons donnés là-haut!",
