    lyrics:
      "1.\nOh! Contez-moi les histoires\nDe mon Sauveur,\nLes beaux récits de victoire\nDu Rédempteur.\nJe veux entendre tout Son amour,\nPour le comprendre\nMieux chaque jour.\n\n2.\nOui, dites-moi Sa tendresse\nPour les petits.\nIl est malgré leur faiblesse,\nLeur grand Ami.\nSon beau visage, Sa douce voix\nSont un message même pour moi.\n\n3.\nNe faites point taire ses souffrances,\nSa mort en Sa croix,\nPour pardonner mes offenses\nEt vivre en moi\nPuis il faut dire qu'Il est vivant,\nEt qu'Il désire mon coeur d'enfant.",
