    title: 'Lagé-m nan dézè-a',
    lyrics:
      '1.\nLagé-m nan dézè-a ma val avèk Jézu\nLi sé bon zanmi mouin li papé jan-m tronpé-m\nLi té mouri pou mouin lap toujou protéjé-m\nLagé-m nan dézè-a ma val avèk Jézu.\n\nKè:\nMouin bézouin alé sèl avèk Sovè mouin\nLè mouin santi-m grangou\nL’abitué bay la ma-n\nLi té mouri é Li min-n nan gnou gro trou roch\nLè mouin santi mouin souaf \nRoché yo, yo kon-n bay dlo.\n\n2.\nLé mon-n sé ipokrit\nMouin pa bézouin zanmi-l\nLé mon-n bézouin lajan\nMouin pa bézouin rélasion-l\nDéja-m vlé détaché-m dé tout bagay la tè\nLagé-m nan dézè-a ma val avèk Jézu.\n\n3.\nMouin kon-n sékrè lé mon-n\nPa gin angnin sérié\nSé maché makiyé pou yo pété lé zòt\nSé maché pran vié pouin\nPou yo kapab manjé gra\nLagé-m nan dézè-a ma val avèk Jézu.\n\n4.\nLi té pran-n nan la bou li fè mouin vini pròp\nLi voyé-m koté nou pou mouin chanté gloua Li\nLè mouin sonjé jou sa fò-m gin rékonésans\nLagé-m nan dézè-a ma val avèk Jézu.',
