    title: 'Oui,  je veux travailler',
    lyrics:
      "1.\t\nOui, je veux travailler pour mon Sauveur,\nMe confiant en sa Parole d'amour.\nJe chanterai mon bonheur,\nÉtant occupé toujours\nDans la vigne du Seigneur.\n\nChoeur\nTravailler et prier\nDans la vigne (bis) du Seigneur\nOui toujours occupé:\nC'est mon suprême bonheur\nDans la vigne du Seigneur.\n\n2.\t\nOui, chaque jour je voudrais travailler,\nMais tu sais, Seigneur, que tout vient de Toi,\nÉtant mon seul Conseiller;               \nMe voici, Seigneur, dis-moi\nTa  très sainte volonté.\n\n3.\t\nJe veux être digne de mon Sauveur,\nComme Lui, souffrir et même mourir\nPour attirer les pécheurs\nA Jésus que veut bénir\nMême le persécuteur.\n\n4.\t\nOui, je veux travailler, oui malgré tout.\nLe Christ Seigneur est là.  Cela suffit.\nJ'ai ce qu'il me faut surtout:\nLe guide du Saint-Esprit.\nAinsi, j'irai jusqu'au bout.",
