    title: 'An nou travay,  an nou konbat',
    lyrics:
      '1.\nAn nou travay an nou konbat Jézu-Kri a la pòt\nAn nou kinbé san rélaché Li pa louin pou-L vini\nA la gnou bèl jou lè Jézu vini\nPou-L fè-m monté avè-L\nSé pou nou kapab pèsévéré.\n\nKè:\nKrétyin révéyé nou, Jézu-Kri a la pòt\nKrétyin révéyé nou, nou pa konnin ki jou\n\n2.\nSé bèl bagay, lè Li vini \nNou pap maché nan nou\nMin L-ap vini pou vi-n jujé moun ki inkrédil\nLi di déja fòk Li vini pou-L fè travay sa\nOu min-m ki mété kè ou an nòd\nFòk ou rété sinsè.\n\n3.\nSé bèl bagay lè Li vini, nou pap mouri ankò\nVéyé, prié nui é lé jou\nNou va santi nou fiè\nSé pou tout létènité nou va yé\nNou va nan kay sa-a\nOu min-m ki mété kè ou an nòd\nFòk ou rété fidèl',
