    title: 'Où va cette foule',
    lyrics:
      "1.\t\nOù va cette foule empressée\nQui d'où n'est pas lassée\nQuel est cet homme, dites-moi\nQui cause aujourd'hui tant d'émoi\nEntendez, entendez ce cri  (bis)\nJésus de Nazareth est ici.\n\n2.\t\nEst-ce Dieu visitant la terre\nQui fait mouvoir la ville entière\nQuel est ce étranger puissant\nA l'aspect si compatissant,\nLa foule répond par ce cri  (bis)\nJésus de Nazareth est ici.\n\n3.\t\nIl guérit de sa maladie\nTout pauvre pécheur qui le prie\nSon bonheur est de soulager\nNos maux dont Il vient se charger.\nDe l'aveugle, entendez ce cri:\nJésus de Nazareth est ici.\n\n4.\t\nRecevez la santé de l'âme\nC'est votre coeur qu'Il réclame\nVous par le monde méprisé\nVenez ô pauvre coeurs brisés\nÉcoutez, écoutez ce cri\nJésus de Nazareth est ici.\n\n5.\t\nMais si vous refusez d'entendre\nL'appel de sa voix douce et tendre\nBientôt, bientôt Il s'en ira\nEt vos pleurs, nul ne sèchera\nTrop tard, trop tard, sera le cri\nJésus de Nazareth est parti.  (bis)",
