      md: '**1.** \n\nSi ou dékourajé ak fado é krint \n\nSan fòs, san éspoua \n\nPa min-m gnou sékou \n\nMalgré ou ap viv sèl \n\nÉ rout ou gin mò-n \n\nJézu ap pansé, lapé pansé dé ou.  (3 foua) \n\n\n\n\n<br/> **Kè:**\n\n**Lè ou san zanmi** \n\n**É ou bézouin gnoun** \n\n**Jézu ap pansé lapé pansé dé ou.** \n\n\n\n<br/> **2.**\n\nJézu ap véyé, lan chafgrin, tristès \n\nL-ap gadé ou é gidé ou koté ou pralé \n\nL-ap tan-n pou-L montré ou mizérikòd Li \n\nJézu ap pansé, lapé pansé dé ou \n\nJézu ap pansé, lè ou sa zanmi \n\nÉ ou bézouin gnoun \n\nJézu ap pansé, lapé pansé dé ou. \n\n\n',
