    lyrics:
      '1.\nNap pran kouraj ak tout bagay\nSan nou pa jan-m dékourajé\nSèvi Bon-Dieu sé gnou bagay trè difisil,\nPèson-n moun pap dékourajé     (trè difisil\nNan gran travay Bon-Dieu ya\nMouin gin éspoua ma délivré pou toujou.\n\n2.\nMap pran kouraj map supòté\nMouin konnin gnou jou\nTout bagay gingnin pou li fini, pou li fini\nSé Bon-Dieu ki gin tout puisans\nLi va kinbé mouin avèk amou Li\nJou-m délivré ma va chanté\nGloua pou Bon-Dieu.\n\n3.\nPafoua rout la kon difisil, \nAk tout kalité tèt chajé\nYap kritiké-m, yap voyé pouin \nSou mouin min-m sèl\nÉlmi-m yo ap fè tripotaj\nPafoua, min-m moun ki nan légliz\nJou-m délivré ma va chanté\nGloua pou Bon-Dieu.',
