    title: 'Mouin konnin gnou jou',
    lyrics:
      '1.\nMouin konnin gnou jou konba-m yo va fini\nLè ma rivé nan vil sélès la\nMa va chanté gnou chan mélanjé ak sin yo\nNan bèl ti vil dò nou-an.\n\nKè:\nMa va di lò adié\nLè ma rivé nan vil sélès la\nMa va chanté gnou chan mélanjé ak zanj yo\nNan péyi koté tristès fini.\n\n2.\nLè-m va rivé bò la ma rakonté lòt yo\nKòman rout la té trè du pou mouin\nMouin té jouin-n gnou puisans \nKi té désan-n sou mouin\nLi kondui-m nan péyi sélès la-a.\n\n3.\nLè-m va rivé anro ma salué ansyin yo\nMa mété ajenou kot Ségnè-m\nLè jou mouin va rivé pou mouin kité tè sa-a\nMa viré, san-m pa di o révoua.',
