    lyrics:
      "1.\nChantons et louons\nLe beau Nom de Jésus,\nExaltons-Le d'un même coeur!\nIl est mort sur la croix,\nNos péchés ne sont plus,\nOh! Quel céleste bonheur! Oui bonheur!\nIl offre encore Son pardon, son salut\nO venez donc, oui, venez à Jésus!\n\n2.\nJésus reviendra\nDe son divin séjour,\nAfin de nous prendre avec Lui.\nVeillons donc et prions;\nAttendons Son retour,\nCar déjà l'étoile luit (dans la nuit).\nQue de nos coeurs\nVers Lui monte en ce jour,\nUn chant joyeux,\nDe louange et d'amour!",
