      md: "**1.** \n\nPar Sa grâce je suis sauvé \n\nPar le moyen de la foi \n\nCar Il paya ma rédemption \n\nQuand Il mourut sur la croix. \n\n\n\n\n<br/> **Choeur:**\n\n**Et désormais, je veux servir** \n\n**Je veux servir mon Sauveur** \n\n**Glorifier par ma vie,** \n\n**Celui qui est mort** \n\n**Pour moi pécheur.** \n\n\n\n<br/> **2.**\n\nAutrefois j'étais rebelle \n\nJ'étais mort par mon péché; \n\nDieu dans Sa miséricorde, \n\nEn Christ m'a ressuscité. \n\n\n<br/> **3.**\n\nLe chemin peut être épineux \n\nOù Il va me diriger \n\nMais ma main est à la charrue \n\nPour Lui je veux travailler. \n\n\n<br/> **4.**\n\nJe me place sur Ton autel, \n\nLié par les liens d'amour \n\nReçois mon offrande entière \n\nJe veux Te servir toujours. \n\n\n",
