    num: 41,
    title: 'O grâce merveilleuse',
    lyrics:
      "1.\nO grâce merveilleuse\nDon qui nous vient de Dieu\nGrâce si précieuse\nFleuve jailli des cieux.\nQui donc saurait décrire\nSa force et sa fraîcheur?\nEt qui donc a pu dire\nQuelle est sa profondeur?\n\nChoeur:\nNous n'avons qu'un seul\nSujet de gloire:\n(Qu'un seul sujet de gloire)\nC'est Ta sainte croix divin Sauveur.\n(Ta sainte croix, divin Sauveur)\nEt par Ton sang nous marchons\n(Ta grâce est puissante, toute suffisante)\nEn vainqueurs!\nTous en vainqueurs.\n(Et Ton sang nous rend plus que vainqueurs)\nPlus touchant que\nL'hymne des archanges\nEt le chant qu'entonnent les élus\nVenez chrétiens qu'éclatent vos louanges:\nGloire à Jésus!\n\n2.\nO grâce qui nous donne\nLe vrai repos du coeur,\nEt qui nous environne\nQuand rôde le malheur!\nElle a rompu nos chaînes\nEt couvre nos forfaits.\nQue Satan se démène:\nNous demeurons en Paix.\n\n3.\nGrâce sans fond ni rive,\nPlus vaste que la mer,\nSource dont les eaux vives\nCoulent en plein désert!\nPar ce courant de vie,\nNous nous savons portés\nEt notre âme affranchie\nChante sa liberté.",
