    title: 'Dans de verts pâturages',
    lyrics:
      "1.\nDans de verts pâturages\nEt l'ombrages doux\nDieu dirige Ses chers enfants.\nOù les eaux paisibles\nRafraîchissent partout\nDieu dirige Ses chers enfants.\n\nChoeur:\nSoit un chemin\nSombre et glissant\nSoit par la fournaise –\nEt tous par le Sang\nMais dans l'affliction\nDieu leur donne un chant.\nSon grand amour\nEntour Ses enfants.\n\n2.\nParfois sur la montagne\nOù le soleil luit\nDieu dirige Ses chers enfants.\nParfois dans la vallée\nA travers la nuit\nDieu dirige Ses chers enfants.\n\n3.\nEt quand les assaille\nLe grand tentateur\nDieu dirige Ses chers enfants.\nPar Sa grâce toujours\nIls seront vainqueurs\nDieu dirige Ses chers enfants.\n\n4.\nBien loin de la fosse\nEt loin de vils péchés\nDieu dirige Ses chers enfants.\nLoin de cette terre\nPour l'éternité\nDieu dirige Ses chers enfants.",
