      '1.\t\nLè map vini pèson-n pap jan-m konnin (bis)\nPa min-m zanj di sièl pap konnin non plus tou (bis)\n(bis 2 lign)\n\nKè:\nKinbé-m, ban-m kouraj mouin\nPou Satan pa pran mouin\nKinbé-m, ban-m kouraj mouin\nJouk tan la vi-n chaché-m.\n\n2.\t\nLè map vini pèson-n pap jan-m konnin (bis)\nSé sèl Bon-Dié nan sièl ki konnin gran jou sa (bis)\n(bis 2 lign)\n\n3.\t\nLè map vini pèson-n pap jan-m konnin (bis)\nGin gnou kout tronpèt kap sonnin nan sièl la  (bis)\n(bis 2 lign)',
