    title: 'Peut-être au matin',
    lyrics:
      "1.\t\nPeut-être au matin quand le soleil se lève\nEt que ses rayons chassent la nuit si brève\nJésus reviendra dans sa gloire immortelle\nPour prendre du monde les siens.\n\nChoeur\nSeigneur Jésus, combien de temps\nPour qu'éclatent nos chants?\nJésus revient, Alléluia!\nAlléluia! Amen.  (bis)\n\n2.\t\nPeut-être qu'au soir, ou peut-être qu'à midi?\nOu peut-être encore qu'aux ténèbres de minuit,\nTous illuminés par l'éclat de sa gloire,\nLe Seigneur prendra les siens.\n\n3.\t\nTandis que l'armée du ciel chante Alléluia!\nL'Époux a l'épouse pour toujours s'unira\nSur son front la grâce est un halo de gloire\nQuand Jésus prendra les siens.\n\n4.\t\nOh joie! Oh bonheur! Nous irons donc sans mourir\nSans crainte et sans pleurs,\nSans tristesse et sans souffrir!\nEn un clin d'oeil, nous serons tous glorifiés\nQuand Jésus prendra les siens.",
