    num: 10,
    title: 'Mouin révé mouin tandé',
    lyrics:
      '1.\nMouin révé mouin tandé trompèt yo\nKi anonsé gran jou jujman an\nMouin révé nasion yo asanblé\nPou yo jujé dévan tròn blan\nGnou anj éklatan kité tròn nan\nSou la tè ak la mè li kanpé\nLi sèmanté ak min douat sou sièl la\nKé tan-an va suspan-n ékzisté.\n\nKè:\nA la moun pral krié, rélé\nLè koupab yo tandé santans la\nYo rélé pou montagn yo kaché yo  (bis)\nYo prié min sé té trò ta.\n\n2.\nNon-m rich té parèt min lajan li\nDépi lontan té disparèt\nSan angnin dutou nan jujman li\nPou akité gnou si gran dèt\nGran nèg té la, min inpòtans li\nPat konté lè la mò mélé\nLè zanj la ékzaminé achiv li\nNon gran nèg pa gin tan mansioné.\n\n3.\nVèv yo té la ak òfélin yo\nBon-Dieu tandé lè yo krié\nNan pouin tristès janmin nan sièl la\nTout dlo nan zié yo fi-n suyé\nTafiatè té la ak  banbochè ya\nInsi ké moun kapé van-n tafia\nOuangatè, vòlè ak adultè yo\nTout ansan-m té désan-n nan lanfè.\n\n4.\nMésié moral rivé nan jujman\nMin bon avèv moral li pat sufi\nSa yo ki té krisifié Jézu\nPasé pou moun moral osi\nÉ sa yo ki pa té ko pasé\nPi ta na gin tan sové oui\nSé pa kòlè pou la rélijion,\nAnfin trouvé tan pou-l mouri.',
