    title: 'Si Kris pat avè-m',
    lyrics:
      '1.\nSi Kris pat avè-m kouman-m ta yé\nLè zéprèv yo ménasé vi mouin\nAvèk amou-L ki antouré mouin\nMét nan kè mouin gnou vrè chan pou Li.\n\nKè:\nKris gin supriz pou ou frè mouin\nKris gin supriz pou ou zanmi mouin\nSi ou lèsé-L dirijé la vi ou\nGras Li va gnou supriz pou ou.\n\n2.\nSi dlo nan zié-m ta koulé souvan\nSi angouas yo ta véglé zié mouin\nSi énmi-m yo ta ban mouin gnou défi\nDélivrans mouin sé nan gras ou.\n\n3.\nSégnè édé-m, fè mouin rivé,\nLòt bò mò-m nan, sé la-m vlé alé\nKoté ki gin la pè, é la joi\nSé la-m va pozé nan-m mouin.',
