    title: 'Mouin révé malé nan',
    lyrics:
      '1.\nMouin révé-m alé nan gnou sité\nSité koté pap gin la nuit\nMouin té ouè zanj yo briyé nan gloua yo\nMouin té ouè bèl palè kristal la\nMouin té kab ouè frè ansyin mouin yo\nMouin té ouè amé sélès Kris la\nMin sa ki té pi bèl nan vizion an\nMouin rév1—m trouvé sièl la pou ou.\n\nKè:\nMouin révé-m trouvé sièl la pou ou\nO, oui-m trouvé sièl la pou ou\nÈské ou vlé préparé ou pou rankontré-m la\nMouin révé-m trouvé sièl la pou ou.\n\n2.\nMouin té ouè Kris nan bèl rouayòm Li\nMouin té ouè rachté yo avèk Li\nMouin té ouè rédanmtè béni mouin an\nKi té bay vi Li pou sové mouin\nTout sin yo tap chanté gnou bèl kantik\nYo tap bay Bon-Dieu gloua chak moman\nMouin té kontan pou-m kontanplé sin yo\nMouin révé-m trouvé sièl la pou ou.\n\n3.\nÉ ou min-m ki koté ou vlé alé\nÈské ou vlé alé nan sité sa-a\nKris ap tan-n ou dé bra Li louvri\nLi vlé fè gnou plas anro pou ou\nGnou jou ou va konvèti, min élas \nLi kapab byin tro ta pou ou jou sa\nZanmi, èské ou vlé tandé voua Li\nLi vlé louvri pòt sièl la pou ou.',
