    title: 'Nan la vi sila fòk gnou',
    lyrics:
      '1.\nNan la vi sila fòk gnou moun pa tro présé\nLèzòm di san fè, lé Ségnè min-m fè san di\nLè ouapé priyé, fòk ou aji foua ou\nLè sa Jézu va voyé délivrans pou ou.\n\nKè:\nOu min-m krétyin priyé, pa dékourajé\nPèsévéré nan la priè, mandé Li pasians\nSé Li ki mèt ou, sé Li k-éspoua ou,\nSé Li k-zanmi ou,\nÉpi oua ouè tout bagay réglé.\n\n2.\nMin-m si ou pat gin éspoua, Priyé Jézu chak jou\nSé Li-k pou délivré ou pou ba ou la vi\nDi Li mèsi toutan, répanti tout péché ou\nKonfésé ou ak Jézu, oua délivré.\n\n\n3.\nLè ou sonjé David, son non-m yo té méprizé\nLi té rivé roua pa puisans Pè Étènèl\nSé min-m jan ou min-m, si ou kinbé la foua\nLè sa Jézu va voyé délivrans pou ou.',
