    lyrics:
      '1.\nGin gnou bèl jou lè la vi-m va fini\nMap vòltijé, map vòltijé.\nPou mouin alé nan kay sélès la;\nMap vòltijé, map vòltijé.\n\nRéfrin:\nMap vòltijé!  Ki bèl gloua!  Map vòltijé!\nLè mouin mouri, o alélouya pa lontant\nMap vòltijé!\n\n2.\nTout éprèv nan vi sa-a va fini,\nMap vòltijé!\nKou gnou zouazo ki té prizonié\nMap vòltijé!\n\n3.\nNan pé dé tan, jou yo pa tro louin,\nMap vòltijé,\nNan péyi koté jou yo pap fini\nMap vòltijé.',
