    lyrics:
      "1.\nQuelques mots à Jésus,\nOui quelques mots souvent,\nEt savoir tout Lui dire,\nOh que c'est bienfaisant!\nNos troubles, nos ennuis,\nBien souvent je l'ai vu,\nS'apaisent vite,\nAprès quelques mots à Jésus.\n\n2.\nQuelques mots à Jésus,\nQuand on est affligé,\nQuand on a fait du mal\nEt qu'on en est fâché,\nOui ces mots de regrets,\nEnfants, n'hésitez plus,\nPour être consolés,\nDites-les à Jésus.\n\n3.\nQuelques mots à Jésus,\nAu milieu du bonheur,\nLui répéter souvent:\nMerci, merci Seigneur;\nVoilà ce qui lui plaît,\nSon coeur en est ému;\nAh! Sachons dire\nCes quelques mots à Jésus.",
