    title: 'Nan la Bib yo rakonté',
    lyrics:
      '1.\t\nNan la Bib yo rakonté istoua gnou profèt apélé\nA gnou vil ki té pèdi nan péché    \nOkin-n moun la li tandé palé konnin gras Bon-Dié\nÉ profèt la pat gin kouraj pou-l alé.\n\nKè:\nO la ba, oui la ba nan péi-a bon é bèl\nLi va rakonté-m tou sa nan sièl la\nNan péi-a «Allélouya» map pran min Jonas a pa\nÉ la rakonté-m tou sa, oui la ba.\n\n2.\t\nO Bon-Dié voyé Jonas préché vil-la répantans\nMin nan gnou bak a Tasis li vlé alé\nMin van yo vanté li fò li pat kapab rét abò\nSé nan vant pouason an li sonjé prié.\n\n3.\t\nO-milié gnou gran lanmè dlo nan jé-l lap la priè\nMin pouason réjté Jonas sou rivaj\nAvèk joua lalé tou souit préché Niniv jou é noui-t\nDézobéisans fini é li vi-n saj.\n\n4.\t\nLè Jonas palé konsa pèp Niniv yo konvèti\nRè-n dé midi konvèti nan tròn la\nRoua Niniv la konvèti li krié dlo nan jé li\nFòs la nan min Létènèl, oui la ba.',
