      '1.\t\nPi bon zanmi mouin gingnin sé Jézu\nLi avèk mouin koté-m pasé\nSé Li min-m rakonté tout afè-m\nÉ-L ban-m toujou konsèy.\n\nKè:\nPa gin gnou lòt ki rinmin-m kon Li\nLi konnin tout sa ki nan kè mouin\nPi bon zanmi mouin gingnin sé Jézu\nPa gin gnou lòt kon Li.\n\n2.\t\nLé mon-n kouè yo ka séparé-m ak Kris\nYo pa kapab, yo pa kapab,\nPaské alians la té fèt ak san Li\nYo pa kapab krazé-l.\n\n3.\t\nMouin jouinn nan Jézu tout sa-m tap chaché\nLa pè, la joua, min-m la santé\nÉ Jézu ban mouin vi étènèl\nSa-m pat kapab achté-l.\n\n4.\t\nJézu bézouin lòt moun pou zanmi-L\nLap rélé ou, lap rélé ou\nSi ou répon-n Li la résévoua ou\nÉ-L va sové nan-m ou.',
