    num: 11,
    title: 'Mouin gingnin gnou bagay',
    lyrics:
      '1.\nMouin gingnin gnou bagay\nKi fè kè mouin kontan\nAnpil moun étoné, pou ouè koman-m kontan\nÉ ma-p toujou kontan.\nÉspoua-m pa sou tè sa-a, \nDaprè promès Bon-Dieu.\nMin-m si mouin té grangou,\nPat gin kay pou-m rété\nMap rét tan-n gran jou sa-a.\n\nKè:\nPap gin palé fransè, konésans pral fini\nRichès pral disparèt, Kris ap vini\nPap gingnin gro mésié, \nPap gingnin gro madan-m\nNou tout va min-m bagay, lè jézu va vini\nLi pap vini chèché savan ak zotobré\nSèlman li va bézouin sa ki fè volonté-L\nYo va min nan la min. (bis)\n\n2.\nAnpil moun konvèti, yo pap chèché Bon-Dieu\nYapé prié sèlman pou kay avèk oto\nPou kay avèk oto, sé bagay kap pasé\nYo pa prié Bon-dieu\nPou padon péché yo, fòk nou fèt atansyon\nPaské kay ak oto\nPap monté gran jou sa.\n\n3.\nPou kapab al légliz, fòk ou byin abiyé\nSak pa gin pou-l  mété, pa doué chita koté ou\nKè ou ranpli ak ògèy\nSonjé sa Kris té di avèk gran Nikodèm\nSi ou ta vlé gin la vi, fòk ou né dé nouvo\nÉ oua ouè rouayòm sa-a.\n\n4.\nLa sians apé travay malgré sa sé nulman\nSak kon-n fè méchansté ap vini pi méchan\nLòm pa kap chanjé lòm sinon san Jézu-Kri\nMin-m si ou té lougarou\nOu té kon-n tuyé moun\nJézu kapab chanjé ou.',
