    lyrics:
      '1.\nMouin vlé sanblé ou Rédanmtè béni\nSé sa dézi-m ak la priè-m\nTout trézò tè sa pa intérésé-m\nSi sèlman mouin kap sanblé Ségnè-m.\n\nKè:\nMouin vlé sanblé Ou, mouin vlé sanblé Ou,\nRédanmtè b1 ni konplètman Sin,\nVi-n nan dousè Ou, répon-n priè mouin\nInprimé pòtré Ou nan mouin.\n\n2.\nMouin vlé sanblé Ou nan umilité\nSin, inosan, san tach, san bla-m\nDousman, supòtan reproch méchan yo\nPrèt pou soufri lè zòt pou sové.',
