      "1.\nJ'ai toujours voulu trouver la lumière\nJ'étais confus mais sur cette terre\nTu m'as reconnu\nSi parfois je tombe, je n'aurais pas honte\nJe prends la vie quand tu me l'as dit.\n\nRefrain\nUn jour à la fois, doux Jésus,\nC'est tout ce que je peux donner\nTu m'as donné la foi pour changer ma vie\nEt je crois en Toi\nHier n'est plus, doux Jésus,\nEt demain n'est pas encore là\nSi je ne le vois pas\nAssiste-moi, un jour à la fois.\n\n2.\nJe T'ai rencontré, Tu sommeillais en moi\nOh Jésus tu sais, j'étais si loin de Toi\nTu veillais sur moi n'oublie pas mon nom\nEntends ma voix que ma chanson\nMonte vers Toi, un jour à la fois.",
