    lyrics:
      "1.\nJe vous envoie travailler sans relâche\nTenez sans peur vos labeurs de cette croix,\nSupportez tout ce monde être méprisé\nJe vous envoie travailler seul pour moi.\n\nRefrain\nComme le Père m'a envoyé, Je vous envoie\nJe vous envoie bander pour Moi les plaies\nCherchant des armes reportant à la croix\nPortez le fardeau de ceux qui chancellent\nJe vous envoie souffrir pleurer pour Moi.\n\n2.\nJe vous envoie au coeur dur et rebelle\nLà où Satan s'approche près de toi\nVous vous sacrifiez jusqu'à donner la vie\nJe vous envoie monter au Calvaire pour Moi.\n\n3.\nJe vous envoie renoncer à vous-même\nAbandonnez ce  qui fait votre joie\nVous pardonnerez tous ceux qui vous haïssent\nJe vous envoie mourir pour vivre en Moi.",
