    title: 'Trilogie',
    lyrics:
      '1.\nPéchè pouki ou égaré dé Bon-Dieu\nLouin di chémin an koté Jézu pasé\nAvan kò ou répozé nan gazon an\nTravèsé rout la mò-a.\n\nKè:\nOu doué janbé rout la mò-a\nVi-n maché nan lumiè sièl la\nAvan kò ou répozé nan tonbo-a\nTravèsé rout la mò-a.\n\n2.\nOu na danjé zanmi mouin\nSa ouap fè toujou\nDémin va vini, min li kapab tro ta\nSa va gnou tristès si ou pèdi pòt la\nTravèsé rout la mò-a.\n\n3.\nOu min-m zanmi ki lan zò-n nan kap kouté\nLè ou va mouri, ki lès ki pral résévoua ou\nTout sa yo ki gin tan aksépté Jézu\nTravèsé rout la mò-a.',
