    title: 'Mouin sonjé gnou jou',
    lyrics:
      '1.\nMouin sonjé gnou jou ki jan mouin té malad\nDoktè t  di konsa li pa kouè map sové\nParna-m yo tandé sa, yo otut pran kriyé\nMin Jézu té palé nan jou sa.\n\nKè:\nMouin pap kapab blié, blié jou sa\nKòman pou-m blié jou sa\nJou-m té jouin-n soulajman pou nan-m mouin\nGloua a Dieu. (bis 3 lign)\n\n2.\nLé mouin pat gin Jézu, kè mouin té toujou tris\nMouin pat kapab manjé mouin pat kapab dòmi\nLè-m vi-n jouin-n ak Jézu tout bagay té chanjé\nA la gnou bon Zanmi sé Jézu.\n\n3.\nLè mouin té nan mon lan mouin toujou tap krié\nPéché mouin té rouj é tèt mouin té chajé\nChak jou mouin lévé, problèm a goch a douat\nMouin té rémèt Jézu ti rès la\n\n4.\nJoi-a si gin moun ki poko gin Jézi\nKouri vit aksépté-L, paské lè-a rivé\nNan Jézu gin la vi, gin la joua nan Jézu\nNan Jézu gin gnou lèt ap koulé.',
