    title: 'Mouin gin gnou fèm',
    lyrics:
      '1.\nMouin gin gnou fè-m asurans\nKé Jézu ap véyé mouin patou koté-m alé\nAmou Li si mèvéyé, Li pap abandoné mouin\nNan mòn-n pédu sa-a.\n\nKè:\nNan gnou péyi plin dé péché\nKris voyé mouin kòm gnou anbasadè\nLi amé mouin ak Léspri Li\nGloua a Jézu-Kri mouin pap maché mouin sèl.\n\n2.\nOu kapab byin maléré, pèsékité sou la tè\nTout souit nou di gloua a Dieu\nÉprèv yo sé pou krétyin\nÉ Jézu, Li chatié pitit ké Li rinmin.\n\n3.\nMalgré tout tribulasion, malgré tout pèsékusion\nTout souit nou di gloua a Dieu\nBonè nou pa isiba\nPlas nou sé nan sièl li yé, pami lè rachté.',
