    lyrics:
      "1.\nJésus est venu dans Sa puissance\nSa paix mon âme inonde.\nDès lors à jamais ma vie est à Lui\nSa grâce surabonde\nSa grâce surabonde.\n\nChoeur:\nO que c'est merveilleux\n(merveilleux, merveilleux)\nQue c'est émouvant et merveilleux\n(émouvant et merveilleux)\nCe que Jésus a fait pour mon âme\n(ce qu'il a fait pour mon âme )\nO que c'est ineffable\n(ô que c'est ineffable)\nO (merveilleux)\nQue c'est merveilleux\nQue c'est émouvant et merveilleux\nCe que Jésus a fait pour mon âme\nO que c'est ineffable!\n\n2.\nDe gloire en gloire Jésus me conduit\nDe grâce en grâce toujours.\nA l'horizon vois briller l'aurore\nVers le céleste séjour\nVers le céleste séjour.\n\n3.\nSi le nom de Jésus ici-bas est\nInexprimablement doux\nO que sera-t-il de voir Sa face\nAu céleste rendez-vous?\nAu céleste rendez-vous?",
