      md: "**1.** \n\nBeau pays de lumière et d'amour \n\nPar la foi nous voyons ton rivage; \n\nNos pensées s'arrêtent chaque jour, \n\nAux bien-aimés déjà sur ta plage. \n\n\n\n\n<br/> **Choeur:**\n\n**Oh! Quel doux rendez-vous,** \n\n**Après notre terrestre voyage,** \n\n**Oh! Quel doux rendez-vous,** \n\n**Ton céleste repos est pour nous.** \n\n\n\n<br/> **2.**\n\nEt le beau cantique de l'Agneau, \n\nNous le chanterons avec les anges, \n\nLe bonheur sera toujours nouveau, \n\nJamais ne cesseront les louanges. \n\n\n<br/> **3.**\n\nOui, nous voulons bénir le Seigneur \n\nLouer d'un coeur joyeux notre Père, \n\nDont l'amour nous donna pour Sauveur \n\nJésus-Christ qui se fit notre Frère. \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Beau pays de lumière et d&#39;amour </p>\n<p>Par la foi nous voyons ton rivage; </p>\n<p>Nos pensées s&#39;arrêtent chaque jour, </p>\n<p>Aux bien-aimés déjà sur ta plage. </p>\n<p><br/> <strong>Choeur:</strong></p>\n<p><strong>Oh! Quel doux rendez-vous,</strong> </p>\n<p><strong>Après notre terrestre voyage,</strong> </p>\n<p><strong>Oh! Quel doux rendez-vous,</strong> </p>\n<p><strong>Ton céleste repos est pour nous.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Et le beau cantique de l&#39;Agneau, </p>\n<p>Nous le chanterons avec les anges, </p>\n<p>Le bonheur sera toujours nouveau, </p>\n<p>Jamais ne cesseront les louanges. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Oui, nous voulons bénir le Seigneur </p>\n<p>Louer d&#39;un coeur joyeux notre Père, </p>\n<p>Dont l&#39;amour nous donna pour Sauveur </p>\n<p>Jésus-Christ qui se fit notre Frère. </p>\n'
