    title: 'Lorsque le ciel',
    lyrics:
      "1.\nLorsque le ciel\nRetentit de louanges\nEt qu'ici-bas\nRégnait la sombre nuit,\nJésus naquît plus\nHumble que les anges,\nPour me sauver\nSi bas il descendit.\n\nChoeur:\nBonheur suprême,\nMon Sauveur m'aime,\nLui qui mourut et fut ressuscité,\nEt sur la nue à Sa venue,\nJe Le verrai, Lui qui m'a racheté.\n\n2.\nLorsqu'à la croix\nLe Prince de la vie\nLava, blanchit mes péchés,\nMes forfaits,\nLe grand pouvoir\nDe Sa grâce infinie,\nFerma l'abîme où\nSatan m'entraînait.\n\n3.\nLorsqu'un matin\nDe la grande victoire,\nIl triompha de la mort,\nDu tombeau,\nIl effaça pour toujours\nLa mémoire\nDu noir passé,\nCet écrasant fardeau!\n\n4.\nLorsqu'Il viendra\nDans Sa magnificence,\nRavir les Siens pour\nJamais dans les cieux,\nJ'entonnerai l'hymne\nDe délivrance,\nEn exaltant\nSon grand nom glorieux.",
