    title: 'Quand un sombre nuage',
    lyrics:
      "1.\nQuand un sombre nuage\nVoile ton chemin\nPourquoi craindre l'orage?\nJésus tient ta main!\nIl n'est plus de tristesse,\nSi tu sais prier;\nTout est paix, allégresse,\nSi tu sais prier.\n\nChoeur:\nSi tu sais aimer,\nSi tu sais prier\nTu pourras chanter\nDans la plus sombre nuit!\nSi Dieu vit en toi,\nS'Il soutient ta foi,\nOui le soleil se lèvera\nSi Dieu vit en toi.\n\n2.\nEs-tu seul dans la vie?\nChante malgré tout\nMarche vers ta patrie,\nMarche jusqu'au bout;\nSi ton sentier est rude,\nDieu peut te donner\nCourage, certitude,\nSi tu sais aimer.\n\n3.\nAux frimas, à la neige,\nSuivra la moisson,\nDélivré de tout piège,\nTrace un pur sillon!\nDe ton labeur, ta peine,\nDieu fera germer\nUne moisson certaine,\nSi tu sais aimer.",
