    title: 'Altéré dans la terre',
    lyrics:
      "1.\nAltéré dans la terre\nAride de péché\nA soulager mon coeur\nJ'ai beau chercher.\nMais je suis venu un jour\nAu pied de la croix\nOù jaillit une source\nD'eau pour moi.\n\nChoeur:\nPuisant à la source d'eau vivante\nJ'ai enfin la paix –\nMon coeur est satisfait\nPuisant à la source d'eau vivante\nQuelle source intarissable à jamais!\n\n2.\nO qu'elle est agréable\nCette eau vivante\nQui m'arrose de joie abondante!\nJe marche dans le chemin\nDe grâce et d'amour\nEt je chante alléluia chaque jour.\n\n3.\nO viens aujourd'hui\nA la croix du Calvaire\nOù Jésus a vaincu l'adversaire.\nO, toi, qui as soif\nDe cette eau de la vie\nViens, puiser à la source infinie.",
