    lyrics:
      '1.\nMouin vlé sanblé Ou Rédanmtè béni\nSé sa ki dézi ak la priè-m,\nTout trézò tè a pa intérésan\nSi sèlman mouin kab sanblé Ségnè-m.\n\nKè:\nMouin vlé sanblé Ou,\nMouin vlé sanblé Ou,\nRédanmtè béni, konplètman sin,\nVi-n nan dousè Ou, répon-n priè nou\nInprimé pòtré Ou nan kè mouin.\n\n2.\nMouin vlésanblé Ou plin ak konpasion\nByinémab, padonnan, plin tandrès,\nSékouri maléré avèk fèb yo,\nAp édé mizérab nan détrès.\n\n3.\nMouin vlé sanblé Ou nan lumilité\nSin, inosan, san tach, san blamé\nDousman supòtan réproch méchan yo\nPrèt pou soufri, léz òt pou sové.\n\n4.\nMouin vlé sanblé Ou, min mouin chè Ségnè\nRanpli kè mouin ak puisans anro\nTou sa-m posédé mouin pòté ba ou,\nMouin vlé transfòmé, né dé nouvo.',
