    title: 'Nan Pi Fon Kè Mouin',
    lyrics:
      '1.\nLè mouin ouvri pòt kè mouin ba Jézu\nLi ba mouin gnou joua mèvéyé,\nSé gnou joua ki va duré tout tan\nSé sou Jézu li konsantré.\n\nKè:\nNan pi fon kè mouin\nLamou Jézu apé chanté,\nNan pi fon kè mouin\nLa pé ak la joua ap pousé\nNan pi fon kè mouin\nLéspérans apé soulajé,\nJoua, pè, amou, éspérans,\nNan pi fon kè mouin.\n\n2.\nLi ba mouin gnou kalité la pè\nKi va supòté tout détrès,\nAkòz mizèrikòd infini\nM-ap joui gnou amou ki sélèst.\n\n3.\nLi ba mouin gnou pafèt éspérans,\nKé gnou jou figu Li ma ouè,\nM-ap fè rout mouin plin ak réjouisans\nAk la joua, léspérans, la pè.',
