      "1.\nLève-toi, pars chercher les âmes,\nM'a dit mon Maître, Jésus-Christ,\nGagne-les-moi, je les réclame\nPour mes joyaux du plus grand prix.\n\n2.\nEt maintenant l'amour me presse\nEt me fait brûler du désir\nD'aller aux pécheurs en détresse,\nPour sauver ceux qui vont périr.\n\n3.\nLa flamme ardente qui m'anime\nMe consumera tout entier;\nEn servant la cause sublime,\nJe perdrai tout pour tout gagner.\n\n4.\nViens avec moi dans la carrière,\nToi, qui mourus pour le pécheur,\nEt ta croix me sera légère,\nSi ton amour remplit mon coeur.",
