    title: 'Seigneur, garde-moi toujours confiant',
    lyrics:
      "1.\nSeigneur garde-moi toujours confiant\nO que chaque jour je sois triomphant\nSi tu m'envoies le jour ou la nuit\nJe sais bien que ta grâce me suffit.\n\nChoeur:\nPlus confiant, plus confiant\nQue chaque jour je sois plus confiant\nDans les orages bien terrifiants\nSeigneur garde-moi toujours plus confiant.\n\n2.\nQue je ne craigne pas le lendemain\nAssuré que ton secours est certain.\nCe que tu m'envoies de jour en jour\nEst toujours scellé de ton grand amour.\n\n3.\nSeigneur garde-moi confiant en Toi;\nQuand la vue remplacera ma foi\nJe te chanterai le coeur débordant;\nSeigneur garde-moi toujours confiant.",
