    title: 'Fas A Fas',
    lyrics:
      '1.\nFas a fas lè m-a ouè Jézu,\nM-a kontanplé bonté Li,\nPou toujou m-a va ouè Jézu,\nPou toujou viv avèk Li.\n\nKè:\nOui, nan tout magnifisans Li,\nM-a va ouè Jézu gnou jou,\nLè tout bon m-a nan prézans Li,\nM-a loué Li pou toujou.\n\n2.\nGloua Jézu pako révélé\nGin gnou voual ki  kouvri Li,\nMin kan voual la va déchiré,\nN-a va ouè tout bonté Li.\n\n3.\nOh!  Kè mouin va plin alégrès,\nKan gnou jou m-a va ouè Li,\nÉ kan la di mouin ak tandrès,\n«Pou ou tou mouin té mouri.»',
