    title: 'Prêt a souffrir tristesse et douleur',
    lyrics:
      "1.\nPrêt à souffrir tristesse et douleur,\nPrêt à tout supporter,\nPrêt à voir aller les volontaires\nQuand il me faut rester.\n\nChoeur:\nPrêt à aller, prêt à rester,\nPrêt à être employé,\nPrêt pour le service,\nQuel qu'il en soit,\nPrêt pour sa volonté.\n\n2.\nprêt à aller, prêt à subir,\nprêt à veiller, prier,\nprêt à donner et sacrifier,\nprêt à être guidé.\n\n3.\nPrêt à parler, prêt à enseigner,\nPrêt avec tout mon coeur,\nPrêt à me tenir en messager,\nPrêt à plaire au Sauveur.\n\n4.\nPrêt à parler, prêt à relever,\nPrêt à porter secours,\nPrêt dans la vie,\nPrêt à son prompt retour.",
