    title: 'Levez Les yeux',
    lyrics:
      "1.Levez les yeux Sur tout le vaste monde, Vers les paysOù règne encore la nuit,Jésus attend queQuelqu'un lui réponde:«Seigneur, j'irai,Conduit par ton Esprit».Choeur:«Je suis avec vous tous les jours,Comptes sur mon puissant secours,Allez partout prêcher, Le saint Évangile,D'une ville à l'autre ville.»2.Levez les yeuxCar la moisson est mûre,Pourquoi resterSans rien faire aujourd'hui?Avec Jésus, la tâcheN'est point dure,N'hésitez plus,Ne comptez que sur Lui.3.Levez les yeuxSonnez de la trompette,Pour railler sousL'étendard sanglantDe Jésus-Christ,Tout héros, tout prophète,Prêt à mourir,S'il faut, en combattant.4.Levez les yeuxSur l'immense détresseDe tout mortelIgnorant du salut;Réveillez-vous!Arrière la paresse!Allez! Partez!Courrez droit vers le but!",
