    lyrics:
      "1.\nJésus, nom suprême –\nSon mélodieux,\nTout racheté l'aime –\nSur la terre et dans les cieux.\n\n2.\nJésus, don céleste –\nSauveur merveilleux;\nTon amour me reste –\nComme un joyau précieux.\n\n3.\nJésus, point de vie –\nToi qui nourris,\nMon âme est ravie –\nQuand du ciel tu me souris.\n\n4.\nJésus, ma richesse –\nMa vie et mon lot;\nSelon ta promesse –\nDu ciel tu viendras bientôt.",
