    title: 'Je me rappelle un jour',
    lyrics:
      "1.\nJe me rappelle un jour\nOù dans le ciel je vis\nLe livre dans lequel\nTout pécheur est inscrit;\nJe vis mon nom très clair,\nJe dis, mon Dieu  que faire?\nEn tombant à ses pieds,\nJe réglai mon affaire.\n\nChoeur:\nA l'instant, à l'instant,\nOui, le vieux compte fut réglé à l'instant;\nJe ne suis plus effrayé\nMa dette est déjà payée,\nEt mon compte avec mon juge\nEst tout réglé.\n\n2.\nMon compte était très lourd,\nEt je voulais toujours,\nQuand j'étais égaré,\nPécher plus chaque jour;\nMais quand mes yeux s'ouvrirent\nEt je vis mon état,\nJe me jetai aux pieds\nDu Sauveur, à l'instant.\n\n3.\nAu jour du jugement,\nDevant le trône blanc,\nQuand tous les morts viendront,\nLes livres s'ouvriront;\nEt quand on cherchera,\nMon nom n'y sera pas,\nCar Jésus l'a inscrit\nAu Livre de la Vie.",
