    title: 'Que Dieu vous donne du repos',
    lyrics:
      "1.\nQue Dieu vous donne du repos,\nSoyez tous sans crainte,\nCar le Christ notre Sauveur\nCe jour sans contrainte\nFut incarné pour nous sauver,\nDans la ville sainte.\n\nChoeur:\nO nouvelle de joie et paix,\nDe joie et paix\nO nouvelle de joie et paix!\n\n2.\nUn ange de Dieu vint du ciel\nAnnoncer aux bergers,\nUne bonne nouvelle,\nAu monde fatigué\nUn message de joie et paix,\nLe pardon du péché.\n\n3.\nNe craignez point l'ange leur dit,\nUn Sauveur nous est né\nDans la ville de David,\nNaquit ce saint Bébé\nLes bergers y allèrent en hâte\nEt l'enfant ont trouvé.\n\n4.\nIls trouvèrent L'Enfant si saint\nDans la crèche couché\nEt Sa mère, Marie,\nSon Dieu a exalté.\nPuis les bergers s'en allèrent,\nL'histoire raconter.\n\n5.\nChantons tous avec louange,\nAu Seigneur en ce jour\nEt que nos coeurs ensemble\nSoient unis par l'amour.\nDonnons-Lui nos vies entières\nPour Le servir toujours.",
