    title: 'Tu payas mon salut',
    lyrics:
      "1.\nTu payas mon salut\nPar ton grand sacrifice,\nO Jésus, quel merveilleux amour!\nDésormais pour ton saint\nEt glorieux service\nTon racheté se donne en retour.\n\nChoeur:\nJe viens à ton autel,\nOffrande volontaire,\nLibrement je veux servir mon Roi;\nJe ne veux désormais\nQue ta gloire, ô mon Père\nNe vivre que par Toi,\nQue pour Toi.\n\n2.\nPrends tout ce que je suis,\nPrends mon coeur et mon âme,\nQue tout mon être te soit livré!\nContrôlé par l'Esprit,\nAnimé de ta flamme,\nEt de ta Parole pénétré.\n\n3.\nSeigneur, de jour en jour,\nTransforme à ton image\nTon enfant, ton heureux racheté;\nDevant moi n'est qu'un but\nJusqu'au bout du voyage,\nConnaître et faire ta volonté.",
