      html: '<p><strong>1.</strong> </p>\n<p>Dépi-m trouvé Jézu mouin trouvé répo, </p>\n<p>Jézu kaché-m nan gran amou Li, </p>\n<p>Li konpran-n mouin, </p>\n<p>L-édé’m pòté tout fado </p>\n<p>Chak jou Li ban-m prèv gran amou Li. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Sèlman Jézu, sèlman Jézu,</strong> </p>\n<p><strong>Li-min’m sèl kab satisfè,</strong> </p>\n<p><strong>Li ban-m la joua, Li ban mouin la pè,</strong> </p>\n<p><strong>Li ban mouin bonnè pafè.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Dépi-m trouvé Jézu mouin trouvé la joua, </p>\n<p>Mouin pa-t pansé sou la tè sa a, </p>\n<p>Mouin pa jan-m kab trouvé. </p>\n<p>Gnou si gran joua </p>\n<p>M-ap gouté déjà bonnè sièl la. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Dépi-m trouvé Jézu mouin gingnin éspoua </p>\n<p>Min-m nan mizè-m, </p>\n<p>Min-m nan soufrans mouin, </p>\n<p>Nan pouin loraj ki kab fè-m pèdu la foua, </p>\n<p>Ténèb chanjé an lumiè pou mouin. </p>\n'
