    lyrics:
      '1.\nLè-m té vi-n jouin-n Jézu,\nMalgré tout péché-m\nLa min-m li sové mouin, é Li padonnin-m,\nLa foua mouin vi-n fèm,\nKè mouin ranpli ak joua\nLè-m fè Li Ségnè-m.\n\nKè:\nMouin fè Li Ségnè konplètmn sou la vi-m,\nÉ m-a maché avèk Li tout lè.\nSé gnou privilèj sévi Li jan Li vlé,\nMouin kouroné Li Ségnè.\n\n2.\nKoun yé a mouin bay Kris\nTou sa-m posédé,\nNan pouin sakrifis ké Li pa mérité,\nM-ap dispozé tan, fòs, ak kapasité\nLè mouin ba Li tout,\nAtò mouin kab chanté.\n\n3.\nEské-m pa doué rinmin-L?\nPou mouin Li mouri,\nEské-m pa doué sèvi-L?\nSé mouin L-afranchi!\nEské-m pa doué obéyi tou sa Li di?\nMin mouin, Ségnè Jézu,\nPran mouin nèt, tanpi!',
