    title: 'Nan Gran Jou Rézurèksion',
    lyrics:
      '1.\nNan gran jou la rézurèksion\nLè tronpèt Bon-Dieu sonnin,\nN-a lévé, alélouya, n-a lévé.\nN-a ranpli ak bénédiksion\nKi gran joua nou va gingnin,\nN-a lévé, alélouya, n-a lévé.\n\nKè:\nN-a lévé, n-a lévé, n-a lévé,\nNan gran jou la rézurèksion,\nLè pòt prizon la mo krazé,\nN-a lévé, alélouya, n-a lévé.\n\n2.\nNan gran jou la rézurèksion\nA la gnou gran réunion,\nN-a lévé, alélouya, n-a lévé.\nAk paran nou, frè ak sè nou\nKi té chèché vrè padon,\nN-a lévé, alélouya, n-a lévé.\n\n3.\nNan gran jou la rézurèksion\nPi gran éspérans mouin gin,\nN-a lévé, alélouya, n-a lévé.\nM-a kontré ak Sovè béni,\nKi té mouri nan plas mouin,\nN-a lévé, alélouya, n-a lévé.\n\n4.\nNan gran jou la rézurèksion\nN-a jouin-n avèk Kris an lè\nN-a lévé, alélouya, n-a lévé.\nL-a pòté nou jouk nan la gloua\nÉ tout bagay va chanjé,\nN-a lévé, alèlouya, n-a lévé.',
