    lyrics:
      '1.\nAndan Paròl Bon-Dieu na jouin-n\nGnou trézò vérité kaché,\nMin si nou fouyé trézò sa\nRichès li va manifésté.\n\nKè:\nChèché pou prézanté ou dévan Bon-Dieu\nTankou ouvrié ki éprouvé nan tout lié,\nKi pa gingnin pou li ront dévan Létènèl,\nAp bay mésaj Lévanjil fidèl.\n\n2.\nSé pou ou li Bib ou chak jou,\nPou profité richès Léspri,\nKonsa oua prospéré tout bon,\nProjè ou yo va réusi.\n\n3.\nBib la montré chémin la vi\nÉ Kris akité péché nou\nMin, fòk nou konnin Bib la byin,\nPou ékspliké mésaj la tou.\n\n4.\nSé moun Bon-Dieu té inspiré\nKi ékri la Paròl Sakré\nÉ lè jujman dènié rivé,\nSé nan Liv sa nou va jujé.',
