    lyrics:
      '1.\nMouin kanpé sou tout promès\nDé Kris, Roua mouin,\nPandan létènité map chanté louanj Li.\nGloua nan tout sièl la\nSa va sujè chan mouin,\nMouin kanpé sou tout promès Bon-Dieu.\n\n\n\nKè:\nKanpé, kanpé,\nMouin kanpé sou tout promès\nKé Bon-Dieu fè nou,\nKanpé, kanpé,\nM-apé kanpé sou tout promès Bon-Dieu.\n\n2.\nMouin kanpé sou tout promès ki pa fayi\nLè mové tanpèt é tout krint vlé koulé-m,\nPa voua Paròl Bon-Dieu ma sòti vinkè,\nMouin kanpé sou tout promès Bon-Dieu.',
