    lyrics:
      '1.\nMouin Té gnou gran péchè lè-m vini,\nChèché padon nan min Bon-Dieu\nKris tandé priè mouin, é-m trouvé,\nKé Li pap fayi-m janmin.\n\nKè:\nGin gnou non nouvo ékri nan la gloua,\nSé pou mouin, oui, sé pou mouin,\nÉ zanj yo ap rakonté istoua la\n«Gnou lòt péchè sové.»\nGin gnou non nouvo ékri nan la gloua\nSé pou mouin, oui, sé pou mouin.\nPéché-m yo padonnin,\nNan sièl la mouin pralé pou létènité.\n\n2.\nDévan la koua Jézu, mouin bésé,\nPaské sé gnou koupab mouin yé,\nÉpi sièl la ouvri, é mouin ouè,\nKoté yo ékri non mouin.',
