    title: 'Kouté Gnou Nouvèl',
    lyrics:
      '1.\nKouté gnou nouvèl, li bon é li bèl,\nKé mouin gingnin é m-a ba ou Li\nTout péché mouin fè yo tout padonnin,\nÉ rékonpans mouin nan Jézu-Kri.\nJuska prézan yo gin plas ankò,\nNan palè sélès, rich ann-ò\nToujou rézèvé pou sa yo ki vlé,\nProfité salu Bon-Dieu.\n\n2.\nTout plézi mondèn pa intérésé-m,\nPaské yo pa kapab satisfè,\nMouin pito la pè ké Jézu ba mouin,\nKi va duré pou létènité.\nKoun yé a mouin kontan nan Jézu\nMouin pral nan sièl la gras a Li\nLi toujou gidé-m, Paròl Li édé-m,\nMaché nan la vérité.\n\n3.\nSa pa fè-m angnin si yo jouré mouin\nPaské yo pa konnin bon Ségnè-m.\nLi té chaché mouin é Li sové mouin\nSé amou Li ki andédan kè-m.\nSou tè a m-a gin éprèv isi,\nMin kè mouin nan répo nan Li\nSa va gnou gran joua pou rivé laba\nKoté tout péché fini.',
