    title: 'Dieu Damou',
    lyrics:
      '1.\nDieu damoui!  Sièl la va di li,\nBèl zétoual manifésté li,\nDieu damou! Réjoui, chanté nan-m mouin\nTout koli-n répété gloua Li\nMin-m ravi-n chanté istoua Li,\nDieu damou!  Ranfòsé bèl réfrin.\nKouté lè van an ap souflé\nDousman nan pié boua\nTandé rosignol la prononsé, Alélouya\nEsk ou tandé chan y-ap chanté?\nKréasion ap manifésté,\nDieu damou Li sé gnou Dieu damou.\n\n2.\nDieu damou!  Anonsé nouvèl,\nSé mésaj ki pi ésansièl,\nDieu damou! Bib la anonsé Li\nJézu-Kri gran Kréatè a\nTé vini kom Rédanmtè a,\nNan plas nou Li aksépté soufri.\nNan gnou tribunal Romin yo kondané Jézu,\nLéz an-m égaré té méprizé gras é salu\nSou la koua Li ba nou la vi,\nPa la foua nou aksépté Li,\nPa la foua nou aksépté Li,\nDieu damou! Li sé gnou Dieu damou!',
