    title: 'Pou Ki \\Moun Pale Kristal Sa-a',
    lyrics:
      '1.\nPou ki moun pale Kristal sa-a\nSe pou mwen ak Jezu kri,\nPou ki moun fotey an no yo?\nSe pou mwen ak rachte yo\n \nRefrain:\nSe yon bel pale Kristal\nAvek anpil chez an nor\nPou tout moun ki vle ale\nAvek Segnè Jezu\n \n2.\nJerizalem nan bel anpil,\nLi pi bel pase dyaman\nLi soti kote Bondye minm\nE li gen tout glwa bondye\n \n3.\nPa bezwen soley al lali-n\nPou klere nou jou e nwit\nMin la glwa Bondye va briye\nEkla li va yon flanbo\n \n4.\nPap gen krint, doule, a touman\nNi lanmo, ni malady\nMedizans, koutlang va fini\nSe lajwa lanmou san fin\n \n5.\nAla yon bel jou, sa va ye,\nLè tronpet la va sonnin\nPou tout mo nan Kris leve\nPou y-al rankontre Jezu',
