    title: "Dans l'amour divin cache",
    lyrics:
      "1.\nDans l'amour divin caché\nMon coeur n'a nulle crainte\nCet abri m'est assuré\nPar sa Parole sainte;\nQuand l'orage fait rage\nMon coeur est abattu\nMais mon Dieu m'encourage\nEt je ne doute plus.\n\n2.\nMon Berger me dirige\nJe Le suivrai partout\nChaque jour Il me soigne\nDans Son amour si doux.\nSa sagesse infinie –\nSa force me soutient\nDésormais que ma vie\nSuivre son seul dessein.\n\n3.\nDans de verts pâturages\nIl me fait reposer,\nCar les sombres nuages\nDe mon ciel passer.\nMon espérance est sûre\nMon destin est certain\nSa Parole m'assure\nPourquoi craindre demain?",
