    title: 'Jour de bonheur, jour mémorable',
    lyrics:
      "1.\nJour de bonheur, jour mémorable,\nNoël est de retour.\nEt vers la crèche de l'étable,\nJoyeux, le monde accourt,  (bis)\nJoyeux, joyeux, le monde accourt.\n\n2.\nDans cette crèche est le Messie,\nQue tout Son peuple attend,\nPar la divine prophétie\nPromis depuis longtemps,  (bis)\nPromis, promis depuis longtemps.\n\n3.\nIl est un Roi, mais sans couronne,\nLes humbles sont Sa cour;\nC'est dans les coeurs qu'Il a Son trône,\nSa loi n'est que d'amour,  (bis)\nSa loi, Sa loi n'est que d'amour.\n\n4.\nRoi désiré, que notre monde,\nDont l'espoir n'est qu'en toi,\nA ton appel d'amour réponde:\n«Jésus, sois notre Roi!»  (bis)\nJésus, Jésus sois notre Roi!",
