      html: '<p><strong>1.</strong> </p>\n<p>A la gnou mèvéyé, mèvéyé jou, </p>\n<p>Jou m-pa kab janmin blié </p>\n<p>Lè-m té nan ténèb, pèdu nan la bou, </p>\n<p>Jézu Sovè-m mouin kontré, </p>\n<p>A la gnou zanmi ki gin charité, </p>\n<p>Li satisfè-m ak gras Li </p>\n<p>Li pran tristès mouin, Li ba-m alégrès, </p>\n<p>É Li fè tout ténèb mouin pati. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Sièl la désan’n, Li plin nan’m mouin ak la joua</strong> </p>\n<p><strong>Lè  Sovè mouin té sové-m a la koua</strong> </p>\n<p><strong>Péché-m tout padonnin,</strong> </p>\n<p><strong>Ténèb nan lumiè tounin,</strong> </p>\n<p><strong>Sièl la désan’n, Li plin nan’m mouin ak la joua</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Fèt dé nouvo pa puisans Léspri sin, </p>\n<p>Li fè-m gnou pitit Bon-Dieu </p>\n<p>Amou Kalvè justifié-m, sé sètin, </p>\n<p>Li ba-m gnou chan glorié. </p>\n<p>Travay sa té fè nan gnou ti moman </p>\n<p>Lè-m répanti nan péché-m </p>\n<p>Lè-m aksépté Li é lè-m konfésé Li, </p>\n<p>O béni non Li, Li sové-m. </p>\n'
