    lyrics:
      '1.\nMèvéyé, abondan gras Bon-Dieu\nGras ki pi gran ké tout péché nou.\nSou koua Kalvé Jézu krusifié\nSan Li té vèsé la pou nou tout.\n\nKè:\nGras, gras, gras Bon-Dieu\nGras ki padonnin é purifié,\nGras, gras, gras Bon-Dieu.\nGras ki pi gran ké tout péché.\n\n2.\nPéché ki gran kou gro vag la mè\nMénasé nan-m nou pou nou pèdu,\nGras ki pi gran, oui, gras Li si chè,\nMontré nou gnou réfuj nan koua Li.\n\n3.\nMèvéyé gras Li ki san mézu,\nBon-Dieu bay li pou tout moun ki kouè,\nOu, ki gnou jou vlé ouè fas Jézu,\nEské oua résévoua gras Kalvè.',
