    title: 'Pitit Mouin, Rétounin',
    lyrics:
      '1.\nEské ou gin tan kité souin Papa ou,\nOu régrèt ké ou égaré louin,\nGin gnou voua dou\nÉ tand kap mandé pou ou,\nPitit mouin, pitit mouin, rétounin.\n\nKè:\nRétounin  (Pitit mouin)\nRétounin  (Pitit mouin)\nO pitit, ou égaré,\nPapa ou ap plédé,\nPitit mouin, rétounin.\n\n2.\nEské ou san sékou nan loraj la vi,\nBato ou prèt pou plonjé anfin,\nMin!  lumiè Lévanjil, antré nan labri,\nPitit mouin, pitit mouin rétounin.\n\n3.\nJodi a L-ap plédé avèk ou ankò,\nAvantaj lé mon-n pa vo angnin,\nAntré vit pa néglijé gnou vrè trézò\nPitit mouin, pitit mouin, rétounin.',
