    num: 68,
    title: 'Chan Gèp Yo',
    lyrics:
      '1.\nLè pèp Kanaan fè kè yo du kont Bon-Dieu\nYo atristé Li ak péché,\nDonk Bon-Dieu voyé gèp yo pou réglé yo\nÉ pou édé pèp Li yo gangnin.\nGèp yo pèsouadé yo li tap préférab\nPrésé vit é pa pou yo mizé,\nDieu pa fè nou aji kont volonté nou,\nSèlman Li fè yo byin dispozé.\n\nKè:\nLi papé fòsé nou alé (non, non)\nLé papé fòsé nou alé,\nLé pa fè nou aji kont volonté nou,\nSèlman Li fè nou byin dispozé.\n\n2.\nSi gnou nich gèp vivan antré nan chan-m sa\nÉpi bèt yo komansé volé\nNou pa ta bézouin konvink ou pou sòti,\nOu ta anvi sòti, nèspa vré?\nSé pa akòz fòs yo pou yo broté ou\nJété ou nan fénèt la, non\nYo pap fè ou aji kont volonté ou\nSèlman ya fè ou byin dispozé.\n\n3.\nLè yo voyé Jonas nan lèv lé Ségné,\nLi pa té vlé alé laba,\nLi pa janmin fè gnou travay ki si rèd,\nDonk, li abandonnin travay la.\nMin Bon-Dieu fè gnou gro pouason avalé-l,\nSé gnou istoua nou tout konnin,\nLi pap fè li aji kont volonté li,\nSèlman li fè li byin dispozé.\n\n4.\nLè Balaam al koté Moab la\nLi té vlé réglé zafè li\nBourik li réproché-l nan mitan chémin,\nProfèt admèt pou li obéyi.\nSi-l kab sèvi ak gnou bourik, Bon-Dieu gin doua\nFè ak nou ninpòt sa Li vlé\nLi pa fè nou aji kont volonté nou\nSèlman Li fè nou byin dispozé.\n\n5.\nGin anpil nan lèz òm ki sanblé ak bourik\nTou dé sé bèt rébèl, sé vré\nSi ou di-l: «Viré» sé tou douat la alé,\nOu di: «La» sé atò li maché\nChan mouin sé tou drol,\nMin m-konnin ké sé vré\nÉ mouin pa vlé ouè gèp yo vi-n piké kò  mouin\nDonk, pa rézisté kont la parol Bon-Dieu\nKité li fè ou byin dispozé.',
