      md: '**1.** \n\nLè pèp Kanaan fè kè yo du kont Bon-Dieu \n\nYo atristé Li ak péché, \n\nDonk Bon-Dieu voyé gèp yo pou réglé yo \n\nÉ pou édé pèp Li yo gangnin. \n\nGèp yo pèsouadé yo li tap préférab \n\nPrésé vit é pa pou yo mizé, \n\nDieu pa fè nou aji kont volonté nou, \n\nSèlman Li fè yo byin dispozé. \n\n\n\n\n<br/> **Kè:**\n\n**Li papé fòsé nou alé (non, non)** \n\n**Lé papé fòsé nou alé,** \n\n**Lé pa fè nou aji kont volonté nou,** \n\n**Sèlman Li fè nou byin dispozé.** \n\n\n\n<br/> **2.**\n\nSi gnou nich gèp vivan antré nan chan-m sa \n\nÉpi bèt yo komansé volé \n\nNou pa ta bézouin konvink ou pou sòti, \n\nOu ta anvi sòti, nèspa vré? \n\nSé pa akòz fòs yo pou yo broté ou \n\nJété ou nan fénèt la, non \n\nYo pap fè ou aji kont volonté ou \n\nSèlman ya fè ou byin dispozé. \n\n\n<br/> **3.**\n\nLè yo voyé Jonas nan lèv lé Ségné, \n\nLi pa té vlé alé laba, \n\nLi pa janmin fè gnou travay ki si rèd, \n\nDonk, li abandonnin travay la. \n\nMin Bon-Dieu fè gnou gro pouason avalé-l, \n\nSé gnou istoua nou tout konnin, \n\nLi pap fè li aji kont volonté li, \n\nSèlman li fè li byin dispozé. \n\n\n<br/> **4.**\n\nLè Balaam al koté Moab la \n\nLi té vlé réglé zafè li \n\nBourik li réproché-l nan mitan chémin, \n\nProfèt admèt pou li obéyi. \n\nSi-l kab sèvi ak gnou bourik, Bon-Dieu gin doua \n\nFè ak nou ninpòt sa Li vlé \n\nLi pa fè nou aji kont volonté nou \n\nSèlman Li fè nou byin dispozé. \n\n\n<br/> **5.**\n\nGin anpil nan lèz òm ki sanblé ak bourik \n\nTou dé sé bèt rébèl, sé vré \n\nSi ou di-l: «Viré» sé tou douat la alé, \n\nOu di: «La» sé atò li maché \n\nChan mouin sé tou drol, \n\nMin m-konnin ké sé vré \n\nÉ mouin pa vlé ouè gèp yo vi-n piké kò  mouin \n\nDonk, pa rézisté kont la parol Bon-Dieu \n\nKité li fè ou byin dispozé. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Lè pèp Kanaan fè kè yo du kont Bon-Dieu </p>\n<p>Yo atristé Li ak péché, </p>\n<p>Donk Bon-Dieu voyé gèp yo pou réglé yo </p>\n<p>É pou édé pèp Li yo gangnin. </p>\n<p>Gèp yo pèsouadé yo li tap préférab </p>\n<p>Présé vit é pa pou yo mizé, </p>\n<p>Dieu pa fè nou aji kont volonté nou, </p>\n<p>Sèlman Li fè yo byin dispozé. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Li papé fòsé nou alé (non, non)</strong> </p>\n<p><strong>Lé papé fòsé nou alé,</strong> </p>\n<p><strong>Lé pa fè nou aji kont volonté nou,</strong> </p>\n<p><strong>Sèlman Li fè nou byin dispozé.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Si gnou nich gèp vivan antré nan chan-m sa </p>\n<p>Épi bèt yo komansé volé </p>\n<p>Nou pa ta bézouin konvink ou pou sòti, </p>\n<p>Ou ta anvi sòti, nèspa vré? </p>\n<p>Sé pa akòz fòs yo pou yo broté ou </p>\n<p>Jété ou nan fénèt la, non </p>\n<p>Yo pap fè ou aji kont volonté ou </p>\n<p>Sèlman ya fè ou byin dispozé. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Lè yo voyé Jonas nan lèv lé Ségné, </p>\n<p>Li pa té vlé alé laba, </p>\n<p>Li pa janmin fè gnou travay ki si rèd, </p>\n<p>Donk, li abandonnin travay la. </p>\n<p>Min Bon-Dieu fè gnou gro pouason avalé-l, </p>\n<p>Sé gnou istoua nou tout konnin, </p>\n<p>Li pap fè li aji kont volonté li, </p>\n<p>Sèlman li fè li byin dispozé. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Lè Balaam al koté Moab la </p>\n<p>Li té vlé réglé zafè li </p>\n<p>Bourik li réproché-l nan mitan chémin, </p>\n<p>Profèt admèt pou li obéyi. </p>\n<p>Si-l kab sèvi ak gnou bourik, Bon-Dieu gin doua </p>\n<p>Fè ak nou ninpòt sa Li vlé </p>\n<p>Li pa fè nou aji kont volonté nou </p>\n<p>Sèlman Li fè nou byin dispozé. </p>\n<p><br/> <strong>5.</strong></p>\n<p>Gin anpil nan lèz òm ki sanblé ak bourik </p>\n<p>Tou dé sé bèt rébèl, sé vré </p>\n<p>Si ou di-l: «Viré» sé tou douat la alé, </p>\n<p>Ou di: «La» sé atò li maché </p>\n<p>Chan mouin sé tou drol, </p>\n<p>Min m-konnin ké sé vré </p>\n<p>É mouin pa vlé ouè gèp yo vi-n piké kò  mouin </p>\n<p>Donk, pa rézisté kont la parol Bon-Dieu </p>\n<p>Kité li fè ou byin dispozé. </p>\n'
