    title: 'Le Zeprèv Yo Vi-n,  Nou Mande Pouki',
    lyrics:
      '1.\nLe zeprèv yo vi-n, nou mande pouki\nNou bezwen soufri kè atiste?\nPoutan lèzot yo ki antoure nou,\nApe rejwi menm nan peche\n\nRefren:\nPi devan na wè Jezu nan glwa li,\nPi devan n-ape konprann pou ki,\nBon kouraj frè mwen, fè kè ou kontan,\nPaske you jou na konprann pou ki.\n\n2.\nSouvan nou mande pouki nou bezwen\nPase nan rout sa-a pou-n swive Jezu\nPansan lèzot yo ap viv byen alez\nn-ap bat pou-n chèche lèzam pèdi.\n\n3.\nRete fidèl jiska lanmo frè mwen\nLe Senyè Jezu egzote nou\nNou va bliye tout traka nou pase\nLè nou antre nan syèl la yon jou\n \n4.\nByento n’ap la ak Jezu sovè nou,\nNan bel kay nou, lè li va vi-ni,\nAnlè n’ap kontre byeneme nou yo,\nLèe sa-a n’ape konprann pouki',
