    title: 'Jésus revient bientôt',
    lyrics:
      "1.\nJésus revient bientôt,\nQuel heureux jour!\nCar mes yeux Le verront,\nEt mes peines finiront,\nSi Jésus revient bientôt.\n\nChoeur:\nQuel heureux jour,\nLe revoir de Jésus!\nJe vivrai triomphant et sans peur\nEn la présence du Sauveur,\nQuel heureux jour,\nLe revoir de Jésus!\n\n2.\nAu ciel j'irai bientôt,\nQuel heureux jour!\nJ'entends déjà la voix\nDes rachetés de la croix,\nBientôt je serai là-haut.\n\n3.\nPlus d'angoisse là-haut\nQuel heureux jour!\nLe Vainqueur de la mort\nMe pilote vers le port,\nIl apparaîtra bientôt.\n\n4.\nJ'appartiens à mon Roi,\nQuel heureux jour!\nJe veux dire aux perdus\nPourquoi j'adore Jésus:\nSon amour est pour moi.",
