    lyrics:
      "1.\nTu m'aime, Jésus,\nTu me tiens en ton coeur,\nOh, que je suis heureux\nDe t'avoir pour Sauveur!\n\nChoeur:\nAlléluia, Jésus m'aime!\nAlléluia, Amen!\nAlléluia, Jésus m'aime!\nEt j'aime Jésus!\n\n2.\nOui, Tu m'as sauvé,\nJ'en rends gloire à Ton nom,\nEt de tous mes péchés\nJ'ai reçu le pardon.\n\n3.\nMe savoir sauvé,\nConnaître, aimer Jésus…\nJ'ai déjà tant de biens,\nQue me faut-il de plus?\n\n4.\nMais le ciel m'attend;\nVers ce séjour de paix\nViendrez-vous avec moi\nPour régner à jamais?",
