    title: 'Je cherchais le bonheur, O Christ',
    lyrics:
      "1.\nJe cherchais le bonheur, O Christ,\nTous les bienfaits de Ta croix;\nJe voulais le don de l'Esprit\nPour travailler, O, pour Toi!\nJe voulais sentir dans mon coeur\nLe vrai zèle et la chaleur,\nMais tu me dis que mon bonheur\nN'est que Toi seul, O Seigneur!\n\nChoeur:\nC'est Toi, Jésus, c'est Toi, Seigneur\nTout en tout, Tu es pour moi:\nJoie, lumière, amour, sagesse.\nTout mon bonheur, Christ, c'est Toi!\n\n2.\nAutrefois je cherchais le Don\nSans trouver le Donateur.\nEt je voulais la guérison,\nMais voici le Guérisseur!\nJadis, Christ, je voulais briller\nPour Toi, O mon Rédempteur.\nMaintenant, je veux refléter\nQue Ta gloire, cher Sauveur!\n\n3.\nJe voulais Te servir, Jésus.\nSers-Toi de moi amintenant.\nTon pouvoir ne demande plus.\nJe Te veux seul, tout-Puissant!\nJe cherchais le bonheur des cieux:\nL'amour, la foi et la paix;\nMais désormais c'est Toi, mon Dieu.\nC'est Toi, c'est Toi à jamais!",
