    title: 'Angnin Pa Ta Inposib',
    lyrics:
      '1.\nMouin li bèl promès Bon-Dieu\nNan Paròl Li\nKé Li kapab fè tout bagay,\n«Nan mouin angnin inposib\npou mouin», Li di,\nsi nou konfié nan Paròl mouin.\n\nKè:\nAngnin pa ta inposib,\nLè konfians nou nan Bon-Dieu.\nAngnin pa ta inposib\nLè-n konfié nan Paròl Li,\nKouté la voua lé Ségnè ankò,\n«Angnin pa ta inposib pou Mouin»,\nmété kofians ou nan Bon-Dieu,\nÉ kouè nan Paròl Li,\nOh angnin, oh angnin, oh angnin\nPa ta inposib pou Dieu.\n\n2.\nParòl Bon-Dieu di, Tout bagay sé posib,\nPromès yo pou ou, sèlman kouè,\nKouè tout sa Li di paské Bon-Dieu fidèl,\nÉ sa Li promèt, Li kab fè.\n\n3.\nParòl Bon-Dieu sé gnou lank byin asuré,\nNan mitan anrajé.\nPaské nan féblès nou kab souvan fayi,\nMin Paròl Bon-Dieu rété fè-m.',
