    lyrics:
      '1.\nDans ces jours-ci, il faut un Sauveur\nDans ces jours-ci, Christ est le Rocher,\nSois très certain, sois très certain,\nQue ton ancre croche le roc solide.\n\nChoeur:\nCe roc est Jésus, oh, oui c’est Lui,\nCe roc est Jésus, seulement Lui.\nSois très certain, sois très certain,\nQue ton ancre croche le roc solide.\n\n2.\nDans ces jours-ci, il faut la Bible,\nDans ces jours-ci, sois invincible,\nSois très certain, sois très certain,\nQue ton ancre croche le roc solide.\n\n3.\nDans ces jours-ci, oh, je suis sauvé,\nDans ces jours-ci, je suis bien ancré,\nJe suis certain, je suis certain,\nQue mon ancre croche le roc solide.',
