    num: 83,
    title: 'Jour Par Jour',
    lyrics:
      '1.\nJour par jour quand chaque moment passe,\nJe trouve la force pour tout supporter.\nConfiant dans les promesses du Père,\nJe n’ai pas besoin de m’inquieter.\nCelui dont le coeur est si aimable,\nChaque jour nous donne ce qu’il nous faut,\nPlein d’amour, Il partage nos peines\nNos labeurs avec paix et repos.\n\n2.\nTous les jours Jésus Lui-même est ici,\nEt sa grâce suffit pour chaque moment.\nSans contraintre Il porta tous nos soucis,\nSon nom est Conseiller, Dieu Puissant.\nLa sûreté de son enfant pour toujours,\nIl voulait de Lui-même la chargée,\nQue ta vigueur dure autant que tes jours\nCette promesse Il l’a donnée.\n\n3.\nAide-moi à l’heure de la souffrance,\nA me confier dans toutes tes promesses\nJamais perdre le réconfort de la foi\nQui m’est offerte remplie de tendresse.\nAide-moi dans les troubles de la vie,\nUn à un, les jours, les moments s’enfuient,\nJusqu’à l’heure où je verrai mon Roi.',
