    title: 'Anba Lonbraj Lakwa Jezu-a',
    lyrics:
      '1.\nAnba lonbraj lakwa Jezu-a\nSe la nou va repose\nWi repose nan gras Bondye\nA la bèl bagay lè n’ap mache\nMen nou nan men Jezu-kri,\nN’ap rete fèm nan gras Bondye\n \nRefren:\nJezu bon bèje ap veye sou nou\nLi fè nou pwomès, li pap janm domi\nSe pou sa nan bèl kay bèje-a\nMouton yo gen kè poze\nWi repose nan gras Bondye\n\n2.\nNan pi bèl patiraj ki genyen\nSe la li fè nou manje\nNan pi bèl rivyè k’ap koule,\nK’ape koule byen trankil,\nLi fè nou bwè, swaf nou pase.\n \n3.\nOu menm k’ap travay pou Jezu\nOu pa bezwen dekouraje\nKenbe pi fèm, ou va rive,\nGras Bondye se benediksyon,\nEske ou pa ta renmen-l tou\nChwazi Jezu Jodi-a menm.',
