    lyrics:
      "1.\nMaranatha! (ter) Christ revient!\nProclamez ce beau message,\nEt qu'au plus lointain rivage\nIl résonne d'âge en âge,\nMaranatha! Christ revient!  (bis)\n\n2.\nMaranatha! (ter) Christ revient!\nLa nature tout entière\nPense à l'aube qu'elle espère,\nL'aube que promet le Père,\nMaranatha! Christ revient! (bis)\n\n3.\nMaranatha! (ter) Christ revient!\nNous croyons à ta venue,\nO Jésus; que sur la nue\nElle éclate à notre vue!\nMaranatha! Christ revient!  (bis)\n\n4.\nMarantha! (ter) Christ revient!\nEn avant sans plus de crainte,\nPrends ta croix sans nulle plainte,\nDans l'espoir de l'heure sainte,\nMaranatha! Christ revient!  (bis)\n\n5.\nMaranatha! (ter) Christ revient!\nÂme si longtemps rebelle,\nViens à Christ, car Il t'appelle,\nViens, entends sa voix fidèle,\nMaranatha! Christ revient!  (bis)",
