    title: 'Tout Gloua A Jézu',
    lyrics:
      '1.\nJézu té sové-m, mèvéyé Sovè\nJézu té sové-m, mouin pa kab di kouman,\nSèl sa mouin konnin, Li péyé dèt la,\nLè Li té mouri sou Kalvè soufran.\n\nKè:\nTout gloua a Jézu, mèvéyé Sovè,\nTout gloua a Jézu, sé Li m-adoré,\nTout gloua a Jézu, mèvéyé Sovè,\nTout gloua a Jézu pou létènité.\n\n2.\nJézu va kondui-m, mèvéyé Sovè\nJézu va kondui-m, mouin pa kon-n koté,\nMin mouin va suiv Li, nan joua ou tristès\nTout koté Li minnin-m, ak Li m-alé.\n\n3.\nJézu va chèché-m, mèvéyé Sovè,\nJézu va chèché-m, mouin pa kon-n ki lè,\nGnou jou ma ouè Li, chita sou tron-n Li,\nLi va kouron-nin mouin, dévan anj yo.',
