    title: 'Quand Dieu Parle',
    lyrics:
      '1.\nQuand Dieu parle,\nLes hauts montagnes tremblent,\nQuand Dieu parle, les ondes retentient,\nQuand Dieu parle,\nMon coeur veut l’entendre,\nEt obéir ce qu’Il me dit.\n\nChoeur:\nParle à mon coeur! Parle je t’en prie!\nO Dieu Créateur, mon Seigneur, Rédempteur\nParle à mon coeur aujourd’hui.\n\n2.\nQuand Dieu parle, les anges Lui obéissent,\nQuand Dieu parle, la nature sourit,\nQuand Dieu parle, les coeurs durs sont changés\nCar sa voix plus doux n’est entendue.\n\n3.\nQuand Dieu parle,\nLes tristes sèchent leurs larmes,\nQuand Dieu parle, la fatigue s’arrête,\nQuand Dieu parle, sa voix consolante\nM’inonde de sa paix parfaite.\n\n4.\nQuand Dieu parle, à mon tour je réponds,\nQuand Dieu parle, apaiser ma tempête,\nQuand Dieu parle, à moi de Le suivre,\nEt faire sa volonté complète.',
