    title: 'Se Pa Yon Cheman Tankou Gran Ri',
    lyrics:
      '1.\nSe pa yon cheman tankou gran ri\nKi plen avèk gwo magazen\nE kote tout machine pase,\nE ou jwenn tout byen materiel.\n\nRefren:\nNou menm nou jwenn\nYon vrè chemen pou n’ale nan syèl\n\n2.\nSe pa yon chemen tankou channmas,\nKote tout moun al pran bon van,\nKe gen frechè, ki gen lonbraj,\nE kit te gen jaden ak bèl flè.\n\n3.\nMande mwenn: ke chemen li ye?\nEm-a va di ou se yon ti chemen li ye\nYon ti chemen etwat anpil\nKote tout moun pa kapab vi-ni.\n\n4.\nSe yon chemen trè danjere,\nKi gen falèz, ki gen danje\nE ki gen tout tan, tout lajounen,\nPlen malady ak pèsekisyon\n\n5.\nOu pa bezwen pè, ou mèt vi-ni\nSi ou vi-ni, ou p’ape sèl\nOu’ap jwenn repo, lapè, lajwa\nAvèk bone isiba.',
