    lyrics:
      '1.\nVa gingnin gnou lumiè sòti palè anlè\nLè-m fini pasé rout la vi sa,\nSoulajman tout fado apé tan-n mouin anro,\nLè-m fini pasé rout la vi sa.\n\nKè:\nLè vouayaj la fini épi jou mouin rivé\nM-a rantré nan démè sélès la,\nKa Sovè mouin rinmin apé\nTan-n la pou mouin,\nLè-m fini pasé rout la vi sa.\n\n2.\nMalgré rout la mové byinto m-a va chanté\nLè-m fini pasé rout la vi sa,\nSi mouin pèsékuté, Kris va fè mouin blié,\nLè-m fini  pasé rout la vi sa.\n\n3.\nPòt sièl la va ouvri é m-a ouè Jézu-Kri,\nLè-m fini pasé rout la vi sa,\nM-a va adoré Li pou gnou si gran salu,\nLè-m fini pasé rout la vi sa.',
