      md: '**1.** \n\nVa gingnin gnou lumiè sòti palè anlè \n\nLè-m fini pasé rout la vi sa, \n\nSoulajman tout fado apé tan-n mouin anro, \n\nLè-m fini pasé rout la vi sa. \n\n\n\n\n<br/> **Kè:**\n\n**Lè vouayaj la fini épi jou mouin rivé** \n\n**M-a rantré nan démè sélès la,** \n\n**Ka Sovè mouin rinmin apé** \n\n**Tan-n la pou mouin,** \n\n**Lè-m fini pasé rout la vi sa.** \n\n\n\n<br/> **2.**\n\nMalgré rout la mové byinto m-a va chanté \n\nLè-m fini pasé rout la vi sa, \n\nSi mouin pèsékuté, Kris va fè mouin blié, \n\nLè-m fini  pasé rout la vi sa. \n\n\n<br/> **3.**\n\nPòt sièl la va ouvri é m-a ouè Jézu-Kri, \n\nLè-m fini pasé rout la vi sa, \n\nM-a va adoré Li pou gnou si gran salu, \n\nLè-m fini pasé rout la vi sa. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Va gingnin gnou lumiè sòti palè anlè </p>\n<p>Lè-m fini pasé rout la vi sa, </p>\n<p>Soulajman tout fado apé tan-n mouin anro, </p>\n<p>Lè-m fini pasé rout la vi sa. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Lè vouayaj la fini épi jou mouin rivé</strong> </p>\n<p><strong>M-a rantré nan démè sélès la,</strong> </p>\n<p><strong>Ka Sovè mouin rinmin apé</strong> </p>\n<p><strong>Tan-n la pou mouin,</strong> </p>\n<p><strong>Lè-m fini pasé rout la vi sa.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Malgré rout la mové byinto m-a va chanté </p>\n<p>Lè-m fini pasé rout la vi sa, </p>\n<p>Si mouin pèsékuté, Kris va fè mouin blié, </p>\n<p>Lè-m fini  pasé rout la vi sa. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Pòt sièl la va ouvri é m-a ouè Jézu-Kri, </p>\n<p>Lè-m fini pasé rout la vi sa, </p>\n<p>M-a va adoré Li pou gnou si gran salu, </p>\n<p>Lè-m fini pasé rout la vi sa. </p>\n'
