    title: 'A La Gnou Gran',
    lyrics:
      '1.\nSégnè Bon-Dieu mouin sézi nan prézans ou\nLè-m ouè mon-n sa ké min Ou té kréyé\nZétoual yo la, mouin tandé loraj grondé,\nSé puisans Ou tout lunivè montré.\n\nKè:\nAlò nan-m mouin chanté dévan Bon-Dieu\nA la Ou gran, a la Ou gran,\nAlò nan-m mouin chanté dévan Bon-Dieu,\nA la Ou gran, a la Ou gran.\n\n2.\nLè mouin sonjé Bon-Dieu bay sèl Pitit Li\nPou-L vi-n mouri, sé sa ké touché kè-m\nSou boua Kalvè Li pòté tout fado mouin,\nSan Li koulé pou ouété tout péché-m.\n\n3.\nLè Kris parèt anj yo va admiré Li\nL-a pran-m nan sièl nan réjouisans tout tan,\nMa prostèné nan pié-L pou adoré Li,\nÉ proklamé, Bon-Dieu, a la Ou gran.',
