    title: 'Mes yeux ont vu la gloire',
    lyrics:
      "1.\nMes yeux ont vu la gloire\nDe Jésus-Christ, mon Sauveur,\nQui remporta la victoire\nSur la croix pour le pécheur;\nLe clairon a déjà sonné,\nÉcoutez, soldats de Dieu!\nJésus va de l'avant!\n\nChoeur:\nGloire, gloire, alléluia!  (ter)\nJésus va de l'avant!\n\n2.\nMes yeux ont vu le Calvaire\nEt le bois cruel dressé;\nEt j'entendis sa prière,\nCri de son coeur angoissé;\nL'épine sur son front blessé\nMon coeur d'angoisse a percé,\nJésus va de l'avant!\n\n3.\nAu jardin, gloire au Père,\nJe Le vois ressuscité;\nLe sceau brisé sur la pierre\nSigna sa divinité!\nIl est sorti tout triomphant,\nIl est vainqueur du péché,\nJésus va de l'avant!",
