    title: 'Je suis la lumière, a dit le Seigneur',
    lyrics:
      "1.\nJe suis la lumière, a dit le Seigneur;\nEt le monde est ténébreux.\nJe veux briller pour Toi, O mon Sauveur;\nEmbrase-moi de ton feu.\n\nChoeur:\nFais briller en moi ton amour, Jésus!\nFais briller en moi ton Saint-Esprit\nFais briller en moi, O Seigneur Jésus!\nTon grand amour pour le monde perdu.\n\n2.\nQu'il fait bon à ton service, Seigneur,\nJe veux travailler pou Toi,\nToi, Jésus, mon espérance et mon bonheur,\nViens, détruis tout mal en moi.\n\n3.\nSoumis à Ta volonté, mon Sauveur,\nMalgré le glissant sentier,\nMourir à moi, vivre pour Toi, Seigneur,\nC'est mon désir désormais.",
