    lyrics:
      '1.\nVoici, Jésus revient des cieux.\nQuelle joie, glorieuse attente:\nBientôt nous le verrons des yeux\nRevenir dans la nue éclatante.\n\nChoeur:\nIl vient bientôt   (bis)\nJoyeux nous acclamerons Jésus.\nTenons-nous prêts,\nLevons les yeux en haut\nJésus vient sur la nue.\n\n2.\nLes signes des temps, sur terre, sur mer\nNous disent que le grand jour approche\nPromesse suprême de Dieu le Père,\nJésus doit régner, le temps est proche.\n\n3.\nCe doux espoir ranime nos coeurs.\nHâtons ce jour de fête, mon frère.\nHeureux le coeur où Christ demeure,\nTravaillons, luttons dans la prière.',
