    title: 'Li Vlé Ouété Tout Fado',
    lyrics:
      '1.\nLé mon-n plin tristès ak mizé\nKè nou chajé chak jou,\nJézu té ouété tout fado yo\nSou mòn Kalvè pou nou.\n\nKè:\nLi vlé ouété tout fado pou ou\nBò Kalvè, bò Kalvè,\nLi vlé ouété tout fado pou ou\nLi tou pré nou toujou.\n\n\n\n\n2.\nLagé tout chaj ou sou Jézu\nKité krint ak sousi\nKà Jézu té ouété fado nou\nSou Kalvè Li mouri.\n\n3.\nNan-m troublé lé Ségnè konnin\nChagrin ki nan kè ou\nMin Li vlé ouété tout fado yo\nSou mòn Kalvè pou ou.',
