    title: 'Ki Sa Pou-m Bay Ou  Mèt Mouin?',
    lyrics:
      '1.\nKi sa pou-m ba Ou Mèt mouin?\nOu té mouri pou mouin,\nEské-m doué bay gnou vié ti bagay,\nKonbyin pou Li réklamé.\n\nKè:\nJézu Sovè ak Ségnè,\nOu sové-m tout antié,\nOu té kité tròn-n nan sièl\nMouri sou boua Kalvè,\nKi sa pou-m ba ou Mèt mouin,\nOu sové-m tout antié\nPa gnou mòso, ni ti kichoy, non,\nM-a ba ou tout, Ségnè.\n\n2.\nKi sa pou-m ba ou Mèt mouin?\nOu té rachté nan-m mouin,\nKado-m piti, min tout sé pou Li,\nPou Li fè tou sa Li vlé.\n\n3.\nKi sa pou-m ba ou Mèt mouin?\nGran byinfètè divin,\nMouin pap kinbé sa mouin posédé,\nM-a dispozé sa-m gingnin.',
