    title: 'Eské Sé Posib Pou-m Ront Lé Ségnè?',
    lyrics:
      '1.\nEské sa posib pou-m ront lé Ségné\nLè-L té bay vi-L, pou-m ta kab rachté?\nPadonni-m Ségnè, fòt mouin ak péché-m\nDèské mouin té pè jan lòt yo ta moké-m.\n\nKè:\nFè-m byin vayan pou-m konfésé\nA ninpòt lè nan tout koté,\nKé Ou sé Sovè-m, Roua mouin é Ségnè-m\nKé gnou jou nan sièl ou va konfésé-m.\n\n2.\nEské sa posib pou-m ront lé Ségnè\nLòské Li nan sièl apé plédé pou mouin?\nDévan tron-n Bon-Dieu Li fè la priè,\nPou-m toujou vinkè sou lé tantatè.\n\n\n3.\nEské sa posib pou-m ront lé Ségnè\nLè-L ban mouin promès\nKé ma jouin-n Li an lè?\nSi-m palé pou Li, pandan-m isi-ba,\nLi pap ront mouin-min’m lè mouin rivé la.',
