    title: 'Anbasadè Dé Jézu-Kri',
    lyrics:
      '1.\nJézu apé voyé Pitit Li publié\nTou patou bon nouvèl dé la vi étènèl,\nNap anonsé péchè amou gnou Rédanmtè\nKi vi-n sou la tè kom Sovè.\n\nKè:\nAnbasadè dé Jézu-Kri,\nKè nou plin puisans Sint-Éspri,\nNapé pòté la pè, nap publié salu,\nPou sové tout moun ki pèdu.\n\n2.\nAvèk joua é kouraj nap publié mésaj\nRoua nou mandé-n pòté\nPou moun ki nan péché.\nPéchè, ouvri kè ou, Jézu ap rélé ou,\nDévan Li tonbé a jénou.\n\n3.\nKouté lè nap palé dévan la koua pòté,\nTout péchè, tout mizè, di Jézu touman ou,\nLi-min’m résévoua ou, San Li kab lavé ou\nSan Jézu-Kri va lavé ou.',
