    title: 'Jésu Sauveur Pilote-Moi',
    lyrics:
      '1.\nJésus Sauveur, pilot-moi\nSur la mer pleine d’effroi\nVers moi roulent des flots noirs,\nQui font perdre tout espoir\nMa carte et mon compas, c’est Toi,\nOh Seigneur, pilote-moi.\n\n2.\nLa mère sait calmer l’enfant\nEt comme elle aux flots bruyants\nQuand Tu dis: «Apaisez-vous,»\nLe vent perd tout son courroux,\nToi, de la mer le puissant Roi,\nOh Seigneur, pilote-moi.\n\n3.\nLorsque je m’approche du port\nDes récifs, le courant fort\nM’enlèvent paix et repos,\nIndique à travers les flots,\nLe seul passage sûr et droit,\nOh Seigneur, pilote-moi.',
