    lyrics:
      "1.\nMeurtri pour moi,  (bis)\nOui, sur la croix,\nIl fut meurtri pour moi;\nDu mal affranchi,\nSauvé par la foi,\nGloire à Jésus\nQui fut meurtri pour moi!\n\n2.\nRessuscité, ressuscité,\nOui, c'est pour moi\nQu'Il est ressuscité!\nC'est dans le ciel\nQue Jésus est monté,\nGloire à Jésus,\nPour moi ressuscité!\n\n3.\nIl reviendra, Il reviendra!\nCéleste espoir,\nLe Seigneur reviendra\nPour m'enlever\nAuprès de Lui, là-haut!\nGloire à Jésus\nQui pour moi reviendra!",
