    title: 'Promès La Yo Byin Dous',
    lyrics:
      '1.\nPromès la yo byin dou, Paròl la bon,\nLi pi présié pasé ninpòt ki lòt mésaj\nKris té gin pansé prop, Li san péché,\nLi sé pi gran égzanp ki janmin égzisté.\n\nKè:\nLè-l kondui-m ma suiv Li\nSuiv Li pou toujou,\nLè-l kondui-m ma suiv Li,\nOui, ma suiv Li pou toujou.\n\n2.\nLamou Jézu montré-m sé mèvéyé,\nPi dous pasé tou sa lèz òm kapab pansé,\nPou sa yo ki pèdu, L-apé plédé,\nLi sé pi gran égzanp ki  janmin égzisté.\n\n3.\n«Vini jouin-n mouin» sé sa L-ap répété,\nPou ou gingnin répo ou-min’m ki fatigé,\nKonfié nan promès Li, sé asuré,\nLi sé pi gran égzanp ki janmin égzisté.',
