    title: 'Mèvéyé  Mèvéyé Jézu',
    lyrics:
      '1.\nOui, jounin nou mèt dékourajan,\nLa nuit nou mèt fatigan\nMin si nou konfié nou nan Jézu,\nN-a jouin-n nan kè nou gnou chan.\n\nKè:\nMèvéyé, mèvéyé Jézu\nSé nan kè nou Li planté gnou chan,\nGnou chan ankourajman,\nGnou chan délivrans,\nOui, nan  kè nou Li planté gnou chan.\n\n2.\nOui, la koua nou pòté mèt byin lou\nN-ap pòté gnou mizè pézan,\nMin Jézu anvi soulajé nou,\nLi rinmin lé mon-n tèlman.\n\n\n3.\nLè sousi apé krazé kè nou,\nLè tristès mété nou an dèy\nSé lè sa Jézu rékonfòté nou,\nLi fè joua nou débòdé.',
