    lyrics:
      '1.\nGingnin gnou chan nan kè mouin jodi\nKi pa té la lontan,\nLi la dépi mouin vi-n konvèti,\nPou sa mouin kontan.\n\nKè:\nMin, oui, mouin kontan, kontan,\nMin, oui, mouin kontan, kontan,\nPaské Jézu déjà viv nan kè mouin\nMin, oui, mouin kontan.\n\n2.\nSé lamou admirab Li mété\nNan gnou kè atristé\nMin-m jan fè noua mouin gin doua chanté\nLi fè-m satisfè.\n\n3.\nKomunion ak Kris bay gnou fréchè\nLang pa kab fi-n palé\nM-ap maché avèk Li nan lumiè\nPou sa m-a chanté.\n\n4.\nVini jouin-n Jézu-Kri ou min-m tou\nPandan ou gingnin tan\nÉ ou va patajé la joua nou\nÉ ou va kontan.',
