    title: 'Min-m Jan Moun Nan Tan Lontan',
    lyrics:
      '1.\nMin-m jan moun nan tan lontan\nOuè zétoual ann orion.\nJan lumiè fè yo réjoui\nGras a li yo té kondui,\nKonsa Ségnè fè kè nou,\nKapab rivé jouin-n Ou to.\n\n2.\nMin-m jan pié yo té maché\nKoté ti Jézu kouché\nÉ yo mété a jénou\nPou adoré Roua sièl tou.\nKonsa fè pié nou kouri,\nChèché sékou Jézu-Kri.\n\n3.\nMin-m jan yo ofri kado\nLa dévan gnou ti bèso,\nSé konsa nou min-m péchè\nAk gnou kè pròp é sinsè,\nVlé prézantézanté trézò nou,\nBay Roua Jézu pou toujou.\n\n4.\nDirijé nou pa-za-pa,\nSégnè, nan rout étouat la,\nÉ lè vi sa fi-n pasé\nMété nou, tanpri, koté,\nAngnin pap sa anpéché,\nOuè la gloua Ou a janmin.',
