    title: 'Eské Gnou Ti Moun Kou Mouin',
    lyrics:
      '1.\nEské gnou ti moun kou mouin,\nAsé gro pou prié Dieu,\nO, min oui, rété fidèl\nAk pasians é avèk zèl,\nRinmin Kris, obéyi-kouè\nAk tout kè ou déklaré.\n\nKè:\nMèsi, bon Papa, mèsi bon Papa,\nPapa nan sièl nou rémèsié Ou.\n\n2.\nPou légum avèk bèl foui\nPou solèy é pou la pli,\nPou zanmi avèk kay nou\nÉ pou Paròl Bon-Dieu tou,\nPou lékol Dominikal\nÉ sutou pou Lévanjil.\n\n3.\nPou santé é pou la pè,\nPou travay é tan pou joué\nPou la vi ki komansé\nPou la joua ké nou gingnin\nPou Sovè nou, Jézu-Kri\nÉ amou Li san mézi.',
