    title: 'Bib La Kanpé Fèm',
    lyrics:
      '1.\nBib la kanpé fèm kou gnou rok solid\nMalgré lénmi ataké-l.\nMésaj li gravé nan kè péchè yo\nPou ba yo la vi étènèl.\n\nKè:\nBib la kanpé fèm lè mòn yo tranblé\nLap rété solid si tè a déplasé,\nAnnou bazé la foua nou sou li\nPaské Bib la rété fèm.\n\n2.\nBib la kanpé, l-a kanpé pou toujou\nLè lé mon-n gin tan pasé,\nMouin vlé obéyi tout présèt li yo\nSé lè liv sa ki inspiré.\n\n3.\nBib la pasé tout éprèv nou ba li,\nPaské otè li divin.\nPa gras mouin vlé viv dakò avèk li\nOui, Paròl Bon-Dieu sé pou mouin.',
