      html: '<p><strong>1.</strong> </p>\n<p>Chak pa mouin fè </p>\n<p>Sovè-m alé dévan mouin </p>\n<p>Ak min Li, Li kondui-m nan bon chémin </p>\n<p>Nan zorèy Li, mouin palé: «M-adoré Ou» </p>\n<p>Nan la joua maché ak Li chak jou. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Chak pa mouin fè</strong> </p>\n<p><strong>M-konnin Jézu va gidé-m,</strong> </p>\n<p><strong>Nan gnou plin-n pi ro Li toujou minnin-m</strong> </p>\n<p><strong>Jouk tan gnou jou</strong> </p>\n<p><strong>Mouin va fè dènié pa mouin</strong> </p>\n<p><strong>Chak pa mouin fè</strong> </p>\n<p><strong>Kondui-m pi prè sièl la.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Lè asurans mouin komansé fayi </p>\n<p>É dévan-m gin gnou falèz infini. </p>\n<p>Mouin viré jé-m é gadé bo Sovè mouin </p>\n<p>Li sé fò mouin lè-m maché avè-l. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Mouin konfié nan Kris malgré sikonstans, </p>\n<p>Jézu gingnin la vi an abondans. </p>\n<p>L-apé kinbé klé a ki louvri pòt la, </p>\n<p>Pou-m antré nan péyi promès la. </p>\n'
