    title: 'Sòlda Jezu-Kri Debou,  Lè-a rive',
    lyrics:
      '1.\nSòlda Jezu-Kri debou, lè-a rive\nSovè nou prale parèt an nou leve\nLaresistans ap lite nan tout peyi\nPou nou ranvèse rwayòm movè zespri\n \nRefren :\nN’ap reziste (2 fwa)\nLannwit, lajounen tout tan n’ap reziste\nN’ap konbat rwayòm satan n’ap reziste\n \n2.\nKont tout tantasyon satan n’ap reziste\nKont tout atirans lajan n’ap reziste\nKont lemonn avèk plezi n’ap reziste\nKont tout movè zespri n’ap reziste\n \n3.\nKont tout kalite peche n’ap reziste\nKont tout move karaktè n’ap reziste\nKont  lògèy avèk gro san n’ap reziste\nKont tripotaj, medizans n’ap reziste\n \n4.\nKont satan, kont malady n’ap reziste\nMalgre tout sa n’ap soufri n’ap reziste\nNan lavi kòm lanmò n’ap reziste\nAndedan kòm andeyò n’ap reziste\n \n5.\nMalgre nou nan tout mizè n’ap reziste\nMalgre nou soufri grangou n’ap reziste\nMalgre kò nou touni n’ap reziste\nMalgre soufrans kretyen sou tè-a n’ap  reziste\n \n6.\nMenm si fanmi nou kite nou n’ap reziste\nZanmi nou mèt kite nou n’ap reziste\nYo te mèt kritike nou nap reziste\nMenm Jezu te konn soufri n’ap reziste',
