    lyrics:
      '1.\nYon jour nou te konvèti,\nAla yon bèl jou sa\nJezu te padone nou,\nLi te ba nou lafwa,\nNou te di: m’ap swiv Jezu pou letènite\nEske nou toujou fidèl?\nEske nou kretyen vre?\n \nRefren:\nO, nou pa kapab preche lemon so nou gen peche\nSe pou tèt sa n’ap mande  Bondye pou yon revèy\nFidèl yo, misyonè yo, paste yo, se vre\nNa wè pwisans le Seyè lè nou gen yon revèy',
