    title: 'A La Gnou Amou Mèvéyé',
    lyrics:
      '1.\nBon-Dieu rinmin gnou péchè kou mouin yé\nLi ouété tristès é fè-m byinn-éré,\nLi ban-m plas tou pré koté Li rété,\nA la gnou amou mèvéyé.\n\nKè:\nAmou, si mèvéyé, amou, si mèvéyé,\nBon-Dieu rinmin gnou péchè kou mouin yé\nNan pouin gnou lòt amou parèy.\n\n2.\nPou plan sa Jézu té byin dispozé,\nMalgré sa té vlé di fòk Li mouri,\nLi obéi Papa-L san ézité,\nA la gnou amou infini.\n\n3.\nNan plan rédanmsion Li Bon-Dieu achté\nGnou ésklav inutil sé sa m-té yé,\nSovè a mouri, san Li té vèsé,\nDélivré gnou varyin antèté.\n\n4.\nLi résévoua-m pito kòm gnou pitit,\nLi pa mété mouin nan ran sèvitè,\nNan gras Li Papa-m anbrasé-m tou souit,\nLè-m chèché padon Li ak tout kè.',
