    title: 'Chèché Dieu',
    lyrics:
      '1.\nLavi sa byinto fini\nTankou fèy yo l-a dévni\nÉ la mò kapab vini – chèché Dieu.\nPaské tan sa ap pasé\nNan-m nou yo va déplasé\nJustis nou pa jan-m asé – chèché Dieu.\n\nKè:\nChèché Dieu, chèché Dieu,\nTandis ké ou nan la vi sa, chèché Dieu.\nSi ou tan-n trop, ap mizé,\nBon chans sa va épuizé,\nÉ ou pap kapab sové, chèché Dieu.\n\n2.\nLòské n-ap maché nan rout\nÉ nou vi-n rivé sou bout\nFok nou sové kout ké kout– Chèché Dieu\nSé Kris min’m ki sèl Sovè\nSèl Pitit Bon-Dieu ki Pè,\nLi rpomèt nan sièl démè – Chèché Dieu.\n\n3.\nVi-n aksépté Jézu-Kri\nNan pouin lòt Sovè kom Li\nLa ba ou lé Sint-Éspri – Chèché Dieu\nNan kè ou L-a mété joua\nSou péché L-a ba ou pouvoua\nVi-n mété nan Li la foua – Chèché Dieu.',
