    lyrics:
      '1.\nMwen pa gen moun k’ap separe-m ak Kris (2 fwa)\nMwen sonje byen koman m’te pèdi\nNan bafon peche kote m’te ye\nJezu te rachte-m ak san li\nMwen pa gen moun ki kap separe-m ak Kris\n \n2.\nMwen sonje byen koman m’te esklav,\nJezu-Kri te vini ak san li.\nE li peye det peche moun yo,\nMwen pa gen moun k’ap separe-m ak Kris\n \n3.\nO Jezu se mèveye pou mwen,\nKi moun ke k’ap separe-m ak Kris?\nJezu-Kri li menm bon bèje.\nLi te bay pwóp tet li pou sove-m,\nE li te rachte-m nan men satan.\nKi moun k’ap separe-m ak Kris ?\n \n4.\nMwen pa kapab bliye soufrans Kris mwen (2 fwa)\nYo te pandye-l anro lakwa,\nYo te souflete li ak kalót,\nE li aksepte tou sa pou mwen,\nKi moun ki k’ap separe-m ak Kris mwen? (2 fwa)',
