    lyrics:
      '1.\nJan peche-n yo miltiplye,\nNou mande ou gras Senyè\nPeche kanpe adwat agoch\nNou mande ou gras Senyè\n \nRefren :\nGras, gras padon Senyè\nGras, gras padone nou,\nGras, gras pou fót nou yo,\nNou rekonèt peche nou\n \n2.\nPadone nou, O Dye damou,\nNou rekonèt peche nou,\nAdiltè, vol ak mechanste,\nYo vini miltiolye.\n \n3.\nLang nou se yon kouto debó\nNou mande ou gras Senyè.\nBouch nou pale sa nou pa wè\nNou mande ou gras Senyè\n 4.\nZorèy nou toujou ap tande,\nPou nou fè lamedizans,\nPye nou pa janmen fatige,\nPou nou ka al fè lemal.',
