      md: "**1.** \r\n\r\nA Toi, Seigneur, je m'abandonne; \r\n\r\nTon grand amour m'a terrassé. \r\n\r\nMa vie entière je te donne: \r\n\r\nMes biens, mes rêves et mon passé. \r\n\r\n\r\n<br/> **2.**\r\n\r\nQue puis-je te donner encore? \r\n\r\nLes cieux, la terre sont à Toi. \r\n\r\nUn coeur qui t'aime et qui T'adore \r\n\r\nEst plus que tout l'argent des rois. \r\n\r\n\r\n<br/> **3.**\r\n\r\nEt je T'aime, O tendre Maître, \r\n\r\nTe suivre sans aucun détour. \r\n\r\nA tous Tes ordres me soumettre \r\n\r\nSera ma joie pour toujours. \r\n\r\n\r\n<br/> **4.**\r\n\r\nPour notre mon qui T'oublie, \r\n\r\nUn monde pauvre en vrai bonheur, \r\n\r\nAccepte, O Christ, et multiplie \r\n\r\nLe tout que vient t'offrir mon coeur. \r\n\r\n\r\n",
      html: '<p><strong>1.</strong> </p>\n<p>A Toi, Seigneur, je m&#39;abandonne; </p>\n<p>Ton grand amour m&#39;a terrassé. </p>\n<p>Ma vie entière je te donne: </p>\n<p>Mes biens, mes rêves et mon passé. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Que puis-je te donner encore? </p>\n<p>Les cieux, la terre sont à Toi. </p>\n<p>Un coeur qui t&#39;aime et qui T&#39;adore </p>\n<p>Est plus que tout l&#39;argent des rois. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Et je T&#39;aime, O tendre Maître, </p>\n<p>Te suivre sans aucun détour. </p>\n<p>A tous Tes ordres me soumettre </p>\n<p>Sera ma joie pour toujours. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Pour notre mon qui T&#39;oublie, </p>\n<p>Un monde pauvre en vrai bonheur, </p>\n<p>Accepte, O Christ, et multiplie </p>\n<p>Le tout que vient t&#39;offrir mon coeur. </p>\n'
