    title: 'O Kanaan,  Bèl Kanaan',
    lyrics:
      '1.\nMap luté pou-m rivé laba\nKoté ki gin la pè, la joua,\nSé la mouin vlé rété tout tan\nNan bèl péi dé Kanaan.\n\nKè:\nO Kanaan, bèl Kanaan,\nSé la mouin vlé rété tout tan\nKoté lèt la ak mièl koulé\nKoté ki pa jan-m gin péché\nSé la map rété viv san fin,\nPou toujou ak Kris, Sovè mouin.\n\n2.\nRout la mové min map rivé\nSatan ap chèché fè-m tonbé\nMin Jézu kinbé-m pa-za-pa\nJouk mouin rivé la nan la gloua.\n\n3.\nMouin pap mumuré, ni krié\nMin map toujou pèsévéré\nKa Kris té soufri trop pou mouin\nFòk mouin suiv Li juska la fin.',
