    title: 'Vini Jouin-n Mouin',
    lyrics:
      '1.\nVini jouin-n mouin moun fatigé,\nVini m-a fè nou répozé,\nM-a fè sousi nou yo alé\nPaské mouin dou, plin umilité,\nPaské mouin dou, plin umilité,\nÉ m-a ba nou répo.\n\nKè:\nNou ki chajé, boulvèsé, fatigé,\nVi-n  jouin-n mouin,\nVini donk, m-a ba nou léson,\nJouk pa mouin pa rèd, é chaj mouin léjé,\nJouk pa mouin pa rèd, é chaj mouin léjé,\nVi-n jouin-n mouin é m-a ba nou répo.\n\n2.\nMoun ki anba fado péché\nVi-n résévoua la joua, la pè,\nM-a lévé fado sou kè ou,\nM-a fè nou jouin-n padon pou toujou,\nM-a fè nou jouin-n padon pou toujou,\nÉ m-a ba nou répo.\n\n3.\nAvèk tandrès Sovè-m plédé,\nMoun pa Li L-apé protéjé,\nToujou L-ap rélé vi-n jouin-n mouin,\nÉ m-a fè nan-m pa nou répozé,\nÉ m-a fè nan-m pa nou répozé,\nÉ m-a ba nou répo.\n(Favorites 2 – No. 79)',
