    title: 'Gran Jou Jujman',
    lyrics:
      '1.\nMouin révé mouin tandé tronpèt yo\nKi anonsé gran jou jujman.\nMouin révé nasion yo asanblé\nPou yo jujé dévan gran ton-n blan.\nGnou anj éklatan kité tron-n nan,\nSou la tè ak la mè li kanpé.\nLi sèmanté ak min douat sou sièl la\nKé tan va suspan-n égzisté.\n\nKè:\nA la moun kap krié é rélé,\nLè koupab yo tandé santans la\nYo plédé pou montagn yo kaché yo,\nYo priè, min sé té tro ta.\n\n2.\nNon-m rich té parèt, min lajan li\nDépi lontan té disparèt.\nSan angnin dutou nan jujman li\nPou akité gnou si gran dèt.\nGnan nèg té la, min inpòtans li\nPa konté lè la mò mélé,\nLè anj égzaminé achiv la\nGrandè nèg la pa mansioné.\n\n3.\nVèv la té avèk oflin yo\nBon-Dieu tandé lè yo krié.\nNan pouin tristès janmin nan sièl la\nTout dlo nan jé yo fi-n suyé.\nTafiatè té la ak banbochè,\nInsi ké moun ki van-n tafia\nOuangatè, volè ak  adultè a\nTout ansan-m désan-n nan lanfè.\n\n4.\nMésié moral rivé nan jujman\nMin bon zèv moral li pat sufi,\nSa yo ki té krusifié Jézu\nPasé pou moun moral osi\nÉ moun nan ki pa té ko paré\n«Pi ta ma gin tan sové, oui!\nSé pa ko lè pou la rélijion»\nAnfin trouvé tan pou mouri.',
