    title: 'Réveille-toi, jeunesse!',
    lyrics:
      "1.\nRéveille-toi, jeunesse!\nEntends l'appel pressant:\nLe monde est en détresse,\nEn pleurs, en feu, en sang.\nDu Christ la grande armée\nSe lève avec ardeur;\nCelui qui l'a formée\nRéclame tout ton coeur.\n\n2.\nRéveille-toi, jeunesse!\nDéjà le jour s'enfuit;\nL'amour de Dieu te presse:\nTravaille avant la nuit.\nPourquoi gâcher ta vie\nEn la vivant pour toi?\nRenonce à la folie,\nEt suis le Roi des rois.\n\n3.\nRéveille-toi, jeunesse!\nEt fuis les vains plaisirs.\nIl faut qu'en toi renaisse\nLa flamme des martyrs.\nA l'aube de la vie\nJoyeuse, élance-toi\nVers Dieu qui te convie\nAu ciel, mais par la croix.",
