      md: "**1.** \n\nRéveille-toi, jeunesse! \n\nEntends l'appel pressant: \n\nLe monde est en détresse, \n\nEn pleurs, en feu, en sang. \n\nDu Christ la grande armée \n\nSe lève avec ardeur; \n\nCelui qui l'a formée \n\nRéclame tout ton coeur. \n\n\n<br/> **2.**\n\nRéveille-toi, jeunesse! \n\nDéjà le jour s'enfuit; \n\nL'amour de Dieu te presse: \n\nTravaille avant la nuit. \n\nPourquoi gâcher ta vie \n\nEn la vivant pour toi? \n\nRenonce à la folie, \n\nEt suis le Roi des rois. \n\n\n<br/> **3.**\n\nRéveille-toi, jeunesse! \n\nEt fuis les vains plaisirs. \n\nIl faut qu'en toi renaisse \n\nLa flamme des martyrs. \n\nA l'aube de la vie \n\nJoyeuse, élance-toi \n\nVers Dieu qui te convie \n\nAu ciel, mais par la croix. \n\n\n",
      html: '<p><strong>1.</strong> </p>\n<p>Réveille-toi, jeunesse! </p>\n<p>Entends l&#39;appel pressant: </p>\n<p>Le monde est en détresse, </p>\n<p>En pleurs, en feu, en sang. </p>\n<p>Du Christ la grande armée </p>\n<p>Se lève avec ardeur; </p>\n<p>Celui qui l&#39;a formée </p>\n<p>Réclame tout ton coeur. </p>\n<p><br/> <strong>2.</strong></p>\n<p>Réveille-toi, jeunesse! </p>\n<p>Déjà le jour s&#39;enfuit; </p>\n<p>L&#39;amour de Dieu te presse: </p>\n<p>Travaille avant la nuit. </p>\n<p>Pourquoi gâcher ta vie </p>\n<p>En la vivant pour toi? </p>\n<p>Renonce à la folie, </p>\n<p>Et suis le Roi des rois. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Réveille-toi, jeunesse! </p>\n<p>Et fuis les vains plaisirs. </p>\n<p>Il faut qu&#39;en toi renaisse </p>\n<p>La flamme des martyrs. </p>\n<p>A l&#39;aube de la vie </p>\n<p>Joyeuse, élance-toi </p>\n<p>Vers Dieu qui te convie </p>\n<p>Au ciel, mais par la croix. </p>\n'
