    title: 'Seulement quelques chagrins',
    lyrics:
      "1.\nSeulement quelques chagrins,\nQuelques tristes soupirs,\nQuelques fatigues de l'étroit chemin;\nPuis, la grande trompette\nDans les cieux va retentir,\nSeulement quelques chagrins,\nPuis, Il vient!\n\nChoeur:\nSeulement quelques chagrins,\nPuis, Il vient.\nSeulement quelques chagrins,\nPuis, Il vient.\nOh, quelle glorieuse bienvenue\nNous attend!\nSeulement quelques chagrins,\nPuis, Il vient!\n\n2.\nSeulement quelque chagrins,\nQuelques tristes adieux,\nQuelques souffrances dans ce monde vain;\nPuis, avec notre Sauveur\nUne rencontrée aux cieux,\nSeulement quelques chagrins,\nPuis, Il vient!\n\n3.\nSeulement quelques chagrins,\nPuis, contempler Sa face\nDans la gloire de joyeux lendemain;\nLes moments passent,\nVite finira ce jour de grâce,\nSeulement quelques chagrins,\nPuis, Il vient!",
