    title: 'Tu laissas ton trône et ta couronne',
    lyrics:
      "1.\nTu laissas Ton trône et Ta couronne\nQuand Tu vins sur la terre pour moi,\nMais Tu fus sans amis à l'hôtellerie\nQuoique Tu sois le roi des rois.\n\nChoeur:\nViens donc dans mon coeur\nSeigneur Jésus;\nPrends Ta place dans mon coeur.\n\n2.\nLe ciel a résonné,\nLes anges ont chanté:\n«Gloire à Dieu dans les lieux très haut»\nMais Tu vins à l'étable,\nO amour insondable\nEt la paille fut Ton berceau.\n\n3.\nTu es venu Seigneur,\nO seul Rédempteur,\nNous sauver de notre misère;\nMais Tu fus rejeté,\nPar tous abandonné,\nCloué à la croix du Calvaire.\n\n4.\nLe ciel résonnera\nEt son choeur chantera\nQuand Tu viendras, O Roi des rois.\nJe serai dans la joie\nQuand j'entendrai Ta voix:\n«J'ai là une place pour toi.»\n\nChoeur:\nMon coeur se réjouira, Seigneur Jésus,\nQuand Tu viendras encore pour moi.",
