    title: "Nous, les trois mages d'Orient",
    lyrics:
      "1.\nNous, les trois mages d'Orient,\nVoyageons portant nos présents,\nBelle étoile, luis sans voile,\nGuide-nous au saint lieu.\n\nChoeur:\nO étoile mystérieuse,\nScintillante et radieuse,\nQui de l'azur profond des cieux.\nAnnonces un jour glorieux.\n\n2.\nMelchior:\nRoi des rois, mon or est à Toi!\nJe soumets mon coeur à Ta loi:\nIl s'incline: Tu domines\nAu royaume des cieux.\n\n3.\nGaspar:\nFils de Dieu, Price glorieux\nCet encens, parfum précieux,\nD'un roi-mage, est l'hommage\nAu Souverain des cieux.\n\n4.\nBalthazar:\nO Sauveur, notre Rédempteur\nCette myrrhe, présent de mon coeur,\nEmbaumera, exaltera,\nLe son du Dieu des cieux.\n\n5.\nTous:\nHosanna au Dieu tout puissant\nA celui qui s'est fait enfant!\nPrends notre être, fais-le naître\nAu royaume des cieux!",
