    title: 'Nésans Gnou Roua',
    lyrics:
      '1.\nPré Bétléèm zanj yo tap chanté,\nBon nouvèl lé mon-n yo tap pòté,\nO chan mèvéyé, O chan glorié,\nKi anonsé nésans gnou Roua.\n\nKè:\n«Gloua a Dieu» zanj yo chanté,\n«Gloua a Dieu» voua yo sonnin,\nO chan mèvéyé, O chan glorifié,\nKi anonsé nésans gnou Roua.\n\n2.\nTou sézi bèjé yo adoré-L\nMaj yo ak trézo yo vi-n chèché-L,\nLè yo ouè zétoual, pi briyan zétoual,\nKi anonsé nésans gnou Roua.\n\n3.\nBèjé, proklamé témouyaj nou,\nÉ maj yo asi nan vouayaj nou\nMésaj ki pi bèl, ki sòti nan sièl\nN-ap anonsé nésans gnou Roua.\n\n4.\nKi sa m-a fè avèk mésaj sa?\nKap sové ninpòt moun ki kouè a?\nDépi fèt Noèl, mouin pa doué kaché-l,\nM-ap anonsé nésans gnou Roua.',
