    title: 'Létènèl Sé Gadyin Mouin',
    lyrics:
      '1.\nLétènèl sé gadyin, mouin pa manké\nPaské Li fè-m répozé\nLi nouri-m byin, Li minnin mouin,\nKoté dlo a byin frè.\n\nKè:\nOui, jouk Li pa rèd, fado Li léjé,\nSé sa m-trouvé, sé sa m-trouvé,\nLi nouri-m byin, Li toujou minnin-m\nKoté dlo a byin frè.\n\n2.\nChak jou Bon Bèjé a réfè nan-m mouin\nLi kondui-m nan bon chémin\nMouin ta égaré, min Gadyin\nPou tèt non Li kinbé-m.\n\n3.\nNan kay Létènèl la m-a va rété,\nÉnmi pa fouti proché-m,\nTou lé jou la vi isi-ba\nGras Li akonpagné-m.',
