    title: 'Réfuj An Jézu',
    lyrics:
      '1.\nMouin gin gnou réfuj lè gran van ap souflé\nMouin gin gnou pòt koté mouin kap kaché,\nSé Ròk étènèl ki pa jan-m kap fayi,\nAk konfians mouin byin asuré.\n\nKè:\nRòk la sé Jézu,\nSégnè-m ki té pan-n sou la koua,\nL-ap ba mouin protéksion ak gran joua,\nNan Li m-a mété tout la foua.\n\n2.\nSi lé mon-n tanté-m avèk tout plézi li,\nPou fè-m kité rout ké Jézu trasé,\nMouin chèché réfuj la koté-m répozé,\nAk tout tantasion fi-n pasé.\n\n3.\nO péchè, vi-n joui ak mouin nan réfuj sa,\nGin plas pou tout, pou ninpòt moun ki vlé,\nSi ou bouké, fatigé ak péché ou yo,\nL-a padonnin é bay la pè.',
