      html: '<p><strong>1.</strong> </p>\n<p>Nan Kris é nan Li sèl na jouin-n vrè la vi </p>\n<p>Sé gras a Li, vié natu a mouri, </p>\n<p>Li rachté mouin nèt, ni kò, nan-m, ni léspri </p>\n<p>M-a viv, min pa mouin-min’m, sé Jézu-Kri. </p>\n<p><br/> <strong>Kè:</strong></p>\n<p><strong>Abondans la vi, mapé jouin-n nan Li,</strong> </p>\n<p><strong>L-a transfòmé mouin, pou-m sèvi Li byin,</strong> </p>\n<p><strong>San Li té rachté mouin</strong> </p>\n<p><strong>Li ba mouin Léspri-Sin,</strong> </p>\n<p><strong>Sé nan Jézu gin abondans la vi.</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Sé Sint-Éspri ki fè-m aksépté Jézu, </p>\n<p>Li fè-m konfié nan promès Bon-Dieu tou. </p>\n<p>Dé gloua an gloua Lap chanjé-m nan imaj Li </p>\n<p>Amou Li dévlopé pi plus chak jou. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Dlo a ki nan sous la vi ap débòdé, </p>\n<p>É sé li ki pòté bénédiksion. </p>\n<p>Sé la vi an n-abondans L-ap transpòté, </p>\n<p>Li bay lamou, la joua, pè ak padon. </p>\n'
