    title: 'Au Mont Des Oliviers',
    lyrics:
      '1.\nAlors, il faisait nuit\nLe Fils de Dieu marchait\nDans un jardin couvert de rosée,\nIl se mit à genoux dans un calme complète,\nLouin des bruits de la foule agitée.\n\n\n\n\n\nChoeur:\nAu mont des Oliviers, au mont des Oliviers,\nSe rendit mon Sauveur pour prier,\nTa volonté soit faite, divinité parfaite,\nEt dans lamienne, et jusqu’à la fin.\n\n\n2.\nÉcoutez les plaintes de son âme angoissée,\nLorsqu’Il avait senti tous les poids,\nDes crimes de la terre, oh! La terre souillée,\n«Coupe amère, éloignez-vous de moi.»\n\n3.\nUne grande tristesse, une terreur mortelle,\nAussitôt de son coeur s’empara,\nEt sa sueur profuse, pour toi amère, belle,\nComme des grumeaux de sang coula.',
