    title: 'Letènèl Konnen Kretyen Satan Genyen Pisans',
    lyrics:
      '1.\nLetènèl konnen kretyen satan genyen pisans\nLè nou nan prezans li, lave nou tou lè jou,\nPriye veye jou e nwit, satan panan domi,\nJezu la tou jè jou si m’konfye-m nan li sèl\n \nRefren :\nJezu-Kri la, Li avek nou, Li pa pi lwen\nJezu la tou lè jou, li delivre nou.\n \n2.\nLè-n te chita na Legliz, m’te de m’ansyen \nM’te mete baryè pou levanjil pa preche,\nKris konnen moun li chwazi pou preche levanjil\nFòk mwen preche levanjil, Jezu ban mwen pisans\n \n3.\nLevanjil ki pou preche pou key o konvèti,\nFòk se pas an ak lachè lògèy, filozofi.\nLobeyisans pa la fwa ak pisans Sentespri\nSentespri la tout tan e li va ede nou\n \n4.\nLè-m t’ap chwazi relijion m’te chaje ak lògèy,\nMoun pat pale avèk mwen Pou-m pat bay repons,\nLè Jezu rantre nan kè mwen.\nMwen vi’n chanje konplètman.\nKris fè-m konnen l’pran chaj mwen\nSe pou-m rete kote-l',
