    title: 'J’ai trouvé un si bon Sauveur',
    lyrics:
      "1.\nJ'ai trouvé un si bon Sauveur,\nJésus-Christ ma joie, ma paix;\nJe demeure dans sa faveur\nGloire à Son nom à jamais.\n\nChoeur:\nJésus fait ma joie de vivre,\nA jamais je suis à Lui\nEntre ses mains je me livre\nPas à pas Il me conduit.\nDésormais je veux Le suivre,\nMon appui; ses bras ouverts.\nJésus à fait ma joie de vivre,\nIl est l'Ami le plus cher.\n\n2.\nO que cette vie est belle,\nMême le travail est doux;\nChaque tâche solennelle\nSanctifiée par Jésus.\n\n3.\nIl me donne sa sagesse,\nSa grâce est ma liberté;\nIl m'amène avec tendresse\nDans Sa sainte volonté.",
