    title: 'Le grand jour de résurrection',
    lyrics:
      "1.\nLe grand jour de résurrection\nQuand nous tous monterons\nVers le ciel (Alléluia),\nQuel beau jour!\nDevant notre bien-aimé Sauveur\nJésus nous paraîtrons,\nQuel beau jour (Alléluia)!\nQuel beau jour  (Quel beau jour)!\n\n\n\nChoeur:\nQuel beau jour (Alléluia)!\nQuel beau jour (Amen)!\nQuel beau jour (Alléluia)\nLe grand jour de résurrection,\nNous l'attendons,\nNous l'attendons,\nQuel beau jour  (Alléluia)!\nQuel beau jour  (Quel beau jour)!\n\n2.\nLe grand jour de résurrection\nAu son de la trompette\nD'un clin d'oeil (Alléluia);\nQuel beau jour!\nQuand ce corps mortel\nSera revêtu d'immortalité,\nQuel beau jour (Alléluia)!\nQuel beau jour  (Quel  beau jour)!\n\n3.\nLe grand jour de résurrection\nQuand nous serons en haut,\nAvec Christ (Alléluia) le Sauveur,\nNous le verrons face à face\nEt nous serons semblables à Lui,\nQuel beau jour  (Alléluia)!\nQuel beau jour  (Quel beau jour)!",
