    title: 'Je voudrais, Jésus, être comme Toi',
    lyrics:
      "1.\nJe voulais, Jésus, être comme Toi;\nSeigneur, viens, mettre ton Esprit en moi,\nTon zèle et ton amour de la vérité;\nMe voici pour accomplir ta volonté.\n\nChoeur:\nOh, prends (Oh, prends) mon coeur,\nEt qu'il soit à Toi seul;\nJe veux, Seigneur, être pur comme Toi,\nLave et garde-moi à l'ombre de ta croix.\n\n2.\nÊtre comme Toi, c'est mon seul désir,\nSi vient la croix, ta force aide à souffrir,\nDonne-moi à proclamer ton grand salut,\nEt par ton Esprit e gagner les perdus:\n\n3.\nÊtre comme Toi, voilà mon seul but,\nJe veux aimer de ton amour, Jésus,\nOublier tout comme Tu le fis jadis,\nÊtre comme Toi, c'est mon éternel cri.",
