    title: "O jeunesse, Christ t'appelle",
    lyrics:
      "1.\nO jeunesse, Christ t'appelle,\nOui, t'appelle au bon combat;\nIl te veut toujours fidèle\nPour le suivre pas à pas.\nSois royale, sois vaillant,\nPure et forte chaque jour;\nSois active, sois fervente,\nDieu t'accorde son secours.\n\n2.\nVois, partout le mal augmente,\nIl redouble son effort;\nIl déchaîne la tourmente,\nC'est la ruine et c'est la mort.\nMais c'est Dieu le Roi, le Maître,\nIl dissipera la nuit;\nTu verras l'espoir renaître\nSi ta foi s'attache à Lui.\n\n3.\nO jeunesse, Christ t'appelle,\nTout entière, livre-toi.\nDans tes rangs, aucun rebelle,\nSuis Jésus jusqu'à la Croix.\nVois déjà du ciel la gloire,\nLà, Dieu séchera tes pleurs;\nCrois toujours à la victoire,\nCrois, et tu seras vainqueur.\n\n4.\nChante et sois dans l'allégresse,\nCar bientôt Jésus viendra.\nPlus d'angoisse, de détresse,\nSon royaume alors naîtra.\nA Lui force, honneur, puissance,\nJusque dans l'éternité;\nCours au but sans défaillance,\nSuis le Christ ressuscité.",
