    title: 'Gen De Bagay Mwen Pa De Konnen',
    lyrics:
      '1.\nGen de bagay mwen pa de konnen\nGen de kote, m’pa dwe ale\nMen gen yon bagay, mwen konnen siman\nWi Jezu bon, m’santi-l nan kè-m\n \nRefren:\nWi Bondye bon, li bon pou nan-m mwen\nKa li lave-m e li fè-m kenbe-l\nTankou yon dlo pi, o wi Bondye bon\nLi telman bon, m’santi-l nan kè-m\n \n2.\nGenyen anpil moun ki pa kren-n Bondye\nO dènye jou li va tro ta\nPou yow è tou sa pisans li te ye,\nO wi li bon, m’renmen-l konsa.\n \n3.\nVa genyen jou soley va kouche\nPap genyen lumyè menm tout tan,\nOu menm ki pa kwè, ki boo u prale?\nP’ap gen kote pou ou kache.\n \n4.\nE tout frè e sè ki genyen pisans\nNou dwe ran glwa pou riches sa-a\nLemonn pa konnen kisa nou jwenn\nSe sovè-a ki renmen nou',
