    title: 'Pawòl Bondye Di Nou: Lè Kris Prèt Pou-l Vini',
    lyrics:
      '1.\nPawòl Bondye di nou: lè Kris prèt pou-l vini\nLamou va refwadi anpil fwa va branle\nPeche va ogmante, lè syèk la pral fini,\nMalgre sa, satan pa janm repanti\n \nRefren:\nJezu ap vi-n maten, middi ou a minwi\nTout mò ki nan Kris y ova tande twonpèt la\nYo va resisite pou yo ale nan syèl,\nKote pap gen lanmò, se viv tout tan.\n \n2.\nTraka isiba yo ranpli kè nou ak krint,\nJouk tan nou fi-n bliye tout byenfè Bondye yo\nImilye nou pou-n sòti anba chatiman,\nFòk nou kretyen pou nou vi-n pèleren.\n \n3.\nEprèv y ova fini lè nou monte anwo,\nNou va jwaye tout tanlè nou ale nan syèl,\nna bliye tout sousi, na  di lemon adye\npou-n ale jwi bone ki p-ap fini.\n \n4.\nNou tout te kondane, Jezu fè nou pwomès\nSi nou vle kenbe li, na jwenn la delivrans\nPwomès la akonpli sou lkwa di kalvè.\nNou di mèsi Seyè pou amou li.',
