    title: "Yon jou m'te pedi nan chemen an",
    lyrics:
      '1.\nYon jou m’te pèdi nan chemen an,\nMwen pat kapab konprann ki kote’m dwe ale,\nMen yon moun té vini pran men mwen\nE ki te kondwi mwen kote dlo-a byen fre.\nKe\nJezu se Rwa, Jezu se Rwa,\nJezu se Rwa de Rwa \nLap vin’ chache mwen pou’l\nMennem an sytel la,\nJezu se Rwa de Rwa.\n2.\nDepi jou men’l te poze sou mwen\nLa vi mwen te chanje, e nan’m mwen te vi’n lib.\nNan ke mwen te toujou gen yon chan\nTemwaye grande gran amou li pou mwen,\n3.\nAla yon si gran jou sa va ye,\nLe Jezu va vini pou-l pran mwen menm ak ou \nAnpil moun va di Seye, Seye\nMen yo pap kapab antre nan bel vil seles la.',
