    lyrics:
      '1.\nSipoze Bondye te chèche nan syèl,\nLi pat kab jwenn pèson kit e vle’l\nPou-l te bay siprèm sakrifis nesesè\nLi bay vi li pou sove mwen ak ou\n \nRefren:\nO, o si se pat pou yon plas yo rele mòn kalvè\nSi se pa te sou vye bwa la kwa-a\nSi se pat pou nonm sa-a yo rele Jezu-a\nE pou toujou mwen menm ak ou ta pèdi\n \n2.\nM-si kontan L-te aksepte bwè koup amè\nMalgre priyè, pè lese-l pase lwen\nm-si kontan li pat rele zanj nan syèl yo\npou vi-n wete klou k-ap toumante menlyo',
