    title: 'Nan Mitan Gwo Lanmè',
    lyrics:
      '1.\nNan mitan gwo lanmè,\nAk tranpèt mwen te ye.\nSan sekou m’te pèdi,\nSan lafwa, san limyè\nToutakou mwen wè yon gwo bato ap pase\nMwen ranmase tout fòs mwen\nE mwen te rele “O sekou” (2 fwa)\n \n2.\nSe bato levanjil vapè byen ekipe\nM’ap Mennen fidèl yo nan rwayòm Bondye,\nKapitènbato-a wè efò mwen t’ap fè\nAk yon men byen anlè\nMwen te kriye trè klè: “O sekou” (2 fwa)\n \n3.\nTouswit bato sovtaj,\nFè mwen reprann kouraj,\nNan gran bonte-l chef la\nPran ka mwen an chaj,\nKounye-a mwen kontan e zafè mwen regle,\nPaske gran Sovè-a rive kote-m te ye\nGlwa a Dye! Glwa a Dye konsa nanm\nMwen chante “glwa a Dye!”\n \n4.\nZanmi dekoiuraje ki ki pa konnen lapè,\nK’ap fè nofraj anba tèrib lanmè peche,\nSenyè mwen dispose sove ou si ou vle,\nvi-n chase sekou li kounye-a san delè\nli sove-m! li sove-m!\nak lajwa m’ap chante li sove-m.',
