    title: 'Le nou nan lamize,  akable toumente',
    lyrics:
      '1.\nLe nou nan lamize, akable toumante,\nLe la vi nou boulvese \nLe nou pedi espwa \nLe tout bagay fe nwa,\nLe nou pa we devan,\nLe tristes nan ke nou,\nLe nou nan laflilksyon\nLe nou vle dekouraje\nLeve zye nou anle,\nEpi gade Jezu\nN’a santi nou pi fo.\n\nRefren\nJézu ! Jézu !\nTanpri ban-nou fos pou nou lite,\nJezu ! Jezu !\nSi ou pa kenbe-n nou va tonbe.\n2.\nPafwa se tantasyon\nChak fwa nou vle fe byen,\nMen se mal ki prezante,\nNou gen bon volonte,\nMen twop difikilte fe nou pedi lafwa.\nPafwa se maladi, gen de le se lanmo,\nElas ! nou dezespere,\nSi nou priye Jezu, ke se nan limenm sel\nNou gen konsolasyon\n3.\nSa vre nou vle travay,\nNou vle machje pou glwa li,\nMen nou manke kouraj\nLe zeprev yo vini, gen kote nou febli,\nMalgre kalamite,\nMalgre difikilte \nMen nou pa janm ebranle,\nAnnou priye Jezu,\nPaske se limenm sel\nKi kab ban ou lajwa.',
