    title: 'Mwen sonje gen yon you kijan mwen te malad',
    lyrics:
      '1.\nMwen sonje gen yon jou kijan\nMwen te malad \nDokte te di’m konsa li pa kwe map sove.\nParan’m te tande sa, yo tout te pran krye\nMen Jezu te pale nan jou sa-a\nRefren\nMwen pa kapab bliye, bliye jou sa-a\nKoman’w ou vle pou’m ta bliye jou sa-a\nJou’m te jwenn soulajman pou nan’m mwen \nGlwa a Dye (bis)\n2.\nLe mwen pat gen Jezu, ke mwen te tout tris\nMwen pat kapab manje, e mwen pa kapab domi,\nLe’m vini jwenn ka Jezu tout bagay te change \nA la yon bon zanmi se Jezu.\n3.\nLe mwen te nanmond la, m’te toujou ap kriye \nPeche mwen te leve, pwoblem agoch adwat \nMwen te remet Jezi ti res la.\n4.\nJodi-a si gen yon moun ki poko gen Jezu,\nKouri vi’n aksepte’l paske le-a\nNan Jezi gen la pe, gen lavi nan Jezu\nNan Jezi gen yon let kap koule.\n5.\nOu menm fre’m, se’m yo ki déjà nan legliz\nFok ou kapab konnen ke satan frekan,\nMet tripotaj ate, mete logey ate,\nPou satan pa vire men-l pran w.\n6.\nOu vle kraze Legliz avek lan ou genyen\nOu fe pawol mache sou do fre\nLanj Bondye ba w a, se pou lwe non li\nKonveti’w koulie-a piga’w jwe.',
