    title: 'Que Nos Chants Retentissent',
    lyrics:
      '1.\nQue nos chants retentissent,\nEt montent vers les cieux\nQue les airs réjouissent,\nDe mille cris joyeux\nEcho encore, écho sonore,\n \nRéveille-toi  réveille-toi\nPour dire encore (bis)\nTout notre émoi, tout notre émoi !\n \n2.\nPetites fleurs coquettes,\nEclatent vos couleurs\nToujours de grandes fêtes\nRépandez vos odeurs.\n \n3.\nBlancs, li as, fraiches rose\nMortels c’emi-eclos\nTout ceux-là passent\nMes paroles ne passeront pas.',
