    lyrics:
      '1.\nKenbe fèm nan travay n’ap fè pou Jezu-Kri\nRout la pa faisil, fòf nou toujou soufri\nLè satan fè ravaj li toupatou,\nMwne konnen Jezu la li va kenbe nou\n \nRefren:\nKenbe fèm jouk sa fini\nKenbe fèm jouk Kris vini,\nKenbe fèm piga ou lage\nlè Jezu la ou p’ap janmè fatige\n \n2.\nYon sòlda p’ap janm touché san-l pa travay\nKi toujou rete fidèl nan tout bagay\nKi p’ap janmè rekile lè ou nan batay\nNou konnen aprè batay n’ap gen viktwa\n \n3.\nJezu sere yon bèl kouròn pou tout kretyen\nKi toujou rete fidèl nan tout jiska lafen,\nVa gen tout kalite kouròn nan jou sa\nLite byen pou nou ka pran tout kouròn yo.',
