    title: 'Lè Moman-an Te Pi Difisil',
    lyrics:
      '1.\nLè moman-an te pi difisil,\nPitit, madanm tonbe ,alad,\nKouche sou kabann lopital\nAk lapenn mwen pa na travay.\nYo ban mwen papye preskripsyon\nMezanmi mwen m’pa gen a touché\nMwen louvri bra mwen bay Jezu\nSe li menm sèl ki ka sove-m\n \nRefren:\nMwen p-ap lache Jezu yon may\nAvèk li mwen pi asire\nMwen p-ap kite Jezu sovè-m\nAvèk li m-ap genyen viktwa.\n \n2.\nS-ak te di-m ale kay book,\nAk lajan m-al rele vye loua,\nAjenouye nan pye pechè,\nPitit, madanm mwen pral mouri,\nMwen fè yon ekzamen konsyans,\nSi yon nonm te kab bay lavi\nNonm sila-a pa te janm mouri\nTout byen sou late ta pou li\n \n3.\nDoktè di-m pa genyen espwa\nTou de moun yo prèt pou mouri\nMen mwen di “O non de Jezu!\nPa gen anyen dròl k-ap pase”\nTou de moun yo pat k-ap manje\nMen demen, yo mande manje\nWuit jou pase yo ekzeyate\nSou proteksyon Jezu sovè-m',
