    title: 'Gen moun ki konprann ale nan syel la',
    lyrics:
      '1.\nGen moun ki konprann ale nan syèl la\nSe tankou pran panye ale nan mache,\nSe pa bel kay, ni lajan ak bel oto.\nRefren\nAle nansyel se pa jan ou konpran nan,\nW gen anpil bagay pou fe pou ka ale nan syel.\nAle nan syel se pa jan w konpran nan,\nW gen anpil travay pou fe pou kab ale.\n2.\nMalgre n’ap chante, malgre na’p priye\nMalgre n’ap jene temwaye tou le jou,\nEpi gen yon moun ki mare sou ke nou\nEpi gen yon moun ki mare sou ke nou\nEpi nou ront pale de syel la.\n3.\nW gen si lontan depi ou nan legliz\nKondwit ou few e ke ou pako ketyen,\nRenmen an kachet avek lemonn yo,\nEpi nou konprann pou nale nan syel.\n4.\nOu genyen dwet lou genyen lang long,\nOu genyen 2 madan’m ou genyen 2 menaj\nGenle ou konprann jan wap antre legliz\nSe konsa ou prale nan syel la.',
