    title: 'Petet se pa sou yon gwo montagn',
    lyrics:
      '1.\nPetet se pa sou yon gwo montagn\nNi nan yon peyi byen lwen.\nPetet se pa nan yon gran batay,\nMenm si mwen pat gen anyen,\nM-ap reponn Bondye Ak men w sou mwen\nMwen ale kote ou vle.\nRefren\nMwen vle ale kote w vle, Bondye\nNan mon sou lame nan vale\nMwen va di sa ou vle mwen di Bondye\n2.\nPetet jodi-a se pawol dou\nJezu Kri vle pou-m pale \nSandout dwe genyen dou rout la tou,\nMwen egare, pou-m cheche.\nO, Bon Sove si ou va gide-m\nE si sou wout la w kenben-m\nMwen va repete mesaj lavi,\nMwen va di sa ou vle mwen di.\n3.\nSetenman genyen yon vie ti plas,\nNan gran rekot monn sa-a \nKote-m kab fe menm yon ti kras\nPou Jezu krisifye-a.\nM’a mete konfyans mwen nan ou Seye-m\nPaske w te renmen mwen vre,\nM’a fe volonte’w che sovem \nMwen va sa w vle ou mwen ye.',
