    title: 'Bondye voye pitit,  li rele Jezu',
    lyrics:
      '1.\nBondye voye pitit, li rele Jezu,\nKi te vini e padone-n.\nLi rachte nou e li mete nou lib.\nKounye-a li ak papa-l,\nLap ret tann nou.\nRefren\nMwen konnen-l vivan,\nM-ap konte sou demen, paske-l vivan\nInkyetid yo ale \nPaske-m konnen  O, m-konnen\nLi se tout lavi mwen,\nM-ap konte jou pou-l vin-n cheche-m\nPaske-l vivan.\n2.\nMwen aksepte tout sa ki rive mwen,\nPaske sove-m ap defann mwen,\nJouden-an met devan-m,\nKe mwen p-ap boulvese.\nPaske Jezu-m nan pa mouri,\nE li vivan.\n3.\nTout espwa mwen se sou li selman\nPaske li di-m l’ap vinn cheche-m\nEprev nan lavi sa-a pap fem twouble ditou\nBondye-m nan gran e li vivan\nM’ap ret tann li.',
