    title: 'Voulez-vous Y Aller',
    lyrics:
      '1.\nVoulez-vous y aller\nAu camp des bienheureux\nLa, nous aurons concert avec les anges\nQue nos pas, chaque jour,\nSa dirigent vers les cieux\nEntonnant les cantiques des archanges\n \nRefrain\nMarchons vers la gloire (3 foi)\nPour rencontrer Jésus\n \n2.\nVoulez-vous arriver\nAu céleste rivage\nRegardez à jésus le grand vainqueur\nCar dans l’éternité,\nC’est là qu’est le passage\nEn avant, vers le ciel, vers le bonheur\n \n3.\nEn avant bien- aime,\nPartons pour la milice\nLe tout-puissant est là pour nous defender\nSans craindre et sans douter, prêt à notre justice\nIl est toujours fidèle à notre entendre.',
