    title: 'Otrefwa-m te kouche',
    lyrics:
      '1.\nOtrefwa-m té kouché,\nZyem louvri m’ap pansé,\nAk komandman Jezi-Kri\nTap bay disip li yo,\nMwen te santi lè sa-a\nYon gwo transformasyon\nYon rivye t’ap koulé nan zye mwen\n\nRefren\nJezu Kri apran-n nou,\nNou dwe gen tet ansan’m\nPi gran Komandman-an\nSe renmen nou youn lot\nAk tout fos de tou kè\nPadone frè nou yo\nPi gran Komandman-an\nSe renmen nou youn lot.\n\n2\nApran’n a padoné\ntout fre e se nou yo\nMen’m le yo meprize-n\nKou yon fatra ki abandone,\nPa kriye, pa plenyen\nresiye ou frè mwen,\nSoufrans lan di se vre, pran Kouraj\n\n3\nPataje ak frè ou\nTristes li ak lapen-n\nSe sa Jezu mande\nPou nou yon soufri pou lot,\nPa imilye fre’w, pa imilye se’w\nNou tout en jeneral sé pousyè.',
