    lyrics:
      '1\nMwen renmen chante yon si bel istwa,\nDepi Kris te santifye mwen,\nKa nam’m mwen te jwenn yon kado lajwa,\nDepi Kris te santifye mwen\n \nRefren\nMwen pap janm bliye, jou sa a dife tonbe\nDife tonbe, dife tonbe.\nMwen pap jan m bliye, jou sa a dife tonbe\nLe Jezu te sanktifye mwen.\n\n2\nTout dout ak krent mwen efase\nDepi Kris te santifye mwen\nafen li te konble m ak gras Li\nLe Jezu te santifye mwen.\n\n3\nPlezi lemonn vin n pa interese m\nLe Jezu te sanktifye m\nLespri tonbe sou mwen kon you dife\nLe Jezi te sanktifye mwen\n\n4\nMwen pa kapab bay frem yo manti anko,\nDepi Kris te sanktifye mwen,\nMwen pa kapab fe tripotaj sou se yo,\nDepi Kris te sanktifwe mwen.\n\n5\nKo mwen vini yon tanp pou Lesentespri\nDepi Kris te sanktifye mwen,\nMwen pakab viv nan peche sal anko\nDepi Kris te sankfifye mwen.',
