    title: 'Senyè Mwen Mande Ou Fòs',
    lyrics:
      '1.\nSenyè mwen mande ou fòs\nPou-m reziste nan konba (2 fwa)\nMwen vle rele fidèl jan ou vle mwen ye\nNan konbat (2 fwa)\n \nRefren:\nKan lespri mwen ta vle boulvèse\nMwen pa pè mwen konnen m’asire\nNan konba (2 fwa)\n \n2.\nPran feblès mwen ban-m fòs\nPou-m kab lite nan konba (2 fwa)\nMwen vle swiv ou e ale kote ou vle\nNan konba (2 fwa)\n \n3.\nSenyè kenbe-m fèm pou mwen pa trouble\nNan konba (2 fwa)\nOu te di mwen tout sa genyen pou rive,\nNan konba (2 fwa)\n \n4.\nNan moman sa nou ye si nou ye si nou pa kenbe ou\nSa na fè (2 fwa)\nNou vle re fidèl pou-n k’ap kourobe\nAprè konba (2 fwa)',
