    title: 'Mwen Gen Yon Bon Papa',
    lyrics:
      '1.\nMwen gen yon bon papa\nKi konnen fè tout mirak\nLi konn geri malad\nE li konn chase demon\nLi konn chase tristès,\nE li resisite mò\nLi kon chase peche,\nE li konn sove nanm yo\n\nRefren:\nSe Jezu bon mèt la,\nLi konn fè tout mirak\nLi konn geri malad,\nLi konnen chase demon\nJezu bon Sovè-a\nKonn leve menm moun mouri.\nMenm tanpèt avèk van\nLi genyen pouvwa sou yo\n\n2.\nYon jou li tap mache,\nLi rankontre dis lepre\nMen lè yow è Jezu yo rele\nPitye pou nou.\nMen yo te panse\nLi ta prale lapide yo\nMenm lè-a kè-l touché-l\nLi gen konpasyon pou yo,\nLi geri yo menm lè\nE yo vini pirifye.\n\n3.\nYon jou li te sou lanmè\nAvèk kèk nan disip yo\nYon tanpèt te leve\nBak la-prèt pou-l chavire\nJezu te nan domi\nDisip yo te pra rele’l\nLi leve men’l anlè,\nLi di “van fè silans”\n\n4.\nYon jou yo te Mennen ba li\nYon fanm adiltè\nMen yo te panse\nLi prale lapide fanm nan\nLè li gade fanm nan\nLi genyen pitye pou li,\nLi di’l mèt ale men pa fè peche ankò',
