    lyrics:
      '1.\nMwen kanpe sou tout pwomes de\nKris rwa mwen,\nPandan letenite M’ap chante lwanj li\nGlwa nan tout syel la sa va sije chan mwen,\nMwen kanpe sou tout pwomes Bondye.\nRefren\nKanpe, kanpe, mwen kanpe sou tout\nPwomes ke Bondye fe nou \nKanpe, kanpe m’ape kanpe\nSou tou pwomes Bondye.\n2.\nMwen kanpe sou tout pwomes kip a fayi,\nLe move tanpet e tout krent vle koule-m \nPa pouvwa pawol Bondye, ma soti vinke\nMwen kanpe sou tout pwomes Bondye',
