    title: 'Ala Yon Mèveye Mèveye Jou',
    lyrics:
      '1.\nAla yon mèveye mèveye jou\nJou m’pamka janmè bliye.\nLè m’te nan tenèb pèdi nan labou\nJezu sovè-m mwen kontre\nAla yon zanmi ki gen charite,\nLi satisfè-m ak gras li\nLi pran tristès mwen li ban-m alegrès\nE li fè tout tenèb mwen pati.\n \nRefren:\nSyèl la desann plan nanm mwen ak lajwa\nLè sovè mwen te sove-m ak lakwa.\nPeche-m, tout padone\nTenèb nan limyè tounen,\nSyèl la desann plen nanm mwenn ak lajwa.\n \n2.\nFèt de nouvo pa pisans lespri sen,\nLi fèm yon pitit Bondye\nAmou kalvè justifye se sèten\nLi ban-m yon non glorye\nTravay sa-a fèt nan yon ti moman\nLè-m repanti nan peche-m\nLè-m aksepte li e lè-m konfese,\nO beni non li, li sove-m\n \n3.\nAlèkile lesperans ke m’twouve,\nVa dire jouk lavi sa-a\nVa fini yon jou pui m’tou asire.\nM’a jwen yon plas nan syèl la\nTout sa-a rive paske yon bèl jou\nMwen te krè nan Jezu-Kri,\nByenfè yo si bèl ak Sali etènèl\nMwen resevwa tout nan men li',
