    title: 'Kè Mwen Boulvèse Anba Kolè Bondye',
    lyrics:
      '1.\nKè mwen boulvèse anba kolè Bondye,\nAnvi monn nan trennen-m nan bafon peche.\nSenyè pou yon pòv miserfab, gen pitye,\nTou swit li vi-n sekoure-m kotem’te ye\n \nRefren:\nLi retire’m nan boubye peche,\nLi mete pye-m sou tè fè-m se vre\nLi fè kè-m rejwi e m’ap chante\nYon chan glwa a Dye!\nAleloya!\n \n2.\nLi te mete-m sou tè fèm, a kote li\nPye mwen vi-n asire nan chemen lavi\nNan pwen danje ankò, li kenbe-m debou\nM’ap mache pazapa avèk li toujou.\n \n3.\nLi mete yon chan louanje anndan kè mwen\nNan nwit kou lajounen.\nKè mwen ap debòde nanm mwen afranchi\nTout glwa pou redanmtè Seyè Jezu-Kri.\n \n4.\nM’ap chante gran mizerikòd li pou mwen\nM’ap felisite jouk tan yon moun konnen\nNan pwen lòt Sali pou lèzò Jodi-a\nVi-n chache sekou li anvan li  trò ta.',
