    lyrics:
      '1.\nM’ape swiv ou, O bon Sovè mwen,\nNenpòt kote ou prale\nTout kote ou vle kondwi mwen\nPran devan m’ape mache\nRefren:\nChemen-an te mèt difisil\nSan limyè e san tras\nDepi ou la, l’ap vini fasil,\nM’ap swiv tras ou, e m’ap mache.\n \n3.\nSi mwen fèb, si mwen akable,\nSi lapenn anvayi kè mwen\nM’ap swiv ou ankò san twouble\nWi Senyè konte sou mwen.\n \n4.\nSi ou Mennen-m nan gran jouden-an\nGwo kouran p’ap fè mwen pè,\nPaske ou traverse-l anvan-m\nBon Jezu, m’ap swiv ou an pè.',
