    lyrics:
      '1.\nLè mwen sèl e dekouraje,\nLè-m pa gen moun pou mwen konfye-m\nMwen konnen Jezu, li toujou la e li konprann\nLè Jezu la, tout tristès ale\nNanm mwen vi-n kalm, lespri-m vi-n lib\nMwen konnen Jezu toujou la pou’l ede mwen\n\n\nRefren:\nSe Jezu sèl ki k’ab konprann mwen\nSe Jezu sèl ki k’ab ede-m\nE pwoteje-m nan tout traka nan lavi sa-a\nSe Jezu sèl ki kenbe men-m\nSe Jezu sèl ki sekoure-m\nSe Jezu sèl, wi se li menm sèl ki konn bezwen-m\n\n\n2.\nSi ou bezwen li Jodi-a\nOu mèt aproche’w bò kwa-a\nMwen konnen Jezu, li toujou la e li konprann\nOu mèt pote tout fado-ou ba li,\nE li va rezoud yo pou nou\nMwen konnen Jezu li toujou la pou’l ede mwen',
