    title: 'Lè Lavi Mouin Va Fini',
    lyrics:
      '1.\nLe la vi mouin va fini \nE moiun jambe rivie-a \nle mouin oue briye\ngnou matin glorie \nma va konnin redampte mouin\nle-m rive nan siel la\nE souri  li va pou mouin gnou byinvenu\n \nRefren:\nma va oue li, ma konnin li, \nle ma kanpe bo kote jezu –kri\nma va oue li, ma konnin li\npa mak klou yo li gingnin nan min li.\n \n2.\nKi transpo dalegres \nle mouin va oue li fas a fas\nE tout gran a mou kap\nbriye nan je li\no ke mouin va loue li \npou mizerikod ak gras,\nki pare pou mouin\ngnou bel plas nan kay li.\n \n3.\nNan bel peyi anro –a\nmouin gingnin kek byinn-eme\nmoin sonje le yo te di mouin \no revoua\nak gran joua yo va\nchante le yo oue mape rive, \nmin mouin ta vle\nsove mouin premieman.\n \n4.\nMape antre nan vil la\nnan gnou rob ki blan e pu,\nkote pap gin soufrans ni tristes anko\nmape chante ak zanj yo \nNan yon seles amoni\nmin mouin ta vle oue\nsove mouin premieman',
