    lyrics:
      '1.\nLè la vi-m sanble tris, lè-m chaje ak pwoblem\nSe sou jenou-m mwen kap jwenn la jwa.\nPesonn sou late sa-a pap kapab édé mwen,\nSelman Seye k-ap fe tout pou mwen.\nRefren\nOu menm ki di frapé é ou va louvri\nOu menm kab vin cheche-m pou-m al nan syel,\nSonje mwen che Jezu nan rout lavi-a\nO, sonjé mwen, sonjé mwen souplé\n2.\nAne yo pasé vit, mwa yo vini pi kout \nSiy nan yo menm vi-n di ou pap vini\nOu menm k-ap sevi Kris Annou swiv li chak jou',
