      md: '**1.** \n\nAle, joli kolonb mesaje Bondye, \n\nAle voye mesaj la bay tout le zimen \n\nAle nan lesinayi \n\nNan laband de gaza \n\nAle opre de Jwif e opre de Arab, \n\nDi yo : Li le pou yo sispann trennen \n\nNan yon la vi kot chen ap manje chen \n\nLi le pou yo siyen yon trete de pe \n\nPaske jistis Bondye pa lwen pou’l vini \n\nRefren \n\nAle di yo sa  se Granmet la ki voye-ou \n\nAle di yo sa, \n\nAvni-an kapab apokaliptik \n\n\n<br/> **2.**\n\nAle jis anro tet tribi-n nasyonzini, \n\nAle voye mesaj bay lemonn antye \n\nAle pwofite pale ak gwo pwisans yo. \n\nAle di yo pou yo sispann frabrike zam \n\nNan tye monn la gen moun kinan grangou \n\nGen timoun k’ap grandi nan malsite \n\nKip a men-m gen anyen pou yo manje \n\nDi yo kile dyalog no-sid la va serye. \n\n\n<br/> **3.**\n\nAle nan tou azil, nan tout sanatoryom, \n\nAle kote lavi-a pa sanble ak lavi lom \n\nAle kote k’gen inosan k’ap anprizone \n\nAle di yo pran kouraj pe-n yo pral fini \n\nAle pale ak tout « Boat People » yo \n\nTout moun ke yo frape pou ide yo \n\nDi yo : ya gen chans re we  peyi yo, \n\nPaske jistis Bondye-a pa lwen pou-l vini \n\n\n<br/> **4.**\n\nAle opre de rwa e opre de pwisan, \n\nAle bo moun ki renmen we espetak san. \n\nAle di yo Agno Bondye-a an kole \n\nAle di yo jou sa-a ki bo yo pral kache ? \n\nAle mache nan tout gran tribinal, \n\nKote jistis ap vann lajan kontan \n\nDi jij la yo, se pou yo repanti, \n\nPaske jistis Bondye-a pa lwen pou-l vini \n\n\n<br/> **5.**\n\nAle bo l’O.M.S et bo la F.A.O. \n\nAle di yo ke tye monn an konvalesan. \n\nAle tout bo lakouarouj intenasyonal \n\nAle di yo ke survi monn la an danje \n\nAle pale ak peyi l’OPEP yo \n\nKi ap monte pri petwol la byen wo \n\nDi yo, pou yo genyen pitye pou nou \n\nPaske bidje tye monn la déjà fin kreve \n\n\n<br/> **6.**\n\nAle, nan tout « night-club » nan tout disko \n\nAle kote y-ap pwofite twoke jen yo. \n\nAle, di yo genyen pitye pou jenes la. \n\nAle mache nan tout gran bodel \n\nKote y’ap eskplwate fanm de nwi yo, \n\nDi yo : pa kontinye peche anko, \n\nPaske jistis Bondye-a pa lwen pou-l vini. \n\n\n<br/> **7.**\n\nAle nan tout vale nan tout mon nan tout plenn \n\nAle konsole sila yo ki aflije \n\nAle kote pitit Bondye ap mouri grangou \n\nAle di yo pran kouraj yo va rasasye \n\nAle pale ak peyizan-l yo kip a gen \n\nYon ti kal te pou yo travay \n\nDi yo an atandan ya pran kouraj \n\nPaske jistis Bondye-a pa lwen pou’l vini. \n\n\n',
