    title: 'Anvan-l te monte nan syèl ale jwenn papa-l',
    lyrics:
      '1.\nAnvan-l te monte nan syel ale jwenn papa-l\nLi te kite disip yo, pou preche laverite.\nTout sa-k, pa vle kwe levanjil déjà kondane\nSa ki obeyi lalwa, prale viv nan syel avel.\nRefren\nJou Jezu desann sou late avek\nLame zanj papa-l yo \nYon moun kip a la, ou p’ap pran avyon ave-l,\nJou Jezu desann sou late\nVi-n cheche tout pitit li yo\nYon moun ki pa la, ou pap pran avyon avel.\n2.\nLevanjil preche gratis, yo p’ap aksepte-l\nFok nou pa konprann denye\nJou-a nou kap pran daso.\nLe avyon Jezu-a prale, sa-k p’ap\nGen visa fok nou pa konprann\nRakek kab voye-n ale ave-l.\n3.\nMak 15 ak 16 di nou « ale toupatou,\nAl pote levanjil bay tout moun ki sou late \nSa ki kwe ki batize, so yo ka sove,\nSa ki meprize levanjil, déjà kondane. »',
