    title: 'Mwen se pelerin e vwayaje',
    lyrics:
      '1.\nMwen se peleren e vwayajè,\nMwen pap rete toutan sou la tè\nE mwen konnen avek asirans\nKe ma we Jezu nan syel\nKè\nKi gran jou, ki gran pou, jou sa-a va ye\nMwen va ajenouye nan pye-li\nPou-m bali tout one-l merite\nLe sa-a ke mwen va ranpil avek jwa\nLe ma we-m nan bra Jezi.\n2.\nSoufrans pa mwen se pou yon ti tan\nMwen pa plenyen pou pwoblem la vi\nRomen chapit 8 vese premye,\nMwen pa gen kondanasyon.\n3.\nPlezi nan mond sa-a pape gare-m\nRiches nan mo-n sa-a pap ebranle-m\nJezu déjà fe mwen yon pwomes :\nNan syel, la va pi dous.',
