    title: 'Moun vle rakonte sa Kris fe pou mwen',
    lyrics:
      '1.\nMoun vle rakonte sa Kris fè pou mwen\nDepi-m te jwen li tout bagay chanje\nNan prizon diab la li ban-m libete\nWi Jezu te delivre-m\n2.\nTèt mwen te chajé mwen pat gin répo,\nSousi la vi te fe-m vi-n pe lanmo \nJezu sove-m e mwen p ape anko.\nWi Jezu te delivre-m\n3.\nChanalite fe-m bliye gras  Bondye,\nTout zev mwen pat bon, peche-m yo te sal \nMen travay Jezu te sifi pou mwen\nWi Jezu te delivrem.\nRefren\nJezu té delivre-m (2 fwa)\nTeneb peche-m tounen yon bel klate\nWi Jezu te delivre-m\n4.\nSa Kris fe pou mwen, la fe-l pou ou tou \nLevanjil la se pou mwen, se pou ou\nSa Kris fe pou mwen, la fel pou ou tou \nWi Jezu te delivre-m',
