    title: 'Mwen se temwen Jezu Kri',
    lyrics:
      '1.\nMwen se temwen Jezu Kri\nM-ap twouble bib la \nLemonn kwe ya jwenn Sove,\nSan pa Jezu Kri\nSatan ban-n yon fos dokrin-n\nPou-n pa fe kole\nMiniste sou late toujou gen finans\nRefren\nO, oui pou-m temwen, fo-m konnen Jezu\nKa Letenel te fe li anvan nou te la,\nLom pa jwenn ak Jezu Kris san pa lesprisen\nAlelouya, m-te pedi men m’trouve lavi.\n2.\nAbraham pe de lafwa, li pa ka temwen\nAnvan Abraham te fet Jezu Kri te la\nSi-m temwen san-m pa konnen pa la verite.\nPou-m temwen, vre temwen fom nan Jezu-Kri\n3.\nLe-m kwe m-te pre Jeova,\nPoutan m-te tre lwen \nLe mwen ap change mo yo m-te vle we rezon.\nTout pouvwa pou Jesu Kri, nan syel e late,\nMwen tap pale vanite, tankou pase van.\n4.\nDye twa fwa sen, Jeova atrave lemonn,\nAbraham, Izarak e Jakob, y opa vre temwen\nLom ki vreman vre temwen sove Emanyel,\nGlwa a Dye, glwa a Dye,\nJezu Rwa de rwa.',
