    num: 74,
    title: 'Bo pi Jakob la yon jou le Seye',
    lyrics:
      '1.\nBo pi Jakob la yon jou le Seyè\nRankontre yon samariten\nKi vini pran dlo, Jezu mande li bwe\nFan’m sila etone\nEske’w pa konnen ke jwif avek samariten\nPagen oken’n rapo, pa gen oken relasyon \nPouki ou mande mwen bwe.\nSi ou te konnen ki don Bondye\nE kiles ki di ou bali bwe\nSe ou menm pito ki ta mande\nE mwen Ta ba’w yon bon dlo \nYon dlo ki pa’p jan fini\nE ki va dire nan lavi ou\nPou tout létènité\nKè\nMezanmi tande mwen jwenn yon Nonm\nKi di mwen tou sa mwen fè\nNon sila-a se yon pwofet\nEske  se pa li menm ki Kris-la !\nMezanmi tande mwen jwenn yon nonm\nKi di mwen tout sa mwen fè,\nNonm sila-a li se pitit, Bondyé\nSe li menm ki mesi-a,\nLi konnen tout sa ki nan ke mwen.\nSa se yon bagay ki meveye !\nLi ban mwen yon dlo pou mwen pa Jan’m swaf.\n2.\nLe fan’m nan tande ke Jezu\nKapab bali yon dlo pou li pa jan’m swaf,\nFan’m nan etone piplis\nLi mande kikote Ou va jwenn bon dlo ?\nTout de men ou vid\nOu pa gen anyen pou pran dlo\nEske ou pi gran pase Jakob ki bay pi sa-a,\nBan mwen yon ti gout ladan’n \nJezu di fan’m nan kote mari’w\nAle chache’l, epi vi’n jwenn mwen \nFan’m nan bay manti, men elas\nPagen Pies moun ki kab’ twonpe Jezu.\nOu di ou pa gen mari, e poutan\nOu pase senk déjà e denye ya pa pou ou.\n3.\nMezanmi tande\nMwen jwenn yon non’m\nKi ban mwen yon dlo\nPou mwen pa jan’m swa (bis 2 liy)\nVini bwe dlo sa-a\nEpi swaf ou va pase.',
