    title: 'Nanm Mwen Te Swaf,  Mwen Pat Jwenn Satisfaksyon',
    lyrics:
      '1.\nNanm mwen te swaf, mwen pat jwenn satisfaksyon\nPlezi lemon yo te twonpe nanm mwen\nMen yon bon jou mwen t-ap chache soulaje mwen\nJezu te di-m “vi-n jwen repo nan mwen.”\n \nRefren:\nWi mwen te jwen li,\nBèl sous lavi-a\nGras a Jezu, kit e mouri pou mwen \nSan I te koule sou bwa kalvè-a\nE kounye-a, li satisfè kè mwen\n \n2.\nlvi-m te tris, lè-m pat konnen Jezu\nm-pat gen espwa, nanmmwen te boulvèse\nmen gras Bondye te louvri sous lavi-a\nm-te jwenn ladann padon e libète\n \n3.\nChè zanmi, O, pou kisa ou mize?\nKouri vini, vi-n jwenn sous lavi-a\nFado peche yo te trò lou pou pote\nJezu vle ba-ou repo Jodi-a',
