    title: 'A Rebò Yon Chemin Ki Mennen Jeriko',
    lyrics:
      '1.\nA rebo yon chemin ki mennen Jeriko\nJezu te rankontre yon mandian\nyon vye rad te sou li tou de jel te fèmin, \nLi tap mande charite\n \nRefren:\nJezu te di ’ou mèt ale’ (bis)\ndepi menm, lè sa-a li wè.\n \n2.\nLè ou gade nan Jan chapit 8 vèsè 12,\nJezu di se limenm ki limyè\nMoun ki swiv li pap janm mache nwa anko\nMen li va gen limyè lavi.\n \n3.\nPawol mwen se yon lanp nan pye’w\nsi ou swiv mwen\nYon limyè nan kè nou pou tout tan\nMache nan fè nwa anko\nMen li va gen limyè lavi',
