    title: 'Chemen-an Pa Fasil',
    lyrics:
      '1.\nChemen-an pa fasil,\nJouk nou rive nan syèl la,\nLi genyen pikan e pieèj anpil,\nCheman-an pa fasil,\nMen Jezu mache ak nou,\nLi ran kè nou tout  toutafè trankil\n \nRefren:\nNon, non chemen-an pa fasil (2 fwa)\nMen Jezu mache ak nou\nLi pote fado nou,\nGras li fè kè nou rejwi anpil.\n \n2.\nChemen-an pa fasil\nGen zeprèv, genyen traka\nTout kote nou pase gendanje\nRout la mèt difisil\nSi Jezu kenbe nou,\nNa rete fèm lè pye nou glise.\n \n3.\nKò nou konn fatige,\nDekouraje nan rout la\nEpi satan konn vi-n tante nou\nMen n’ape tann le Senyè\nKi va parèt nan glwa li,\nL’ape pran nou ak li yon bèl jou.',
