    lyrics:
      '1.\nLemonn plen tristès ak mizè \nKè nou chaje chak jou.\nJezu te wete tout fado yo.\nSou mòn kalvè pou nou.\n \nRefren:\nLi vle wete tout fado pou ou\nBò kalvè,  bò kalvè \nLi vle wete tout fado pou ou.\nLi tout pre nou toujou.\n \n2.\nLage tout chaj ou sou Jezu \nPote krent ak sousi \nSan Jezu te wete fado nou.\nSou kalvè li mouri.\n \n3.\nNanm twouble, Leseyè konnen\nChagren ki nan kè ou \nMen li vle wete toiut fado yo\nSou mòn kalvè pou ou',
