    title: 'Gen Yon jou Kap Vini',
    lyrics:
      '1.\nGen yon jou kap vini,\nLe sa-a pap genyen chagrin\nPap gen nyaj nan syel la,\nNi gro dlo pou twouble zye-m\nVa gen lape pou toutan\nNan bel ti vil do sa-a\nki gran jou, jou glorye sa va ye\n\n\nRefren:\nKi gran jou sa va ye, le m’a rakontre Jezu\nE mwen va gade figi-l,\nLi menm ki sove-m pa gras\nli va genbe nen mwen\npoul mennen mwen nan te promes la\nki gran jou jou sa va ye\n \n2.\nPape genyen tristes,\nNi fado pou nou pote,\nNi maladi, ni doule,\nNi pataj nan peyi sa-a.\nVa gen lape pou tout tan\nNan bel ti vil do sa-a\nKi gran jou, jou gloye sa va ye\n\n3.\nOu min-m ki san Jezu\nsa ou va fe nan jou sa a?\nMin Jezu pral vini\nPot lagras prale femin\nKole Bondie pral tonbe\nSou tout moun ki san Jezu\nKi gran jou, jou glorye sa va ye',
