    title: 'Te Gen Yon Fanm Kit E',
    lyrics:
      '1.\nTe gen yon fanm kit e,\nLi pase douzan, li pat kapab geri.\nTout kote l-ale li pat jwenn gerizon\nLi vi-n kouche, pou li tan lanmò li.\n \nRefren:\nPandan li kouche, li tande y-ap pale\nGen yon sovè ki fè anpil ,irak,\nLi pran kouraj li di konsa\n“mwen gen espwa ke m-ap jwenn gerizon”\n \n2.\nYon jou li leve, li te ale’\nFoul la anpil, li pa kapab antre,\nLi te fòse-l touché ròb Jezu,\nMenm lè sa-a fanm nan te jwenn gerizon\n \n3.\nPandan fanm nan touché ròb Jezu\nJezu santi li pa menm jan ankò\nLi te kanpe, li foul la:\n“mwen santi yon moun ki touché mwen”\n \n4.\nDisip yo reponn, yo di “Senyè\nFoul la anpil kòman ou fòman ou fè konn sa”\nFanm nan parèt, li di “Senyè\nSe mwen menm ki touché ròb ou-a”\n \n5.\n“fanm nan kanpe tou ap tranble\nJezu rete, li gade fanm nan\nLi di fanm nan: “ou gen lafwa,\nAvèk lafwa wa jwenn gerizon.”',
