    title: 'O Ala Mwen Boulvèse',
    lyrics:
      '1.\nO ala mwen boulvèse,\nO, ala mwen artiste (2 fwa)\nSe lè nan kè-m\nKris pa pran premye plas,\nTout bagay chanje pou mwen.\n \n2.\nO! pou kisa li ale?\nO! pou kisa’l kite-m sèl? (2 fwa)\nSe lè mwen fè sa k’pa nan volonte’l\nLi fè’m santi li pa la.\n \n3.\nO! ala yon bon Jezu!\nO! oui mwen santi li bon! (2 fwa)\nKòm la parol-la di nous a klèman\nLi chatye moun li renmen\n \n4.\nO! an-nou tout byen-eme\nChèche konprann sa li vle,\nLè sa-a nou pape janm fè li fache\nTout bagay va byen mache\n(Repete chak line 2 fwa)',
