    title: 'Rwa Nebikanetza fè yo leve yon estati',
    lyrics:
      '1.\nRwa Nebikanetza fe yo leve yon estati \nLi di: Yon moun ki pa vle adore estati sa-a\nSe pou yo mare pye-l pou yo lage yo nan fou-a\nTe gen twa jenn gason, yo te refize obeyi.\n\nRefren\nYo te genyen konfyans (3 fwa)\nNan Bondye yo t’ap sevi-a\nTelman yo te fidel\nPa menm cheve yo pat boule\n\n2.\nTwa jenn sa yo sete: Chadrak, Mechak, Abednego\nTwa jenn sa yo, te devwe pou yo sevi Letenel\nTelman yo te fidel, yo pat vle sevi satan.\nRwa-a te mare pye yo et te lage yon an dife-a\n\n3.\nLe rwa sonje twa jenn sa yo ki te nan dife-a\nLi voye al gade : yo vi-in di-l yo we ka om\nKatriyem nan, se te anj Bondye ki te pami yo,\nYo t-ap mache nan fou-a, yo t-ap lwe non Bondye.',
