    title: 'Jezi se ou menm ki sove-a',
    lyrics:
      '1.\nJezi se ou menm ki sove-a\nSan ou menm mwen pa genyen la vi (3 fwa)\n\nRefren\nYo panse fe mwen mal,\nMal change anbyen\nSe pou glwa Bondye manifeste.\n\n2.\nYo pran-n, lage-m nan siten nan,\nPou m-pedi lavi materyel mwen \nJezu ki kon-n sa li pra-l fe,\nMwen kouri lage mwen nan bra li.\n\n3.\nMalgre mwen nan bouch delivrans mwen\nSatan vi-n pou-l lage-m nan lemonn\nJezu ki ranpli ak tout fos li\nMwen kouri lage mwen nan bra li.\n\n4.\nJezu, menm nan mitan brigan yo\nTou sa mwen fe yo leve kont mwen,\nSi ou pa vire zye gade mwen,\nBrigan yo ta lage-m nan lemonn.\n\n5.\nMalgre mwen nan bouch delivrans mwen,\nMadanm Potifa vi-n po jete-m \nMadanm Potifa kenbe rad mwen,\nMwen kouri lag eves mwen ba li',
