    title: 'Koute Vwa Jezu Ki Nan Dezè-a',
    lyrics:
      '1.\nKoute vwa Jezu ki nan dezè-a \nl-ap chèche mouton ki pèdu yo \nmouton ki egare nan patiraj la\nl-ap fè yo rantre nan pak la.\n \nRefren:\nVini, vini, mouton ki pèdu yo \nVini, vi-n jwenn mwen  bèje w-ap chache’w \nMen vwa-m nan dezè-a ape rele’w,\nE de bra-m louvri pou-m resevwa ou\nvi-n jwenn mwen\n \n2.\nSonje te gen 100 mouton nan pak la \nGenyen youn ki te egare\nByen lwen nan mòn, lwen nan vale-a \nLi te trouse pye-l l-al chèche-l\n \n3.\nSonje te genyen anfan prodig la \nLi te mande papa-l byen pa-l\nE lè-l te pati fi-n depanse yo \nLi te oblije retounen.\n \n4.\nLi te lèse katrevin-diznèf yo,\nPoul ale chèche yon sèl la.\nE lè-l jwenn li, li te tèlman kontan\nE sou zepòl li, li pote-l\n \n5.\nOu menm si ou vle vini jodi-a tou,\nKonsa, la va resevwa-ou\nKite pote lòt. O, la sou zepòl li\nOu menm, t-ap vlope ou nan manto-l.',
