    title: 'Seye Bondye mwen sezi nan prezans',
    lyrics:
      '1.\nSeye Bondye mwen sezi nan prezans ou,\nLe-m we monn sa-a ke men ou te kreye,\nZetwal yo la, mwen tande loraj gwonde \nSe pwisans ou tout linive montre.\nRefren\nNanm mwen chante non ou Bondye pwisan :\nAla ou gran, ala ou gran (2 fwa)\n2.\nLe mwen sonje, Bondye bay sel pitit li\nPou-l vin mouri, se sa ki touche ke-m\nSou bwa kalve, li pote tout fado mwen,\nSan li koule pou wete tout peche-m.\n3.\nLe Kris paret, zanj yo va admire li\nLa pran-m nan syel nan rejwisans tout tan \nM-a pwostene nan pye-l pou adore li,\nE proklame « Bondye ala ou gran. »',
