    lyrics:
      '1\nOu bezwen Konnen\nKoman Jezu té sové mwen?\nLi te vin wete m nan monn égaré\nMwen té gen lajan,\nMen mwen pat genyen yon bi\nSete plezi, manje byen bwe e mouri?\nJezu nan amou Li,\nTe fè mwen apel sa a\n"Vin jwen mwen, moun ki fatige et chage\nM a va soulaje ou, m a va pwteje ou\nE tout problem ou\nVa rezoud youn aprè lot\nOu va gen lavi, jwa e menm,\nLa sante, ou va gen espwa, lavi étenel.\n2\nMwen kite satan\nPou mwen vi n aksepté Jezu\nE dei le sa a tout lavi m te change\nMwen té toujou gen tristes\nAndedan ke mwen.\nLajan m kounye a,\nMwen pap pote li bay ougan\nM ap chita manje li avek tout fanm m.\nBondye pwotéjé m,\nLi pran sousi mwen,\nGade kijan m viv byennéré.\nMwen vin san pwoblem\nKa mwen gen Jezu\nJezu vini li régénéré m (2 fwa)',
