    title: 'Chak Fwa Mwen Fè Yon Bagay',
    lyrics:
      '1.\nChak fwa mwen fè yon bagay,\nMwen pat pou fè\nChak fwa mwen di yon bagay,\nMwen pat pou di\nKite-m di ou sa mwen fè,\nE nanm mwen va beni\nMwen kache yon kote pou-m priye\n \nRefren:\nMen wi mwen kache (2 fwa)\nMwen mande sovè mwen pou li dirije-m\nMwen kache yon kote pou-m priye.\n \n2.\nFrè ze sè dan le senyè\nMete nou prè\nAn nou priye pou nou kapab reveye.\nJezu-Kri fè nou pwomès\nFòk li jwenn nou prepare\nApòt la di nou priye tout tan.\n \n3.\nChak fwa mwen fi-n la priyè\nMwen vi-n pi fè\nMwen vi-n pi fèm\nPaske sentespri Bondye pale nan kèm\nNan galat 5 vèsè 25\nMoun kab swiv selon lespri\nSe pou yo mache daprè lespri\n \n4.\nNan Bib la nou jwenn moun kite kon priye\nPami yo nou jwenn Moize ak Danyèl\nNan 1 Tesalonisyen cahpit 5 vèsè 17\nApòt la di nou priye tout tan.',
