    title: 'Mwen Genyen Yon Bagay',
    lyrics:
      '1.\nMwen genyen yon bagay\nKi fè kè mwen kontan\nAnpil moun etone, pou wè\nKòman-m kontan,\nE m’ap toujou kontan\nEspwa-m pa sou tè sa-a\nDaprè pwomès Bondye\nMenm si mwen te grangou,\nm-pat gen kay pou-m rete,\nm-ape tann gran jou sa-a\n \nRefren:\np-ap gen pale franse konesans\npral fini riches pral disparèt\np-ap genyen gwo mesye:\nni p’ap gen gwo madanm,\ntout moun va menm bagay.\nLè jezu retounen, li pap vini chèche\nSavan ak zotobre sèlman li va bezwen\nMoun ki fè volonte-l, y ova men nan la men.\n \n2.\n \nPou ou kapab al legliz, fòk ou byen abiye\nSa-k pa gen pou’l mete,\nPa dwe chita kote-w\nOu ranpli ak lògèy\nSonje sa Kris te di avèk gran nikodèm\n“si-w ta vle gen lavi, fòk ou ne de nouvo, \nOu va wè gran jou sa-a.”\n \n3.\nAnpil moun konvèti, y opa cheche Bondye,\ny-ape priye sèlman pou kay avèk \noto, se bgay k’ap pase yo p’ap\npriye Bondye pou padon peche yo\nfòk nou fèt atansyon, paske ka yak oto\np-ap rantre nan syè la.\n \n4.\nLasyans ape travay, malgre sa se nilman,\nSa kon-n fè mechanste, syans fè-l\nVin pi mechan, syans pa ka bay lavi\nLòm pa kab chanje lòm, sinan san Jezu Kri\nMenm si-w te lougawou,\nOu te konn touye moun\nJezu kapab chanje-w',
