      html: '<p><strong>1.</strong> </p>\n<p>A la bèl bagay lè yon moun nan Jezu </p>\n<p>Zyel pa genyen vwal ki pou </p>\n<p>Eksite-l fè sa ki mal (2 fwa) </p>\n<p>Refren : </p>\n<p>Kris ap reke-w, li di : retire kè ou </p>\n<p>Nan tout vye plezi kab mennen </p>\n<p>Lanmò pita (2 fwa) </p>\n<p><br/> <strong>2.</strong></p>\n<p>Tout plezi sa yo kab fè ou bliye </p>\n<p>Si genyen Bondye k-ap ba ou </p>\n<p>Tout sa ou bezwen (2 fwa) </p>\n<p><br/> <strong>3.</strong></p>\n<p>Gen moun ki chwazi satan </p>\n<p>Pou yo kite Bondye, yo pito al anba gid yo. </p>\n<p>Genyen kèk bagay ou dwe reflechi, </p>\n<p>Tout bagay, li va ba ou lavi étènèl. </p>\n'
