    title: 'Sa fe sink mil ane pase',
    lyrics:
      '1.\nSa fe sink mil ane pase\nNoe bati lach la, Bondye di\n« M’ap voye yon delij pou detwi late-a\nZannimo antre andedan-l\nMedizan yo mande\nSi Noe panse fe lach la\nSou te sek la, l=ap fel\nAk fanmi-li, Noe antre,\nBondye femen pot la\nSyel la vin-n sonb,\nZekle pete  pasyans Bondye kaba\nAla yon lapli  (2 Fwa)\nLi tonbe pandan karant jou\nSan li pat rete ditou\nAla yon lapli… (2 Fwa)\nMen lach, la vwayaje toujou \nAla yon lapli\n\n2.\nMoyiz ale soukont Bondye\nBay pep-la libete\nRwa Ejip deklare : mwen pap lese\nEsklav ale\nBanboch nan deze ya.\nMen yo tout va rete\nOlye mwen lese yo m’ap fe\nTravay yo redouble\nMoyiz reponn: “Ou pral soufri”.\nMoyiz menm pate pe,\nLi kanpe bo rivye, e,\nLeve baton li anle,\nAla yon lapli… (2 Fwa)\nSotrel, krapo, mouch, pou ak grel\nGrengole ou lejip sot nan syel.\nAla yon lapli  (2 Fwa)\nFararon pat kab sipote.\nAla yon lapli…\n\n3.\nNan tan Eli Izrael,\nLe rwa Akab reye,\nSechres te fe twa zan edmi,\nLapli-a pat tonbe,\nAkab banboche sou Kamel,\nPandan Eli priye\nSis fwa, nan pwen anyen,\nMen Eli pat dekouraje\nByento yon ti nyaj paret,\nEli te pran kouri\nL’al di Akab: “pou ou prepare ou,\nPou yon kokenn lapli »\nAla yon lapli… (2 Fwa)\nSyel la tou nwa, dlo sa pa yon jwet\nAla yon lapli… (2 Fwa)\nLe li rive, li mouye net.\nAla yon lapli.\n\n4.\nAnvan Jezu tounen nan syel, kote li soti \nAk onz apot yo, li promenen\nJouk nan Betani.\nLi di le-l rive nan syel la, l-ap voye sentespri.\nDonk rete tann nan Jerizalem\nJouk pwisans la vini,\nSanvin disip nan chanmot la te veye e priye\nYon van sibit sekwe kay la,\nBenediksyon vide.\nAla yon lapli…(2 fwa)\nBondye voye lesentespri,\nPreche chak moun nan lang pa li.\nAla yon lapli… (2 Fwa)\nMesaj repann nan tout peyi,\nAla yon lapli',
