    title: 'Lè Nou Nan dezè-a Lè Nou Gade Syèl La',
    lyrics:
      '1.\nLè nou nan dezè-a lè nou gade syèl la\nN’ap sonje gin lòt kay papa-m al prepare \nSi mwen fè volonte-l, l-ap ban mwen yon kouwòn\n\nRefren:\nSatan patisipe prèske nan tout bagay \nSi Jezu pa te la, di mwen sa mwen ta fè (bis 2 liy)\n\n2.\nMwen santi-m vle ale se pase m’ap pase\nMwen pa moun isiba\nVwayajè wout mwen long\nPeyi-m se nan syèl la\nSi Bondye va ede-m\n\n3.\nKamyon-an trè chaje\nGen lè-l pra’l chavire\nBato-a pra’l koule Jezu se vòl dirèk\nSe nan li mwen konfye’m\nSe li menm k’ap sovem\n\n4.\nN’ap priye, satan la\nN’ap mache satan la\nN’ap dòmi satan la\nN’ap jene satan la\nNan misyon satan la satan nan tout bagay\n\n5.\nN’ap jwaye e satan la\nN’ap preche satna la\nNan legliz satan la nou vire santan la\nNou tounen satan la.\nSatan nan tout bagay.',
