    title: 'Mwen Kontan,  Kouwòn Mwen Va Yon Etwal',
    lyrics:
      '1.\nMwen kontan, kouwòn mwen va yon etwal.\nLè’m rive nan bèl pòt syèl la mwen gen yon boukè\nE rout la va klere plis pou mwen.\n \nRefren:\nTravay pou kouwèn nan,\nBèl kouwòn nou-an\nTravay pou kouwòn nan,\nKe m’ap pote pou jou\n \n2.\nKilè mwen va ale nan peyi byennere,\nKote gen rekolt pou tout tan \nKote ki va genyen anpil ouvriye \nKote pwomès Kris la akonpli\n \n3.\nE kòman pou-m gen yon \nEtwal nan kouwòn mwen ?\nEske se lè-m rive nan syèl la ?\nMwen dwe travay pou nan Kris la kounye-a \nPou wa ki mouri pou mwen.',
