    title: 'Pour Toi Redempteur Precieux',
    lyrics:
      '1.\nPour toi rédempteur précieux\nJ’entonne un hymne d’amour\nMa voix s’élevé vers toi, vers mon Dieu\nCar de toi vient le secours\nDe ma vie tu suis le cours\nMa force de chaque jour\nC’est jésus\n \nREFRAIN\nMon jésus, mon jésus\nQuel ami précieux\nJe trouve en jésus\nPar son sang, il m’a lave\nPar sa mort, il m’a sauve\nDe sa vie il m’a donne\nMon jésus.\n \n2.\nTu subis mon châtiment\nPour me donner le salut\nTu pris sur toi mes tourments mon jésus\nMon cœur ne désespère plus\nMon amé n’est plus abattue, je suis toujours soutenu par jésus\n \n3.\nDe ma vie, mon temps mes bien\nA ton gré dispose de moi\nMon être entier t’appartient O ! Jésus\nMa vie cachée dans ta croix\nNe veut suivre que ta voie\nPrendre pour son divin Roi que jésus.',
