    title: 'Pourqoi Ne Pas Chanter',
    lyrics:
      '1.\nPourquoi ne pas chanter\nLa gloire du seigneur\nPourquoi ne pas louer\nLa bonté du sauveur ?\nTout l’univers d’accord\nSemble exalter l’amour\nD’un dieu compatissant et fidèle a toujours\n \nREFRAIN\nFaisons de même ne nous lassons pas !\nL’amour suprême veille sur nos pas\nDans la l’lumière, marchons dignement\nQue la prière s’unisse à nos chants !\n \n2.\nEntends l’oiseau de l’air\nIl chante faiblement pourtant le créateur\nReçoit son humble accent\nVois-tu la fleur des champs\nSon doux parfum parvient\nJusqu’au trône de Dieu qui veille sur les siens\n \n3.\nEt toi, petit ruisseau,\nTu cours en murmurant\nTon chant si simple et doux\nEst plein d’enchantement\nMême l’étoile dit :\nNous chantons en concert\nLa gloire de celui qui régit l’univers',
