    lyrics:
      '1.\nJezu mande nou ale vit preche\nBon pawòl la \nNou gen dwa obeyi li\nJiska lafen monn sa-a\n \nRefren:\nAle, gaye toupatou\nLa pawòl Bondye damou,\nSe Kris ki mande : ale, bay\nByen lwen ak tou pre  priye\n \n2.\nPriye pou fòs  rete fidèl,\nE viv nan pwisans li \nKonsa tout moun va kapab wè-l\nE resevwa gras li.\n \n3.\nGen anpil moun tou ki deyò \nKris vle pou yo vini\nLafè noue de voye moun \nRanmase y oba li',
