    title: 'Kite-m Touche,  Kite-m Touche Jezu',
    lyrics:
      '1.\nKite-m touché, kite-m touché Jezu,\nKite-m touché-l tan l’ap pase la-a\nE, lè-l va lonje men-l ba lòt yo,\nYo va konnen y ova viv, na va sove\n \nRefren:\nO, pou mwen kapab wè men ki lonje,\nSovè say o ki oprime\nKite-m touché: kite-m touché Jezu,\nKonsa lòt y ova konnen, y ova sove.\n \n2.\nMwen te pèdi lwen Jezu-Kri,\nMwen te poukont mwen, mwen pat gen lavi\nE lè sa-a Sovèm nan te touché-m\nKounye-a m’ap ede lòt yo k-ap viv nan peche.\n \n3.\nGen yon rivyè, yon rivyè k-ap koule, koule\nAk dlo-a, li lave nanm mwen,\nE dlo sa-a fè lavi mwen briye\nSentespri plis pase lajan avèk lò.',
