    title: "Elas,  elas,  mwen regret sa pou lemon'n",
    lyrics:
      'Ke\nElas, elas, mwen regrèt sa pou lemon’n\nTalè konsa lemon’n pral boulvese\nElas, élas, mwen regret sa pou lemon’n\nTale konsa lemon’n pral dlo nan je.\nPou nenpot ti bagay\nOu we you’n meté kouto sou lot,\nPou nenpot ti bagay\nOu tande lom ap tiye lom,\nLom kapab gade lom\nYon moman yo mete’l kadav,\nYap touye, yap jete-ou\nKe yo pa jan’m sole.\nLezom fabrike zam\nSe pa pou yo touye pye bwa\nLezom fabrike zam\nSe pa pou touye zannimo,\nLezom fabrike zam\nSe pou touye  lom parey yo\nYap touye’w, Yap jete’w\nEpi yap banboche\nAkaba k Jezabel\nMet ansan’m pou touye Nabot,\nAkab ak Jezabel\nTe panse Bondye pat we yo.\nSa pat rete konsa\nLetenel te kondane yo,\nSe yon ekzanp, yon ekzanp\nBondye trase sou yo.',
