    title: 'Ecoutez l’apel de notre maitre',
    lyrics:
      '1.\nEcoutez l’appel de notre  Maître\nAllez au monde annoncer  la nouvelle\nA toutes les races à toutes les nations\nPréchez la parole en temps  hors de temps\n\nRefrain\nAllez partout le monde\nJoyeusement proclamer\nAux Nicodemes aux Zaches\nChrist est mort pour nos  peches\n2.\nLa moisson est grande, a dit le maitre\nQui veut pour moi travailler\nIl demande que nul ne dise\nJe ne puis rien faire  lorsque Jésus\nNotre chef nous commande\n\n3.\nVoyez l’etendard Celeste  devant nous\nC’est un secours manifeste  et puissant\nLe combat est long mais  n’ayez pas peur\nCar avec Christ nous  serons plus que vainqueurs',
