    lyrics:
      '1.\nJe ne sais pourquoi Christ  m’a tant aimé\nIl a fait pour moi des  chose merveilleuses\nJe vois des choses dont  je ne sais pourquoi\nChrist m’a montré qu’Il a  fait pour moi\nRefrain\nGloire à Toi Christ mon  Rédempteur\nGloire a Toi Jesus m’a  délivrance\nToi qui a eu pitié de moi\nEt qui m’a sauvé de tout  mal\n2.\nJesus Christ est mon  berger\nJamais Il ne laisse  abandonner\nJe te suis enfin sans  effroi\nToujours je vois, il est  près de moi\n3.\nQuand les hommes  m’auraient condanné\nAlors par eux je serai  maltraité\nTout comme Jésus je me  résignais\nMon âme en Dieu se réjourais\n4.\nIl m’a retiré d’entre  leurs mains\nIl me protègeras pas sa  main\nIl m’envoie enrefuge sous  son ombre\nJe me repose toujours sous  son ombre\n5.\nJe me souviens du prophète  Elie\nLe roi Achab l’avait  poursuivi\nUn corbeau lui avait  apportait du pain\nPour qu’il ne mourru pas  de fain',
