    title: 'Âme souffrante',
    language: 'fr',
    lyrics:
      '1.\nÂme souffrante,\nÂme  angoissante et vacillante\nDans  cette vie,\nToute espérance  est déjà perdue\nRegarde le  ciel en écoute la douce voix\nQui aujourd’hui  t’appelle\nToujours  t’appelle sans cesse\nChoeur\nEntends  la voix de ton Sauveur\nNe le méprise  pas  pour toi toujours\nOh !  Entends la voix qui t’appelle\nEt en écoutant,  elle changera ton\nTriste  sort\nEntends  la voix et tu auras en toi la paix\n2.\nMalade  et triste je me trouve en cette vie\nPas de  docteur, pas de remède pour me soulager\nSans espérance  je vivais mes jours en agonie\nSa douce  voix que j’écoutais me donna la paix',
