    lyrics:
      '1.\nPar son grand amour divin\nJesus invite au festin\nTous les saint qu’il a  racheté\nOh! venez\nSa manne vous nourrira\nEt chaque jour suffira\nVenez vous tous les  invités\nOh! Mangez\n Refrain\nOh venez! Quelle merveille\nOh venez!\nQuelle fête sans pareille\nOh mangez!\nCelui qui créa le pain\nEt qui de l’eau fut du vin\nInvite tous au festin\nOh mangez\n2.\nComme les saints autrefois\nObéissaient à sa voix\nSoyez aussi bien disposés\nO venez!\nVoice le poisson le pain\nMangez vous n’aurez plus  faim\nEnfants du Seigneur\nOh venez et mangez\n3.\nBientot descendra l’agneau\nEnlever son cher troupeau\nOh qu’il sera beau de le  voir désormais\nCouvert d’immortalité\nEt parfais dans l’unite\nFrère vivons dans cet  espoir à jamais',
