    title: 'Lorsqu’on est jeune, on danse et l’on rit',
    lyrics:
      '1.\nLorsqu’on  est jeune, on danse et l’on rit\nOn rêve  de grands espoirs,\nOn aime,  on chante, tout nous sourit.\nMais il  nous faut faire un choix.\nRefrain\nChante  O ! Jeunesse to Dieu ton Roi\nC’est  lui qui nous mène au but à coup sur\nA lui la  flamme de notre foi\nNos  cœurs qu’il veut rendre purs.\n2.\nVous les  amis, quel sens a pour vous\nLa vie  et ses durs combats ?\nEn  Christ on trouve le ciel de tout\nSa grâce  affermit nos pas.\n3.\nVous les  amis pour qui cette peur ?\nQuand  passe soudain la mort,\nChrist  est vivant  c’est le grand vainqueur\nIl veut  rendre libre et fort.\n4.\nVous les  amis comment donc bâtir\nUn monde  qui soit meilleur\nIl est  le chef qu’il nous faut servir\nC’est  Christ le seul vrai Sauveur.',
