    title: 'Nous prêchons la vérité',
    lyrics:
      '1.\nNous prêchons la vérité,\nCombattons l’iniquité,\nRejetons tous dogmes fondés  sur l’erreur.\nEt toutes inventions\nAinsi que la tradition.\nQui détruisent la parole du  Seigneur\nREFRAIN\nGloire à Dieu Jésus peut  vous sauver,\nDe tout péché racheté,\nSeul il est libérateur,  l’Unique Médiateur,\nJésus Christ seul peut  sauver et racheter.\n2.\nNous ne pouvons raconter,\nNi ne devons confesser\nTous nos péchés à l’oreille  d’un pécheur\nCelui qui vient repentant,\nDevant Dieu comme un enfant,\nTrouve le pardon et la paix  du Seigneur.\n3.\nDemandons aussi pourquoi\nL’on retranche de la loi,\nLe sixième commandement que  Dieu donne.\nTu ne feras point  d’images \nNi ne lui rendras hommages,\nAdorez Dieu   seul !  Voila ce qu’il ordonne.\n4.\nNous rejetons le latin,\nDont l’emploi vient du  malin.\nNous lisons notre Bible en  langue vulgaire.\nMessage de vérité,\nLivre de l’éternité,\nElle offre le salut acquis  au calvaire.\n5.\nL’on chante tous les  matins\nPour exploiter les humains\nDe leur messe de requiem  sans valeur\nCependant le purgatoire\nN’existe point c’est la  gloire\nQue doit attendre du  Seigneur',
