    lyrics:
      '1.\nDieu tout-puissant,\nQuand mon cœur considère\nTout l’univers\nCree par ton pouvoir,\nLe ciel d’azur,\nLes éclairs, le tonnerre.\nLe clair matin\nOu les ombres du soir\nDe tout mon être,\nAlors s’élève un chant\nDieu tout-puissant\nQue tu es grand (bis)\n2.\nMais quand je songe\nO sublime mystère !\nQu’un Dieu si grand\nA pu penser à moi\nQue son cher Fils\nEst devenu mon frère\nEt que je suis\nL’héritier du grand Roi,\nAlors mon cœur\nRedit la nuit, le  jour :\n« Que tu es bon\nO Dieu d’amour ! »  (bis)\n3.\nQuand mon Sauveur,\nEclatant de lumière,\nSe lèvera de son trône  eternel,\nEt que laissant\nLes douleurs de la terre,\nJe pourrai voir\nLes splendeurs de Son ciel,\nJe redirai dans son divin séjour\n« Rien n’est plus grand\nQue ton amour ! »  (Bis 4 lignes)',
