    title: 'Contemplez, O Chrétiens, vous qui fuyez le monde',
    lyrics:
      '1.\nContemplez, ô Chrétiens,  vous qui fuyez le monde,\nLe divin Rédempteur  descendant au Jourdain.\nIl s’offre à ce tombeau que représente  l’ordre.\nMais en vainqueur, Jésus se révèle  soudain.\n2.\n \nLes siens veulent aussi dans cet instant  propice,\nAnimes d’un saint zèle, imiter  le Sauveur.\nEt. Selon sa parole,  accomplir la justice,\nDans la joie obéir   trouvant la paix du cœur.\n3.\nBaptises en ton nom, nous  vivons sur la terre,\nPour mourir au péché, ne  plus vivre qu’en toi,\nPour suivre en ces bas lieux  ton sentier solitaire,\nPuis avec toi régner dans ta  gloire, o grand Roi !',
