    title: 'A Dieu soit la gloire',
    lyrics:
      '1.\nA Dieu soit la gloire\nPar son grand amour\nDans mon âme noire\nS’est levé le jour\nJésus à ma place\nMouru sur la croix\nIl m’offre sa grâce\nEt je la reçois\n\nRefrain\nGloire à Dieu (bis)\nTerre écoute sa voix\nGloire à Dieu (bis)\nMonde rejouis-toi\nOh! Venez au Père\nJésus est vainqueur\nQue toute la terre\nChante en son honneur\n2.\nDe Jésus la joie\nRemplit notre Coeur\nQu’importe qu’on voie\nTout notre bohneur\nSelon sa promesse\nJésus changera\nDeuil en allégresse\nQuand Il reviendra\n3.\nCéleste patrie\nMon Coeur pense à toi\nLa mon âme unie\nA Jésus son Roi\nBénira sans cesse\nLe grand Dieu Sauveur\nQui dans sa tendresse\nSauve le pécheur',
