      md: '**1.** \n\nA Dieu soit la gloire \n\nPar son grand amour \n\nDans mon âme noire \n\nS’est levé le jour \n\nJésus à ma place \n\nMouru sur la croix \n\nIl m’offre sa grâce \n\nEt je la reçois \n\n\n\n\n<br/> **Refrain**\n\n**Gloire à Dieu (bis)** \n\n**Terre écoute sa voix** \n\n**Gloire à Dieu (bis)** \n\n**Monde rejouis-toi** \n\n**Oh! Venez au Père** \n\n**Jésus est vainqueur** \n\n**Que toute la terre** \n\n**Chante en son honneur** \n\n\n\n<br/> **2.**\n\nDe Jésus la joie \n\nRemplit notre Coeur \n\nQu’importe qu’on voie \n\nTout notre bohneur \n\nSelon sa promesse \n\nJésus changera \n\nDeuil en allégresse \n\nQuand Il reviendra \n\n\n<br/> **3.**\n\nCéleste patrie \n\nMon Coeur pense à toi \n\nLa mon âme unie \n\nA Jésus son Roi \n\nBénira sans cesse \n\nLe grand Dieu Sauveur \n\nQui dans sa tendresse \n\nSauve le pécheur \n\n\n',
