    title: 'Vivre près de mon Sauveur',
    lyrics:
      '1.\nVivre près de mon Sauveur,\nSeigneur tiens-moi près de toi,\nC’est le désir de mon cœur\nEn marchant toujours plus près de toi. (bis)\n\nRefrain\nJe suis faible, tu es fort,\nJésus, tu es mon soutien.\nJe serai toujours content.\nQue tu reste constamment près de moi!\n2.\nJe suis faible par le péché,\nQui veut terrasser mon Cœur.\nJésus sois mon bouclier\nEt reste toujours plus près de moi.\n\n3.\nMalgré  mon indignité\nJe veux être un de tes disciples.\nEnseigne-moi bien tes voies\nAfin d’être toujours avec toi.\n\n4.\nJe veux mourir dans tes bras,\nApprends-moi comment…\nPour être avec toi au ciel\nParmi ceux qui sont plus près de toi.',
