    title: 'Dieu tout Puissant, Dieu de ma délivrance',
    lyrics:
      '1.\nDieu tout Puissant, Dieu de  ma délivrance,\nJe mets en toit toute mon espérance,\nLes grosses eaux débordent  en fureur\nVeille sur moi, soutient mon  faible cœur. (bis)\n2.\nAh ! Quel ami  pourrait sur cette terre\nMe consoler dans ma douleur amère ?\nOu donc aller, si ce n’est  point à toi ?\nToujours, Seigneur, tes bras\nS’ouvrent pour moi (bis)\n3.\nLes malheureux qui, dans  son infortune,\nS’adresse à toi, jamais ne  t’importune.\nAllez a lui, travailles et  charges,\nVous reviendrez guéris et  soulages.\n4.\nSi je n’avais cette foi  consolante,\nJe trouverais chaque peine  accablante.\nMais puisque Dieu me prête  son secours.\nIl n’est pour moi plus de  fardeau trop lourd.',
