    lyrics:
      '1.\nLe saint  consolateur\nL’envoyé du Seigneur\nEst dans le cœur contrit\nComme libérateur\nAnnoncez la nouvelle\nAux hommes et aux pécheurs\nL’Esprit Saint est venu\nRefrain\nL’Esprit  saint est venu,\nSi longtemps attendu\nNous sentons sur la terre\nLa promesse du Père\nProclamez le message aux\nHommes, d’âge  en âge\nL’Esprit Saint est venu.\n2.\nPauvre  enfant de la nuit\nLe péché  vous poursuit\nRenoncez  au plaisir\nDu monde  qui séduit\nEcoutez  le message\nEn vous  le soleil luit\nL’esprit  Saint est venu.\n3.\nOut tout  est accompli\nDe  l’Esprit sois rempli\nBien que  sa plénitude\nVaincra  l’ennemi\nO  Chrétien c’est pour toi,\nReçois  cd don béni\nL’Esprit  Saint est venu.',
