    title: 'Longeant péniblement',
    lyrics:
      '1.\nLongeant péniblement\nLa route de Jéricho\nLa vie devenait noire\nEt lourd mon fardeau\nJésus Christ vint vers moi\nDès lors me fis grâce\nMe donna l’asurrance\nQu’au Ciel est ma place\n\nRefrain\nChemin de Jéricho\nChemin du Calvaire\nSentier ou l’abri\nPure et salutaire\nFait cesser nos maux\nEt tarir nos pleurs\nAmène aux perdus\nLeur Dieu, leur Sauveur\n\n2.\nAinsi à Jéricho\nS’asseyait Bartimé\nAveugle et misérable\nEt l’âme assoiffée\nMais Christ passait soudain\nIl cria plein de foi:\n“Jésus de Nazareth,\nAi pitié de moi”\n\n3.\nEt le Seigneur Soudain\nL’appela, le benit\nEt lui rendit la vue\nPour lui plus de nuit!\nPlus d’ombre plus de faim!\nDe soif, de misère\nIl vient de rencontrer\nL’écho du calvaire\n\n4.\nDe même qu’un seul mot\nBannit la cécité\nDe même qu’un seul mot\nOte les péchés\nSi tu t’aventures,\nEnfin sur la route\nDe Jéricho sans peur\nS’enfuiera le doute',
