    title: 'Du maitre qui m’appelle',
    lyrics:
      '1.\nDu maître qui m’appelle\nA le suivre ici-bas\nJ’entends la voix fidèle\nQui me dit: “Ne crains rien pas\nL’ennemi te menace:\nJe suis le tout-puissant\nJe verse en toi ma grâce\nMoi le vivant\n\nRefrain\nIl vit, Il vit Jésus vit à jamais\nIl vit au ciel, Il vit en moi\nLui le Prince de paix\nIl vit, Il vit me regarde, me conduit\nEt par Lui, je marche en vainqueur\nCar il vit dans mon Coeur\n2.\nIl vit et rien au monde\nNe saurait me ravir\nLe Bonheur qui m’inonde\nEt m’aide à le servir\nEn lui j’ai force et joie\nTout le long du chemin\nOu son amour m’envoie\nMoi faible humain!\n3.\nTressaille d’allégresse\nRacheté de Jésus\nRetentir sans cesse\nL’hymne saint des elus\nOh! Sublime Espérance\nMerveilleuse assurance\nIl va venir, rien ne peux tenir ma foi',
