    num: 16,
    title: 'L’amour de Dieu est trop sublime',
    lyrics:
      '1.\nL’amour  de Dieu est trop sublime\nPour  le langage de la voix\nIl  est plus haut que les etoiles\nEt  que l’abime le plus profound\nDieu  nous donna le Redempteur\nQui  soufrit sur la croix\nSon  fils unique vint mourir\nCe  bien-aime du Dieu bon\n\nRefrain\nAmour  de Dieu, puissant et tendre\nInexprimable  bonté, alleluia\nC’est  le cantique\nDu  bien heureux racheté\n2.\nO  pour écrire cet amour\nLes  Cieux ne sont pas assez\nL’océan  d’encre ne suffit\nPour  contenir ces mots d’amour\nSi  chaque tige était une plume\nEcrivains  grands et petits\nEnsemble  toutes leurs louanges\nNe  sont que l’ombre d’un jour\n3.\nDe  même qu’il est difficile\nDe  bien pouvoir rimer ces vers\nDe  même frère est-il facile\nDe  sonder cette charité\nJe  suis sauvé, quelle pensée\nPlus  profonde que la mer\nDès  ici-bas vie éternelle\nGloire  au Christ réssuscité\n4.\nLorsque  la nuit ne sera plus\nQuand  les royaumes passeront\nQuand  les moqueurs prendront la fuite\nVers  les collines, les rochers\nL’amour  de Dieu demeura\nToujours  fidele et profond\nLes  rejetons: Adam et Eve\nAuront  été rachetés',
