    title: 'Chantons Notre Bonheur',
    lyrics:
      '1.\nChantons notre bonheur\nEn des accents joyeux\nNous, les enfants du père\nCar nos noms sont inscrits\nDans le livre des cieux\nPar le sang du calvaire.\n\nRefrain\nAlléluia, chantons en chœur,\nCar le seigneur nous aime\nOui le seigneur nous aime\nAlléluia, c’est le bonheur.\n\n2.\nCe monde n’est pour nous\nQu’un pays étranger\nOu notre chemin passe\nEt nous le traversons, conduit par le berger\nOui nous comble de grâces.\n\n3.\nTravail, peine et douleur\nEt larmes ici-bas\nSombre nuit d’orage\nRien ne saurait nous tenter\nDe notre beau voyage\nEt détourner nos pas\n\n4.\nEt, s’il nous faut passer\nA l’ombre de la mort\nA tant d’autres funestes\nNous verrons, le seigneur\nOuvrir la porte d’or\nDe la cite céleste.',
