    title: 'Grand en fidélité O Dieu mon père',
    lyrics:
      '1.\nGrand en fidélité O Dieu  mon père\nChez nulle trâce de  changement\nTes compassions ne sont  pas à leurs terme\nTu restes fidèle  éternellement\n\nRefrain\nGrand en fidélité (bis)\nJour après jour tu me  tiens par la foi\nTu as pourvu chaque jour a  mes besoins\nGrand en fidelite toi  envers moi\n2.\nL’été et l’hiver, les  saisons fertiles\nLes astres brillants que  tu as créés\nSe joignent avec la nature  entière\nPour témoigner à ta  fidelite\n3.\nPardon du péché, paix douce  et profonde\nTa sainte présence pour me  guider\nForce aujourd’hui pour\nDemain Espérance\nMe rassurent de ta fidélité',
