    title: 'C’est dans l’évangile qu’on trouve',
    lyrics:
      '1.\nC’est dans l’évangile qu’on trouve\nLa paix, le pardon, le bonheur, la vie.\nOuvrons notre cœur a la grâce infinie,\nDonnons tous nos biens aux pécheurs.\n\nRefrain\nAuprès du Seigneur avec lui sur la route,\nMarchons de tout cœur en chantant,\nIl sauve, il guérit, puis enlevé le doute\nIl vit, Il est la maintenant\n\n2.\nIl montre des endroits pour jeter la souillure.\nVoila c’est ici Golgotha\nUn lieu de folie, un endroit de rupture.\nMais crois, ce pardon est bien là.\n3.\nSouvent en chemin, il vient nous entrainer\nAu sentier de la vérité \nPendant que l’amour de Jésus nous entraine,\nAu règne de l’éternité.',
