    lyrics:
      '1.\nVivant  sur cette terre de péché\nde confort  de Bonheur prive\nLutant  contre l’adversaire Obstiné\nQui  peut m’aider si non Jesus\nRefrain\nA qui  crier? Oh, à qui aller?\nPour  un refuge sur trouver\nAyant  besoins d’un ami pour m’aider\nQui  prendre si non Jésus-Christ\n2.\nLes  amis sont gentils et je les aiment\nNous  vivant en de très bon termes\nMais  quand mon âme\nA  soif de paix suprême\nQui  peut m’aider, si non Jésus\n\n3.\nLa  vie est belle auprès de bons parents\nQui  m’entourent bien tendrement\nMais  de la mort, Quand mugit le torrent\nQui  peut m’aider si non Jésus',
