    num: 26,
    title: 'Je suis un débiteur',
    lyrics:
      '1.\nJe suis un débiteur\nChaque jour de ma vie\nC’est pourquoi O seigneur\nJe chante et je prie\nJe n’ai rien ni argent\nNi or pour donner\nMais l’amour de Dieu\nJe veux confesser\nRefrain\nJe suis un pauvre debiteur  insolvable\nCar le prix est rop grand\nQui peux payer?\nIl s’est donner pour moi\nMon Sauveur adorable\nMon divin Redempteur\nJe veux le chanter\n2.\nIndigne d’etre appele\nUn enfant de enfant de  Dieu\nDans l’ereur le peche\nJ’errais malheureux\nMais au seigneur Jesus\nJ’ai donne ma vie\nJe suis son debiteur\nQuelle paix benie\n3.\nQuand est t’il de ton âme\nN’as tu pas levé\nDans le sang de l’agneau\nTon iniquité\nIl est mort pour blanchir\nÔter ta souillure\nTe cherir et ta tête orner  de parure',
