    num: 62,
    title: 'Céleste voix, tu nous convies',
    lyrics:
      '1.\nCéleste voix, tu nous  convies\nAu festin de la charité \nTu remplis nos âmes ravies\nD’une sainte félicité.\nNous venons, Seigneur, à ta  table,\nOù tu veux nourrir notre foi,\nPour ôter ta grâce ineffable\nEt pour nous consacrer a toi\n2.\n \nApprochez, âmes accablées\nSous le fardeau de vos péchés \nApprochez, soyez consolées\nVoici les biens que vous  cherchez.\nNe craignez point, Jésus  pardonne\nAu cœur contrit, et pénitent,\nEt la gloire qui l’environne\nN’empêche pas qu’il soit clément.\n3.\nVous qu’abandonne l’espérance,\nVous qui marchez triste et  las,\nVous dont le deuil ou  l’indigence\nEst la lourde part ici-bas,\nApprochez : Jésus voit  vos larmes \nQu’elles coulent plus  doucement !\nLe Dieu qui connait vos  larmes\nSe donne à vous en ce  moment.\n4.\nChrétiens, célébrons la  mémoire\nD’un bienfaiteur si généreux,\nJusqu’au jour ou, brillant  de gloire,\nIl viendra nous ouvrir les  cieux.\nLa nous chanterons les  louanges\nDevant le trône du Dieu  fort,\nO Roi des hommes et des  anges\nQui nous a sauves par la  mort.',
