    title: 'Nous reclamons Seigneur ta presence',
    lyrics:
      '1.\nNous  réclamons Seigneur ta présence\nDe  ton Esprit le feu la puissance\nViens  et demeure au milieu de nous\nBénis  ce rendez-vous\n\nRefrain\nParle  bien-aimé Maitre\nOh!  Oui parle à nos coeurs\nTa  grâce fait paraître\nVerse en nous tes faveurs\n2.\nViens-nous  donner selon ta promesse\nPaix et Bonheur, parfaite allégresse\nFais abonder en nous chaque jour\nTa  grâce ton amour\n3.\nMets  sur nos yeux ton divin Collyre\nPlace  nos coeurs sous ton doux empire\nQue  t’aimer et de t’obéir\nSois  notre seul désir\n4.\nAlors par nous le flot salutaire\nDe  ton amour coulant au calvaire\nSe  répendra parmi les perdus\nPour ta gloire O Jesus',
