    title: 'Pour être heureux dans la vie',
    lyrics:
      '1.\nPour  être heureux dans la vie\nPour  être heureux tout les jours\nPour  avoir la paix bénie\nIl faut  Jésus-Christ toujours\nRefrain\nSur son  cœur, douce retraite,\nHeureux  qui va se cacher,\nIci la  douleur s’arête,\nJésus  est le bon berger\n2.\nSi  l’orage se déchaine,’\nJe ne  crains pas sa fureur\nCar de  sa brebis en peine\nIl veut  calmer la frayeur\n3.\nSi vos âmes  sont amères\nSi vous êtes  seuls souffrants\nLa  victime du calvaire\nPrendras  sur lui, vos tourments\n4.\nVenez au  Christ qui console\nEt qui  sauve le pécheur\nOn  apprendra a son école\nLe  chemin du vrai bonheur',
