    title: 'O! Mon enfant reprend la lyre!',
    lyrics:
      '1.\nO !  Mon enfant reprend la lyre !\nOui mon  enfant tu dois chanter\nSi vers  le ciel ton cœur t’attire\nComme le  ciel tu dois vibrer\nVibrer  de joie et de tendresse\nVibrer  d’amour, de douce paix\nN’est tu  pas protéger sans cesse\nPar Dieu  qui t’aime a tout jamais\n2.\nO !  Mon enfant reprend ta route\nIl faut  monter malgré les flots\nMonter  toujours, coute que coute\nMonter  vers Dieu, monter plus haut !\nReprends  donc l’ouvre de la vie\nVa consoler,  sécher les pleurs\nChante  et va créer l’harmonie\nUn chant  d’amour dans d’autres chœurs\n3.\nO !  Mon enfant reprend la tache\nReprends  la lyre  tu dois chanter,\nPuisque  ton cœur au ciel s’attache,\nDe  l’infini va témoigner !\nBientôt,  bientôt c’est l’arrivée,\nC’est  l’au-revoir du grand matin\nQuand  l’âme atteint sa destinée,\nDe dieu  la plénitude enfin',
