    title: 'Minuit Chrétien, c’est l’heure solennelle',
    lyrics:
      '1.\nMinuit Chrétien, c’est  l’heure solennelle\nOù l’homme Dieu descendit  jusqu’à nous\nPour effacer la tâche  originelle\nEt de son Père arrêter le  courroux.\nLe monde entier trésaille d’espérance,\nA cette nuit qui nous donne  un Sauveur,\nPeuple à genoux !  Attends la délivrance.\n\nREFRAIN\nNoël! Noël! Voici le Rédempteur\nNoël! Noël! Voici le Rédempteur\n\n2.\nDe notre foi que la lumière  ardente\nNous guide tous au berceau  de l’enfant\nComme autrefois une étoile  brillante,\nY conduit les chefs de  l’orient.\nLe Roi des rois nait dans  une humble crèche,\nPuissant du jour, fier de  votre grandeur,\nA votre orgueil, c’est la  qu’au Dieu, pécheurs\nCourbez vos fronts devant le  Rédempteur.\nREFRAIN\nNoël! Noël! Voici le Rédempteur\nNoël! Noël! Voici le Rédempteur\n\n3.\nLe Rédempteur a brise  toute entrave\nLa terre est libre et le  ciel est ouvert,\nIl voit un père ou n’était  qu’un esclave,\nL’amour unit ceux  qu’enchainait le fer\nQui lui dira notre  reconnaissance ?\nC’est pour nous tous qu’il  nait, qu’il souffre et meurt.\nPeuple debout, chante la délivrance.\nREFRAIN\nNoel ! Noel !  Voici le Rédempteur\nNoel ! Noel !  Voici le Rédempteur',
