    title: 'Je viens Seigneur, à la table bénie',
    lyrics:
      '1.\nJe viens Seigneur, à la  table bénie,\nLe cœur brise, soupirant après  toi \nC’est dans ta mort que je  trouve la vie \nTa croix, Jésus est l’espoir  de ma foi.\n2.\nJ’ai faim, j’ai soif de  la vie éternelle,\nSoif de pardon et soif de sainteté.\nRéponds, Seigneur a ma voix  qui t’appelle !\nOh ! Redis-moi que tu  m’as racheté.\n3.\nQu’en venant tous a la  table sacrée,\nNous n’apportions que  l’amour et la paix \nDe notre cœur, garde, o Jésus  l’entrée !\nQue l’ennemi n’y pénètre  jamais !\n4.\nQu’ici, Jésus en ta  sainte présence,\nNous goutons tous les délices  du ciel !\nViens raffermir la céleste  alliance,\nQui nous unit, O Sauveur  Eternel.\n5.\nSeigneur, descends !\nDescends ! Esprit de  flamme.\nViens pour toujours  embrasser notre cœur !\nDétruis en nous tout  penchant que Dieu blâme,\nCree en nous l’image du  Sauveur.',
