    title: 'Je ne vois aucun espoir de paix pour le monde',
    lyrics:
      '1.\nJe ne vois aucun espoir de paix pour le monde\nS’il ne passe par de nouvelle naissance.\nLa civilisation est condamnée,\nPar les causes de son incrédulité.\nLes problèmes qu’il confronte aujourd’hui\nDépassent l’humanité tout entière.\nRefrain\nNous trouvons cette consolation\nDans la parole qu’il nous a donnée :\nSur cette pierre je bâtirai mon Eglise,\nEt ses portes ne seront point fermées.\n2.\nLe monde maintenant est sous l’agitation.\nL’homme sans Dieu n’a plus d’espérance.\nLes démons de l’enfer sont relâchés,\nL’histoire est sérieusement engagée,\nNous traversons une impasse très critique,\nLe toit va bientôt s’effondrer.\n3.\nNous sommes semblables à un peuple condamne\nA la peine de mort, sans espoir d’amnistie.\nLes hommes sont pris dans un engrenage :\nUn événement va se produire,\nMais nous ne pouvons l’éviter,\nCar c’est déjà prédit dans la Bible.\n4.\nLes marxistes sont en train de conquérir le monde,\nCar ils ne trouvent aucun sacrifice trop grand.\nLa fin justifie les moyens.\nMême s’ils ont tort, ils ont un but\nIls peuvent vaincre aujourd’hui ou demain\nSi le christianisme vient d’échouer.\n5.\nLe christianisme est une nécessité vitale\nL’Eglise doit se réveiller de son sommeil\nPour proclamer cette bonne nouvelle\nQu’il nous a recommandée,\nCar c’est un gain pour ceux qui sont chrétiens.\nUne réponse finale sera bientôt',
