    lyrics:
      '1.\nTout  prés de moi toujours\nDans la  plus sombre nuit\nTout  prés de moi Oh ! Jésus mon Roi\nEt le  long du chemin\nIl me  tient par la main\nTout  prés de moi\nOh mon  Sauveur, mon Roi\nRefrain\nToujours,  tout prés de moi\nSe tient  Jésus mon Roi\nEt le  long du chemin\nIl me  tient par la main\nEt je  suis si heureux,\nSi  content, si joyeux\nDes que  mon Roi se tient\n2.\nQuand la  terre passera et quand tout finira\nJésus  mon Roi se tient tout prés de moi\nDans la  céleste nuit, je serais pour toujours\nTout  prés de toi, O mon Sauveur mon Roi\n3.\nQuand  j’étais sans espoir\nQuand  tout me semble noir\nJésus  mon roi, Se tient tout prés de moi\nQuand le  monde m’abandonne\nQuand le  mal m’environne\nTout  prés de moi\nO mon  Sauveur, mon Roi',
