    title: 'Vaillants soldats de Jésus-Christ.',
    lyrics:
      '1.\nVaillants soldats de Jésus-Christ.\nD’un cœur toujours joyeux, toujours contrit \nPar la vertu de son Esprit\nMarchons avec persévérance !\n\nRefrain\nPar la foi, par la foi,\nSans trêve et sans effroi,\nPar la foi, par la foi,\nNous suivons notre Roi.\nBientôt Seigneur, auprès de toi,\nNous chanterons la délivrance !\n\n2.\nSi nous rencontrons sur nos pas\nLabeur, fatigue et périlleux combats,\nNe craignons rien, ne cédons pas,\nNe perdons point notre assurance.\n\n3.\nEt si pour te gagner les cœurs,\nIl faut passer par le sentier des pleurs,\nTon bras nous rend plus que vainqueurs\nEt ton ciel est notre espérance.',
