    lyrics_Markdown: {
      md: '**1.** \n\nVaillants soldats de Jésus-Christ. \n\nD’un cœur toujours joyeux, toujours contrit \n\nPar la vertu de son Esprit \n\nMarchons avec persévérance ! \n\n\n\n\n<br/> **Refrain**\n\n**Par la foi, par la foi,** \n\n**Sans trêve et sans effroi,** \n\n**Par la foi, par la foi,** \n\n**Nous suivons notre Roi.** \n\n**Bientôt Seigneur, auprès de toi,** \n\n**Nous chanterons la délivrance !** \n\n\n\n<br/> **2.**\n\nSi nous rencontrons sur nos pas \n\nLabeur, fatigue et périlleux combats, \n\nNe craignons rien, ne cédons pas, \n\nNe perdons point notre assurance. \n\n\n<br/> **3.**\n\nEt si pour te gagner les cœurs, \n\nIl faut passer par le sentier des pleurs, \n\nTon bras nous rend plus que vainqueurs \n\nEt ton ciel est notre espérance. \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Vaillants soldats de Jésus-Christ. </p>\n<p>D’un cœur toujours joyeux, toujours contrit </p>\n<p>Par la vertu de son Esprit </p>\n<p>Marchons avec persévérance ! </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Par la foi, par la foi,</strong> </p>\n<p><strong>Sans trêve et sans effroi,</strong> </p>\n<p><strong>Par la foi, par la foi,</strong> </p>\n<p><strong>Nous suivons notre Roi.</strong> </p>\n<p><strong>Bientôt Seigneur, auprès de toi,</strong> </p>\n<p><strong>Nous chanterons la délivrance !</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Si nous rencontrons sur nos pas </p>\n<p>Labeur, fatigue et périlleux combats, </p>\n<p>Ne craignons rien, ne cédons pas, </p>\n<p>Ne perdons point notre assurance. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Et si pour te gagner les cœurs, </p>\n<p>Il faut passer par le sentier des pleurs, </p>\n<p>Ton bras nous rend plus que vainqueurs </p>\n<p>Et ton ciel est notre espérance. </p>\n'
    },
