    title: 'A ta cène bénie, O Sauveur charitable',
    lyrics:
      '1.\nA ta cène bénie, O Sauveur charitable !\nTu viens nous convier de nouveau en ce jour.\nAu milieu du désert tu dresses cette table\nQui nous rappelle\nO Christ, ton ineffable amour !\n\n2.\nTon troupeau, d’un seul amour\nAutour de toi se groupe\nPour annoncer ta mort jusqu’à ton retour\nIl veut rompre ton pain i veut boire ta coupe.\nPour proclamer, O Christ ton ineffable amour !\n\n3.\nRévèle a tes enfants ta divine présence !\nIls bénissent ton non  bénis-les a ton tour !\nAugment-leur la foi, remplis-les d’Esperance\nFais-leur gouter, O Christ, ton ineffable amour !\n\n4.\nViens, et dans tous nos cœurs, verse ta sainte vie,\nDonne-nous l’avant-gout du céleste séjour \nOu bientôt, a jamais, dans la gloire infinie,\nNous bénirons, O Christ ton ineffable amour!',
