    title: 'Belle Haïti ! Chère Haïti !',
    lyrics:
      '1.\nBelle Haïti ! Chère Haïti !\nBeau pays de verdure !\nNotre terrestre paradis.\nA l’eau limpide et pure,\nBelle Haïti ! Chère Haïti !\nDieu te comble de grâce,\nQue ton âme soit belle aussi !\nDe laideurs poindre de trace !\n2.\nBelle Haïti ! tes voyageurs,\nCharges de tes denrées\nNourissent le monde en douleur\nDes âmes affamées.\nBelle Haïti ! Chère Haïti !\nO ! Sois aussi nourrie\nPar ton Protecteur, Jésus Christ\nEt qu’il te sanctifie !\n3.\nTon histoire, chère Haïti,\nDe ton sang est tracée\nTes fils cherchent tes droits bénis,\nLa victoire assurée,\nBelle Haïti, chère Haïti,\nNous louons ta noblesse\nQue ton mal en toi soit banni,\nVaincu par ta sagesse.\n4.\nMais Haïti, chère Haïti,\nPour que tu sois plus belle,\nSuis en toutes choses le Christ\nTon glorieux modèle.\nO ! Haïti ! Chère Haïti !\nCherche le bien suprême\nPrends pour guide le Saint-Esprit\nDemeure en paix sereine.',
