      md: '**1.** \n\nUn merveilleux Sauveur est Christ mon Seigneur, \n\nUn merveilleux Sauveur pour moi \n\nCar mon âme cachée au fond de son cœur. \n\nY trouve l’eau vive et j’en bois. \n\n\n\n\n<br/> **Refrain**\n\n**Mon âme en le roc crevassé s’est cachée** \n\n**Et Dieu m’y couvre par sa main** \n\n**Du monde, ma vie, enfin, s’est détachée** \n\n**Pourquoi craindre le lendemain ? (bis)** \n\n\n\n<br/> **2.**\n\nUn merveilleux Sauveur est mon Christ mon Seigneur, \n\nIl ôte tout fardeau pour moi, \n\nIl me soutient afin que je sois vainqueur. \n\nJe marche aujourd’hui par la foi. \n\n\n<br/> **3.**\n\nUn merveilleux Sauveur est Christ mon Seigneur, \n\nIl me bénit de jour en jour, \n\nTout joyeux plein d’élan, moi jadis pécheur \n\nJe chante sa grâce a toujours. \n\n\n<br/> **4.**\n\nLorsque dans sa beauté, le Roi je verrai, \n\nJe serai semblable a Jésus \n\nLe thème des chants des élus pour jamais \n\nSera son amour, son salut ! \n\n\n',
      html: '<p><strong>1.</strong> </p>\n<p>Un merveilleux Sauveur est Christ mon Seigneur, </p>\n<p>Un merveilleux Sauveur pour moi </p>\n<p>Car mon âme cachée au fond de son cœur. </p>\n<p>Y trouve l’eau vive et j’en bois. </p>\n<p><br/> <strong>Refrain</strong></p>\n<p><strong>Mon âme en le roc crevassé s’est cachée</strong> </p>\n<p><strong>Et Dieu m’y couvre par sa main</strong> </p>\n<p><strong>Du monde, ma vie, enfin, s’est détachée</strong> </p>\n<p><strong>Pourquoi craindre le lendemain ? (bis)</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Un merveilleux Sauveur est mon Christ mon Seigneur, </p>\n<p>Il ôte tout fardeau pour moi, </p>\n<p>Il me soutient afin que je sois vainqueur. </p>\n<p>Je marche aujourd’hui par la foi. </p>\n<p><br/> <strong>3.</strong></p>\n<p>Un merveilleux Sauveur est Christ mon Seigneur, </p>\n<p>Il me bénit de jour en jour, </p>\n<p>Tout joyeux plein d’élan, moi jadis pécheur </p>\n<p>Je chante sa grâce a toujours. </p>\n<p><br/> <strong>4.</strong></p>\n<p>Lorsque dans sa beauté, le Roi je verrai, </p>\n<p>Je serai semblable a Jésus </p>\n<p>Le thème des chants des élus pour jamais </p>\n<p>Sera son amour, son salut ! </p>\n'
