    num: 55,
    lyrics:
      '1.\nSegnè Jézu gad jan ou bon Segnè\nNap fè louanj, pou ou, pou tout sa ou fè\nOu deliver nou, nan aksidan yo\nNan malady yo, nan péché nou yo\nSé pou tèt sa, nap fè louanj pou ou\n\nKè\nMin jus ki lè ouap\nretounin Segnè\nAnpil pitit ou apé mouri mal\nMéchan tuyé yo, méchan manjé yo\nMin nou konnin\nouap vi-n jugé\nTout kriminèl yo\n\n2.\nNou gin konsians, sé nan labou ou jouin-n nou\nOu lave nou é pui ou fè-n vi-n pròp\nOu soufflé sou nou, souf dé vi pa ou la\nGras a ou Segnè, nous anti-n sové\nSé pou tèt sa, nap fè louanj pou ou\n\n3.\nChak jou-n levé le mon-mandé chanjman\nMin yo pansé sé gouvènman kak fè-l\nDe jou an jou nou ouè, sa ap pi mal\nPaské sé Jézu, kap vi-n fè chanjman\nSé pou tèt sa, an-n prepare tan-li\n',
