    title: 'Nous les chrétiens qui attendons Jésus Christ',
    lyrics:
      '1.\nNous les chrétiens qui attendons Jésus-Christ\nSoyons joyeux car il est notre Sauveur,\nDans sa cité d’or il nous attend et soyons prêts\nCar un jour il viendra nous prendre avec lui.\nRefrain\nChrétiens soyons victorieux\nSur la tentation et le péché\nCar il a dit : je compte sur les chrétiens en tout temps\nC’est pourquoi nous devons être victorieux\n2.\nLa tentation veut nous vaincre toujours,\nPrions Dieu il nous donnera la victoire\nCar Dieu nous donnera la victoire sur la tentation\nIl est notre médiateur pour toujours.\n3.\nOui nous attendons le Seigneur glorieux\nD’un cœur joyeux et rempli de confiance\nIl va régner sur la terre, la mer et les cieux,\nDans ce merveilleux jour de notre délivrance.\n4.\nSi la tempête, les ouragans se déchainent\nNous ne perdons pas courage, Jésus est vivant\nIl est le Prince de la paix, et le Seigneur des Seigneurs\nDans ce merveilleux jour de notre délivrance.',
