      html: '<p><strong>1.</strong> </p>\n<p>Krétyin an nou palé de Jézu </p>\n<p>Sé gnou non-m nou papé jan-m blié </p>\n<p>Sé lik té vin-n </p>\n<p>pou sové lemond </p>\n<p>Epi li kon-n </p>\n<p>fè anpil mirak </p>\n<p><br/> <strong>Kè</strong></p>\n<p><strong>Jézu sé Roi oui</strong> </p>\n<p><strong>Jézu sé Roi</strong> </p>\n<p><strong>Jézu sé Roi,</strong> </p>\n<p><strong>Jézu sé roi des rois</strong> </p>\n<p><br/> <strong>2.</strong></p>\n<p>Jézu monté a Jéruzalèm </p>\n<p>Gnou ban-n mou-n té vlé pou&#39;l vini roi </p>\n<p>E lè li antré </p>\n<p>andédan tanp la </p>\n<p>Li chase moun ki tap fè komès yo </p>\n<p><br/> <strong>3.</strong></p>\n<p>Jézu monté a Getsémané </p>\n<p>Gnou ban-n </p>\n<p>solda té vin-n arété&#39;l </p>\n<p>Tout disip li yo viré kite li </p>\n<p>Yo di yo pa </p>\n<p>konnin non-m sila </p>\n<p><br/> <strong>4.</strong></p>\n<p>Eské nou min-m nou pa pou Jézu </p>\n<p>Si nou dakò pou-n </p>\n<p>soufri pou li </p>\n<p>Sé nou min-m yo </p>\n<p>va pi meprizé </p>\n<p>Si gnou jou nou pral rejoui avèl li </p>\n'
