    lyrics:
      "1.\nIci-bas bonheur suprême\nAvec Dieu je ne crains rien\nIl fait tout puisque je l'aime\nConcourir à mon seul bien\nJe puis croire à sa promesse\nSon amour ne change pas\nJusqu'à ma blanche vieillesse\nIl dirigera mes pas\n\n2.\nIl me dit quand il m'éprouve\nDemande et tu recevras\nEt voici qui cherche, trouve\nA qui frappe, on ouvrira\nJésus dit qui cherche trouve\nQui demande, recevra\nIl permet que je les trouve\nSi je frappe, il ouvrira\n\n3.\nQuand Satan sème le doute\nSi I'orage éclate un jour\nQuand la nuit voile ma route\nJe me fie en son amour\nPourquoi donc perdre courage\nDieu demeure il m'aime encore\nEt pour moi chaque nuage\nA toujous sa frange d'or",
