    language: 'fr',
    songId: '9_GA_fr',
    num: 9,
    lyrics:
      "1.\nSi I'ombre de la nuit vient obscurcir ma route\nMon Dieu en qui je crois\nEst mon ferme soutien\nSi I'orage en mon coeur\nÉveille quelques doutes\nII me garde en sa main\nJe ne crains rien\n\n\nRefrain\nC'est dans sa main que Dieu me tient\nII m'aime, il me protège, il me soutient\nPour moi, jour après jour, il a son plan d'amour\nDieu me tient dans sa main je ne crains rien\nNon je ne connais pas mon avenir d'avance\n\n2.\nMais je m'attends a Dieu,\nQui ne veut que mon bien\nJe sais que je peux mettre en lui ma confiance\nII me garde en sa main, je ne crains rien\n\n3.\nJe sais que son amour sera toujours le même\nQu'il m'accompagnera jusqu'au bout du chemin\nOui Ie Dieu que je sers, que j'adore et que j'aime\nMe garde dans sa main je ne crains rien",
