    title: 'Un vêtement blanc, une harpe d’or',
    lyrics:
      '1.\nUn vêtement blanc, une harpe d’or\nUn beau palais, une couronne\nLa sainte joie, le vrai trésor\nLa haut le Sauveur donne\n\nRefrain\nCar Jésus est mon Sauveur qui m’a tant aimé,\nPayé ma dette sur le calvaire,\nIl m’a dans son grand amour sauvé du péché,\nJe vis dans sa sainte lumière\nOui nous marchons nous marchons tous joyeux,\nNous marchons, nous marchons vers les cieux (bis)\n2.\nDimanche je suis heureux, lundi plein de joie\nMardi j’ai une paix que le monde ne connait pas,\nMercredi et Jeudi je vis dans la lumière.\nVendredi et samedi c’est le ciel sur la terre.\n3.\nEn avant contre le péché,\nAllons soldats de courage\nProclamer ceux qui condamnes\nVers la céleste plage.\nRefrain\nJe veux louer mon Sauveur qui m’a racheté\nPayé ma dette sur le calvaire\nIl m’a dans son grand amour sauve de péché\nJe vis dans sa sainte lumière\nOui nous marchons, nous marchons tous joyeux\nNous marchons tous joyeux. (Bis)',
