    title: 'Bethleem naquit mon Rédempteur',
    lyrics:
      '1.\nBéthléem naquit mon Rédempteur\nQui connait le mépris et la douleur \nO ! Meilleur amour, gloire au Sauveur\nQui m’a cherché, sauvé,\nIl m’a cherché, sauvé (bis)\nO ! Meilleur amour de mon Sauveur\nQui m’a cherché, sauvé.\n2.\nIl paya ma dette sur le calvaire,\nDélivra mon âme de sa misère\nIl m’apporta le pardon de son père,\nJésus est mort pour moi !\nJésus est mort pour moi ! (bis)\nIl m’apporta le pardon de son père.\nJésus est mort pour moi.\n3.\nFuyant le bercail, je cherchais en vain\nUn asile sur…quand sa voix soudain\nMe dit : « Mes brebis, je suis le chemin «\nDe la vie Eternelle !\nOui, je suis le chemin… (Bis)\nJésus me dit, de la vie éternelle,\nJe suis le seul chemin !\n4.\nJe suis heureux, même dans la souffrance\nJésus revient  j’attends la délivrance,\nJe m’en vais à lui plein de confiance\nIl m’appelle là-haut, (bis)\nJe m’en vais à lui plein de confiance.\nIl m’appelle là-haut.',
