    title: 'Dans les vallons et sur les montagnes',
    lyrics:
      '1.\nDans les vallons et sur les montagnes\nA la clarté d’un rayon divin,\nJésus mon rédempteur m’accompagne,\nIl est mon guide jusqu’à la fin.\n\nRefrain\nClarté céleste ! Clarté céleste !\nRemplis mon cœur d’un rayon divin.\nClarté céleste ! Clarté céleste !\nInonde de soleil mon chemin.\n\n2.\nLorsque le nuage m’environne,\nIl ne peut cacher mon rédempteur,\nCar sa lumière sur moi rayonne\nLa nuit perdu toute terreur.\n\n3.\nEn avant chrétiens dans l’allégresse !\nToujours plus haut, montez vers les cieux\nMarchez en chantant, louez sans cesse\nChrist le Seigneur, Jésus le fils de Dieu.',
