    lyrics:
      "1.\nDors bien-aimé(e)\nTon oeuvre est terminée\nVoici pour toi le soir de la journée\nDu grand repos I'heure est enfin sonnée\nA Dieu mon frère (soeur) à Dieu\n\n2.\nSi nous t'aimons!\nChris t'aime d'avantage\nII t'a conduit dans ton pèlerinage\nII te soutient dans le sombre passage\nA Dieu mon frère (soeur) à Dieu\n\n3.\nÂme fidèle entre dans la patrie\nD'où la souffrance est à jamais bannie\nBois à longs traits au fleuve de la vie\nA Dieu mon frere (soeur) a Dieu\n\n4.\nSublime espoir Jésus-Christ va paraître\nPour saluer le retour de ton maître\nTon corps bientôt glorieux va reparaître\nA Dieu mon frère (soeur) à Dieu",
