    lyrics:
      "1.\nJe possède un Sauveur\nDon l'amour fut si grand\nIl connut la suprême agonie\nDon sublime Oh c'est moi\nQue le divin mourrant\nVeut sauveur dans sa grâce infinie\n\nRefrain\nMoi, moi, il sauve un pêcheur tel que moi\nLes épines déchirent et son fron adorable\nPour sauveur un pêcheur tel que moi\n\n2.\nC'est pour moi qu'il souffrit\net qu'en Gethsémané\nIl pleura buvant la coupe amère\nDans son immense amour il m'a tant pardonné\nEn mourrant sur la croix du calvaire\n\n3.\nD'un amour si profound\nJe fus convit, brisé\nÀ genoux près de la croix benie\nJe reçus son pardon et mon coeur apaisé\nA trouvé le Bonheur et la vie",
