      "1.\nTribulation nou Segnè, Segnè, Segnè, Segnè\nProblèm nou y oak kalamité\nYo tout vlé poté nou alé (bis)\n\nChak jou-n levé sé gnou sèl kozé\nNou pa kab manjé, nou pa kab abiyé\nPitit nou yo pa kap alé lékol\nNa pé mande ki koté sa pralé. O mon Dié\n\nKè\nProblèm nou yo, traka nou yo\nYo tout vlé poté nou alé\n\n2.\nLè gro problem vini pou'l troubé nou\nLè tout espoua sanblé fini pou nou\nLè-n pa konnin si pou-n monté, ni desan-n\nNou vin-n koté pou-n monté, ni desan-n\nNou vin-n koté pou toujou\ndeliver-n o mon Dié\n\nLè-n gin gnou problem ki pa ka rézoud\nLè-n pa konnin si pou-n monté ni desan-n\nPran téléfòn siel la e pi telephone anro\nPriè va monté, délivrans va desan-n",
