      '1.\nMapé suiv ou O Bon Sovè\nNinpòt koté ou pralé\nTout koté ou vle kondui moin\nPran devan mape mache\n\nKè\nBon Sovè mapé suiv ou\nOu kite mouri pou mouin\nMin-m si tout lòt\nmoun ta nié ou\nMin Segnè konté sou mouin\n\n2.\nChemin an té mèt difisil\nSan lumiè e sans trasé\nDepi ou la, lap vini fasil\nMap suiv tras ou\né mapé maché\n\n3.\nSi ou minin-m nan gran joudin an\nGran kouran pap fè mouin pè\nPaské ou traverse-l avan\nMin Jézu map suiv ou pi pré',
