      '1.\nPouki ou bat kò ou pou sa kap vin-n demin\nPou tout bagay kè nou pa kap konpran-n\nSi nap viv chak jou pou-n atin-n bu an\nSé pou-n véyé pou-n touché ké ròb le Ségnè\n\nKè\nLòt pa nou kapab minnin nou a la pèfeksyon\nLòt revèy Bon Dié va pi gran ké tout sa avan\nE lè voi sa pale sé voi Jézu\nAn nou véyé pou-n touché ké ròb le Segnè\n\n2.\nPouki bat kò ou pou gnou mariaj fòsé\nPouki ou pa tan-n le Segnè fè choua pou ou\nEské marié vlé di sové pou sa\nSé pou-n véyé pou-n touché ké ròb le Segnè\n\n3.\nFòk nou fò,fòok nou krié an avan\nFò-n pa faché lè bagay yo maché mal\nJézu konnin bezoin chak pitit li\nSé pou-n véyé pou-n touché ké ròb le Segnè',
