    lyrics:
      "1.\nJésus, Ô nom qui surpasse\nTout nom qu'on puisse exafter\nQue jamais je ne me lasse\nNom béni de te chanter\n\n2.\nII t'appelle ne crains plus\nMon frère entend, écoute\nSuis ses pas et sur la route\nChante ce beau nom Jésus\n\n3.\nQui pleura sur ceux qui pleurent\nC'est lui I'homme méprise\nQui mourut pour ceux qui meurent\nC'est lui l'homme au coeur brisé\n\n4.\nJésus par qui Dieu pardonne\nRoi d'épines couronne\nQue le monde t'abandonne\nA toi mon coeur s'est donné",
