    lyrics:
      '1.\nLè ou anba nuaj ak tanpèt yo\nChan e souri yo alé\nSanblé gin gnou-n\nki rinmin ou\nMin-m lè la nui la tro long\nGin gnoun ankò pou édé ou\nGingnin gnoun\nki ka repon-n ou\nGin gnoun ki ouè\ntout sò sou yo\nGin gnoun ki konnin sa\n\nKè\nLi konnin sa (bis)\nTout tantasion ak doulè yo\nSé Jézu sèl espoua\n\n2.\nLè plézi tè sa disparèt\nJounin ak nuit rasanblé\nPou ou nan poin angnin anko\nMin-m kouraj nan pouin ankò\nOu pansé pa gingnin espoua\nPoutan gin gnou-n\npou édé ou\nSé li min-m ki va\npran soin ou\nLi konin bezouin ou\n\n3.\nKité Sovè a pran soin ou\nChèché, Chèché prézans li\nLi bay la pè, konsolasion\nLi fè tout dout yo alé\nLi chanjé vi ou konplètman\nSièl la va louvri pou ou\nSé Jézu ki va pran souin ou\nPaské li konnin sa',
