    title: 'Au petit bourg de Bethleem',
    lyrics:
      '1.\nAu petit bourg de Bethléem,\nPaisible dans la nuit :\nVeillant sur ton repos profond\nL’étoile du soir luit,\nMais voici dans tes parvis\nBrille un rayon divin,\nLes espoirs de tous les âges\nSont accomplis enfin.\n2.\nVenu de la gloire des cieux\nL’Ange avait proclame\nLa naissance de l’humble enfant,\nAux bergers étonnés.\nOui, chantez sa naissance\nEtoiles du matin,\nCélébrez la puissance\nDe ce Sauveur divin\n\n3.\nIl vint silencieusement\nCe don si merveilleux !\nAinsi Dieu donne à cœur de l’homme\nLes bienfaits de ces cieux.\nSans bruit fut sa venue\nDans ce monde pécheur,\nToujours Christ veut venir des cieux\nChez les humbles de cœur.\n\n4.\nO Saint Enfant de Bethleem,\nDescends t’en prions-nous,\nOte le mal, Christ sans égal,\nSois en ce jour en tous,\nNous entendons les anges\nLeur cantiques chanter \nO viens à nous reste avec nous\nEmmanuel ! Entrez !',
