    lyrics:
      "1.\nJe veux parler de la croix\nOù mourût Ie Roi des rois\nL'unique objet de mon choix\nMa seule espérance\nCroix bénie du Sauveur\nSeul refuge du pécheur\nEt sa délivrance\nRefrain\nAmour merveilleux, amour merveilleux\nII meurt sur Ie bois infâme de la croix\nAmour merveilleux\n\n2.\nO regarde maintenant\nLe sacrifice sanglant\nDu Sauveur agonisant\nSur le bois infâme\nC'est pour toi qu'il est blessé\nEt pour tes forfaits brisés\nPour sauver ton âme.\n\n3.\nViens, réponds à cet amour\nDu plein salut c'est le jour\nApproche-toi sans détour\nViens, car il pardonne\nEnrôle-toi maintenant\nSous la croix du Dieu clément\nViens, la paix il donne",
