    lyrics:
      '1.\nBien pa-m pa isiba\nSé passage moin yé\nBien ké moin maléré\nMin sa pa fèm angnin\nJézu sé tréso moin avèk li moin satisfè\nAllélouia-m gin gnou plas nan siel la\n\nKè\nO oui-m santi-m Kontan\nNon moin ékri nan siel la\nMin-m si sou tè sa-a\nMouin jouin-n difikilté\nMin sa pa fèm angnin\nJézu té pasé plis\nAllélouia-m gin gnou plas nan siel la\n\n2.\nFrèm yo dan le Segnè\nPiga-n dékourajé\nChemin an pa facil\nPou-n rive nan siel la\nMépri pèsèkision sé sa ki sou rout la\nAllélouia gnou jou sa va fini\n\n3.\nPa okipé le mond\nKap manjé jodia\nYap fè gnou vié progrè\nPou gnou vi passage\nNou min-m ki sé krétien\nNou gin vi étènèl\nAllélouia sé nou min-m ki rich\n',
