    lyrics:
      '1.\nJésus-Christ me donna Sa vie\nPuis-je lui donner la mienne ?\nJe me consacre à toi Seigneur\nJe serai tout à toi\nRefrain\nMa vie Ô Seigneur je te donne\nMes talents et mon tout.\nJe te sers et je suis à toi\nJ’entendrai ton appel\n2.\nOù le Seigneur me dirigera\nJ’accomplirai sa tâche\nJe sais qu’il protège celui\nQui fait sa volonté\n3.\nS’il me faut traverser la mer\nAvec Jésus j’irai\nRaconter aux perdus son amour\nPour qu’ils voient sa puissance.\n4.\nMon foyer, mes amis sont chers\nPour moi Christ est plus cher\nPremier de mes affectionnés\nSa juste volonté.',
