    lyrics:
      '1.\nPèlerin sur le chemin de la vie,\nVoyageur vers la céleste patrie\nQu’il est grand ce Dieu d’amour, de grâce\nDe nous jamais il ne se lasse,\nQu’il est grand !\nRefrain\nAimez, aimez, et vous serez fils de Dieu \nAimez, aimez, l’amour est la loi des cieux\nAimez, aimez, d’un amour grand et tendre\nCherchons toujours à rendre gloire à Dieu.\n2.\nPèlerin sur le chemin de la vie \nVoyageur vers la céleste patrie\nQu’il est doux, sa douceur est si tendre,\nLes faibles, Dieu peut les comprendre,\nQu’il est doux.\n3.\nPèlerin sur le chemin de la vie,\nVoyageur vers la céleste patrie,\nQu’il est bon son bonté paternelle\nDieu la montre à l’âme rebelle \nQu’il est bon.',
