    lyrics:
      '1.\nMap vouyagé pou gnou bèl cité\nKoté tout ri yo sé lo\nKoté-n va demere an pe\nE joua moin pap jan-m fini\n\nKè\nEské ou va rankontré\nmoin la (bis)\nPou male avèk zanj yo\nEské ou va rankontré moin la\nKoté nou pap jan-m di adie\n\n2.\nSa va pou moin\ngnou gran reunion\nAk Sin yo kit te devan\nDi moin si ou prèt\npou apei yo\nVini vit ma ran n ou pu\n\n3.\nOu trè mouin di moin ki jan ouape viv\nJézu vléou alé la\nO ki gran joua, jou reunion sa\nSé va la vi pou tout tan',
