    lyrics:
      '1.\nVoici cher Seigneur tes pieux serviteurs\nQui viennent pour s’unir dans le mariage (bis)\nRefrain\nJette sur eux ta bénédiction\nPour que ta parole soit gardée (bis)\n2.\nJeune homme aime ta femme\nCar saint Paul a dit :\nAime-la, protège-la en toute chose. (Bis)\n3.\nEt toi jeune fille,\nSois toujours fidele,\nRespecte ton mari, obéis-lui. (Bis)\n4.\nJeune homme et jeune fille\nQui viennent donc s’unir\nVous êtes en Jésus qu’une seule chair. (Bis)\n5.\nQue la grâce de Dieu\nVous soit abondée\nPour que vous viviez toujours en paix. (Bis)',
