    lyrics:
      '1.\nSi la route est jonchée de peine et de douleurs\nSi ton soleil sombre dans un noir nuage\nEt que nul rayon d’espoir n’illumine ton cœur\nPense à Christ, à son message\nRefrain\nJésus ton Sauveur sera ton guide\nA lui seul confie ton sort, il agira\nRappelles-toi bien que dans les lieux arides,\nTon âme, il rassasiera.\n2.\nSi la personne sur la terre ne peut te comprendre\nSi la tentation t’a charmée à t’assiéger\nSi tes vains efforts ne suffisent pour te défendre\nFais de Christ ton bouclier.\n3.\nSi ton pauvre cœur à force de revêts sans flamme\nEt que tu finis par te décourager,\nSaches que Christ connait les tortures de ton âme\nEt veut bien te soulager.',
