    lyrics:
      "1.\nSeigneur ce que mon coeur réclame\nC'est le feu! (ter)\nQue sur moi descende la flamme\nDe ton feu (ter)\nQue ce sort une chambre haute Qu'une nouvelle\nPentecôte fasse de nous de vrais apôtres\nPlein de feu (ter)\n\n2.\nLe seul secret de la victoire\nC'est lefeu! (ter)\nNous pouvons refléter ta gloire\nPar le feu (ter)\nO Dieu tout-puissant qui nous aime\nVenez nous affranchir de nous-memes\nRemplis-nous d'un amour suprême\nPar le feu! (ter)\n\n3.\nNous voulons porter I'espérance\nPar le feu! (ter)\nEt proclamer la délivrance\nPar le feu! (ter)\nTon regne vienne sur la terre\nTa volonté soit faite, O Pere\nExauce enfin notre prière\nPar le feu! (ter)",
