    num: 37,
    lyrics:
      "1.\nDu monde la gloire ainsi que tous les biens\nNe seront jamais ici-bàs mon partage\nParce que Jésus-Christ le Nazaréen\nLà haut me prépare un si grand héritage\n\nRefrain\nMa demeure est là où Jésus fait sa demeure\nLorsqu'à travers un périlleux sentier\nIl s'approche, me guide auprès de ma demeure\nM'exhortant toujours à veiller, à prier\n\n2.\nBien souvent je suis tenté et balloté\nPour Satan le grand terrible adversaire\nConnaissant du monde l'instabilité\nVers mon sûr abri, je crois par la prière\n\n3.\nQue j'affronte laboeur, fatigue sur mes pas\nQue mon père, ma mere, mon frère m'abondonnent\nQue je suis content Oh gloire alleluia\nJusqu'au ciel m'attend ma précieuse couronne",
