      '1.\nJézu, Jézu, Jézu ki rinmin moin\nLi vi-n sou la tè,\nli ban moin la vi\nLi mouri pou moin é moin sové\nJézu résisté mò li té\ngéri malad yo\nLi chase demon li fè\navèg yo ouè\nLi té géri leper yo é min-m paralitik yo\nJézu bon Sovè ya\nté fè anpil mirak\n\nKè\nO mouin rinmin li map adore li\nMap chanté pou li sé mèvéyé\n\n2.\nMin yo té arétéli yo minnin-l tribunal\nYo té fè anpil ruz pou yo té pran-l nan pièj\nJézu pa té koupab min yo té kondané li\nYo té krisifié li, li resisité\nKounié yal vivan map chanté pou li\nO oui moin kontan li ban moin la vi\n\n3.\nLi mouri pou nou tout, li ban nou la vi\nNou gin rékonésans, map chanté pou li\nJézu, Jézu\nSi sé pou Jézu nou ap chanté\nMin si sé nan Jézu nou mèt dansé Jézu, Jézu\n\n4.\nLi té mouri pou moin, li té mouri pou ou\nSak fè li fè tou sa paské li rinmin nou\nLi alé nan sièl lap retounin ankò\nPou li kap vin chèché sa ki fè volonté-l\nLi fè nou promès sa sé vérité\nNou pa kap rete san-n pa chanté pou Jézu\n',
