    lyrics:
      "1.\nSi la mer se déchaîne\nSi le vent soufflé fort\nSi la vague t'entraîne\nN'aie pas peur de la mort\n\nRefrain\nIl n'a pas dit que tu coulerais\nIl n'a pas dit que tu tomberais\nIl a dit: Allons de l'autre bord\nIl a dit: Je te délivrerai\nIl a dit: Je te protègerai\n\n2.\nSi ton coeur est en peine\nSi ton corps est souffrant\nCrois en Jésus qui t'aime\nIl est le tout-puissant\n\n3.\nSi un jour sur ta route\nTu croises le méchant\nNe sois pas dans le doute\nDieu prendra soin de son enfant",
