      '1.\nJan péché yo multiplié\nNou mandé ou gras Segnè\nPéché kampé a douat a goch\nNou mandé ou gras Segnè\n\nKè\nGras, gras padon Segnè\nGras, gras padoné nou\nGras, gras pou fot nou yo\nNou rekonèt péché nou\n\n2.\nPadoné nou O Dié damou\nNou rekonèt péché nou\nAdultè, vol ak méchansté\nYo vini multiplié\n\n3.\nLang nou sé gnou kouto de bò\nNou mandé ou gras Segnè\nBouch nou pale sa nou pa ouè\nNou mandé ou gras Segnè\n\n4.\nZorèy nou toujou ap tandé\nPou nou fè la médizans\nPié nou pa janmè fatigue\nPou nou ka al fè le mal\n',
