      md: '**1.** \n\nEntre vite dans le vrai chemin, \n\nCrois, pécheur, à la vérité \n\nDe Christ reçoit la vie enfin, \n\nTu seras sauvé \n\n\n\n\n<br/> **Refrain**\n\n**Oh ! Viens sans tarder (bis)** \n\n**Accepte Jésus tu seras sauve.** \n\n\n\n<br/> **2.**\n\nJésus est ton parfait Sauveur, \n\nL’Envoyé de ton Dieu d’amour \n\nA l’instant donne-lui ton cœur, \n\nOh ! Viens en ce jour. \n\n\n<br/> **3.**\n\nJésus reçoit chaque pécheur \n\nDans ta misère, viens à lui. \n\nNe refuse pas ce Sauveur, \n\nTon plus sur appui. \n\n\n<br/> **4.**\n\nPourquoi renvoyer à demain \n\nCe choix de qui dépend ton sort \n\nCar qui sait si le lendemain \n\nNe suivra ta mort \n\n\n',
