      "1.\nSainte, Sainte, Sainte, Trinité puissante\nDès l'aurore du matin, vers toi montent nos chants\nSainte, Sainte, Sainte Lumière éclatante\nEn trois personnes, un Dieu bienfaisant\n\n2.\nSainte, Sainte, Sainte, tous les saints t'adorent\nEn jetant leurs couronnes à tes pieds, Dieu d'amour\nChérubins et Seraphins te louent, t'honorent\nToi qui fus, es et seras pour toujours\n\n3.\nSainte, Sainte, Sainte Trinité mystère\nDont la gloire ne peut voir l'oeil de l'homme pécheur\nToi sur la sainte et divine lumière\nParfait en puissance, amour et bonheur\n\n4.\nSainte, Sainte, Sainte Trinité puissante\nChaque créature doit glorifier ton Nom\nSainte, Sainte, Sainte Lumière éclatante\nDieu de grâce et d'amour et de pardon",
