    language: 'ht',
    songId: '41_GA_ht',
    num: 41,
    lyrics:
      "1.\nPadoné moin Segnè Jezu\nPadoné moin pou fot moin yo\nOu min-m kit e desann sou tè ya\nPou nan-m moin té kap sove\nGingnin pitié pou la vi moin\nMin-m si éta-m pa bon devan ou\nDi gnou mo pou moin nan jujman sa\nPou-m ka sové\n\nKè\nKi sa ma fè nan gran jou sa\nSi Jézu pa resevoua moin\nLan pòt sièl la gin sentinel\nKi kanpé la, baton-l nan min-l\nSi ou sové la resevoua ou\nSi ou pa sove lap di ou alé\nDi gnou mo pou moin Segnè Jézu\npou-m ka sové\n\n2.\nGin gnou jujman ki gin pou-l vini\nGin gnou balans ki pral balansé\nGin anpil pay ki pral boulé,\nNan difé sa-a gin pou'l vini\nSové-m Ségnè ak zanmi-m yo\nFanmi-yo, ak tout frè moin yo\nPou-m pa gnou pay, pou-n pa al boulé\nNan difé sa\n\n3.\nGin anpil mou-n ki kouè se jouèt\nPa gin gnou jujman kap vini\nNou min m kretyin nou asuré\nGin gnou jujman ki gin pou vini\nNap fè éfo, nape travay\nNap fè éfo pou nou sové\nNan gran jou sa-a\nPou-n pa al boulé nan difé sa-a",
