    lyrics:
      '1.\nGnou zanmi rinmin-m, gnou zanmi raiy-m\nGnou zanmi sové moin\nMouin gin gnou zanmi toutan-m gin lajan\nLè-m pa gin lajan mouin pa angnin\n\nKè\nJézu sové-m, li deliver-m, Jézu sové-m nan mouin\nO moin vlé chanté istoua li, glorifié non li\nJézu ou sé mèt moin\nMoin rankontré Jézu nan gnou chemin\nLi mandé mouin koté-m pralé\nMoin di le Segnè\nsé ou map chaché\nMap suiv ou juska la fin\n\n2.\nMouin té kondané pou-m té mouri\nPaské péché-m té gro\nJézu rélé moin\nsou mo-n Golgota\nPou-l ban moin la vi étènèl\n\n3.\nGnou zanmi ban moin, karès amou\nTou tan pa lan tonbo\nMoin gin gnou zanmi toutan-m gin lajan\nLè-m pa gin lajan\nmoin pa angnin\n',
