    songId: '32_GA_fr',
    num: 32,
    lyrics:
      "1.\nIl va bientôt venir! Gloire, Gloire à Jésus!\nDans le Ciel il veut reunir \nSes bien-aimés elus\nLevons en haut les yeux,\nTressaillons le bonheur\nIl vient sublime et glorieux,\nLe grand liberateur\n\n2.\nIl va bientot venir! Gloire, Gloire a Jésus\nToutes nos douleurs vont finir,\nLe mal ne sera plus\nLa mort disparaitra.  A la voix du Sauveur\nQuand pour toujours, il reviendra,\nLe grand libérateur\n\n3.\nIl va bientot venir, Gloire, Gloire à Jésus\nSur la nue il va resplendir, Frères ne craignons pas\nLevons, levons les yeux voici notre Sauveur\nC'est pour nous qu'il revient des cieux\nLe grand libérateur",
