      "1.\nJésus de Nazareth, il passe ici\nDe même il demeure à jamais\nEt comme autrefois il vient, il bénit\nIl aime à nous donner sa paix\n\n\nRefrain\nAujourd'hui tandis qu'il passe\nAujourd'hui tandis qu'il passe\nAujourd'hui tandis qu'il passe\nOuvrez-lui, ouvrez-lui ton coeur\n\n2.\nJésus de Nazareth vient-il en vain\nPourquoi voudrais-tu résister\nO hâte-toi donc de saisir sa main\nCar bientôt la nuit va tomber\nJésus de Nazareth son amour est grand\n\n3.\nPour tous ceux qui veulent sa paix\nPartout ou il passe, il pardonne, guérissant\nTous ceux qui sont pesés et chargés",
