      '1.\nMinnin mouin o bon Sovè\nKondui-m nan chemin salu\nAvèk ou m-pa bezouin pè\nNan ou sèl moin jouin-n la vi\n\nKè\nJézu, Jézu pa kite-m,\nO bon Sové\nFè-m soti nan tantasion\nOua fè moin plis ké vinke\n\n2.\nJézu pa kite-m isit\nSou tè sa plin ak doulè\nSan ou nan pouin lòt zanmi\nMin nan ou moin jouin-n bone\n\n3.\nOut e levé-m nan la bou\nDepi profon méchansté\nOua fè m rive nan siel tou\nSe la gloua ou ma chante\n',
