    lyrics:
      "1.\nJe ne suis pas à moi-même\nJ'appartiens à mon Sauveur\nCréé par mon Dieu suprême\nSauvé par le Redempteur\n\nRefrain\nSeigneur j'appartiens à toi\nTout mon coeur toute ma vie\nDésormais je suis à toi (bis 3 lignes)\n\n2.\nPas à moi, car de l'abîme\nJésus vient me retirer\nQuand du péché la victime\nJ'allais cesser d'espérer\n\n3.\nPas à moi car sans réserve\nJe livre tout au Sauveur\nEt c'est lui qui me préserve\nDes pièges du tentateur\n\n4.\nPas à moi, Jésus m'engage\nDans le bataillon sacré\nJe suis à lui sans partage\nA lui pour l'éternité",
