    lyrics:
      "1.\nSi ton sentier devient rude et pénible\nRassures-toi Jésus est là\nSouviens-toi qu'avec lui tout est possible\nSon amour te conduira il est la\nTous tes soucis ne les connait-il pas\nPar sa puissance invincible ll t'en delivrera\n\n2.\nEt si Satan dans sa rage t'assaille\nRassures-toi, Jésus est la\nDans le combat si ta force défaille\nSon bras fort te soutiendra\nRassures-toi Jésus est la\nTes ennemis ne les connait-il pas\nAu plus fort de la bataille\nII en triomphera\n\n3.\nEt si tu souffres triste et solitaire\nRassures-toi, Jésus est la\nPour toi n'a t-il pas gravi le calvaire\nSon amour te suffira\nRassures-toi, Jésus est la\nTous tes soupirs ne les connait-il pas\nII t'aime et plus doux qu'un frère \nII te consolera",
