      '1.\nJézu sové moin, map di ou mèsi\nDeské ou rachté-m, ou pat kite-m peri\nNan peché-m yo, mèsi papa\nPa kite-m tonbé, pa kite enmi yo\nTrionfé sou moin\n\n2.\nOu jistifié moin, avèk prop san ou\nOu mété-m a pa pou-m fè louanj ou\nO Bondié moin konfié-m nan ou\nPa kite-m tonbé pa kité èlmi yo\nTrionfé sou moin\n\n3.\nMoin konfié-m nan ou O Bon Sovè moin\nPran moin par la min pou-m ka fe rout la\nO Bondié moin konfié-m nan ou\nPa kite-m tonbé pa kite èlmi yo\nTrionfé sou moin\n',
