    lyrics:
      "1.\nJ'errais dans le péché quand Jésus m'a sauvé\nDans le courant des vives eaux\nLa main toute meurtrie je recouvrai la vie\nÀ la source des vives eaux\nRefrain\nVivant auprès des vives eaux\nVives eaux\nLoin du péché, loin de tous maux\nJésus est ma lumière, je vis sous sa bannière\nToujours auprès des vives eaux\n\n2.\nA mon coté Jésus que desirai-je de plus\nJe suis auprès des vives eaux\nChrist est mon espérance joyeux en sa présence\nJe suis au sein des vives eaux\n\n3.\nMes combats vont finir et le compte va venir\nBientôt au sein des vives eaux\nDans la céleste armée ma place est préparée\nPrès des ruisseaux des vives eaux.",
