    lyrics:
      "1.\nJe suis un soldat de mon Roi\nDisciple de l'agneau\nSans peur je confesse ma foi\nEn Jésus nom si beau\nRefrain\nNous serons couronnés après la bataille\nDieu nous couronnera que nul ne defaille\nNous serons couronnés après la bataille\nDans tes murs sainte Sion\nDans tes murs (ter) Sainte Sion\nNous serons couronnés après la bataille\nDans tes murs Sainte Sion\n\n2.\nIrai-je à mon tour dans les cieux\nSans lutter, sans douleur?\nQuand d'autres, martyrs glorieux\nOnt verse tant de pleurs\nDu monde aux funestres attraits des pièges du malin\nJésus me garde, et pour jamais\nJ'ai le secours divin\nVeux tu régner? Il faut lutter\nDonne Seigneur, la foi\nPour souffrir, vaincre et remporter\nLe prix mon Dieu pour toi.",
